(72784, 'esES', 'La lucha por la Galera Cobalto', 'Habla con Venthi en la Galera Cobalto.', '$n, llegas justo a tiempo.\n\nHas odo hablar de la Galera Cobalto? Antao fue un lugar maravilloso donde vivan la mayora de mis hermanos.\n\nLa Llama Hendida nos expuls del lugar y se apropiaron de l.\n\nTenamos la esperanza de recuperarlo, pero las ltimas noticias apuntan a que estamos librando una batalla perdida.\n\nNos prestas tu apoyo? Renete con Venthi en la Galera Cobalto cuando puedas.', '', '', '', '', '', 'Habla con Venthi en la Galera Cobalto.', 47187),
(72783, 'esES', 'Pedidos de fabricacin', 'Habla con la funcionaria jefa Mimzy Sprazzlerock para informarte sobre los pedidos de fabricacin.', 'Qu cosa ms chula has conseguido en el dispositivo titnico. Ahora dmela!\n\nEs broma! No tengo ni idea de cmo usar eso. Y t?\n\nVe a hablar con Mimzy Sprazzlerock. Ha montado todo un tinglado para encontrar gente con la que llevar a cabo algo llamado \"pedidos de fabricacin\".\n\nAportas los materiales y otra persona te fabrica cosas con ellos.\n\nSencillo, eh? Habla con Mimzy y lo vers! Ah, y no le digas que te envo yo.', '', '', '', '', '', '', 47187),
(72773, 'esES', 'Aprendizaje de inventiva', 'Renete con Greyzik Dedoguijarro en Valdrakken.', 'Hay algunos goblins en Valdrakken que estn investigando un dispositivo titnico abandonado.\n\nY la verdad es que estn armando un gran revuelo. A algunos les preocupa que la investigacin provoque ms mal que bien.\n\nLos habitantes de Valdrakken agradeceran que fueras a reunirte con los goblins para ver si puedes encontrar una solucin a su investigacin.\n\nSin destruir parte de nuestra ciudad.', '', '', '', '', '', 'Renete con Greyzik Dedoguijarro en Valdrakken.', 47187),
