(72729, 'esES', 'El gran Corno', 'Lleva la moneda oxidada de las islas al gran Corno, que est en las Llanuras de Ohn\'ahra.', 'Una moneda peculiar, pescada en las Islas Dragn.\n\nHas odo rumores de otros pescadores que mencionaban a una criatura en las Llanuras de Ohn\'ahra que las colecciona.', '', '', '', '', '', '', 47187),
(72728, 'esES', 'El mundo aguarda', 'Completa 10 misiones del mundo en las Islas Dragn.', 'Sabes lo que es una autntica muestra de fuerza? Que ayudes a la comunidad de las Islas Dragn!\n\nHay muchos problemas que resolver por aqu. Mustrame lo fuerte que eres y echa una mano!', '', '', '', '', '', '', 47187),
(72709, 'esES', 'Financiacin para una caza del tesoro', 'Compra las notas sobre artefactos arqueolgicos a la catalogadora Jakes.', '<La catalogadora Jakes rebusca con rapidez en su bolsa de suministros y saca un mapa recin dibujado>.\n\nUno de nuestros arquelogos acaba de informarnos sobre ciertos hallazgos relacionados con un artefacto perdido que se cree que est en esta zona.\n\nSi donas esos suministros para financiar la siguiente expedicin del arquelogo, te entregar este mapa que indica la ubicacin de un tesoro cercano.', '', '', '', '', '', '', 47187),
(72708, 'esES', 'Suministros de las Islas Dragn', 'Entrega la bolsa de suministros de las Islas Dragn a la catalogadora Jakes en la Embajada Reposo Alado.', '<Ese protodragn debe de haberle robado la bolsa de suministros a un desafortunado miembro de la Expedicin Dragontina.\n\nLa catalogadora Jakes sabr qu hacer con ella en la Embajada Reposo Alado>.', '', '', '', '', '', 'Entrega la bolsa de suministros de las Islas Dragn a la catalogadora Jakes en la Embajada Reposo Alado.', 47187),
