(72686, 'esES', 'Oleada tormentosa', 'Derrota criaturas imbuidas de elementos para recoger desbordamiento elemental mientras ests en una tormenta elemental.', 'Los Primalistas se las han apaado para invocar feroces tormentas elementales por todas las Islas Dragn, $n.\n\nCuando una tormenta est activa, dirgete a ella y mata a las criaturas imbuidas que veas en la zona.\n\nLuego recoge el desbordamiento elemental de los enemigos derrotados. Ten en cuenta que, cuanto ms poderoso sea el enemigo, ms desbordamiento elemental obtendrs.\n\nNo debemos permitir que la corrupcin elemental de los Primalistas vaya a ms.', '', '', '', '', '', '', 47187),
