(72585, 'esES', 'Orientacin abierta', 'Completa las misiones de orientacin en centro de cada faccin: el Campamento Base Dragontina, Maruukai, Iskaara y Valdrakken.', 'Has hecho mucho por las Islas Dragn, $ghroe:herona;.\n\nMucha gente agradece tus contribuciones y quiere darte la bienvenida a sus comunidades. Ve a verlos y conoce a cada grupo y sus especialidades.\n\nCreo que descubrirs que, al igual que t, las islas Dragn tambin tienen mucho que ofrecer!', '', '', '', '', '', '', 47187),
(72584, 'esES', 'Colocar tu propia red', 'Coloca una red de pesca en el agujero de pesca de la boca del ro.', 'Quieres probar tu red? Ve a la boca del ro, al sur de las Orillas del Despertar, y busca un sitio donde abunden los peces. Debera haber un buen lugar para montar tu red.', '', '', '', '', '', '', 47187),
