(72525, 'esES', 'Equipamiento de catalogacin bsico', 'Usa el kit de suministros de expedicin para investigar el equipamiento de catalogacin.', 'Todos los catalogadores de la expedicin se merecen su propia cmara!\n\nNo tienes por qu darle un nombre especial a la tuya, pero te animo a que lo hagas. As es mucho ms divertido.\n\nSea como sea, el abrecaminos Jeb debera poder proporcionarte todo lo que necesitas.\n\nAn no he dado con una sola cosa que no haya podido conseguir. Es increble.', '', '', '', '', '', '', 47187),
(72524, 'esES', 'Equipamiento de escalada bsico', 'Usa el kit de suministros de expedicin para investigar el equipamiento de escalada.', '<El abrecaminos Jeb seala los suministros que tiene a su lado>.\n\nVas a necesitar suministros si quieres sobrevivir ah fuera.\n\nTengo aqu todo lo que te hace falta para empezar a escalar.', '', '', '', '', '', '', 47187),
(72519, 'esES', 'Puesta a punto temporal', 'Utiliza el cronocristal con Eternus y Cromi en Azmerloth para evitar que caigan a travs del tiempo.', 'Ya veo... Estn cayendo a travs de todas las posibilidades y del propio tiempo.\n\nRpido, he localizado otro punto en la lnea temporal donde podramos alcanzarlas. Es... inusual, pero no dejes que la extraeza de este mundo te frene. El destino de Chronormu est en tus manos.', '', '', '', '', '', 'Vuelve con Nozdormu al presente.', 47187),
(72512, 'esES', 'Una brisa susurrante', 'Acrcate a Ohn\'ahra en el Nidal de Ohn\'ahra.', '<Godoloto ladea la cabeza con curiosidad, asiente y finalmente te sostiene la mirada. Tras un largo momento, alza la vista al cielo... y hacia la montaa que est junto a Maruukai. Percibes que quiere que te dirijas al Nidal de Ohn\'ahra.>', '', '', '', '', '', 'Acrcate a Ohn\'ahra en el Nidal de Ohn\'ahra.', 47187),
(72488, 'esES', 'El recorrido avanzado de Thaldraszus', 'Participa en cada uno de los circuitos avanzados de Thaldraszus.', 'Una vez ms, toca viajar a Thaldraszus! Un lugar lleno de picos, valles... y circuitos listos para que los recorras!\n\nBusca a mis colegas bronce para demostrar tu habilidad en los circuitos avanzados y terminar as tu recorrido por las Islas Dragn.', '', '', '', '', '', '', 47187),
(72487, 'esES', 'El recorrido de Thaldraszus', 'Participa en cada una de las carreras de Thaldraszus.', 'Thaldraszus, hogar del Trono de los Aspectos y de gran parte de la historia de los dragnicos.\n\nAll vers picos elevados y barrancos escarpados y profundos que parece que piden que los sobrevueles!\n\nComo siempre, mis colegas bronce han preparado unas cuantas carreras en Thaldraszus en las que puedes competir mientras exploras la zona.\n\nPor qu no las pruebas y as completas todos los circuitos de las Islas Dragn?', '', '', '', '', '', '', 47187),
(72486, 'esES', 'El recorrido avanzado de las Tierras Azures', 'Participa en cada uno de los circuitos avanzados de las Tierras Azures.', 'Los circuitos avanzados de las Tierras Azures estn diseados para llevar tus habilidades como jinete de dragones a nuevas cotas!\n\nT procura... no caerte.\n\nBusca a mis colegas bronce cuando quieras probar estos circuitos!', '', '', '', '', '', '', 47187),
(72485, 'esES', 'El recorrido de las Tierras Azures', 'Participa en cada una de las carreras de las Tierras Azures.', 'Los circuitos de las Tierras Azures son una experiencia nica. Los picos altos, el terreno nevado y los densos bosques suponen muchos obstculos interesantes y desafos.\n\nMientras ests all, busca a mis colegas bronce y prueba sus circuitos!', '', '', '', '', '', '', 47187),
(72484, 'esES', 'El recorrido avanzado de las Llanuras de Ohn\'ahra', 'Participa en cada uno de los circuitos avanzados de las Llanuras de Ohn\'ahra.', 'Los circuitos avanzados deberan suponer un mayor desafo, pero tengo la certeza de que no hay nada que no puedas superar!\n\nMis colegas bronce han preparado circuitos avanzados en las Llanuras de Ohn\'ahra con algunos obstculos y otras sorpresas. Tambin puedes intentar batir tus propios rcords.\n\nBuena suerte!', '', '', '', '', '', '', 47187),
(72483, 'esES', 'El recorrido de las Llanuras de Ohn\'ahra', 'Participa en cada una de las carreras de las Llanuras de Ohn\'ahra.', 'Ah, las Llanuras de Ohn\'ahra. Grandes espacios abiertos, fuertes vendavales, paisajes interminables... y nuevas carreras!\n\nAl igual que en las Orillas del Despertar, si te cruzas con alguno de mis colegas bronce, pregntales sobre los circuitos.', '', '', '', '', '', '', 47187),
(72482, 'esES', 'El recorrido avanzado de las Orillas del Despertar', 'Participa en cada uno de los circuitos avanzados de las Orillas del Despertar.', 'Ahora que has volado por todos los circuitos bsicos de las Islas Dragn y has demostrado tu habilidad, qu te parece enfrentarte a un nuevo reto?\n\nLas carreras avanzadas son similares a las que has hecho hasta ahora, pero muchas tienen rutas de vuelo ms complicadas u otros obstculos que llevarn tus facultades al lmite.\n\nEmpecemos por los circuitos de las Orillas del Despertar!', '', '', '', '', '', '', 47187),
(72481, 'esES', 'El recorrido de las Orillas del Despertar', 'Participa en cada una de las carreras de las Orillas del Despertar.', 'Sabes qu es lo ms divertido de ser jinete de dragones? Las carreras!\n\nMis colegas bronce han organizado circuitos para carreras a lo largo de las Islas Dragn. Es un paisaje tan variado y dinmico que parece hecho para la exploracin a toda velocidad.\n\nSi te encuentras con uno de nuestros circuitos de carreras en las Orillas del Despertar, anmate y participa.', '', '', '', '', '', '', 47187),
(72456, 'esES', 'Escritos de confianza', 'Recupera varios volmenes de la genealoga obsidiana, y entrgaselos a los intendentes de Wrathion y Sabellian.', 'A pesar de haber asegurado las murallas superiores de la Ciudadela Obsidiana, las fuerzas de los Djaradin continan saqueando el patio. Esa zona est repleta de registros histricos de valor incalculable! Debemos actuar con rapidez para poner a salvo todo lo que documente el linaje del Vuelo Negro.\n\nTanto Wrathion como Sabellian desean hacerse con esta informacin, as que puedes conseguir un escrito para cada uno.\n\nVe a la torre derrumbada de la ciudadela. All deberas encontrar algo que merezca la pena.', '', '', '', '', '', '', 47187),
(72448, 'esES', 'Asegurar nuestro legado', 'Elimina a dos enemigos poco comunes en la Ciudadela Obsidiana o en Cienoescoria.', 'No he trabajado tan duro ni he llegado tan lejos para perder ahora la Ciudadela!\n\nPor desgracia, han surgido nuevas amenazas. Puedo contar contigo para hacerles frente?\n\nAydanos a asegurar el rea. Busca y elimina a dos de nuestros enemigos ms poderosos.', '', '', '', '', '', '', 47187),
(72447, 'esES', 'Las mayores amenazas', 'Elimina a dos enemigos poco comunes en la Ciudadela Obsidiana o en Cienoescoria.', 'Unos poderosos djaradin y otras criaturas amenazan tanto la Ciudadela Obsidiana como la seguridad de mi Vuelo.\n\nEsto no puede seguir as.\n\nAydanos a asegurar el rea. Busca y elimina a dos de nuestros enemigos ms poderosos.', '', '', '', '', '', '', 47187),
(72435, 'esES', 'Orientacin: Iskaara', 'Conoce a algunos vendedores de mercancas valiosas.', 'Te doy la bienvenida a Iskaara, $gamigo:amiga;.\n\nLas historias sobre tus hazaas con los Frondacuero ya se han extendido entre nuestra gente. Ya conoces a muchos de los nuestros, pero hay an ms compaeros que quieren intercambiar conocimientos y mercancas contigo.\n\nPor favor, tmate un momento para familiarizarte con algunos de los habitantes de Iskaara. Somos una comunidad que se apoya mutuamente, as que al igual que t tienes mucho que ofrecernos, muchos de los nuestros tambin lo tienen para ti.', '', '', '', '', '', '', 47187),
(72434, 'esES', 'El circuito del Vitasagrario Rub', 'Completa el circuito del Vitasagrario Rub.', 'Dicen que an no soy lo bastante mayor para volar en los circuitos.\n\nPero puedo ver cmo lo hacen otros. Deberas participar! Y as yo puedo verte correr.', '', '', '', '', '', 'Completa el circuito del Vitasagrario Rub.', 47187),
(72429, 'esES', 'Orientacin: Maruukai', 'Renete con la guardiana del renombre y la intendente de renombre en Maruukai.', '<Okir pone voz a las seales de la khan Sansok>.\n\nLos Maruuk no estamos en contra de los forasteros, pero necesitamos que cualquier aliado potencial demuestre su vala. A medida que conozcas a los clanes y les ayudes, se ir corriendo la voz sobre tu apoyo.\n\nEn el piso inferior del krutal, en la colina, podrs encontrar a una de las hijas de la khanam Matra; ella te informar sobre la situacin de nuestra gente. Ve y presntate.', '', '', '', '', '', '', 47187),
(72428, 'esES', 'Cornisapos acaparadores', 'Recolecta 20 gemas acres de los cornisapos de las Islas Dragn para Gnoklin Bobinavagante de la Expedicin Dragontina.', 'No es ningn secreto que a los cornisapos de estas tierras les encantan las gemas, las joyas y cualquier cosa brillante. El otro da, hasta encontr una joya extraordinaria entre los excrementos de uno de ellos!\n\nPuede que no sea la ms pulcra de las tareas, pero parece que a los cornisapos no solo les gusta coleccionar, sino tambin zamparse objetos de valor.', '', '', '', '', '', '', 47187),
(72427, 'esES', 'Infusin animada', 'Recolecta 13 hojas con pinchos de los azotadores de las Islas Dragn para Dhurrel de los Centauros Maruuk.', 'Hoy vengo con una peticin bastante simple.\n\nLos alquimistas andan escasos de un ingrediente necesario para un brebaje particularmente difcil, aunque es una hierba bastante fcil de recolectar. Solo necesitas encontrar algunas plantas agresivas y extraerles muestras. Crees que podrs?', '', '', '', '', '', '', 47187),
(72423, 'esES', 'Hacer frente a la tormenta', 'Hazte con 12 armamentos de la tempestad de los centauros Nokhud de las Islas Dragn para Temnaayu de los Colmillarr de Iskaara.', 'Ah, has llegado justo a tiempo! Hemos odo que los centauros Nokhud tienen poderosas armas imbuidas del poder de la tormenta. Me gustara hacerme con algunas de ellas para aprender a defendernos mejor de su amenaza.\n\nLo mnimo que podemos hacer es arrebatarles algunas para darles un mejor uso.', '', '', '', '', '', '', 47187),
(72410, 'esES', 'Pinzas y agujas', 'Rene 10 pinzas puntiagudas de los guadidos de las Islas Dragn para Gnoklin Bobinavagante de la Expedicin Dragontina.', 'ltimamente andamos escasos de agujas, no dejan de partirse en dos!\n\nCreo que las pas de los guadidos podran servirnos para sustituirlas.', '', '', '', '', '', '', 47187),
(72406, 'esES', 'Orientacin: Valdrakken', 'Conoce a los proveedores importantes de Valdrakken.', 'Te doy la bienvenida a Valdrakken, $p. Soy Unatos, guardin del renombre del Acuerdo de Valdrakken.\n\nComo reconocimiento a la ayuda que has prestado a los Vuelos, se ha autorizado a ciertos proveedores de la ciudad a ofrecerte nuestros mejores productos.\n\nPorque no te tomas un rato para ver dnde estn y qu productos ofrecen?', '', '', '', '', '', '', 47187),
(72399, 'esES', 'El jardn del ermitao', 'Habla con Szareth en el Saliente de las Sombras.', 'Nuestros padres siempre dicen que no deberamos visitar los jardines que hay sobre Gelikyr. Creen que el jardinero es malo y peligroso.\n\nPero no es verdad! Es un poco grun pero muy simptico.\n\nAunque no hemos vuelto desde que aparecieron los Primalistas. Ahora es demasiado peligroso. Espero que el jardinero siga bien. Podras ir a comprobar cmo est?', '', '', '', '', '', '', 47187),
(72397, 'esES', 'Orientacin: Campamento Base Dragontina', 'Conoce a los proveedores importantes en el Campamento Base Dragontina.', 'Te doy la bienvenida al campamento base,$p.\n\nNos llev un buen rato elegir el lugar perfecto, pero no podra estar ms contenta con nuestra eleccin.\n\nCuenta con un fcil acceso a las ruinas, a los criaderos de protodragones, y claro est, a los Vuelos.\n\nPor qu no te tomas unos minutos para explorar el campamento y conocer a algunos de los proveedores que ayudan a la expedicin?', '', '', '', '', '', 'Renete con Toddy Bigotis en el Campamento Base Dragontina.', 47187),
