(72380, 'esES', 'Juntos somos imparables', 'Vuelve al Trono de los Aspectos e informa a Alexstrasza de lo que ha ocurrido tras la derrota de Raszageth en la Cmara de las Encarnaciones.', '$n, debes informar a Alexstrasza y a Nozdormu de lo que ha ocurrido.\n\nKhadgar y yo nos reuniremos contigo en el Trono de los Aspectos enseguida.', '', '', '', '', '', 'Vuelve con Alexstrasza la Protectora en el Trono de los Aspectos, que est en Valdrakken.', 47187),
(72374, 'esES', 'Ayudar al Acuerdo de Valdrakken: La Fortaleza de Ruinadragn', 'Ve a las Orillas del Despertar y asedia la Fortaleza de Ruinadragn. Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragn.', 'Nuestros aliados en las islas necesitan tu ayuda una vez ms. En Valdrakken se respira con ms tranquilidad sabiendo que tus esfuerzos han ayudado a forjar nuestro futuro.\n\nPero, bueno, al grano.\n\nLa amenaza de los Djaradin brota desde las profundidades de la Fortaleza de Ruinadragn para cernirse sobre las Orillas del Despertar. Debemos ser rpidos e interrumpir sus avances.\n\nEsperamos tu regreso, $n.', '', '', '', '', '', '', 47187),
(72373, 'esES', 'Ayudar al Acuerdo de Valdrakken: Se abre la veda', 'Ayuda a los Maruuk en una cacera en las Islas Dragn. Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragn.', 'Nuestros aliados de las Llanuras de Ohn\'ahra han solicitado que cualquier cazador que haya en estas tierras preste ayuda a su causa.\n\nMientras continas con tus esfuerzos por las islas, por qu no visitas a nuestros aliados en uno de sus campamentos y les echas una mano?\n\nHay mucho que hacer. No te demores.', '', '', '', '', '', '', 47187),
