(72354, 'esES', 'La gran cmara', 'Consigue una pieza de botn de la gran cmara.', 'A lo largo de los aos, los Aspectos y su pueblo adquirieron muchos artefactos y mucho armamento. Los Aspectos encargaron la construccin de una gran cmara encantada en la que pudieran almacenarlos hasta el momento en que un alma digna viniera en busca de los tesoros que custodiaba.\n\nSe encuentra en el interior del banco. Tal vez, si demuestras tu vala, puedas reclamar una parte del antiguo tesoro de los Aspectos.', '', '', '', '', '', '', 47187),
(72338, 'esES', 'Llave obsidiana superior', 'Consigue $1oa llave reconstruida.', 'Treme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier faccin que haya en la Ciudadela del Dragn Negro.', 47187),
