(72293, 'esES', 'Aventuras en las Islas Dragn', 'Revisa el mapa de exploracin para elegir una zona de las Islas Dragn a la que apoyar.', 'Ah, ya s qu puedes hacer!\n\nLa Expedicin Dragontina ha colgado un esplndido mapa de las Islas Dragn por aqu cerca.\n\nSus dibujos son muy precisos y detallados, si se me permite decirlo, aunque tampoco es que ests aqu para criticar obras de arte.\n\nDeberas echarle un vistazo para ver qu zonas de las Islas Dragn necesitan tu ayuda!', '', '', '', '', '', '', 47187),
(72292, 'esES', 'La historia de una victoria espectacular', 'Cuntale la historia de tu victoria a la anciana Poa en Iskaara.', 'Ha sido una batalla majestuosa!\n\nLa anciana Poa de Iskaara querr escuchar la impresionante historia de tal victoria.', '', '', '', '', '', '', 47187),
(72291, 'esES', 'Historia de una victoria memorable', 'Cuntale la historia de tu victoria a la anciana Poa en Iskaara.', 'Ha sido una buena pelea!\n\nA la anciana Poa de Iskaara le interesar or la historia de esta victoria.', '', '', '', '', '', '', 47187),
