(72269, 'esES', 'Thaldraszus', 'Viaja a Valdrakken y renete con Alexstrasza la Protectora.', 'Alexstrasza la Protectora est organizando una reunin en el Trono de los Aspectos para hablar sobre la amenaza de los Primalistas.\n\nHa convocado a cualquier aventurero que est dispuesto a ayudar.', '', '', '', '', '', 'Viaja a Valdrakken y renete con Alexstrasza la Protectora.', 47187),
(72268, 'esES', 'Las Tierras Azures', 'Habla con Masud el Sagaz en las Llanuras de Ohn\'ahra.', 'El Kirin Tor necesita toda la ayuda posible para localizar la piedra de juramento del dragn azul.\n\nHan visto a algunos de sus magos en las Llanuras de Ohn\'ahra buscando ayuda.', '', '', '', '', '', '', 47187),
(72267, 'esES', 'Las Llanuras de Ohn\'ahra', 'Renete con la embajadora Taurasza en la Avanzada Escama Rub.', 'El Vuelo Verde necesita la ayuda de aventureros. Para ello, debes aliarte con los centauros de las llanuras.\n\nLa embajadora Taurasza puede ayudarte.', '', '', '', '', '', '', 47187),
(72266, 'esES', 'Las Orillas del Despertar', 'Renete con Sendrax en las Orillas del Despertar.', 'La dracnida Sendrax necesita que le echen una mano para ayudar a los recin llegados en las Orillas del Despertar.', '', '', '', '', '', '', 47187),
(72263, 'esES', 'La caballera tiene su lugar', 'Aprende a montar tu vorquin personal.', '$gEvocador:Evocadora;! An quedan manadas de vorquin por aqu!\n\nMe las he apaado para reunir algunos que podrs usar como montura cuando se te cansen las alas. Te acuerdas de cmo montar?\n\nMe ordenaron que te entregara este ejemplar ahora que los escamandantes estn organizndolo todo. Cudalo bien.', '', '', '', '', '', '', 47187),
(72261, 'esES', 'Ms que una prisin?', 'Lleva el artefacto antiguo de la Cmara a Lillian Brillaluna.', '<El artefacto antiguo parece de naturaleza elemental. Lillian Brillaluna, que est en Valdrakken, podra saber ms>.', '', '', '', '', '', '', 47187),
