(72256, 'esES', 'Las Garfas Oscuras', 'Entrega las rdenes de la escamandante a Kodethi y las Garfas Oscuras.', 'Naleidea tiene entusiasmo, pero es historiadora, no soldado. Desconoce los peligros a los que nos enfrentaremos en las Islas Dragn.\n\nPero no hay nada de qu preocuparse. Al fin y al cabo, las Garfas Oscuras protegern la expedicin.\n\nHablar con Ebyssian y los lderes de tu Horda sobre la logstica de la misin.\n\nMi lugarteniente, Kodethi, est explorando la ciudad con el resto de los dracthyr. Dile que nos reuniremos en la torre de zepelines. Le transmitir mis rdenes al resto.', '', '', '', '', '', 'Renete con Naleidea en la torre de zepelines a las afueras de Orgrimmar.', 47187),
