(72246, 'esES', 'Sueos serenos', 'Habla con el gerente de la sauna.', 'Te doy la bienvenida a la Sauna de Sueos Serenos!\n\nLo siento, pero ahora mismo no podemos admitir nuevas visitas por circunstancias ajenas a nuestro control.\n\nDeja que te remita al gerente de la sauna, Xijan Zarpa Espinosa. l podr responder a todas tus preguntas.', '', '', '', '', '', '', 47187),
