(72241, 'esES', 'Lecciones de nuestro pasado', 'Habla con las escamandante Pavethal.', 'Soy Pavethal, escamandante de los dracthyr. Wrathion nos ayud cuando despertamos de la larga estasis y ahora me toca a m ayudarlo.\n\nSeguro que tienes preguntas sobre los mos y nuestra historia. Hasta hace poco, yo tambin las tena.\n\nPero Nozdormu el Atemporal nos ha revelado verdades perdidas sobre los dracthyr. Me ha concedido una visin sobre nuestros orgenes... y el motivo por el que estbamos encerrados.\n\nDeja que te cuente las cosas que he visto.', '', '', '', '', '', '', 47187),
(72240, 'esES', 'Las Depositarias Obsidiana', 'Entrega las rdenes del escamandante a Derviche y a las Depositarias Obsidiana.', 'El entusiasmo de Toddy es admirable. Espero que eso no la ciegue ante los peligros que nos aguardan en las Islas Dragn.\n\nAl margen de eso, las Depositarias Obsidiana tenemos el deber de proteger la expedicin.\n\nDebo hablar con Wrathion y el lord comandante sobre la prxima misin.\n\nLos dems dracthyr estn explorando la ciudad. Busca a Derviche, mi leal lugarteniente, e infrmale de que nos reuniremos en los muelles. Le transmitir mis rdenes al resto.', '', '', '', '', '', 'Comunica tu xito a Toddy Bigotis en el Puerto de Ventormenta.', 47187),
(72193, 'esES', 'La Academia Algeth\'ar', 'Visita el recinto de la Academia Algeth\'ar.', 'Tengo entendido que la Academia Algeth\'ar vuelve a estar abierta al mundo.\n\nHace mucho tiempo, sus salas sagradas solo lo estaban para los dragones, pero, en los aos que han pasado, la directora ha considerado sabio dar la bienvenida a cualquiera que quiera aprender. Me ha pedido que le recomiende estudiantes prometedores.\n\nComo gran $galiado:aliada; de los dragnicos, sera un honor que asistieras a nuestra gran academia. T decides si quieres apuntarte, pero seguro que a Doragosa le encantar, como mnimo, ensearte la academia.', '', '', '', '', '', '', 47187),
(72192, 'esES', 'Salas de Infusin: Entropa al orden', 'Entra en las Salas de Infusin y derrota al tsunami primigenio.', 'Los Primalistas pretenden desatar de nuevo el caos elemental en este mundo y no se detendrn ante nada hasta cumplir su objetivo.\n\nHe recibido noticias inquietantes que aseguran que se han infiltrado en las Salas de Infusin, dentro de Tyrhold. Pretenden desbaratar la obra del guardin Tyr para sus fines nefastos.\n\nPor favor, debes acabar con cualquier amenaza primalista dentro de esas salas sagradas, $n.', '', '', '', '', '', '', 47187),
(72191, 'esES', 'Recompensa de escasez de suministros', '', '', '', '', '', '', '', '', 47187),
(72190, 'esES', 'Reservas sobre la reserva', 'Encuentra a Zuttiki.', '$C! Conozco a alguien que necesita desesperadamente tus habilidades.\n\nLos Primalistas han atacado la Reserva de Tyrhold. Yo tuve suerte de escapar, pero temo que los dems no hayan tenido tanta.\n\nSe encuentra al norte de aqu. Busca a Zuttiki. Ella podr contarte todos los detalles.\n\nSi sigue viva, claro.', '', '', '', '', '', '', 47187),
(72189, 'esES', 'Variedad de jardines', 'Habla con Gryrmpech.', 'Ests disfrutando del jardn de mariposas?\n\nSabes qu? Hay un jardn mucho ms grande al sur de aqu. Lo cuida un viejo dracnido llamado Gryrmpech.\n\nSiempre le vienen bien un par de manos extra. Tiene un \"ayudante\", pero yo nunca lo he visto. No creo que lo ayude mucho.\n\nSi te pasas por all, asegrate de decirle que te enva Xina.', '', '', '', '', '', '', 47187),
