(72175, 'esES', 'Un momento cetre-stacular', 'Fabrica $1oa cetro del espectculo: Fuego y $2oa cetro del espectculo: Aire para Soragosa en Valdrakken.', 'Esta semana tenemos unos pedidos muy importantes. Los estudiantes de la Academia Algeth\'ar estn como locos por estos cetros.\n\nPor qu no nos ayudas con alguno?', '', '', '', '', '', '', 47187),
(72172, 'esES', 'Esencia, fragmentos y polvo cromtico', 'Fabrica $1oa de polvo cromtico para Soragosa en Valdrakken.', 'Parece que siempre nos faltan componentes bsicos. Esencia, fragmentos... Adems, nuestros suministros de polvo cromtico estn bajo mnimos.\n\nSi no te importa ayudarnos en esto, quizs podamos pasar ms de una semana sin tener que reponer suministros.', '', '', '', '', '', '', 47187),
(72171, 'esES', 'Demostracin en solitario', 'Completa 12 rondas de Batiburrillo de solitarios.', 'Tu afn por buscar conflictos por tu cuenta me agrada. Si confas tanto en tus propias habilidades, te observar para entretenerme.\n\nA ver qu eres capaz de demostrar. Despus, vuelve a verme.', '', '', '', '', '', '', 47187),
(72168, 'esES', 'Demostracin en escaramuzas', 'Consigue puntos de honor en escaramuzas de arena.', 'Confas en tus dotes tcticas, eh? He odo que los mortales peleis en escaramuzas a pequea escala. Ve y busca rivales a los que enfrentarte.\n\nA ver qu eres capaz de demostrar. Despus, vuelve a verme.', '', '', '', '', '', '', 47187),
(72167, 'esES', 'Demostracin en la guerra', 'Consigue puntos de honor en campos de batalla picos.', 'Quieres un \"desafo real\"? Que as sea. Conozco algunos conflictos a gran escala que podran suponer un reto hasta para m.\n\nTengo mucha curiosidad por ver cmo fracasas... O sea, cmo lo haces. Veamos si puedes demostrar tu vala.', '', '', '', '', '', '', 47187),
(72166, 'esES', 'Demostracin en batalla', 'Consigue puntos de honor en campos de batalla aleatorios.', 'A los mortales os encanta pelearos por cualquier motivo. Pues que as sea.\n\nAl menos ser divertido. Es decir, para m. Vamos a ver si eres capaz de demostrar lo que vales, como os gusta decir a vosotros.', '', '', '', '', '', '', 47187),
(72159, 'esES', 'Menos escamas', 'Recolecta $1oa pellejos de escamas lustrosas para Ralathor el Robusto, que est en Valdrakken.', 'Las escamas tienen un sinfn de usos: brindan proteccin, pero, en algunos casos, tambin pueden ofrecer una perfecta superficie reflectante. Muchos de nuestros mejores espejos son, de hecho, escamas.\n\nEsos espejos tambin tienen mucha demanda. Treme algunos pellejos de escamas y compartir algunos de mis secretos.', '', '', '', '', '', '', 47187),
(72157, 'esES', 'El peso de la Tierra', 'Recolecta $1oa de Tierra reanimadora para Sekita el Excavador en Valdrakken.', 'Tengo un pedido de varios cientos de toneladas de aleacin de magma primigenio, pero me he quedado sin Tierra reanimadora. S que es una tarea pesada, pero puedo hacer que merezca la pena!', '', '', '', '', '', '', 47187),
