(72135, 'esES', 'Neltharus: Los secretos ms profundos', 'Recupera $1oa notas de Neltharion, $2oa diarios de obsidiana y un tomo de investigacin en Neltharus.', 'Tenemos un problema. Los Djaradin salieron de Neltharus, lo que quiere decir que lo estn saqueando!\n\nNeltharus contiene muchos tesoros, pero, y esto es an ms importante, alberga conocimiento. La historia de nuestro Vuelo, su cada en desgracia... Tanto Sabellian como Wrathion buscan ms informacin sobre la vida y obra de Neltharion.\n\nVete y recupera cuanto puedas antes de que los Djaradin lo saqueen todo!', '', '', '', '', '', '', 47187),
(72134, 'esES', 'La ayuda de un aventurero', 'Usa el mapa de exploracin para elegir tu primera zona.', 'Hemos descubierto que hay muchos problemas en las Islas Abruptas, la tierra sobre la que flotamos.\n\nHaremos lo que podamos desde aqu. Quiero que eches un vistazo al mapa cercano para ver a quin puedes ayudar primero.', '', '', '', '', '', '', 47187),
