(72129, 'esES', 'Ayudar a Khadgar', 'Renete con Khadgar en la Ciudadela Violeta, que est en Dalaran.', '$gBienvenido:Bienvenida; a Dalaran, $n. Me alegro de que hayas llegado a salvo.\n\nHabla conmigo en la Ciudadela Violeta, hay mucho que hacer.', '', '', '', '', '', 'Renete con Khadgar en la Ciudadela Violeta, que est en Dalaran.', 47187),
