(72122, 'esES', 'En busca de los ecologistas perdidos', 'Encuentra a los ecologistas perdidos.', 'Hemos podido estabilizar a los heridos, pero hay algo que me preocupa, $n.\n\nUn par de ecologistas dragauros haban venido a la avanzada a estudiar los humedales. No he sabido nada de ellos desde el ataque, y eso me preocupa.\n\nSi vas a salir ah fuera, te importara echar un ojo y asegurarte de que estn a salvo?\n\nY ten cuidado. Se rumorea que los humedales estn infestados de grlocs.', '', '', '', '', '', '', 47187),
