(72083, 'esES', 'El cebo de la suerte', 'Recupera el cebo de la suerte del capitn Haab.', 'Estoy abatido, $r, y no es porque est muerto.\n\nMor durante una caza y me asegur de que la bestia que mat a mi tripulacin no viviese para volver a matar. No hay nada malo en eso, es lo que mi padre hubiera querido.\n\nNo, el problema es que el combate acab en empate.\n\nEl espritu de la bestia sigue ah fuera, igual que yo estoy aqu ante ti. Pero, al ser un fantasma, ni siquiera puedo recuperar mi cebo de la suerte de las alimaas que limpiaron mi cuerpo para volver a intentarlo.\n\nTe importara ayudarme?', '', '', '', '', '', '', 47187),
(72079, 'esES', 'Festn comunitario', '', '', '', '', '', '', '', '', 47187),
(72075, 'esES', 'Nuevas existencias', 'Recoge peces para reponer el agujero de pesca y monta en tu draco para soltarlos desde el aire.', 'Podran picar muchos ms peces, no crees?\n\nTengo una idea. La leyenda dice que estos lagos de lava no siempre tienen peces afines al calor. Cuentan que estos estanques se llenaron de peces porque unos dragones los lanzaron dentro mientras los sobrevolaban. Te lo puedes creer?\n\nCrees que tu draco y t podrais hacer lo mismo?', '', '', '', '', '', '', 47187),
(72072, 'esES', 'Lluvia de peces en las Fuentes de Dragn', 'Recoge peces para reponer el agujero de pesca y monta en tu draco para soltarlos desde el aire.', 'Podran picar muchos ms peces, no crees?\n\nTengo una idea. La leyenda dice que estos lagos y ros no siempre han tenido pesca. Cuentan que estos pozos de agua se llenaron de peces porque unos dragones los lanzaron dentro mientras los sobrevolaban. Te lo puedes creer?\n\nCrees que tu draco y t podrais hacer lo mismo?', '', '', '', '', '', '', 47187),
(72071, 'esES', 'Segunda ronda, a pescar!', 'Mata a Mochoby.', 'Qu te parece si pescas un poco, $n?\n\nHay un banco de peces de carnada frente a la costa que la bestia estpida ataca cuando se juntan, olvidndose de que ya est muerta.\n\nNada hasta all y agita el cebo. Puedes tratar de imitar a una foca herida, seguro que no podr resistirse.', '', 'Un terror de las profundidades.\n\nLa cacera del capitn Haab acab con ambos muertos, pero ni siquiera la muerte ha calmado su ansia de venganza.', 'Mochoby', '', '', '', 47187),
(72068, 'esES', 'Ayudar al Acuerdo de Valdrakken: Un festn para todos', 'Viaja a Iskaara en las Tierras Azures y participa en un festn comunitario. Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragn.', 'Nuestros aliados necesitan tu ayuda, $n!\n\nTus esfuerzos en las islas no han pasado desapercibidos. Nuestros leales amigos del sur, los Colmillarr de Iskaara, quieren celebrar tus logros con la madre de todos los festines.\n\nViaja a las tierras de Iskaara mientras sigues colaborando con tus aliados del Acuerdo de Valdrakken. Cuando llegues a las relucientes aguas de las tierras del sur, no dudes en sumarte a los festejos.', '', '', '', '', '', '', 47187),
(72067, 'esES', 'Hora de descansar!', 'Ve a la Sauna de Sueos Serenos.', 'T!\n\nEsts para el arrastre. Tienes pinta de necesitar un descanso urgentemente, y yo tengo justo lo que necesitas! La Sauna de Sueos Serenos es el lugar perfecto para ti.\n\nDisfruta de nuestras nuevas clases de youga, son alucinantes! O prefieres un tratamiento facial con una mascarilla de barro? Te recomiendo ambas actividades.\n\nPara llegar a la sauna, solo tienes que salir de la ciudad por el norte.', '', '', '', '', '', '', 47187),
(72063, 'esES', 'Devolver el barco de juguete de Yennu', 'Devuelve el barco de juguete a Yennu.', 'Es el barco de juguete de Yennu. Estar encantado de recuperarlo.', '', '', '', '', '', '', 47187),
