(71242, 'esES', 'Apoyar a los investigadores de la tormenta', 'Lleva el cmulo de poder rebosante elemental a un investigador en Valdrakken.', 'Parece un buen cmulo de poder rebosante de las criaturas de la tormenta primalista.\n\nSeguro que algn investigador de Valdrakken estar interesado.', '', '', '', '', '', '', 47187),
(71241, 'esES', 'Pato, pato, trampa', 'Prepara las trampas del Clan Aylaag en el Valle Primordial.', 'La arboleda que llaman el Valle Primordial rebosa magia de los antiguos dragones. Mis hermanos aprecian especialmente la piel de unos astudracos que habitan en esa arboleda, pero son muy esquivos y difciles de encontrar.\n\nEn lugar de ponerte a rastrearlos, puedes usar las trampas que hay por la zona. Deja algo de carne de las aves fluviales de la zona sobre ellas para activarlas. Enviar a alguien a recoger lo que hayas atrapado.', '', '', '', '', '', '', 47187),
(71239, 'esES', 'Perdida en el cielo', 'Encuentra a Harleen Chirridos en los Riscos Plumazul.', 'Necesito un favor y t pareces la persona adecuada.\n\nUna vieja amiga ma, Harleen Chirridos, deba reunirse conmigo en la ciudad hace unos das. Planebamos atiborrarnos en el Festn Rub, pasar por la peluquera y visitar esa casa de subastas de postn que tienen aqu.\n\nPero no apareci. A veces el trabajo la absorbe, pero me sentira ms tranquilo si supiera dnde est.\n\nPrueba en las montaas al sur de aqu. Mencion que se pasara por all de camino.', '', '', '', '', '', '', 47187),
(71238, 'esES', 'El Festn Rub!', 'Habla con los chefs Rumiastrasza y Bocado en el Festn Rub.', 'A todos los aspirantes a chef!\n\nTu corazn ansa conocer los sabores definitivos de este mundo? Buscas oportunidades para explorar? Arriesgaras tu vida por completos desconocidos?\n\nSi has respondido a todo que s, ven a hablar con el inconfundible y distinguido do de chefs, Rumiastrasza y Bocado! Actualmente estn celebrando el Festn Rub en la ciudad de Valdrakken.', '', '', '', '', '', '', 47187),
(71235, 'esES', 'Magos de campo', 'Busca a los magos del Kirin Tor cerca del Salto de los Astudracos, que est en las Tierras Azures.', 'Lok\'tar, $r. \n\nSi tienes tiempo, hay dos magos realizando trabajo de campo cerca, y estoy seguro de que les vendra bien algo de ayuda.\n\nEsta es una tierra peligrosa incluso en los buenos tiempos. \n\nY no son buenos tiempos.', '', '', '', '', '', '', 47187),
(71234, 'esES', 'Noticias del Rincn', 'Visita el Rincn del Ballenero en las Tierras Azures.', 'Eh, t, $r. \n\nTienes pinta de haber viajado mucho. \n\nMi primo Wayun me trajo una pieza desde Rincn del Ballenero y mencion que cierta... gente extraa ha acampado all.\n\nParece que se estn comportando, pero te importara ir a ver cmo est?\n\nWayun puede ser algo desagradable.', '', '', '', '', '', '', 47187),
(71233, 'esES', 'Cataratas', 'Habla con Willa en la Atalaya de Tres Cascadas, que est en las Tierras Azures.', 'Me encantan las cascadas. \n\nSabes qu es mejor que una cascada? \n\nDos cascadas. \n\nY lo nico mejor que eso es... bueno, ve a Tres Cascadas, al oeste de aqu, y lo vers.\n\nLa tabernera es muy amable.', '', '', '', '', '', '', 47187),
(71232, 'esES', 'Renombre de las Islas Dragn', 'Habla con Therazal en Valdrakken.', 'An hay mucho que hacer para ayudar a las Islas Dragn.\n\nHabla con Therazal. Sabe quin necesita ayuda en esta tierra.', '', '', '', '', '', 'Habla con Therazal en Valdrakken.', 47187),
(71231, 'esES', 'La llamada de la cacera', 'Habla con el instructor Frodrum en las Llanuras de Ohn\'ahra.', '<Roki deja caer la nota en tu mano>.\n\n$n, el Clan Shikaar te invita a la gran cacera. Renete con el instructor Frodrum en las Llanuras de Ohn\'ahra.', '', '', '', '', '', '', 47187),
(71230, 'esES', 'Equipo de pesca colmillarr', 'Habla con Tavio en Iskaara, que est en las Tierras Azures.', 'Hola de nuevo, $n.\n\n<Rowie mira a su alrededor y tararea una meloda>.\n\nAh, s! Tavio me estaba haciendo una nueva red y dijo que poda hacerte una a ti. Tambin puede hacer ms equipo de pesca si le llevas el material necesario.\n\nDeberas ir a hablar con ella.', '', '', '', '', '', '', 47187),
(71229, 'esES', 'Llamada de las llanuras', 'Habla con la khan Hadari en las Llanuras de Ohn\'ahra.', '<Roki deja caer un mensaje en tu mano>.\n\n$n, el Clan Aylaag ha odo historias de tus grandes hazaas. Te invitamos a conocer nuestro clan y a compartir nuestras costumbres.\n\nKhan Hadari', '', '', '', '', '', '', 47187),
(71227, 'esES', 'Retos areos', 'Habla con un vigilante del tiempo bronce para saber ms sobre los retos areos.', '<Aleteos sacude las alas con entusiasmo y deja caer una nota y un roedor chamuscado a tus pies>.\n\nJinete de dragones! Tu destreza en vuelo ha llegado a ser muy conocida. Ven a probar los retos areos de las Islas Dragn.\n\nHabla con cualquier vigilante del tiempo bronce para empezar.', '', '', '', '', '', '', 47187),
(71226, 'esES', 'Matar caracoles de piedra', 'Mata a $1oa conejito de fatalidad en la Plaza de Entrenamiento.', 'Socorro! Los conejos me estn devorando! Por favor, acaba con ellos antes de que nos maten a todos!', '', '', '', '', '', '', 47187),
(71219, 'esES', 'La oteadora dscola', 'Encuentra a la oteadora Alvi.', 'Parece que algunos de los oteadores ms jvenes han estado holgazaneando ltimamente.\n\nLa oteadora Nori me ha pedido que controle a su hermana pequea, Alvi, que est destinada en la entrada al Pasadizo del Tiempo. Al parecer, su rendimiento ha dejado bastante que desear ltimamente.\n\nSi te diriges al este y te encuentras con la oteadora Alvi, por favor recurdale la importancia de su trabajo, y hazle saber que su hermana est bastante preocupada por ella.', '', '', '', '', '', '', 47187),
(71212, 'esES', 'Atacar a los Frondacuero', '', '', '', '', '', '', '', '', 47187),
(71210, 'esES', 'A la Fortaleza de Ruinadragn!', 'Viaja a las Orillas del Despertar y nete a los desterrados obsidiana en el asedio a la Fortaleza de Ruinadragn.', '<Aleteos deja una nota ligeramente chamuscada en tu mano>.\n\n$n, los desterrados obsidiana han odo hablar de tu valenta. Nuestro antiguo hogar, la Fortaleza de Ruinadragn, ha cado en manos de los Djaradin. No podemos permitir que siga as. nete a nosotros para reclamar nuestro territorio.\n\n- Jefe', '', '', '', '', '', '', 47187),
(71209, 'esES', 'Bestia de las llanuras', 'Acepta las riendas de Lizi.', 'Creo que Lizi est lista para volver a las llanuras. Ahora se muestra muy amistosa con $gnosotros:nosotras;, pero s que quiere volver a su entorno.\n\nAlgn da, cuando sea una sabia del viento, explorar todo el mundo ms all de estas fuentes. Pronto tendrn lugar las pruebas de los iniciados de mitad de temporada! El tiempo vuela.\n\nHe hecho una silla y unas riendas con la lana que trajiste. Lizi estar encantada de acudir a tu llamada.\n\nLlvala en todas tus aventuras, $p.', '', '', '', '', '', '', 47187),
(71205, 'esES', 'Hidrocolmillarr', '', '', '', '', '', '', '', '', 47187),
(71202, 'esES', 'Maligno de man cuerpo a cuerpo pequeo', 'Derrota a Arcantus en un duelo de mascotas.', '', '', '', '', '', '', '', 47187),
(71199, 'esES', 'Domesticar un espinatrueno', '', '', '', '', '', '', '', '', 47187),
(71198, 'esES', 'Domesticar un espinatrueno', '', '', '', '', '', '', '', '', 47187),
(71197, 'esES', 'Domesticar un espinatrueno', '', '', '', '', '', '', '', '', 47187),
(71196, 'esES', 'Domesticar un espinatrueno', 'Consigue $1oa fluidos fluorescentes de los insectos de las Islas Dragn y $2oa suministros de las Islas Dragn.', 'Me alegra mucho que Lizi est a salvo con nosotros.\n\nSin embargo, sus heridas sanan ms despacio de lo esperado. Espero que la magia no le haya causado daos permanentes.\n\nPodras ayudarme a recolectar icor de insecto? S, ya s que suena asqueroso, pero en realidad es la base de muchos ungentos curativos.', '', '', '', '', '', '', 47187),
(71195, 'esES', 'Domesticar un espinatrueno', 'Consigue el curri verde de Meluun en los Manantiales Ohn\'iri y $2oa suministros de las Islas Dragn.', 'Parece que este es el nuevo lugar preferido de Lizi. No ha mostrado inters en volver a casa. Al fin y al cabo, es una bestia salvaje.\n\nPero debo confesar que... no he hablado con Meluun desde que salvamos a Lizi. S que ella tena razn, pero... no s cmo abordar el tema. No parece que le guste nada de lo que hago. S que debera centrarme ms en mi entrenamiento.\n\nMeluun hace un curri delicioso que le encantara a Lizi. Crees que podras pedirle un poco? Suele estar trabajando en la casa del Ohn, al oeste de los manantiales.', '', '', '', '', '', '', 47187),
(71194, 'esES', 'Ranas de fuego', 'Ensea a un par de pinchocuernos a evitar el brebaje de carmbanos.', 'He encontrado un lugar perfecto para echar una red de pesca, pero tengo un problema: los pinchocuernos. Tengo la certeza de que harn pedazos las redes en cuanto las deje solas. Qu hacemos?\n\nTengo una idea. Podemos aplicar brebaje de carmbanos a nuestras redes de pesca en lava para que sean resistentes al calor. Me parece que solo har falta ensear a esos pinchocuernos que se alejen del olor.\n\nLanza un frasco de brebaje de carmbanos a un pinchocuerno e inflgele un poco de dao. Procura no matarlos. No aprendern nada si estn muertos, verdad?', '', '', '', '', '', '', 47187),
(71193, 'esES', 'Amenaza subacutica', 'Usa 5 caracolas siniestras en el agujero de pesca de Tyrhold para invocar a una enorme bestia de las profundidades y trae algo como prueba de su muerte.', 'Has visto eso? Ah, bajo el agua! Una enorme y hambrienta bestia acorazada! No pienso acercarme a mi red mientras esa monstruosidad siga acechando. Si quieres, puedes atraerlo con un puado de caracolas siniestras. No tendrs problemas en atrapar unas cuantas.', '', '', '', '', '', '', 47187),
(71192, 'esES', 'Control de depredadores', 'Coloca las efigies aterradoras.', 'Saludos, $gamigo:amiga;!\n\nHe estado buscando un buen sitio para lanzar redes de pesca, pero parece que por aqu hay demasiados nades. Se comen a casi todos los peces jvenes antes de que puedan madurar.\n\nHe fabricado unas efigies, que asustarn a algunas de esas aves tan voraces. Eso nos ayudar a mantener la abundancia de pescado en las Fuentes de Dragn.\n\nMe ayudas a colocarlas?', '', '', '', '', '', '', 47187),
(71191, 'esES', 'Valor de red', 'Recupera la red del pescador hurao en los agujeros en el hielo de las Tierras Azures.', 'Ay, la corriente se llev mi red de pesca. <Suspira>. Y no me gusta usar caas para pescar como a mis camaradas...\nSi por casualidad encuentras mi red de pesca por ah, tremela.', '', '', '', '', '', '', 47187),
(71182, 'esES', 'Archivistas dscolos', 'Renete con Sindragosa en los archivos superiores del Archivo Azur.', 'T, dracthyr.\n\nDos de los tuyos han estado buscando en los archivos justo al sur de aqu. No me he presentado an, y apreciara tu compaa.\n\nSi tienes tiempo, podemos reunirnos en los archivos superiores.', '', '', '', '', '', '', 47187),
(71179, 'esES', 'Mira al Mirador', 'Habla con el comandante Thadezus en el Mirador Gelikyr.', '$n, tengo otra tarea para ti.\n\nHa habido informes de actividad de primalistas cerca del Puesto Gelikyr que amenaza nuestro control de Tyrhold.\n\nHabla con el comandante Thadezus y averigua cmo puedes ayudar.', '', '', '', '', '', 'Habla con el comandante Thadezus en el Mirador Gelikyr.', 47187),
(71178, 'esES', 'Puerta: Santuario Sombreado', 'Encuentra la puerta latente en el Santuario Sombreado de las Llanuras de Ohn\'ahra.', 'Nos hemos enterado de que hay una piedra latente en las exuberantes colinas del suroeste. Es un viaje bastante largo, pero merece la pena enviar a alguien con tus conocimientos a investigar.', '', '', '', '', '', '', 47187),
(71166, 'esES', 'La liblula ms antigua', 'Derrota al cornisapo en un duelo de mascotas.', '', '', '', '', '', '', '', 47187),
(71165, 'esES', 'Puerta: Margen del En', 'Localiza la puerta latente del Margen del En, en Thaldraszus.', 'Al otro lado de las montaas de Thaldraszus, en las laderas, hay una pequea posada. Justo en la entrada descansa una piedra latente olvidada.\n\nQu te parece? $gListo:Lista; para otra aventura, $n?', '', '', '', '', '', '', 47187),
(71162, 'esES', 'Puerta: Algeth\'era', 'Localiza la puerta latente en lo alto de la aguja de Algeth\'era, en Thaldraszus.', 'Otra piedra. Otra aguja.\n\nSer mejor que empieces. Esta va a ser una gran caminata. Y peligrosa, segn los que la descubrieron.\n\nTe apuntas?', '', '', '', '', '', '', 47187),
(71161, 'esES', 'Puerta: Vakthros', 'Localiza la puerta latente en lo alto de la aguja en Vakthros, en las Tierras Azures.', 'He recibido un informe sobre otra de esas piedras latentes en la regin invernal que hay al sureste.\n\nAntes de que te emociones, debo decirte que es un lugar al que la mayora no ira por propia voluntad, pero si te apasiona la aventura y tal vez hallar una muerte prematura, es un trabajo para ti!\n\nTe lo he vendido bien? Perfecto!\n\nPonte tus ropas ms clidas y dirgete al este hasta que el viento helado te haga cosquillas en la nariz, y luego sigue adelante. Sabrs que ests cerca cuando te cueste respirar y sientas el fro en los huesos.', '', '', '', '', '', '', 47187),
(71160, 'esES', 'Carga de profundidad', '', '', '', '', '', '', '', '', 47187),
(71157, 'esES', 'Puerta: Observatorio Cima Celestial', 'Localiza la puerta latente en el Observatorio Cima Celestial, que est en las Orillas del Despertar.', 'Algunos de nuestros expedicionarios del norte nos han comunicado que hay otra de aquellas piedras en lo alto de la aguja, al noreste.\n\nHe odo que es difcil llegar por aquello de que est muy alto, pero seguro que encuentras el modo!', '', '', '', '', '', '', 47187),
(71155, 'esES', 'La Cmara Azur', 'Detn a la Llama Hendida en la Cmara Azur.', 'Tenemos un problema, $n.\n\nBajo el Archivo Azur se encuentra la Cmara Azur. A lo largo de mi vida, he almacenado all importantes y peligrosas curiosidades mgicas.\n\nUn gran grupo de la Llama Hendida ha irrumpido en la cmara, convencidos de que alberga algn secreto.\n\nDebes entrar ah y detener este asalto antes de que liberen peligros que no comprenden.\n\nEsos ladrones no saben lo que hay dentro.', '', '', '', '', '', '', 47187),
(71153, 'esES', 'Misin del mundo, objetivos de bonificacin y escenarios increbles', 'Completa 3 misiones del mundo de los tortolianos.', 'Completa 3 misiones del mundo para ayudar a los tortolianos.', '', '', '', '', '', 'Vuelve con el recolector Kajo.', 47187),
(71152, 'esES', 'De vuelta a la cmara principal', 'Renete con Toddy en la cmara principal.', 'Ahora que hemos accedido a las consolas de anulacin, deberamos poder atravesar esa barrera.\n\nRenete conmigo en la cmara principal y acabemos con esto!', '', '', '', '', '', '', 47187),
(71151, 'esES', 'Seguir explorando las puertas', 'Renete con Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<La carta est limpia y su escritura es de lo ms ntida. Adems, lleva el sello de la Expedicin Dragontina.\n\nThaelin Yunquenegro solicita tu presencia>.', '', '', '', '', '', '', 47187),
(71150, 'esES', 'Seguir explorando las puertas', 'Renete con Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<El papiro desprende un desagradable olor a moho. Tras hacer un esfuerzo por recuperar la concentracin, queda claro que Thaelin necesita tu ayuda para encontrar nuevas respuestas.\n\nLa nica pregunta que queda es qu hacer con este papiro tan apestoso>.', '', '', '', '', '', '', 47187),
(71149, 'esES', 'Seguir explorando las puertas', 'Renete con Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<Sorprendentemente, esta vez el mensajero no te ha dejado una mochila ni una nota, sino un objeto de la coleccin personal de Thaelin.\n\nAl investigarlo ms a fondo, encuentras un pequeo mensaje suyo donde te pide ayuda>.', '', '', '', '', '', '', 47187),
(71148, 'esES', 'Seguir explorando las puertas', 'Renete con Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<La curiosa criatura que tienes ante ti te hace entrega de una nota firmada y sellada por la Expedicin Dragontina.\n\nQuizs sea una peticin de ayuda de algn afamado explorador>.', '', '', '', '', '', '', 47187),
(71146, 'esES', 'Seguir explorando las puertas', 'Renete con Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<El expedicionario en instruccin te entrega una nota enrollada. Al investigarla, descubres que es de un viejo amigo, Thaelin Yunquenegro, que necesita tu ayuda.\n\nAntes de salir corriendo, la criatura extiende su mano como si pidiera un premio. Segundos despus, suelta un fuerte chirrido y se aleja con las manos vacas>.', '', '', '', '', '', '', 47187),
(71145, 'esES', 'El gran maestro', 'Derrota a Patchu en un duelo de mascotas', '', '', '', '', '', '', '', 47187),
(71144, 'esES', 'El asesino de la Alianza', 'Mata 10 miembros de la Alianza sin morir y con una recompensa por tu cabeza.', 'Bien! Sigue as, no des tregua a esos perros de la Alianza!\n\nMata ms miembros de la Alianza y acabars en los libros de historia, $c.\n\nNo ser fcil, ya que la Alianza ha puesto precio a tu cabeza, as que ten cuidado!\n\nPor la Horda!', '', '', '', '', '', '', 47187),
(71143, 'esES', 'El asesino de la Horda', 'Mientras la Horda te da caza, mata 10 miembros de la Horda sin morir.', 'Guau! Sigue as, soldado!\n\nMata ms miembros de la Horda y acabars en los libros de historia de la Alianza.\n\nNo ser fcil, ya que la Horda ha puesto precio a tu cabeza, as que ten cuidado!\n\nPor la Alianza!', '', '', '', '', '', '', 47187),
(71141, 'esES', 'Agallas canallas', 'Mata a Gurblbrblr el Invasor en el Campamento Gotarrisco.', 'Kad\'irsza es imprudente, pero conoce a sus cangrejos. Los grlocs han ido demasiado lejos!\n\nMe he dado cuenta de que los grlocs siguen las rdenes de Gurblbrblr. Les est ordenando apresar a los cangrejos. No podemos permitir que esto contine, por el equilibrio de la vida y la seguridad de los que la atienden.\n\nDerrota a Gurblbrblr. Impide que puedan expandirse ms all del ro!', '', 'Grlocs de tamao repugnante? Desde luego.', 'Gurblbrblr el Invasor', '', '', '', 47187),
(71140, 'esES', 'Dos y dos juntos', 'Derrota a Bakhushek en un duelo de mascotas.', '', '', '', '', '', '', '', 47187),
(71139, 'esES', 'Joya Arcana resplandeciente', 'Llvale la joya Arcana resplandeciente a Noriko la Omnisciente, que est en el Campamento de Antonidas.', '<Esta gema parece bastante poderosa. Tiene un brillo inquietante.\n\nQuiz sea mejor entregrsela al Kirin Tor para que la guarden en un lugar seguro>.', '', '', '', '', '', 'Llvale la joya Arcana resplandeciente a Noriko la Omnisciente, que est en el Campamento de Antonidas.', 47187),
(71138, 'esES', 'Puerta: Trecho de Rusza\'thar', 'Encuentra la puerta latente en el Trecho de Rusza\'thar de las Llanuras de Ohn\'ahra.', 'Un miembro de la expedicin ha informado del avistamiento de una piedra latente en las Llanuras de Ohn\'ahra.\n\nTe animas a una aventura?', '', '', '', '', '', '', 47187),
(71135, 'esES', 'Cabos sueltos', 'Enfrntate a Muerdefro en el Campamento Nievepiel, que est en las Tierras Azures.', 'Si algo he aprendido de mi estancia en la naturaleza, es que si te topas con un mal y no le rompes los huesos y le arrancas las races, seguir creciendo. Y luego ser ms complicado eliminarlo.\n\nEstas montaas ya sufran la amenaza de Muerdefro cuando yo era un cachorro como t, y la cosa solo ir a peor cuando se haga con el control de la tribu Nievepiel.\n\nDeb hacer algo al respecto hace mucho tiempo, pero ahora somos los nicos capaces de enmendar ese error.', '', 'Es hora de poner fin al cruel reinado de Muerdefro.', 'Muerdefro', '', '', '', 47187),
(71097, 'esES', 'Una zarpa amiga', 'Activa el artefacto en la torre que hay sobre la Galera Cobalto y vigila las acciones de Venderthvan.', 'Bien, has cargado el artefacto. Vamos a encenderlo...\n\nY deja de mirarme as. No hagas como si no tuvieras curiosidad por ver si funciona. \n\nDale otra sacudida, retrate despacio y djame terminar el trabajo.', '', '', '', '', '', '', 47187),
(71096, 'esES', 'Una zarpa en la necesidad', 'Intenta activar el artefacto.', '<Venderthvan se frota los ojos y grue de dolor>.\n\nVale. Si no quieres drmelo, descubre por tu cuenta cmo hacer que funcione. \n\nTe lo arrebatar cuando hayas acabado. Por la fuerza, si es necesario.\n\nAs que adelante. Sacdelo o algo.', '', '', '', '', '', '', 47187),
(71095, 'esES', 'Una zarpa en apuros', 'Pregunta a Venderthvan cmo puedes ayudarlo y haz lo que te pida.', 'Veamos qu podemos hacer para ayudar a este tipo!\n\n<Heleth se inclina y te susurra>.\n\nNo te preocupes, no vamos a dejar que se lleve nada ni cosas as. Vamos a divertirnos!\n\nHace siglos que nadie viene por aqu para ver cmo nos va. Estamos MUY aburridos!\n\n<Heleth te guia un ojo>. \n\nPor qu no le preguntas lo que quiere?', '', '', '', '', '', '', 47187),
(71094, 'esES', 'Siempre ayudamos!', 'Encuentra vendas en la torre que hay sobre la Galera Cobalto para sanar a Venderthvan.', 'Hola! \n\nTambin has venido a ayudar? Tienes pinta de ser til!\n\n<Heleth seala al dracthyr herido>.\n\t\t\t\nEste se ha hecho dao en el ala tratando de volar hasta aqu. Parece uno de esos tipos malos de abajo, pero no me da miedo! Lo ayudar de todas formas, porque as somos nosotros.\n\n<Heleth saca pecho>. \n\t\t\t\nYo lo vigilar mientras t me buscas unas vendas!', '', '', '', '', '', '', 47187),
(71093, 'esES', 'Legado de Tyr: secretos del pasado', 'Entra en Uldaman: Legado de Tyr, que est en las Tierras Inhspitas, y recupera el disco.', 'Debemos restaurar el poder de los Aspectos para impedir que Raszageth libere al resto de Encarnaciones.\n\nPor desgracia, los titanes estn bastante preocupados y el guardin Tyr muri hace mucho tiempo.\n\nLa reina Alexstrasza ha propuesto un plan. En lo profundo de las Tierras Inhspitas hay una instalacin titnica llamada Uldaman. Al parecer, es posible que los aliados de Tyr hayan escondido all un disco con sus recuerdos.\n \nDicen que los troggs han invadido el lugar. Rene a tus aliados, dirgete a Uldaman y consigue el disco en nombre de la reina de dragones!', '', '', '', '', '', '', 47187),
