(71029, 'esES', 'Tcticas de caza: entrenamiento de compaero', 'Elige una facultad de compaero adicional para usarla durante la gran cacera.', 'Tu renombre con los Maruuk sigue creciendo. Por tus esfuerzos, te ensear a comandar a tu compaero de caza con mayor eficacia durante el combate.', '', '', '', '', '', '', 47187),
(71028, 'esES', 'Tcticas de caza: bendicin de Ohn\'ahra', 'Selecciona una bendicin de Ohn\'ahra para usarla durante la gran cacera.', 'Tu renombre con los Maruuk crece. Escucha con atencin y te ensear a invocar una bendicin de Ohn\'ahra para que os proteja a ti y a tus aliados.', '', '', '', '', '', '', 47187),
(71027, 'esES', 'SE BUSCA: Mara\'nar el Atronador', 'Mata a Mara\'nar el Atronador en el Valle Primordial y recupera una de sus placas.', 'Se busca a un poderoso cazador para acabar con una bestia desenfrenada!\n\nUn truenagarto llamado Mara\'nar el Atronador se ha abierto camino desde el Zarzal Espinatrueno hasta el Valle Primordial, alterando la fauna local. Ha electrificado el agua, derribado rboles y destruido nidos de pato.\n\nHay que detener esta amenaza. Mtalo y lleva una de sus placas al guardin del khan Jebotai como prueba.\n\nQue Ohn\'ahra te gue.', '', 'Esta bestia perturba la fauna local del Valle Primordial y ha destruido demasiados nidos de pato.', 'Mara\'nar el Atronador', '', '', '', 47187),
(71026, 'esES', 'Contra toda adversidad', 'Mata a 25 jugadores de la Horda de nivel 70 o ms en cualquier parte de las Islas Dragn.', 'Aunque algunos de vosotros, mortales insignificantes, hayis acordado una tregua, tengo entendido que hay quien todava alberga algn rencor.\n\nSi renes a algunos amigos, s de un lugar en el que podrs mostrar qu bando es el que manda.\n\nY para que todo sea ms interesante, si tienes xito, te har un regalito.', '', '', '', '', '', '', 47187),
(71024, 'esES', 'Caos y revuelo', 'Ayuda a Erima a investigar el incidente en la planta baja del Trono de los Aspectos.', '$n! Has odo ese ruido? Ha habido un incidente en la planta baja.\n\nUno de mis investigadores de confianza, Erima, ya estaba ah. Necesitar ayuda para reunir pruebas mientras intenta entrevistar a la multitud.', '', '', '', '', '', '', 47187),
(71023, 'esES', 'Renombrado con el Acuerdo de Valdrakken', 'Habla con Unatos en Valdrakken.', 'Tus hazaas coinciden con tu legendaria reputacin previa a tu llegada a las Islas Dragn.\n\nMe gustara ayudarte ms proporcionndote suministros adicionales. Bscame en Valdrakken.', '', '', '', '', '', '', 47187),
(71022, 'esES', 'Reino de los carneros', 'Ordena a Taivan que se enfrente al carnero obcecado de la manada.', 'Como los argales no parecen tener mucho respeto por Taivan, deberamos ver si puede con el carnero del rebao.\n\nEs el jefe de todos los argales, y bastante testarudo. Si Taivan puede dominar al carnero, el rebao empezar a obedecerle.\n\nLo encontrars justo all, en la colina. Buena suerte, Taivan. Si esto no funciona, me temo que no hay mucha esperanza de que se convierta en pastor.', '', '', '', '', '', '', 47187),
(71020, 'esES', 'Cmara de las Encarnaciones: Vamos a romper algunos huevos', 'Consigue 3 fragmentos del gran bastn de la vigilante de linaje Dyurna en la Cmara de las Encarnaciones en dificultad mtica.', 'La vigilante de linaje Dyurna est en algn lugar de esta fortaleza, custodiando la cmara desde sus aposentos. Si logras hacerte con piezas de su gran bastn, podremos asaltar su guarida directamente.\n\nCon tres fragmentos nos bastara; cuatro me parece excesivo.', '', '', '', '', '', '', 47187),
(71019, 'esES', 'Cmara de las Encarnaciones: Vamos a romper algunos huevos', 'Consigue 3 fragmentos del gran bastn de la vigilante de linaje Dyurna en la Cmara de las Encarnaciones en dificultad heroica.', 'La vigilante de linaje Dyurna est en algn lugar de esta fortaleza, custodiando la cmara desde sus aposentos. Si logras hacerte con piezas de su gran bastn, podremos asaltar su guarida directamente.\n\nCon tres fragmentos nos bastara; cuatro me parece excesivo.', '', '', '', '', '', '', 47187),
(71018, 'esES', 'Cmara de las Encarnaciones: Vamos a romper algunos huevos', 'Consigue 3 fragmentos del gran bastn de la vigilante de linaje Dyurna en la Cmara de las Encarnaciones en dificultad normal.', 'La vigilante de linaje Dyurna est en algn lugar de esta fortaleza, custodiando la cmara desde sus aposentos. Si logras hacerte con piezas de su gran bastn, podremos asaltar su guarida directamente.\n\nCon tres fragmentos nos bastara; cuatro me parece excesivo.', '', '', '', '', '', '', 47187),
(71017, 'esES', 'Carta de Naluki', 'Entrega la cabeza de pescado de Naluki al viejo Colmigrima.', 'A ver si lo adivino, Colmi te dijo que no abrieras la carta, verdad?\n\nParece que cumpliste sus rdenes; no me extraa que confe tanto en ti! \n\nDale esta cabeza de pez de mi parte. l sabr lo que significa.', '', '', '', '', '', 'Entrega la cabeza de pez de Naluki a Colmigrima.', 47187),
(71016, 'esES', 'Hermana de Colmigrima', 'Entrega la carta de Colmigrima a su hermana Naluki, que est en Iskaara.', 'La ltima es mi hermana, Naluki. Ahora ayuda a llevar la posada de Iskaara.\n\nDale esta carta. \n\nNo la abras.', '', '', '', '', '', 'Entrega la carta de Colmigrima a su hermana Naluki, que est en Iskaara.', 47187),
(71015, 'esES', 'Mucho msculo, poco cerebro', 'Encuentra a Varsek en el Mirador Antiguo.', 'Varsek es uno de los dracnidos ms duros que conocers jams. Y uno de los ms estpidos, aunque nunca lo admitir.\n\nDespus de lo de Muerdefro, se asust y comenz a replantearse la vida... o algo as. Dijo que nunca haba podido estudiar las ruinas que dejaron sus ancestros, as que huy y se convirti en \"erudito\".\n\nTrelo de vuelta. Ese lugar no le corresponde!', '', '', '', '', '', 'Encuentra a Varsek en el Mirador Antiguo.', 47187),
(71014, 'esES', 'Un amigo frbolg lejano', 'Encuentra a Barst en la Isla Garralarga.', 'Barst era uno de los frbolgs ms duros que he conocido. No es moco de pavo que la manada de Muerdefro lo derrotara en una pelea.\n\nLo ltimo que s de l es que parti hacia una isla frente a la costa de Iskaara. Deca que se \"jubilaba\" o no s qu estupidez parecida.\n\nDile a Barst que es hora de volver a la accin.\n\nAh, y no te dejes engaar por su forma de hablar. Es capaz de hacerte pedazos si lo miras mal.', '', '', '', '', '', 'Encuentra a Barst en la Isla Garralarga.', 47187),
(71013, 'esES', 'Nada de vengarse con el estmago vaco', 'Pesca $2oa dardos de cola congelada en el Escondrijo de Colmigrima.', 'Ahora que hemos vuelto a centrarnos en nuestro objetivo, tenemos que hablar con los colmillos de frente. Te acuerdas de Muerdefro, ese gnoll con el que hablaste?\n\nHan pasado cosas entre nosotros.\n\nPuede que tarde un poco en explicarlo. T ve y consigue algo de pescado mientras hablo, joven. Tenemos que alimentar a todo el mundo. Necesitan fuerzas para el siguiente paso.', '', '', '', '', '', '', 47187),
(71012, 'esES', 'Varsek reclutado', 'Informa a Colmigrima de que has reclutado a Varsek.', 'Parece que ser capaz de resolver los misterios de este lugar sin problemas en el futuro. \n\nNo hace falta que le contemos esto al viejo Colmigrima, vale?\n\nMe dirigir a su escondrijo. Creo que disfrutar soltando algo de agresividad acumulada contra Muerdefro.', '', '', '', '', '', 'Vuelve con Colmigrima.', 47187),
(71011, 'esES', 'Se busca: lirio torrencial', 'Encuentra el lirio torrencial.', '<El cartel est escrito con una bonita caligrafa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen el lirio torrencial para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensacin por su labor.\n\nAlgunos miembros de la expedicin afirman haber avistado a una poderosa primalista en el Mirador Gelikyr de Thaldraszus con una flor mgica en el cuello. Desconocemos si se trata del legendario lirio torrencial, pero es un buen punto de partida.', '', 'Un poderoso primalista acutico de Thaldraszus lleva el lirio torrencial en su caperuza.', 'Alora Nieblabruma', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(71010, 'esES', 'Se busca: catalejo temporal', 'Encuentra el catalejo temporal.', '<El cartel est escrito con una bonita caligrafa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen el catalejo temporal para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensacin por su labor.\n\nMiembros de la expedicin informan de que un enano presuma de este catalejo mgico en las tabernas del sur de Thaldraszus. Recomendamos centrar la bsqueda en esa regin.', '', 'Un oteador primalista de Thaldraszus usa el catalejo temporal para planear su prximo ataque.', 'Oteador Mordren', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(71009, 'esES', 'Elemental, mi querido dracnido', 'Ayuda a Varsek a resolver el misterio del Mirador Antiguo.', 'Colmigrima quiere darle otra vez a Muerdefro, eh? Lamento decepcionarlo, pero dej esa vida atrs para convertirme en erudito.\n\nEstoy tratando de estudiar la historia... y de hacerla, pero me he topado con este acertijo esotrico en estas ruinas antiguas.\n\nLa cosa va as: si tocas un cristal que hay aqu cerca, dice \"sigue el patrn\". Pero no tengo ni idea de lo que significa!\n\nSabes qu? Si me ayudas a descifrarlo, ayudar a Colmigrima a acabar con Muerdefro de una vez por todas.', '', '', '', '', '', '', 47187),
(71008, 'esES', 'Se busca: corazn de piedra de Corazn Ptreo', 'Encuentra el corazn de piedra de Corazn Ptreo.', '<El cartel est escrito con una bonita caligrafa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen el corazn de piedra de Corazn Ptreo para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensacin por su labor.\n\nMiembros de la expedicin afirman haber visto a Corazn Ptreo en una cueva situada en el centro de las Tierras Azures.', '', 'Corazn ptreo guarda su corazn ptreo en... Bueno, esa parte probablemente la puedas deducir.', 'Corazn ptreo', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(71004, 'esES', 'Se busca: ttem vinculador masivo de ohunas', 'Encuentra el ttem vinculador masivo de ohunas.', '<El cartel est escrito con una bonita caligrafa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen el ttem vinculador masivo de ohunas para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensacin por su labor.\n\nAlgunos miembros de la expedicin han informado de la presencia de un primalista especialmente poderoso en el Alto Son del Viento de las Llanuras de Ohn\'ahra, el cual parece controlar los poderes de este ttem.', '', 'Un primalista de aire de las Llanuras de Ohn\'ahra blande el ttem vinculador masivo de ohunas.', 'Prozela Tirovendaval', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(71002, 'esES', 'El mejor hechizo de la historia', 'Lee \"Tormentas de man para principiantes\" y descubre el hechizo secreto de Molino.', '<Este libro, que levita suavemente y emite magia Arcana, contiene innumerables hechizos y encantamientos creados por la bella aunque catica mente de Molino Tormenta de Man>.', '', '', '', '', '', '', 47187),
(71001, 'esES', 'Se busca: ncleo primordial vinculado a la tierra', 'Encuentra el ncleo primordial vinculado a la tierra en Neltharus.', '<El cartel est escrito con una bonita caligrafa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen el ncleo primordial vinculado a la tierra para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensacin por su labor.\n\nLos registros recuperados de la Ciudadela Obsidiana indican que pudo haber estado almacenado en el Tesoro Oculto del Dragn de Neltharus, aunque su ubicacin actual es incierta.', '', 'Se rumorea que el ncleo se perdi en El Tesoro Oculto del Dragn de Neltharus.', 'Ncleo primordial vinculado a la tierra', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(71000, 'esES', 'Barst reclutado', 'Informa a Colmigrima de que has reclutado a Barst.', 'Bueno, un trato es un trato. Si Colmigrima necesita una mano para matar a Muerdefro de una vez por todas, me apunto.\n\nEl odio que pueda quedar en mi corazn, lo reservo para Muerdefro. Colmigrima te cont lo que ocurri? \n\nTodos los que cazbamos con Colmigrima creamos que ramos imparables, hasta que nos topamos con Muerdefro. \n\nNo solo nos derrot: nos humill delante de todos. \n\nFuimos derrotados y dejados ensangrentados y maltrechos en el escondrijo. Muerdefro nos us como ejemplo.\n\nEs hora de la venganza.', '', '', '', '', '', 'Vuelve con el viejo Colmigrima.', 47187),
(70996, 'esES', 'Una pequea alga para mis amigos', 'Derrota al elemental de algas salvaje en Isla Garralarga.', 'Vaya, parece que Colmigrima est en un aprieto. Estoy hasta el gorro de los conflictos del continente, pero...\n\nHan pasado cosas entre Muerdefro y yo. Hay cuentas que ajustar.\n\nQu demonios, no puedo dejar indefensos a los dems... Tenemos problemas con un elemental que est causando estragos en la playa. Solo yo puedo mantenerlo a raya. Es un bicho escurridizo... Literalmente.\n\nMira, encrgate de ese elemental por m y yo me dar un garbeo por el campamento de Colmigrima.\n\nQu te parece, colega?', '', 'En marcha!', 'Elemental de algas', '', '', '', 47187),
(70995, 'esES', 'Se busca: calavera de Fenistrasza', 'Encuentra la calavera de Fenistrasza.', '<El cartel est escrito con una caligrafa preciosa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen la calavera de Fenistrasza para nuestro archivo de artefactos.\n\nQuien la consiga, que la entregue a la catalogadora Jakes para procesarla y compensar por la labor.\n\nAlgunos miembros de la expedicin han informado de que la vieron en manos de un djaradin desterrado en las montaas del oeste, pero nadie ha podido convencerlo de que se desprenda de ella.', '', 'Un solitario djaradin guarda el crneo encantado en su alcoba.', 'Tarjin el Ciego', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(70994, 'esES', 'Soluciones de drenaje', 'Succiona $1oa corrientes brillantes en la cueva este de las Ruinas de la Cmara de la Vida.', 'Quieres el honor de ayudar a la famossima geloga jefa de la Expedicin Dragontina? Eso es. Soy exactamente quien crees que soy. Y estoy en un aprieto!\n\nEstaba examinando este ro en busca de nuevas muestras sedimentarias, pero entonces el agua arrastr los trozos de limo ms interesantes!\n\nTengo aqu mi dispositivo patentado de captacin de agua, pero necesita desesperadamente que alguien vaya y succione esos elementales.\n\nCrees que ests a la altura de la tarea?', '', '', '', '', '', '', 47187),
(70992, 'esES', 'Se busca: cometa colmillarr perdida', 'Encuentra la cometa colmillarr perdida.', '<El cartel est escrito con una caligrafa preciosa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedicin busquen la cometa colmillarr perdida para nuestro archivo de artefactos.\n\nQuien la consiga, que la entregue a la catalogadora Jakes para procesarla y compensar por la labor.\n\nAlgunos miembros de la expedicin han informado de una cometa sujeta a un transporte colmillarr a lo largo de la costa occidental, pero nadie ha podido alcanzarla, pues el transporte la mantiene en el aire y fuera del alcance mientras se mueve.', '', 'La cometa vuela orgullosa detrs del Arvillo Perdido mientras se mueve...', 'La cometa colmillarr perdida', '', '', 'Vuelve con la catalogadora Jakes, que est en el Campamento Base Dragontina.', 47187),
(70990, 'esES', 'La lana es el camino', 'Esquila a los argales pezuarrisco por su lana.', 'Aunque la mayora de nuestra lana procede de nuestros propios rebaos de argales, a veces tenemos que recurrir a las criaturas salvajes cuando los nuestros escasean.\n\nPuedes encontrar argales salvajes en las llanuras cercanas. Suelen ser ms temperamentales que el rebao de nuestro clan. Si pudieras tomar esta hoja e intentar esquilar su lana, haras un gran servicio a los Aylaag.', '', '', '', '', '', '', 47187),
(70989, 'esES', 'Parte de una manada', 'Caza al draco voraz con Taivan y la manada de bakars de caza.', 'Quiz tu bakar necesite que los de su propia especie le enseen a cazar.\n\nPuedes tomar prestados algunos de nuestros bakars adiestrados. Llvatelos y acaba con el draco que merodea por la zona. \n\nVeamos cmo se desenvuelve Taivan en una manada!', '', '', '', '', '', '', 47187),
(70987, 'esES', 'Corazones de almidn', 'Habla con Meliane Enorath en las Ruinas de la Cmara de la Vida, que est en las Orillas del Despertar.', 'Qu puede haber que sea mejor que una comida que puedes llevar mientras exploras?\n\nLa comida callejera es la esencia de las ciudades bulliciosas de este gran mundo. Pero no todas las comidas son aptas. El secreto de los grandes platos para llevar es el almidn, puesto que se mantiene firme mientras te mueves. El pan, las patatas y el arroz, entre otras cosas, son la clave de este tipo de comida.\n\nMe gustara invitar a mis compaeros pandaren a probar un sabroso ingrediente llamado acechamaz. Bocado me lo ense cuando nos conocimos cerca de unas ruinas de los titanes en las Orillas del Despertar.', '', '', '', '', '', '', 47187),
(70986, 'esES', 'Soldado Shikzar', '', '', '', '', '', '', '', '', 47187),
(70985, 'esES', 'La exploradora solitaria', 'Habla con drades en el Santuario Sombreado.', 'Lo s, lo s, es ridculo. Un centauro y una drade? No podemos ser ms diferentes.\n\nPero desde que vi los Jardines Esmeralda, he querido conocer mejor a una de ellas. Lo que pasa es que no soy capaz de decir ni hacer nada para mantener su inters.\n\nHe odo que les gustan... las plantas. Y las cras de animales. Y quiz matar furtivos, pero ni siquiera s por dnde empezar.\n\nT puedes hablar con ellas, no? Podras preguntarles y averiguar qu les interesa? Entonces tal vez tenga una oportunidad.', '', '', '', '', '', 'Vuelve con la exploradora Santuun.', 47187),
