(70981, 'esES', 'La mar de sabrosa', 'Habla con Wayun en el Rincn del Ballenero, que est en las Tierras Azures.', 'Ah, qu olor a mar! Lo notas, $n? Hueles los minerales cargados con sal marina gruesa? Eh?\n\nExiste una variedad poco comn de pescado que prob hace tiempo cerca de Iskaara, en las Tierras Azures. Dos colmillarr estaban asando uno en un fuego y desprenda un olor de lo ms delicioso por toda la tundra glacial.\n\nIntenta conseguir uno para nosotros. S que nuestros clientes quedarn tan embelesados por el sabor del mar como yo aquel da.', '', '', '', '', '', '', 47187),
