(70976, 'esES', 'Gandulear y deslizarse en trineo', 'Busca a Kiopo en la isla que est al sureste.', 'Como sabrs, los hijos de Iskaara son extremadamente independientes. Aprenden a valerse por s mismos a una edad temprana.\n\nPara muchos de los cros mayores, escabullirse al iceberg que hay al sureste de aqu es un rito de iniciacin. Kiopo, el mayor de nuestros hijos, est all ahora mismo. Dile que te envi yo y te ofrecer uno de nuestros trineos.\n\nAh, esto me recuerda a mis das de juventud con los amigos...', '', '', '', '', '', '', 47187),
