(70970, 'esES', 'Buenas intenciones', 'Detn a Alia Alzasol y destruye el artefacto Valthrux.', 'Puede que sepa dnde est el artefacto. Alia no dejaba de susurrar frenticamente cuando trajiste todos los fragmentos.\n\nDeca algo sobre una cueva que pareca atraer a las araas.\n\nNo hay ninguna cueva en la zona frente a nosotros, lo que me lleva a pensar que podra haber una en las profundidades de las ruinas.\n\n$n, nosotros nos quedaremos aqu para mantener abierta la ruta de escape. T salva a Alia y destruye ese artefacto maldito.', '', 'Esperemos llegar a tiempo, antes de que el artefacto consuma a Alia.', 'Valthrux', '', '', '', 47187),
