(70958, 'esES', 'Los mejores hongos del festn', 'Habla con la capitana celadora Sinjoirmi en la Confluencia Temporal de Thaldraszus.', 'La buena cocina consiste en usar las mejores tcnicas con los mejores ingredientes, como es natural. La comida pensada para la buena cocina suele costar una fortuna, pero en el Festn Rub nunca permitiramos eso.\n\nBocado me ha hablado de un ingrediente perfecto para el tema de hoy. Uno tan poco comn y tan exquisito que... an no existe. Tentador, verdad?\n\nLos dragones bronce han descubierto un portal a un futuro peligroso. Uno donde existe una trufa negra con un sabor inimaginable.\n\nTienes que ir!', '', '', '', '', '', '', 47187),
(70957, 'esES', 'El mar al oeste', 'Habla con Azucarillo en el Santuario Sombreado, que est en las Llanuras de Ohn\'ahra.', 'Disfrutando de la vegetacin que rodea nuestro paisaje, $n?\n\nMe recuerda a un plato que me ofrecieron un par de hermanas drades y su amable amigo antrbol. Se llamaba Azucarillo. Un residente del Santuario Sombreado en la costa occidental de las llanuras.\n\nEra una mezcla de hierbas frescas, verduras y especias. En el centro del plato estaba la capa ms deliciosa de algas marinas que haya probado jams.\n\nQu? Nunca has probado las algas marinas? Solo tienes que ir a buscar unas pocas. Y trae tambin para m!', '', '', '', '', '', '', 47187),
