(70946, 'esES', 'Nadie debe blandirlo', 'Convence a Alia de que destruya a Valthrux.', 'Por lo que has encontrado, se dira que el poder del artefacto ha condenado a todo aquel que lo ha usado hasta ahora.\n\nLos dragauros que vivan aqu se mataron unos a otros por l. Parece que tambin est corrompiendo a la Llama Hendida.\n\nEste no es un artefacto que haya que recuperar; debemos destruirlo antes de que pueda daar a nadie ms.\n\nTenemos que convencer a Alia y a Kattigat.', '', '', '', '', '', '', 47187),
