(70941, 'esES', 'Agujeros de pesca', 'Habla con Nunvuq en Iskaara, que est en las Tierras Azures.', 'Hola de nuevo! Sabas que voy a ser el mejor pescador de la aldea? Una vez pesqu una piraa gigante. Quera comerme la cara!\n\n<Rowie mira a su alrededor con aire distrado>.\n\nAh, s! Tengo un mensaje para ti. Nunvuq ha vuelto a Iskaara y quiere hablar contigo sobre los agujeros de pesca.', '', '', '', '', '', '', 47187),
(70940, 'esES', 'Relatos de campeones colmillarr', '', '', '', '', '', '', '', '', 47187),
