(70938, 'esES', 'Festines comunitarios', 'Habla con Gran Kinook en Iskaara en las Tierras Azures.', 'Aqu ests, $n! La sopa est lista.\n\nMs te vale darte prisa y llegar a Iskaara. Gran Kinook te ha estado buscando.\n\nUna vez me pidi que le diera un pez espinoso viscoso y asqueroso para la sopa y, como no quera, le grit: \"No, chef!\".\n\nSe enfad tanto que pens que iba a meterme en la sopa!', '', '', '', '', '', '', 47187),
(70937, 'esES', 'Lo que Valthrux fue antao', 'Encuentra pistas sobre qu es en realidad el artefacto Valthrux.', '<To\'tik te susurra>. \n\nEsto no me gusta. Eso de que un artefacto misterioso te susurre promesas de grandeza no suena bien.\n\nPero no podemos hacernos a un lado. De lo contrario, la Llama Hendida se har con l... Sea lo que sea.\n\nConozco este tipo de ruinas. Los dragones azules suelen dejar notas sobre su trabajo. Mantn los ojos bien abiertos y tal vez encuentres alguna.\n\nPodemos usar cualquier prueba que halles para avisar a Alia y a Kattigat.', '', '', '', '', '', '', 47187),
(70936, 'esES', 'Los ttems colmillarr robados', '', '', '', '', '', '', '', '', 47187),
(70935, 'esES', 'Pescar y soltar: dorado islaaleta', '', '', '', '', '', '', '', '', 47187),
(70932, 'esES', 'La vida de las especias', 'Habla con Griftah en el Trono Obsidiana.', 'Para muchos, la carne es esencial en cualquier comida de verdad. Pero qu es lo esencial en un plato de carne?\n\nLas especias!\n\nEn estas islas existe una especia que supera a todas las dems en trminos de sabor, textura y rareza. Por desgracia, solo se puede encontrar en los elementales que habitan en las profundidades del Bastin Obsidiana. Se trata de una zona ocupada por los Djaradin.\n\nQuizs puedas consultarlo con un trol peculiar que conoc mientras cruzaba por all. Creo que se llamaba... Griftah.', '', '', '', '', '', '', 47187),
(70931, 'esES', 'Fragmentos susurrantes', 'Recupera $1oa fragmentos susurrantes de manos de la Llama Hendida.', 'Creo que Valthrux intenta comunicarse con nosotros a travs del fragmento que recuperamos.\n\nPodemos usar esto a nuestro favor siempre que protejamos nuestra mente de la influencia del artefacto.\n\nMe equivoqu con respecto a la Llama Hendida. Por desgracia, ya han conseguido varios fragmentos. \n\nLos susurros de Valthrux indican que no les queda mucho para encontrar su ubicacin.\n\nVe y recupera los fragmentos de manos de la Llama Hendida antes de que lleguen al artefacto!', '', '', '', '', '', '', 47187),
(70930, 'esES', '\"T\" lo digo en serio', 'Habla con Lilial Estallamanecer en el Valle Red Trmula.', 'La fiesta de hoy es una celebracin del t: caliente, helado y de cualquier otra forma. Y con pastelitos y galletitas extravagantes.\n\nPero hay un ingrediente poco comn de las islas que creo que podra darle una nueva dimensin de sabor. En lo ms profundo de los dominios infestados de reptadores del Valle Red Trmula hay un maravilloso arbusto con la hoja ms estimulante que existe: la sagittata muerdescarcha.\n\nLa Expedicin Dragontina ha estado explorando la zona hace poco. Tal vez alguien all te pueda ayudar, no?', '', '', '', '', '', '', 47187),
