(70919, 'esES', 'Graznando a un hroe', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este patito lleva tanto en la burbuja que se ha quedado profundamente dormido. Grazna silenciosamente mientras ronca>.\n\n<Quizs los ecologistas sepan cmo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(70918, 'esES', 'Grazna por tu vida', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este patito grazna frenticamente. Si alguien no echa una mano, los grlocs se van a cabrear!>.\n\n<Quizs los ecologistas sepan cmo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(70917, 'esES', 'Un cuac sobre el que llorar', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este nervioso patito est lleno de energa. Parece que est deseando salir de este aprieto>.\n\n<Quizs los ecologistas sepan cmo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
