(70883, 'esES', 'Echar una mano en el cultivo', 'Busca a Gryrmpech en los Jardines de la Unidad.', 'Saludos, mortal. Tengo noticias de nuestro jardinero jefe Gryrmpech. Me cuenta que los jardines estn sumidos en el caos, pero no s si eso es algo inusual.\n\nMe ha garantizado que lo tiene todo bajo control. Bueno, \"bajo la pala\" es la expresin que us. No tengo claro qu significa, pero seguro que l te lo explicar como es debido. Por favor, ve a buscarlo y te equipar como es debido para esta situacin.', '', '', '', '', '', '', 47187),
