(70880, 'esES', 'Las mejores galas para cocinar', '', '', '', '', '', '', '', '', 47187),
(70879, 'esES', 'Informe sobre los rebeldes', 'Renete con la capitana Drine en la planta superior del Trono de los Aspectos.', 'Estoy impresionado con lo que hemos logrado hoy. Espero que ests de acuerdo, $n.\n\nHemos logrado acabar con las nefastas actividades de estos rebeldes aliados de los Primalistas. Al menos, de momento. Tendremos que seguir vigilantes ante cualquier posible disidencia.\n\nVuelve con la capitana Drine en cuanto puedas. Querr un informe completo.', '', '', '', '', '', '', 47187),
(70878, 'esES', 'Anillo de Fuego', 'Protege a Maldra Lenguallama mientras cierra el portal de los Primalistas.', 'Los Primalistas han abierto un portal gneo en lo ms profundo de la Caverna Pizarrascua, desde el que estn surgiendo elementales.\n\nPuedo sellarlo, pero eso atraer la ira de lo que sea que haya al otro lado, incluido el aparecido Magmaticus al que han estado ayudando los Primalistas.\n\nVoy a necesitar tu proteccin si queremos detenerlos.', '', 'Hay que acabar con ese aparecido de llamas desenfrenado antes de que los Primalistas lo dejen suelto en las Islas Dragn.', 'Magmaticus', '', '', '', 47187),
(70877, 'esES', 'Un cuac en el tiempo', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este desalentado patito grazna en silencio para s mismo con la mirada aterrada>.\n\n<Quizs los ecologistas sepan cmo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(70876, 'esES', 'Fracturar los focos', 'Destruye $1oa focos primalistas en la Caverna Pizarrascua.', 'Si Maldra est en lo cierto, los rebeldes estn creando piedras rnicas en la Caverna Pizarrascua.\n\nDada la naturaleza de estos dispositivos, sabemos que debe haber focos primalistas de por medio.\n\nDestryelos. Los reconocers cuando los veas.\n\nNo podemos permitir que los rebeldes sigan creando armas de destruccin.', '', '', '', '', '', '', 47187),
(70875, 'esES', 'Lo peor de lo peor', 'Mata a $1oa rebeldes y a $2oa elementales en la Caverna Pizarrascua.', 'Los rebeldes de la Caverna Pizarrascua muestran una lealtad inquebrantable hacia los Primalistas y, por lo tanto, representan la mayor amenaza para Valdrakken.\n\nMtalos y elimina cualquier elemental que hayan liberado.', '', '', '', '', '', '', 47187),
(70874, 'esES', 'La brecha en el muro de fuego', 'Recibe la bendicin elemental de Maldra.', 'Los rebeldes de la caverna han sido imbuidos de una bendicin elemental que les permite atravesar el muro de llamas sin peligro. Te puedo conceder ese mismo don.\n\nNo te preocupes, he visto muchas veces cmo lo hacen. Debera poder hacerlo sin problemas.', '', '', '', '', '', '', 47187),
(70873, 'esES', 'Perseguir las cascadas', 'Cosecha $1oa motas de la cascada.', 'La verdadera amenaza se encuentra en la Caverna Pizarrascua. En ese lugar tallan las piedras rnicas y las imbuyen de Fuego primigenio.\n\nSeguro que has visto el muro de llamas que bloquea la entrada. No puedo disiparlo. Sin embargo, quizs pueda hacer algo para ayudar. Creo que, con una aplicacin adecuada de caudalo, podremos atravesarlo sin peligro.\n\nConsigue motas de agua de los elementales cercanos.', '', '', '', '', '', '', 47187),
(70871, 'esES', 'Red de pesca de Iskaara', 'Lleva materiales a Tavio para que te fabrique una red de pesca de Iskaara.', 'Veo que te llevas bien con los aldeanos.\n\nQuieres aprender cmo pescamos? Pues lo primero que debes saber es que nadie pesca con las manos. Te puedo fabricar una red de calidad y resistente, digna de los nativos de Iskaara.', '', '', '', '', '', '', 47187),
(70867, 'esES', 'Fortaleza del Azote Escamado', '', '', '', '', '', '', '', '', 47187),
(70859, 'esES', 'Lo que contempla el guardin', 'Recupera el fragmento susurrante de Edavix, el guardin corrupto.', 'Agradezco tu ayuda, $c. Yo fui la maga del Kirin Tor que descubri el artefacto, Valthrux y los planes de la Llama Hendida.\n\nLa recuperacin y el estudio de este artefacto supuestamente consciente y poderoso es de vital importancia, y recuerda mis palabras: ser yo quien lo haga.\n\nLa Llama Hendida intuye su ubicacin, pero yo he usado mi magia para trazar una ruta para nosotros.\n\nHay un guardin corrupto cerca que posee un fragmento mgico conectado con Valthrux. Puedo usarlo para encontrar el resto del artefacto.', '', 'Un guardin corrupto por el poder de Valthrux. Posee los secretos para descubrir la ubicacin del artefacto.', 'Edavix', '', '', '', 47187),
(70858, 'esES', 'De vuelta a la accin', 'Usa el antdoto fro como el hielo en Alia Alzasol.', 'Vale, el antdoto est listo. Yo sujeto a Alia y t viertes el contenido del vial en su boca.\n\nEspero que viva... Necesitaremos su magia para rastrear el artefacto.', '', '', '', '', '', 'Habla con Alia Alzasol.', 47187),
(70856, 'esES', 'Mtalo con fuego', 'Destruye $1oa cadveres infectados con la antorcha lanzallamas.', 'Estas viles araas ponen sus huevos en cadveres...\n\nY a veces tambin en los vivos.\n\nHemos visto varios cuerpos de miembros de la Llama Hendida que han cado ante ellas.\n\nSi queremos sobrevivir y derrotar a la Llama Hendida, no podemos permitir que eclosionen esos huevos.\n\nToma esta antorcha. Est imbuida del poder del aire y el fuego. Apunta hacia lo que quieras chamuscar y listo.\n\nLos colmillarr no nos andamos con chiquitas; he venido preparada.', '', '', '', '', '', '', 47187),
(70854, 'esES', 'Bueno, cmo ha ido?', 'Vuelve con Jyhanna, que est en la Guardera de Cras, en Valdrakken.', 'Lo has hecho bien, $n. Loche ha mejorado mucho y est de un humor excelente. \n\nJyhanna querr estar informada, as que vuelve y dale la buena noticia!', '', '', '', '', '', '', 47187),
(70853, 'esES', 'Un amigo para Loche', 'Captura a una moscaesquiva en la Reserva Agreste, en las Orillas del Despertar.', 'Como te dije, Loche necesita dos cosas: un colega y un combate.\n\nCreo que podemos darle ambas cosas a la vez.\n\nEsta zona es un terreno de apareamiento primordial para las moscaesquivas. Si buscas un poco, seguro que encuentras algunas.\n\nRecuerda, tienes que debilitarlas antes de poder capturarlas con tu trampas.\n\nVuelve cuando hayas atrapado a una. Puede que est un poco magullada tras la batalla, pero tengo unas piedras de entrenamiento de duelo que la dejarn como nueva!', '', '', '', '', '', '', 47187),
(70851, 'esES', 'Nacido para ser ms salvaje', 'Infrmate sobre lo que Loche necesita de Haniko.', 'Hay mucha informacin que necesitas saber. Vamos a hablar y luego decidiremos qu es lo mejor para Loche.', '', '', '', '', '', '', 47187),
(70850, 'esES', 'Maldra con el agua al cuello', 'Rescata a Maldra de Orian Aguaoscura.', 'Un trabajo excelente. Mientras hacas tu trabajo, yo he estado explorando el campamento. No esperaba encontrarme a mi vieja amiga Maldra Lenguallama.\n\nSaba que haba desaparecido, pero los rumores decan que se haba unido a los rebeldes. Aunque, por lo que he podido ver, la tienen prisionera.\n\nNo podemos dejarla aqu. Resctala de los dragauros!', '', 'El lder rebelde ha apresado a su prisionera, Maldra Lenguallama, con cadenas de Agua primigenia.', 'Orian Aguaoscura', '', '', '', 47187),
(70849, 'esES', 'Se necesita a un especialista', 'Habla con Haniko en la Reserva Agreste, que est en las Orillas del Despertar.', 'Loche ha mejorado muchsimo, pero creo que necesita ms ayuda. \n\nHace poco conoc a una exploradora de la Expedicin Dragontina superlista llamada Haniko que trabaja mucho con protodracos. Tambin es instructora de mascotas. Apuesto a que podra ayudar a Loche! \n\nCreo que se diriga a las Orillas del Despertar. Si vas all, seguro que la encontrars. \n\nMe alegro de haber podido ayudarte! \n\n<Se despide alegremente con la mano>.\n\nAdis! Buena suerte, Loche.', '', '', '', '', '', '', 47187),
(70848, 'esES', 'Blasn de dragn olvidado', 'Entrgale el objeto a Exadria.', '<Puede que Exadria quiera esto>.', '', '', '', '', '', '', 47187),
(70847, 'esES', 'Talismn de obsidiana antiguo', 'Entrgale el objeto a la acechagarra Kavia.', '<Puede que la acechagarra Kavia quiera esto>.', '', '', '', '', '', '', 47187),
(70845, 'esES', 'Tras los pasos de Tyr', 'Encuentra el primer desafo de Tyr en las Tierras Azures.', 'El guardin Tyr plane cualquier imprevisto. Sospechaba que algn da sera necesario potenciar a los artesanos de Azeroth, por lo que cre el motor de innovacin. El motor posee la facultad de crear un material nico que puede hacer que un objeto alcance una calidad imposible para la capacidad de cualquier mortal.\n\nPara asegurarse de que el motor no cayera en malas manos, Tyr me cre con la misin de supervisar a quienes buscaran su poder. Solo quienes sean dignos podrn desbloquear todo su potencial.\n\nEsts a la altura del desafo?', '', '', '', '', '', 'Encuentra el primer desafo de Tyr en las Tierras Azures.', 47187),
(70843, 'esES', 'Arruinar las piedras rnicas', 'Destruye alijos de piedras rnicas incendiarias.', '<Esta piedra rnica es muy parecida a la que el rebelde trat de colocar en Valdrakken.\n\nAunque est sin terminar, ves ms alijos de piedras rnicas completas a lo lejos.\n\nSi destruyes los alijos, los rebeles no podrn utilizarlos>.', '', '', '', '', '', '', 47187),
(70842, 'esES', 'Ubicaciones de detonacin', 'Consigue mapas del Valle Calgine.', 'Estoy seguro de que los rebeldes estn documentando sus planes para futuros ataques. Debemos descubrir qu planean antes de que puedan hacerlo.\n\nRegistra su campamento en busca de mapas marcados como el que encontramos en Valdrakken.', '', '', '', '', '', '', 47187),
