(70838, 'esES', 'Rebeldes con causa', 'Mata a $1oa rebeldes y primalistas.', 'La base de los rebeldes. Hemos estado buscando este lugar. Qu suerte que el saboteador nos guiara hasta aqu en su descuido.\n\nNo puedo creer que mis camaradas se rebajaran a trabajar con los Primalistas. Tenemos que hacer algo. Acaba con los rebeldes y sus amigos primalistas antes de que siembren el caos.', '', '', '', '', '', '', 47187),
(70837, 'esES', 'Seguir las pistas', 'Renete con el investigador Erima en el Valle Calgine.', '<El investigador Erima revisa el mapa>.\n\nEst claro lo que representa la X en el Trono de los Aspectos.\n\nPero tambin hay un crculo dibujado alrededor del Valle Calgine. Podra ser el prximo objetivo de los rebeldes? O quiz una base de operaciones.\n\nSolo hay una forma de averiguarlo. Renete conmigo en el valle.', '', '', '', '', '', '', 47187),
