(70781, 'esES', 'Cada del cielo', 'Encuentra a Harleen Chirridos en los Riscos Plumazul.', 'Has visto eso?!\n\nEsta criatura alada acaba de caer del cielo! No s qu tipo de ser es, pero desde luego no es originario de las islas.\n\nEspera... Recuerdo que una pequea goblin me pidi indicaciones para llegar a los Riscos Plumazul, que estn justo encima de nosotros. Crees que sabr algo al respecto?', '', '', '', '', '', '', 47187),
