(70779, 'esES', 'Historias de Tarjin', 'Recoge $1oa calaveras de dragn impresionantes de dragones y protodragones poderosos de las Islas Dragn.', '<Tarjin sigue mirando a la isla lejana mientras te habla>.\n\nTe crees $gdigno:digna; de las increbles leyendas e historias de los djaradin?\n\nT, que apenas tienes el tamao de una de nuestras armas? Pfft.\n\nDudo que tengas el estmago para cargar el legado de mi gente.\n\nDemuestra que estoy equivocado, si es que puedes. Busca dragones, los nicos rivales dignos en estas islas.\n\nTreme trofeos de tu victoria sobre los ms fuertes.', '', '', '', '', '', '', 47187),
