(70750, 'esES', 'Ayudar al Acuerdo de Valdrakken', 'Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragn.', 'T! S, te estoy hablando a ti. Ves a alguien ms por aqu?\n\n<Therazal mira de reojo a unos cuantos transentes>.\n\nEsos no cuentan. No tienen nada que ver con lo que voy a pedirte. He odo hablar de ti y es contigo con quien quiero hablar!\n\nEl Acuerdo de Valdrakken me ha pedido que busque a quienes se estn forjando una reputacin en las islas y a quienes tienen como prioridad la seguridad de nuestros aliados.\n\nHaz lo que se te da mejor, $gamigo mo:amiga ma;. Se te recompensar generosamente.', '', '', '', '', '', '', 47187),
(70748, 'esES', 'Solo para tus ojos... azules', 'Busca las notas de Malygos en el Archivo Azur.', 'No me extraa que tus compaeros no hayan encontrado nada.\n\nEstos libros eran solo para ojos de los azules.\n\nSin embargo, mi presencia debera bastar para que algunos de los libros ms pertinentes revelen sus secretos.', '', '', '', '', '', '', 47187),
(70747, 'esES', 'El mago azur', 'Habla con el archimago Khadgar en el Campamento de Antonidas.', 'No tengo tiempo para discutir con hechiceros.\n\nVe y trata con este \"archimago\", $p. Aprende cuanto puedas y mantente siempre en guardia. Podran ser tanto aliados como enemigos...\n\nNuestros informes indican que hay un gran archivo al sur.\n\nAh es adonde me dirijo.', '', '', '', '', '', '', 47187),
(70746, 'esES', 'Tonos de azul', 'Acompaa a Pavethal y a Telash al Campamento de Antonidas.', 'Eh, $p!\nMe alegra ver una cara amigable en estos lugares. Telash y yo estbamos hablando de los informes que hemos recibido sobre los... recin llegados a la zona.\n\n<Pavethal baja la voz>.\n\nDragones azules.\n\nDada nuestra... historia con los azules, Telash y yo pensamos que era necesario evaluar la situacin con nuestros propios ojos.\n\nPor favor, acompanos.', '', '', '', '', '', '', 47187),
(70745, 'esES', 'Relajacin forzosa', 'Mata a la invocadora de elementales.', 'Los primalistas que viste no tenan pinta de lderes. Quin le va a tener miedo a un perrito? Ja!\n\nSi han mencionado a Vadne, entonces significa que ella es su lder. Debe ser la responsable de la aparicin de estos elementales. Debemos acabar con esa invocadora. Si son capaces de provocar tanto caos, entonces es que estn cerca. Echa un vistazo en la cueva que tenemos debajo. S que algunos de los empleados menos diligentes van all para tomarse un descanso algo ms largo.', '', 'Esta primalista, una invocadora de vapor y llamas, prefiere cocinar vivos a sus enemigos.', 'Vadne Corazn Umbro', '', '', '', 47187),
(70744, 'esES', 'Mira qu huesos!', 'Limpia $1oa puntos del desastre.', '<Seguro que el gerente de la sauna agradecera que no hubiera sangre por todas partes>.', '', '', '', '', '', '', 47187),
(70743, 'esES', 'Beb precioso', 'Encuentra al beb de Elzara.', 'Eh, $pr! Eres ms o menos competente?\n\nCmo andas de prioridades?\n\nBien!\n\nMi preciosa beb ha desaparecido. Slvala inmediatamente. Date prisa; no puede defenderse por s sola en estas horribles circunstancias.', '', '', '', '', '', '', 47187),
(70742, 'esES', 'Es cosa de familia', 'Busca pistas sobre el pasado de los drachyr en el Observatorio Obsidiana.', 'Desde el aire, examin uno de los artefactos que Edress descubri junto a la entrada de las ruinas. Sin duda hay ms dentro.\n\nEstn protegidos de alguna manera, aunque tendr que acercarme antes de poder examinarlos. La magia de aqu es muy antigua.\n\nLos terrenos parecen desiertos, pero no confiara en que eso dure mucho cuando empecemos a entrometernos. Mantente alerta. Descubramos todo lo que podamos.', '', '', '', '', '', '', 47187),
(70741, 'esES', 'Algunas cosas favoritas', 'Recoge $1oa pertenencias perdidas.', '<Parece que la clase de youga se interrumpi y las pertenencias de los estudiantes estn repartidas por todas partes.\n\nSi recoges estos objetos, ayudars a la Sauna de Sueos Serenos>.', '', '', '', '', '', '', 47187),
(70740, 'esES', 'Limpieza al vapor', 'Mata a $1oa elementales en la sauna inferior.', 'Xijan parece pensar que la invasin de nuestra hermosa sauna por parte de los elementales es un problema menor, pero esta oleada de llamas y vapor debe ser controlada de inmediato.\n\nHemos contratado a unos msicos para que toquen en el nivel inferior, pero los elementales han destruido sus instrumentos. Como nunca hemos presenciado tal nivel de destruccin elemental en esta zona, sospecho que los Primalistas estn detrs de esto.\n\nSi quieres ayudar, acaba con los elementales que hay en la parte oriental de la sauna inferior. Ah es donde estn programados los primeros conciertos.', '', '', '', '', '', '', 47187),
(70739, 'esES', 'Linajes, dulces y Teerai', 'Ayuda al cazador Narman a conseguir una bendicin tradicional para su propuesta de matrimonio.', 'He cazado con khanes, he corrido ms rpido que nuestro bakar ms veloz y he luchado contra un toro brfalo con las manos desnudas. Como cazador, no me queda nada que demostrar.\n\nSin embargo, como compaero, an tengo mucho que aprender.\n\nEl sabio del viento Dawa, del Clan Ohn\'ir, es mi corazn y mi felicidad. Solo quiero demostrar que soy digno de su amor, pero no s nada sobre tradiciones y rituales. Necesito la sabidura de los ancianos de Maruukai.', '', '', '', '', '', 'Habla con el cazador Narman en la congregacin Shikaar de Maruukai.', 47187),
(70738, 'esES', 'Clase de youga', 'Encuentra al instructor y a $1oa estudiantes de youga.', 'Todo iba bien, pero ya no. Los elementales estn planteando algunos... desafos menores.\n\nNuestros invitados estaban disfrutando de las instalaciones cuando, de repente, aparecieron todos estos elementales! Esos malditos monstruos lo han estropeado todo. Puede que le hayan dado problemas al nuevo instructor de youga.\n\nOh, el youga es una nueva disciplina de estiramientos que tambin sirve para meditar. Seguro que el instructor y los estudiantes estn tan relajados que ni se han fijado en los elementales.\n\nAun as, ms vale prevenir que curar. Por favor, encuntralos.', '', '', '', '', '', '', 47187),
(70732, 'esES', 'Un duelo de prctica', 'Derrota a Gwosh en un duelo de mascotas.', 'Muy bien! Ahora que has usado esa piedra en Loche, pongamos a prueba sus habilidades en un duelo de prctica. \n\nEn la orilla al norte de aqu vive un gran cornisapo llamado Gwosh al que le encanta luchar. Bueno, jugar. Y es muy bueno con las mascotas! \n\nSer un juego... digo... combate perfecto para Loche.', '', '', '', '', '', '', 47187),
(70730, 'esES', 'Asignador Shikaar', 'Ayuda al sabio del viento Dawa a prepararse para la propuesta perfecta.', 'Oh, $p.\n\nSientes como el sol te reconforta? Te sientes a salvo en su abrazo luminoso? Cada nuevo da representa esperanza para el futuro y una oportunidad de vivir tu vida como siempre has soado?\n\nEntonces, como yo, sabes qu es el amor.\n\nNarman del Clan Shikaar es mi sol, mi calor, mi luz, mi esperanza.\n\nUn hombre como l merece una propuesta digna de su estatura.\n\nDebemos buscar el consejo de un Ohn.', '', '', '', '', '', '', 47187),
(70723, 'esES', 'Destrozar a los primalistas terrneos', 'Llvale el ncleo primigenio a Rethelshi.', 'Rethelshi agradecer que le lleves esto a Valdrakken para contribuir a su investigacin sobre los Primalistas.', '', '', '', '', '', '', 47187),
(70722, 'esES', 'Lo que Loche necesita', 'Habla con Patchu en Iskaara.', 'Creo que s lo que tenemos que hacer, $n. \n\nPero hablemos de ello antes.\n\nHasta tengo un regalo que darte cuando terminemos! Qu dver, eh?', '', '', '', '', '', '', 47187),
(70721, 'esES', 'Mi corazn de Ohn', 'Ayuda al sabio del viento Dawa y al cazador Narman con sus propuestas.', 'Hay un pequeo estanque junto al Espejo del Cielo, donde Narman y yo nos conocimos durante mi instruccin.\n\nLos iniciados van all para estar ms cerca de Ohn\'ahra y sentir el viento. Lo vi en el reflejo del agua cuando una brisa repentina abri mis ojos. Es el paisaje ms hermoso de todas las llanuras.\n\nSer el lugar perfecto para nuestra propuesta.', '', '', '', '', '', '', 47187),
