(70710, 'esES', 'La ruta de los rpidos del ro', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70708, 'esES', 'Hueco', 'Toma un trago con Kolgar.', 'Parece que hubieran pasado aos. Pero tambin es como si solo hubieran sido unos minutos.\n\nMe vendra bien alguien con quien hablar, si tienes tiempo.\n\nTe apetece ir a por una ronda? Pide lo que quieras, yo invito.', '', '', '', '', '', '', 47187),
(70706, 'esES', 'Puerta: Santuario Sombreado', 'Encuentra la puerta latente en el Santuario Sombreado de las Llanuras de Ohn\'ahra.', 'Nos hemos enterado de que hay una piedra latente en las exuberantes colinas del suroeste. Es un viaje bastante largo, pero merece la pena enviar a alguien con tus conocimientos a investigar.', '', '', '', '', '', '', 47187),
(70703, 'esES', 'El legado de Tyrhold', 'Investiga la escama de plata con Koranos en Tyrhold.', 'Al guardin Tyr le encantan los misterios. Est claro que el regalo que nos dio tiene un significado ms profundo. Como es probable que forjara esta escama en su antigua ciudadela, quiz sea la clave para desvelar sus secretos.\n\nVe con Koranos hasta Tyrhold, $n. Como consejero de confianza y guardin de esta tierra, seguro que sabr algo sobre este asunto.', '', '', '', '', '', 'Habla con Koranos en Tyrhold.', 47187),
(70702, 'esES', 'Seguir explorando las puertas', 'Renete con Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<La estridente y fuerte llamada del pequeo mensajero capta tu atencin. Te entrega una nota antes de salir corriendo.\n\nSe trata de una peticin de ayuda de Thaelin Yunquenegro>.', '', '', '', '', '', '', 47187),
(70701, 'esES', 'Suean los bakar con argales perdidos?', 'Devuelve a los argales perdidos al Clan Aylaag.', 'Algunos de los argales del clan han vuelto a alejarse del rebao.\n\nEl risco que nos rodea es demasiado peligroso para que nuestros pastores se aventuren por ah para buscarlos. Nos haras un enorme favor si te llevaras a uno de nuestros bakar y nos trajeses los argales. Nuestros pastores te dirn por dnde ir.', '', '', '', '', '', '', 47187),
(70698, 'esES', 'La investigadora Alaescape', '', '', '', '', '', '', '', '', 47187),
(70697, 'esES', 'Una opinin experta', 'Habla con Patchu en las Tierras Azures.', 'Puede que las heridas de Loche se hayan curado, pero no as su confianza. Creo que es hora de pedir ayuda.\n\nAl suroeste, en una seccin remota de las Tierras Azures, hay una instructora de mascotas llamada Patchu. Es una de las mayores expertas del mundo en estos asuntos.\n\nPor favor, ve a verla, seguro que puede ayudar a Loche!', '', '', '', '', '', '', 47187),
