(70647, 'esES', 'Ay, ay, dnde estar, dnde estar?', 'Rescata a Loche y llvalo ante Jyhanna en la Guardera Escamitas, que est en Valdrakken.', 'Me alegro de verte, $n! Estoy preocupadsima y me vendra bien tu ayuda.\n\nHace poco rescat a un cra de protodraco abandonada. Le puse Loche de nombre. Es tan adorable! Lo traje aqu para cuidar de l y buscarle un buen hogar como mascota.\n\nPero ahora ha desaparecido y temo que se haya perdido o est herido. Lo buscara yo misma, pero tengo que vigilar al resto de mis pequeos. Podras buscarlo?', '', '', '', '', '', '', 47187),
