(70641, 'esES', 'Un juramento al despertar', 'Habla con los miembros del Vuelo Rojo en el Vitasagrario Rub.', 'Espera un momento, $p. Quiero darte las gracias personalmente por tu ayuda a la hora de restaurar nuestra piedra de juramento.\n\nNo conoca a los dracthyr hasta vuestro despertar en el Confn Olvidado. No estaba claro lo que vuestra llegada significaba para nosotros. Si suponais una bendicin... o una maldicin.\n\nTe animara a aprender ms cosas sobre nuestra piedra de juramento. Habla con algunos de mis hermanos en el Vitasagrario Rub. Quizs nuestras historias te resulten familiares.', '', '', '', '', '', '', 47187),
(70640, 'esES', 'SE BUSCA: jefe', 'Mata a Frigellus cerca del Campamento de Antonidas.', '<La escritura de la hoja despide una suave luz azul>.\n\nEl elemental Frigellus, en su momento un juguete muy querido de Malygos, acab sufriendo el abandono de su amo.\n\nMientras este asentamiento, antao rebosante de felicidad, se desmoronaba, la malhumorada y traviesa criatura se fue deformando y retorciendo por los males que asolan esta tierra.\n\nPor favor, asegrate de neutralizarlo.\n\nY cuando lo consigas, informa de ello al custodio Cynegos.', '', '', 'Frigellus', '', '', '', 47187),
