(70633, 'esES', 'Combustible para el motor', 'Usa la esencia embotellada para potenciar el motor de innovacin.', 'Has superado el primer desafo que dej el guardin Tyr. Aunque este no es ms que el primer paso de tu viaje, tengo fe en que lo hars bien. Te has ganado la oportunidad de empezar a desvelar los secretos de la forja. \n\nAade la esencia embotellada al motor de innovacin y descubre qu ocurre.', '', '', '', '', '', '', 47187),
