(70627, 'esES', 'Qu hay del Clan Pelaje Invernal?', 'Renete con Sonova Cubilnevado en la Atalaya de Theron.', 'Si supiramos que sera seguro..., nos uniramos a otro clan.\n\nMe preocupa que los Primalistas tentaran a otros clanes como hicieron con el nuestro.\n\nLa \"Expedicin Dragontina\" dice que tiene una posicin cerca del Clan Pelaje Invernal.\n\nPuede que estn corruptos o puede que escuchen nuestra advertencia. Sea como sea, nos necesitan.\n\nEn la Atalaya de Theron hay un \"experto en frbolgs\", Sonova Cubilnevado. Ve a verlo y averigua lo que sabe.', '', '', '', '', '', '', 47187),
(70625, 'esES', 'Creaciones forjadas con hechizos', '', '', '', '', '', '', '', '', 47187),
(70620, 'esES', 'Escalando', 'Recolecta $1oa escamas de adamantita para Ralathor el Robusto en Valdrakken.', 'Mucha gente me pregunta cmo es que se me da tan bien desollar. Yo les digo que el secreto est en las escamas.\n\nTe gustara saber el secreto? Treme unas escamas y te mostrar a qu me refiero.', '', '', '', '', '', '', 47187),
(70618, 'esES', 'La llamada de la forja', 'Recolecta $1oa menas de serevita para Sekita el Excavador, que est en Valdrakken.', 'La forja... me llama. Y me pide serevita. T! Treme serevita! S, mucha serevita! <Sekita empieza a rerse de forma extraa>.', '', '', '', '', '', '', 47187),
(70617, 'esES', 'Mo! Mo! MO! Todo mo!', 'Recolecta $1oa menas de draconio para Sekita el Excavador, que est en Valdrakken.', 'No hay nada tan til como las menas de draconio Se pueden hacer tantas cosas con ellas! Es la mena perfecta, pura en todos los sentidos.\n\nTreme draconio. Debo tenerlo. Eres $gminero:minera;, no? Pues a picar!', '', '', '', '', '', '', 47187),
(70613, 'esES', 'Dales el pino antes de que te hagan una caja con l', 'Recolecta $1oa de pino retorcido para Agrikus, que est en Valdrakken.', '$p, eres $gun:una; herborista la mar de hbil, sabes? Tengo a un montn de alquimistas en la puerta suplicndome que les venda pino retorcido... O los tendra si tuviera puerta. Y casi no nos queda!\n\nMe ayudaras a conseguir ms? Me temo que, si no pueden crear las ampollas que necesitan, empezarn a experimentar con mis pertenencias.', '', '', '', '', '', '', 47187),
(70595, 'esES', 'Servicios de sastrera solicitados', 'Completa pedidos de fabricacin de sastrera para el Consorcio de Artesana.', 'Hola, hola, hola, $p! Llegan pedidos de fabricacin a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesana siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos pblicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70594, 'esES', 'Peletera a su servicio', 'Completa pedidos de fabricacin de peletera para el Consorcio de Artesana.', 'Hola, hola, hola, $p! Llegan pedidos de fabricacin a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesana siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos pblicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
