(70586, 'esES', 'Demasiados cocineros...', 'Fabrica $1oa gorros de cocinero de tela salvaje para Fulafong, que est en Valdrakken.', '$p, si algo he aprendido en todos estos aos como costurera, es que demasiados cocineros lo estropean todo.\n\nEn este caso, iba a salir a tomar un trago cuando lleg un pedido de ltimo minuto: un ropero entero de uniformes de chef.\n\nSi pudieras coser los gorros, yo me encargara de todo lo dems.', '', '', '', '', '', '', 47187),
(70582, 'esES', 'Tejer bien a solas', 'Fabrica $1oa rollos de tela salvaje para Fulafong, que est en Valdrakken.', '$p, si algo he aprendido en todos estos aos como costurera, es la importancia de la prctica.\n\nNunca dejes de practicar aunque creas que ya lo has dominado todo. Quiero que seas capaz de tejer con prestancia sin mi supervisin.\n\nPor qu no practicas esta semana? Haz unos cuantos rollos de tela salvaje de la mejor calidad.', '', '', '', '', '', '', 47187),
(70571, 'esES', 'Necesitamos tambores!', 'Fabrica $1oa tambores de pellejo feral para el moldeapieles Koruz, que est en Valdrakken.', 'Nos conocen en todas partes por nuestros tambores, algo que los centauros hemos perfeccionado durante generaciones. Por desgracia, eso significa que siempre andamos cortos de suministros.\n\nVeo que tu habilidad est al nivel, podras ayudarme a fabricar algunos tambores para nuestras tiendas?', '', '', '', '', '', '', 47187),
(70569, 'esES', 'Un kit para Trisket', 'Fabrica $1oa cestas florales de herborista para el moldeapieles Koruz, que est en Valdrakken.', 'Tengo muchos buenos clientes, pero Trisket es de mis favoritos. Hace poco vino a verme porque su faltriquera de herborista se haba desgastado.\n\nMe ofrec a hacerle una seleccin de cestas para sustituir a su vieja faltriquera.\n\nMe ayudas en esta tarea, $p? Trisket estar muy agradecido.', '', '', '', '', '', '', 47187),
(70567, 'esES', 'Cuando le des un hueso a un bakar...', 'Fabrica $1oa ballestas huesoforjado para el moldeapieles Koruz, que est en Valdrakken.', 'Tena algunos arcos de huesoforjado hermossimos, pero nuestros bakar se los llevaron antes de que pudiramos usarlos. A los bakar les encanta masticar huesos aunque tengan forma de arco, y ahora estn inservibles!\n\nPuedes ayudarme a fabricar unos repuestos?', '', '', '', '', '', '', 47187),
(70565, 'esES', 'Separacin por saturacin', 'Fabrica $1oa colgantes de peligros inminentes para Tuluradormi, que est en Valdrakken.', 'Ah, $gjoyero:joyera;, te gusta mi collar?\n\nClaro que s. Pero no se puede apreciar como es debido si no destaca.\n\nYa s, por qu no fabricas unos cuantos colgantes simples e inundamos el mercado? Cuando todo el mundo lleve tus diseos, mi collar los eclipsar a todos!', '', '', '', '', '', '', 47187),
(70564, 'esES', 'Especta-ocular', 'Fabrica $1oa lentes de aumento de nice hendido para Tuluradormi, que est en Valdrakken.', '$gJoyero:Joyera;, se acerca una exposicin, y me preocupa que los clientes no puedan apreciar la belleza de cada corte sin las lentes de aumento adecuadas.\n\nNo tienen que ser elegantes, solo hay que fabricar unos cuantos pares para que puedan ver con claridad.', '', '', '', '', '', '', 47187),
(70560, 'esES', 'La herramienta ms poderosa: una buena documentacin', 'Fabrica $1oa compendios bsicos del expedicionario para Talendara, que est en Valdrakken.', '$gAprendiz:Aprendiza; de escriba, te $gsientes listo:lista; para escribir hoy? La Expedicin Dragontina ha trado una gran cantidad de notas de sus aventuras y nos han pedido que recopilemos sus horribles garabatos en un compendio de campo adecuado. Ah, y mi mano no est por la labor hoy. Puedo confiar en ti una vez ms?', '', '', '', '', '', '', 47187),
(70559, 'esES', 'Me echas una pluma?', 'Fabrica $1oa plumas atadas de escriba para Talendara, que est en Valdrakken.', 'Me alegro de verte, $gaprendiz:aprendiza; de escriba.\n\nAntes han venido algunos novatos para probar sus aptitudes con la inscripcin, pero todos escriban con demasiada fuerza y han roto sus plumas.\n\nDetesto pedrtelo, pero podras confeccionar unas cuantas plumas ms?', '', '', '', '', '', '', 47187),
(70558, 'esES', 'Desilusiones con las ilusiones', 'Fabrica un $1oa pergamino de ilusin: Escudo contra hechizos para Talendara, que est en Valdrakken.', 'Mi aprendiz de escriba! No podras haber elegido mejor momento.\n\nHa ocurrido un terrible accidente! Resulta que todos los pergaminos de ilusin que ped son reales. Te lo puedes creer? Se creen que esto es un juego? Alguien podra salir herido!\n\nCrees que podras rectificar la situacin y crear ilusiones autnticas?', '', '', '', '', '', '', 47187),
(70557, 'esES', 'Falta de miras', 'Fabrica $1oa petardos del Vuelo Bronce para Clinquiclic Explobum, que est en Valdrakken.', 'Chispitas, hoy quiero hablarte de un artilugio impresionante.\n\nPor lo visto, hay ciertos fuegos artificiales que se han puesto de moda entre los cazadores. Los usan para ahuyentar a los patos de forma que alcen el vuelo. En mi opinin, los patos son demasiado listos como para caer en algo as, pero eso no nos impedir sacarle provecho! Crees que puedes con esta tarea?', '', '', '', '', '', '', 47187),
(70550, 'esES', 'Bienvenido a la Asamblea', 'Habla con Xavin en la Galera Cobalto para ver qu facultades se pueden usar en la zona.', 'Nos vendra bien tu ayuda.\n\nLa Llama Hendida ha tomado el control de la mayor parte de la Galera Cobalto.\n\nPor favor, aydanos en esta lucha contra ellos. No somos muchos, pero, aun as, podemos echarte una mano.', '', '', '', '', '', '', 47187),
