(70540, 'esES', 'El mejor amigo del ingeniero', 'Fabrica $1oa multiherramientas para Clinquiclic Explobum, que est en Valdrakken.', 'Oye, chispitas, has visto mi...?\n\nEmmm... Puedes pasarme el...?\n\nSe acab, creo que va siendo hora de hacernos con ms herramientas para el taller, no te parece?', '', '', '', '', '', '', 47187),
(70533, 'esES', 'Aceite para los jarabes', 'Fabrica $1oa de aceite retuercefuego para Conflago, que est en Valdrakken.', 'Sabas que el aceite retuercefuego es el componente ideal para dar el toque final a tus jarabes? Yo s. Y ahora me he quedado sin nada. No puedo trabajar sin una abundante reserva de aceites. Por favor, $p, aydame a reponer las existencias de mi laboratorio.', '', '', '', '', '', '', 47187),
(70532, 'esES', 'Colaborar en el ataque', 'Fabrica $1oa pociones de sanacin refrescante para Conflago, que est en Valdrakken.', 'Ah, $p, me alegro de verte. Varios campeones han resultado heridos en el ltimo asalto contra los Primalistas. Tenemos una gran necesidad de pociones de sanacin. Supongo que, como $gaventurero:aventurera;, llevars varias encima. Vamos a necesitar muchas.', '', '', '', '', '', '', 47187),
