(70501, 'esES', 'Licencia para cazar', 'Completa las tareas de entrenamiento de la gran cacera.', 'Por fin vas a demostrar tu destreza en la caza? Ten en cuenta que no es tan sencillo como correr y cazar todo lo que se mueve. Los Shikaar cazamos con un propsito. Cazamos para alimentar y vestir a nuestro clan, para demostrar nuestra fuerza contra enemigos poderosos y para equilibrar la naturaleza.\n\nNo cazamos en tierras baldas y sembramos las semillas de las futuras grandes caceras a nuestro paso. Demuestra que eres capaz de seguir estas instrucciones y podrs unirte a nosotros.\n\nSin embargo, no creo que tu colega lo consiga.', '', '', '', '', '', '', 47187),
(70450, 'esES', 'Devastacin de nutrias', 'Asusta a los nutriones fastidiosos.', 'Hola! Estos nutriones no paran de robar mi pesca.\n\nSi fuera por m, los hara volar en mil pedazos, pero nuestros amigos colmillarr no parecen estar demasiado de acuerdo. He fabricado este dispositivo disuasorio de nutriones, el MK-SH4RK, pero... no se me da muy bien nadar.\n\nParece que a ti s, por qu no nos haces un favor? Activa el dispositivo, date un bao por ah y asstalos.', '', '', '', '', '', '', 47187),
(70446, 'esES', 'Una historia personal', 'Renete con Pavethal en el Observatorio Obsidiana.', 'Mientras investigaba los archivos, he encontrado pistas que indican que el Observatorio Obsidiana es un lugar de especial importancia para el Guardin de la Tierra. Lo nico que puedo hacer es elucubrar sobre los registros que contendr con la historia de nuestro Vuelo.\n\nDado el inters de Pavethal en el asunto, la he informado de mi descubrimiento. Espero que no haya sido un error.\n\nSe ha ido all a explorar. Por favor, no la pierdas de vista. Es una soldado competente, pero se trata de un asunto... delicado. Quin sabe lo que encontraris.', '', '', '', '', '', '', 47187),
(70444, 'esES', 'Los Campos de la Ferocidad', 'Renete con Gurgthock en los Campos de la Ferocidad.', 'A los Shikaar ms valientes!\n\nPreparaos y dirigos a los Campos de la Ferocidad. Quin se har con la corona del combatiente ms poderoso?\n\nDemostrad vuestro podero! Enseadnos vuestra fuerza!\n\nSe aplican trminos y condiciones.', '', '', '', '', '', '', 47187),
