(70376, 'esES', 'Segundo desafo de Tyr: poder', 'Completa el segundo desafo de Tyr en las Llanuras de Ohn\'ahra.', '<Al acercarte, la inscripcin de la estatua emite un brillo tenue>.\n\n\"Blande el poder del guardin y muestra la intrpida determinacin del que se mantiene firme\".', '', '', '', '', '', '', 47187),
