(70373, 'esES', 'Alamuergurlugull', 'Sbete al saltarn y derrota a Alamuergurlugull!', 'Alamuergurlugull, Alamuergurlugull, Alamuergurlugull!\n\nGrrrooooooooom blarglg!!\n\n<No necesitas una traduccin para saber que quieren que acabes con su versin mrloc de Alamuerte. Antes de que puedas aceptar o negarte, se dirigen hacia ti los rugidos del motor de una mquina>.', '', 'Alamuergurlugull, Alamuergurlugull! Alamuergurlugull, alamlgrbrrl!', 'Alamuergurlugull', '', '', '', 47187),
