(70370, 'esES', 'Oposiciones para profesiones', 'Haz el cuestionario de personalidad de Haephesta para conocer tu profesin ideal.', 'Hola! Te interesa trabajar con el Consorcio de Artesana para obtener beneficios abundantes y proporcionar valiosos bienes y servicios a clientes de todo Azeroth?\n\nExcelente! En qu dos habilidades tienes experiencia?\n\nMmm... Que no tienes profesiones? Pues te pierdes una oportunidad nica!\n\n<Haephesta reflexiona un momento>.\n\nYa s! Te har una serie de preguntas sobre tu personalidad, y as descubriremos qu otra profesin puede complementar mejor a la primera. Qu te parece?', '', '', '', '', '', '', 47187),
