(70352, 'esES', 'Escamas hasta el infinito', 'Mata a cornisapos y a protodracos territoriales con Toluiqi.', 'Eh, t! Has matado protodragones antes, verdad?\n\nSera lgico pensar que si combinamos tu experiencia con mi pericia para la caza, acabaramos con unos cuantos. Hay fuentes por aqu que atraen a bestias dracnicas.\n\nAydame a demostrar a mi estpida otra mitad que soy la mejor cazadora.', '', '', '', '', '', '', 47187),
(70351, 'esES', 'Fiesta en el jardn', 'Habla con Akora en los Estanques de Vida Rub.', 'Llevo aos cuidando este jardn como preparacin para el da en el que pueda aceptar mi convocavida. Ese da ha llegado!\n\nMe encantan las flores, los rboles y las plantas. Hasta los bichos que tienen dentro! Cuando cuido el jardn, siento el espritu de la naturaleza, el espritu de la gran dragona.\n\nSolo queda una cosa por hacer. Voy a invocar al espritu de la gran dragona, igual que en las leyendas.\n\n<Akora sonre feliz>.\n\nRenete conmigo en el jardn de abajo, junto al estanque donde descansan sus huesos. All te lo contar todo.', '', '', '', '', '', '', 47187),
(70341, 'esES', 'Una victoria bien merecida', 'Vuelve al motor de innovacin en Valdrakken.', 'La cosa ms pequea puede contener el mayor de los tesoros.\n\nLleva la esencia al motor de innovacin.', '', '', '', '', '', '', 47187),
(70339, 'esES', 'Tras los pasos de Tyr: Llanuras de Ohn\'ahra', 'Busca el segundo desafo de Tyr en las Llanuras de Ohn\'ahra.', 'Aunque lo has hecho bien en el primer desafo, no creas que los superars todos tan fcilmente. El guardin Tyr quera que el motor de innovacin fuese solo para aquellos lo bastante dignos para usarlo con sabidura.\n\nSi no te amilanas, encontrars el siguiente desafo en las Llanuras de Ohn\'ahra. Estoy deseando poner a prueba tus capacidades, $gaventurero:aventurera;.', '', '', '', '', '', 'Busca el segundo desafo de Tyr en las Llanuras de Ohn\'ahra.', 47187),
(70338, 'esES', 'Se han llevado los cachorros', 'Rescata a los cachorros.', 'Si Sylvie est as de angustiada, solo puede significar que sus cachorros estn all!\n\nLos gigantes han debido secuestrar a sus cachorros mientras estaba infectada y demasiado dbil como para salvarlos.\n\nLos cachorros son muy vivaces a esta edad y quiz hayan sido lo suficientemente veloces como para evitar a los gigantes hasta ahora...\n\nToma, usa mi talismn de invisibilidad. Rpido, debes salvarlos antes de que se los coman!', '', '', '', '', '', '', 47187),
(70337, 'esES', 'Viga de Ascuas', 'Lleva las campanillas de viento Ohn\'ir a Viga de Ascuas.', 'Saludos, $gforastero:forastera;.\n\nLos vientos me han contado que hay un grupo de refugiados en las ruinas de Viga de Ascuas. Parecen que solo estn interesados en el pasado, pero los centauros preferimos vivir el presente bajo la gracia de Ohn\'ahra.\n\nSin embargo, son invitados en nuestro hogar. He creado estas campanillas de viento para que puedan or la presencia de Ohn\'ahra. Esperemos que les aporten un poco de alegra y consuelo.', '', '', '', '', '', '', 47187),
