(70319, 'esES', 'Nergazurai', 'Lleva un corazn de nutrin, un fmur colmillorroca, una escama de zancacuerno y una molleja de buitre a Muqur Tocado por la Lluvia en la Avanzada Pasoleo.', 'Mi to me cont muchas historias sobre su batalla con un zancacuerno llamado Nergazurai. Me habl de sus escamas fucsia, que zigzagueaban en las colinas de las llanuras al acechar a su presa, de sus afiladas garfas y de sus mordeduras venenosas.\n\nMientras estaba cazando, vi un destello, pero era demasiado tarde. Me mordi en el hombro. Era tan terrible como describi mi to, pero logr salir con vida.\n\nTengo que limpiar la infeccin del mordisco. Por favor, rene los componentes que necesito. El tiempo es oro.', '', '', '', '', '', '', 47187),
(70299, 'esES', 'Defensa dracnica', 'Mata primalistas en la Cicatriz de la Tormenta.', 'He odo en el viento que unos forasteros se han aliado con el Clan Nokhud para derrotar a nuestros vecinos los dragones. Estos Primalistas son una desgracia para las llanuras de nuestros ancestros.\n\nMtalos y treme los ncleos de los elementales a los que dirigen.', '', '', '', '', '', '', 47187),
(70279, 'esES', 'Sangre de dragones', 'Mata a Karkidan.', 'Como sin duda habrs visto, en esta tierra habitan criaturas que crecen ms all de su tamao normal.\n\nCreemos que han sido bendecidas por los dioses de la naturaleza, y suelen considerarse objetivos honorables para que los cazadores demuestren su fuerza. Una de estas bestias, a la que llamamos Karkidan, est por aqu cerca. Quedara muy impresionado si lograras acabar con ella.', '', '', '', '', '', '', 47187),
(70268, 'esES', 'Recuerdos revividos', 'Dale el diario a Veritistrasz.', 'Has encontrado un diario parcialmente destruido. Parece que est escrito desde el punto de vista de una joven dragona negra, antes de la corrupcin.\n\nAunque la parte trasera resulta ilegible, al leer por encima la primera parte, un nombre llama tu atencin. Veritistrasz.', '', '', '', '', '', 'Entrega el diario a Veritistrasz, que est en el Sagrario Rub.', 47187),
(70244, 'esES', 'Nokhud malo nunca muere', 'Entra en la aldea con la khanam Matra Sarest y arrebata el cuerno a los Nokhud.', 'Durante miles de aos, los Teerai han protegido el Cuerno de Drusahl, nuestra reliquia ms sagrada. Al saquear esta aldea, Balakar ha traicionado todo lo que significa ser un Maruuk. Ya no hay redencin posible para l.\n\nDebemos recuperar el cuerno antes de que Balakar pueda destruirlo y rescatar a los Teerai que an viven. Voy contigo a llevar personalmente a ese falso khan ante la justicia. Los Nokhud conocern la ira de la khanam Matra!', '', '', '', '', '', '', 47187),
(70242, 'esES', 'Vida tras vida', 'Recoge un receptculo inerte de Trellain en el Vitasagrario Rub.', 'Not que su amigo tena una cicatriz profunda. Algo en este lugar la reaviv..., quiz para que pudiera sanar adecuadamente esta vez.\n\nAhora le toca recuperarse a Kolgar.\n\nPodrs encontrar a mi amigo Trellain trabajando con los encantadores en el bancal que est sobre nosotros. Dile que necesito uno de los recipientes que usa l; te lo entregar sin rechistar.', '', '', '', '', '', '', 47187),
(70241, 'esES', 'Un final amargo', 'Lleva a Bathoras a Duroz y Kolgar.', 'Acaba de pasar. Estaba durmiendo y mir hacia otro lado y... Volvamos aqu todos los das, l solo quera sentarse con las cras, no tena ni idea de que...\n\n<La cara de Kolgar est surcada de lgrimas. Se frota los ojos con el dorso de la mano>.\n\nNo, s lo saba. Lo saba. Pero no s qu hacer ahora. Qu hago con l?\n\nPuedes... llamar a Bathoras?', '', '', '', '', '', '', 47187),
(70240, 'esES', 'Gestin del dolor', 'Recolecta $1oa bocaflores lechosas, $2oa lirios de bajo florecidos y un vial de los Estanques de Vida lleno.', 'Menos mal que lo has trado aqu. Se nota que est sufriendo mucho, aunque lo soporta bien. Todos debemos hacerlo cuando nos llega el momento.\n\nMe temo que es la edad lo que lo aflige y no una enfermedad, pero tal vez pueda aliviar parte de su sufrimiento.\n\nTe importara conseguir unas bocaflores, varios lirios de bajo y agua pura del jardn cercano? Si encuentras los suficientes, podr usarlos para crear algo que alivie su dolor.', '', '', '', '', '', '', 47187),
(70239, 'esES', 'Remordimientos inimaginables', 'Acompaa a Duroz y Kolgar para encontrar ayuda.', 'Duroz est mayor, enfermo y es cabezota como un kodo. No hubo forma de impedir que se subiese a la nave para venir aqu. Lo mximo que he podido hacer es ayudarlo a andar.\n\nLe he visto sufrir tantas veces en el campo de batalla que ya s cundo oculta el dolor. Cada da est peor. Puedes ayudarme a llevarlo con los alquimistas? La cerveza ya no ayuda.\n\nSi puedes llevar nuestras armas, yo lo ayudar a caminar.', '', '', '', '', '', '', 47187),
(70236, 'esES', 'Ojo de dragn desprendido', 'Entrgale el objeto a Emilia Bellocq.', '<Esto podra ser de inters para Emila Bellocq>.', '', '', '', '', '', '', 47187),
(70235, 'esES', 'Factura de reparacin', 'Fabrica $1oa martillos de reparacin de serevita para la forjametales Kuroko, que est en Valdrakken.', 'Las Islas Dragn no han vivido un conflicto como este desde hace milenios. Nadie pone en duda nuestro trabajo, pero cualquier buena armadura acusa los daos del uso constante. Tengo un gran pedido de martillos de reparacin de serevita y necesito que todo el mundo colabore. Si me ayudas, volver a darte ms informacin para ampliar tus habilidades en herrera de las Islas Dragn.', '', '', '', '', '', '', 47187),
(70233, 'esES', 'Escasez de hachas', 'Fabrica $1oa hachas de draconio para la forjametales Kuroko, que est en Valdrakken.', 'Un error en los pedidos ha provocado una enorme escasez de hachas nuevas para nuestros expedicionarios. Necesitamos ms hachas de draconio urgentemente y buscamos a cualquier herrero que pueda ayudarnos. A cambio, te impartir nuevos conocimientos de herrera para ayudarte a forjar piezas an ms increbles.', '', '', '', '', '', '', 47187),
(70229, 'esES', 'Boku el Mstico', 'Encuentra a Boku en Teerakai.', 'Hace unos das, los msticos se retiraron al Retiro Crestagua, pero an queda uno. Se llama Boku. Lo encontrars en lo alto de la colina del santuario de Ohn\'ahra.\n\nEs un iniciado, pero debera poder entrar en comunin con Ohn\'ahra y conseguir su bendicin. Con Ohn\'ahra de nuestro lado, quizs podamos ganar esta guerra antes de que empiece.', '', '', '', '', '', 'Encuentra a Boku en Teerakai.', 47187),
(70221, 'esES', 'Demostrar tu entereza', '', '', '', '', '', '', '', 'Recibe la entereza de artesano de Thomas Brillante.', 47187),
(70220, 'esES', 'Santuario Sombreado', 'Habla con la capitana de la guardia Alowen, Sariosa, Sidra la Cuidadora y Viranikus.', 'Debemos informar al resto del Vuelo Verde de que la barrera de la Rama Ancestral est siendo amenazada. Gerithus y yo tenemos mucho de qu hablar.\n\n$n, pondr mi marca sobre ti. Los dragones que la vean sabrn que tienes mi absoluta confianza.\n\nVe y rene a mi Vuelo. Tienen que saber esto y prepararse para la batalla que se avecina.', '', '', '', '', '', '', 47187),
(70215, 'esES', 'La curiosidad es la clave', 'Habla con la taumaturga de distorsin Delandra en el Campamento de Antonidas.', 'Que dudara de hablar sobre estos smbolos no fue por falta de confianza en ti, sino por la naturaleza desconocida de estos smbolos y las piedras en las que habitan.\n\nS, piedras. Varias, de hecho, repartidas por las islas.\n\n<La taumaturga de distorsin Delandra te mira. Una pizca de curiosidad y emocin aparece en su mirada>.\n\nNo lo sabas.\n\nMuy bien. Tu perseverancia y tu afn por encontrarme demuestran que tienes ganas de comprender tu reciente descubrimiento. Quizs sea hora de hablar largo y tendido.', '', '', '', '', '', '', 47187),
(70213, 'esES', 'Harkyn Piedrasiniestra', '', '', '', '', '', '', '', '', 47187),
(70212, 'esES', 'Penumbrus', '', '', '', '', '', '', '', '', 47187),
(70210, 'esES', 'Tradicin no olvidada', 'Coloca incienso y elimina a las bestias fantasmales de los Kurgans Eternos.', 'Para los Aylaag es tradicin, mientras estamos en este campamento, que nuestros miembros peregrinen a los Kurgans Eternos para pedir viajes libres de la plaga que asol a nuestros ancestros. La presencia de los Nokhud ha hecho que este peregrinaje sea peligroso.\n\nSi no te importa, te pedira que defendieses nuestra tradicin por nosotros.', '', '', '', '', '', '', 47187),
