(70198, 'esES', 'La llamada de los cielos', 'Renete con Naleidea Brillorro en Durotar.', 'Nuestros aliados se renen en Durotar. Es un momento muy emocionante.\n\nnete a nosotros, $n! Es hora de zarpar rumbo a las Islas Dragn!', '', '', '', '', '', '', 47187),
(70197, 'esES', 'La llamada de los cielos', 'Renete con Toddy Bigotis en el Puerto de Ventormenta.', 'Tienes todo listo para esta aventura irrepetible? Yo s, sin duda!\n\nHan venido todos nuestros aliados y los suministros estn cargados. As que, a qu esperas?\n\nRenete conmigo en los muelles de Ventormenta. Es hora de zarpar rumbo a las Islas Dragn!', '', '', '', '', '', '', 47187),
(70196, 'esES', 'Reducir la Reserva', '', '', '', '', '', '', '', '', 47187),
(70195, 'esES', 'Tomados por la tormenta', 'Rescata a Altan y busca pistas sobre el forastero.', 'Segn los informes, los Nokhud iban acompaados por un forastero con unas habilidades mgicas nunca vistas. Arras nuestras filas como una tempestad.\n\nSi los Nokhud tienen aliados capaces de causar estos estragos, debemos averiguar todo lo que podamos sobre ellos.\n\nEnvi a mi ohuna, Altan, para que buscase al forastero. No ha regresado an y eso me preocupa. $n, puedes buscar pistas sobre el forastero y ver qu ha sido de Altan?', '', '', '', '', '', '', 47187),
