(70185, 'esES', 'Bestia misteriosa', 'Encuentra y mata a la bestia y lleva pruebas a la exploradora Tomul.', '<Encuentras una huella de zarpa enorme hundida en el barro. Miras a tu alrededor, pero ninguna de las criaturas cercanas tiene zarpas, y menos de ese tamao.\n\nPodras impresionar a los centauros si cazas a esta enorme bestia>.', '', '', '', '', '', 'Lleva la pelambre de Konkhular a la exploradora Tomul.', 47187),
(70184, 'esES', 'Secretos especializados: herrera', '', '', '', '', '', '', '', '', 47187),
(70183, 'esES', 'Secretos especializados: alquimia', '', '', '', '', '', '', '', '', 47187),
(70182, 'esES', 'El dulce sabor de la victoria', 'Vuelve al motor de innovacin en Valdrakken.', 'Hay un gran potencial en las cosas pequeas. La esencia embotellada es ligera como una pluma, pero guarda un poder inmenso.\n\nLlvala al motor de innovacin.', '', '', '', '', '', '', 47187),
(70181, 'esES', 'Primer desafo de Tyr: sutileza', 'Completa el primer desafo de Tyr en las Tierras Azures.', '<Al acercarte, la inscripcin de la estatua emite un brillo tenue>.\n\n\"Blande el poder del guardin y lleva su luz a un futuro mejor para todos\".', '', '', '', '', '', '', 47187),
(70180, 'esES', 'En marcha? En marcha!', 'Ayuda a Greyzik a encender el dispositivo misterioso.', 'Algunos de los habitantes de la ciudad afirman que este dispositivo fue creado por el legendario viga de los titanes, Tyr.\n\nEl problema es que no logramos que funcione! Hemos probado todos los trucos habituales: desmontaje, giroscopio, una leve descarga elctrica... Nada ha funcionado, salvo la descarga. En realidad..., acabo de tener una idea genial.\n\nVes ese girocptero? Sube y veamos si podemos darle un poco ms de corriente a este trasto de los titanes.', '', '', '', '', '', '', 47187),
(70179, 'esES', 'Dos pjaros de un tiro', 'Consigue materiales de construccin de los elementales de tierra de la zona.', 'Saludos, adalid! Pareces bastante capaz. Podras echarme una mano?\n\nAzkra y yo tenemos que vigilar una torre que se encuentra en lo que a m me gusta llamar \"un emocionante estado de renovacin previa\". El problema es que cuando nos hemos puesto a trabajar, nos han atacado los elementales de tierra de la zona.\n\nAs que me he dicho: \"Zefren, no sera maravilloso ocuparse de esos elementales de tierra y conseguir materiales de construccin al mismo tiempo?\". Y ah es donde entras t! Puedes ayudarme?', '', '', '', '', '', '', 47187),
(70178, 'esES', 'Kit de suministros de expedicin', 'Examina las nuevas herramientas disponibles en el kit de suministros de expedicin en el Campamento Base Dragontina.', 'Tus descubrimientos han sido de gran valor.\n\nAn quedan cosas por descubrir y tenemos herramientas que te sern de utilidad.\n\nVuelve al Campamento Base Dragontina y pertrchate con el kit de suministros de expedicin.', '', '', '', '', '', '', 47187);
