(70175, 'esES', 'Banda rota', 'Entrgale el objeto a Emilia Bellocq.', '<Esto podra ser de inters para Emila Bellocq>.', '', '', '', '', '', '', 47187),
(70174, 'esES', 'Los Shikaar', 'Renete con la khan Sansok.', 'La khan Sansok es la cazadora ms hbil de nuestro clan. Si bien no puede or, demuestra sus capacidades como cazadora y lder una y otra vez.\n\nEs una mentora para todos, una lder de confianza y una feroz defensora de los Maruuk.\n\nEs un honor que hables con ella.', '', '', '', '', '', '', 47187),
(70172, 'esES', 'Misterios montaosos', '', '', '', '', '', '', '', '', 47187),
(70171, 'esES', 'Accidentes afortunados', 'Encuentra la ltima obra de Hudson.', '<Los ojos de Ranpiata se humedecen>.\n\nEs culpa ma? Soy el motivo por el que ha perdido la inspiracin?\n\nDice que me quiere, pero... ya has odo cmo le sienta dejar de pintar.\n\nQuiero lo mejor para l. Si le hace sentir mejor..., me marchar.\n\nTir su ltima obra. Lo ltimo que dibuj antes de rendirse.\n\nNo pude soportar la idea de que se perdiese. La escond en nuestra casa. Por favor..., llvasela... como recuerdo.', '', '', '', '', '', '', 47187),
(70170, 'esES', 'Recuperando la inspiracin a golpes', 'Recupera las pinturas perdidas de Hudson de los jefes finales de las Salas de Infusin, la Academia Algeth\'ar, la Cmara Azur y Neltharus.', 'Me temo que puede ser muy testarudo.\n\nNo pienso rendirme con l. Debemos intentarlo de nuevo!\n\nAn quedan por ah ms pinturas de las que haba tirado. Estn en lugares an ms peligrosos, as que espero que ests a la altura del desafo!', '', '', '', '', '', '', 47187),
(70169, 'esES', 'Hasta los rboles necesitan amigos', 'Habla con Rauvros.', 'S que Ran y t estis intentando ayudar.\n\nPero dudo que ayudarme sirva para algo. He perdido... la inspiracin y mi voluntad para pintar, sin ms.\n\nPero Ran tiene razn. Te debo el intentarlo.\n\nPresntame a ese artista en ciernes.', '', '', '', '', '', '', 47187),
(70168, 'esES', 'Pequeos accidentes tristes', 'Recupera las pinturas perdidas de Hudson de los jefes finales de los Estanques de Vida Rub, la Ofensiva Nokhud y la Hondonada Frondacuero.', 'Has venido hasta aqu. Lo siento...\n\nA mi querido Hudson le encantaba pintar. Era su razn de ser! No s qu habr causado que se bloqueara.\n\nHace unas semanas, de vuelta de uno de sus viajes para pintar, cogi todas sus obras inacabadas y las tir en un ataque de rabia.\n\nPor favor, si no te importa..., podras encontrarlas? Puede que le devuelvan la chispa que necesita.\n\nHudson no rehye los lugares peligrosos para encontrar las mejores vistas, as que preprate bien.', '', '', '', '', '', '', 47187),
(70166, 'esES', 'El placer de la pintura', 'Entrega el cuadro de presentacin de Rauvros a Hudson.', 'Te gusta mi coleccin? Son obras de Hudson, el mejor pintor de toda la historia.\n\nSon poco comunes y puede que muy valiosas..., ms que nada porque l es un ermitao y lleva un tiempo sin pintar nada nuevo. Ay, me encantara conocerlo! O aprender algo de l!\n\nOye... Parece que tienes agallas. Podras dar con l? T-ten! Llvate una de mis obras. Puede que le impresione!\n\nO quiz le parezca horrorosa... Madre ma.', '', '', '', '', '', '', 47187),
(70164, 'esES', 'La oportunidad de una manitas', 'Habla con el cronomntico Phosildral y Sibrit Puntapgina en las Ruinas de la Cmara de la Vida.', 'Tienes un momento, $p? Estoy cerca de un nuevo avance!\n\nTras el colapso del nido, perd algo ms que mi capacidad de volar. Perd mi identidad como dracthyr. Quizs puedas entenderlo.\n\nSiempre he disfrutado montando y desmontando cosas, por lo que la Expedicin me pareci una buena opcin. Pero este artefacto me est volviendo loca.\n\nPodras pedirle a Phosildral y a Sibrit que revisen mis notas? Quiero demostrar que puedo ser una verdadera manitas... tanto a ellos como a m misma.', '', '', '', '', '', '', 47187),
(70163, 'esES', 'Los cruces avanzados de las cavernas', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70161, 'esES', 'Los cruces de las cavernas', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70159, 'esES', 'El sabor del hogar', 'Pregunta a los miembros de la Horda en el Campamento Base Dragontina si te pueden prestar los ingredientes que necesitas.', 'Por fin aparece $gun:una; dracthyr para echar una mano!\n\nMi hermano y yo hemos intentado preparar algunas raciones, pero...\n\n<Scaralesh gesticula a su alrededor>.\n\nPor aqu todo es muy diferente. Es difcil encontrar los mismos ingredientes que utilizbamos para cocinar.\n\nPero podemos adaptarnos. Ve a preguntar a los miembros de la Horda si tienen algo que podamos usar como materia vegetal, protenas y lquido emulsionante. Luego comeremos como es debido.', '', '', '', '', '', '', 47187),
(70158, 'esES', 'El paseo avanzado por los jardines', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70157, 'esES', 'El paseo por los jardines', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70156, 'esES', 'Un despertar ancestral', 'Potencia la puerta.', 'La puerta est justo detrs de m. No hay forma de saber cunto tiempo tenemos hasta que el encantamiento de este recipiente se desvanezca o, peor, se rompa.\n\nLa cantidad de energa inestable liberada podra ser catastrfica.\n\nSeguimos?', '', '', '', '', '', '', 47187),
(70155, 'esES', 'Mira, escucha y respira', 'Pesca con Threshrak.', 'Saludos, $r. Pocos se paran a saludar y son menos todava los que se quedan un rato. La mayora se apresuran a seguir hacia su siguiente destino.\n\nTe gustara pescar conmigo?', '', '', '', '', '', '', 47187),
(70154, 'esES', 'Un portal a algn lugar', 'Sigue a la taumaturga de distorsin Delandra hasta la ubicacin de la puerta.', 'El encantamiento nos proteger de la energa inestable que contiene.\n\nAbrir paso hasta la piedra ms cercana.\n\nUna vez que cruces, no te alejes. Necesitar tu ayuda cuando lleguemos para activar el dispositivo.', '', '', '', '', '', '', 47187),
(70149, 'esES', 'Esperanza para las Tierras Altas', '', '', '', '', '', '', '', '', 47187),
(70148, 'esES', 'Sin propsito', 'Encuentra al garfa Ethrethi en la Embajada Reposo Alado.', 'Me concedes un momento?\n\nMe preocupa un dracthyr que pas por aqu. Nos pregunt a mis compaeros y a m todo tipo de cosas, pero pareca... decepcionado con las respuestas.\n\nSe haca llamar \"garfa Ethrethi\". Creo que eso implica que es un novato entre nuestras filas.\n\nMe dio la impresin de que le vendra bien algo de ayuda. Puedes ayudarme con esto?\n\nLo vi hablar con Kholmar por all.', '', '', '', '', '', '', 47187),
(70146, 'esES', 'Impugnacin de las Tierras Altas', '', '', '', '', '', '', '', '', 47187),
(70139, 'esES', 'Este resguardo me lo guardo', 'Evala los daos causados a las piedras de resguardo en la Reserva de Tyrhold.', 'Antes, la reserva estaba protegida por tres piedras de resguardo colocadas por Tyr.\n\nSe supona que deban estabilizar la magia elemental de las Islas Dragn.\n\nCuando me despertaste, percib el dao causado al resguardo del oeste. Me temo que los Primalistas pueden haber causado el mismo dao a todos los resguardos.\n\nAun as, debemos evaluar los daos para saber qu hacer a continuacin.', '', '', '', '', '', '', 47187),
(70136, 'esES', 'No hay tiempo para el dolor', 'Recupera el bastn de Caminante del Tiempo y las notas de Caminante del Tiempo y mata al alfa enloquecido por el tiempo en el Bosque Fluyente de Thaldraszus.', 'Agh... Necesito un momento...\n\nEra mi primera misin... La energa temporal inestable se est filtrando en el bosque... y afectando a la fauna... Yo deba evaluar las consecuencias y, si era posible, recolectar esa magia para los Caminantes del Tiempo...\n\n<Zera sacude la cabeza un momento>.\n\nEstaba examinando una manada de vorquin cuando me atac un oso enloquecido rebosante de magia temporal. Me pill desprevenida y solo consegu escapar por los pelos.\n\nPodras encontrar el equipo que he perdido, $c? Ah, es posible que tambin tengas que encargarte de ese oso.', '', '', '', '', '', '', 47187),
(70135, 'esES', 'Elementales invasores', 'Mata a $1oa elementales primigenios en la Embajada Reposo Alado.', 'Los forjadores, artesanos y exploradores de la Expedicin Dragontina no son aptos para el fragor de la batalla.\n\nT y yo s, $p.\n\nUsemos esa fuerza en las Islas Dragn para proteger a aquellos que no pueden protegerse por s mismos.\n\nElimina a los elementales que se aproximan desde el norte para que la expedicin pueda centrarse en sus nobles quehaceres.', '', '', '', '', '', '', 47187),
(70134, 'esES', 'Recuerdos', 'Recupera la cpsula del tiempo de Veritistrasz.', 'Gracias por escucharme, joven. Tengo que pedirte un favor.\n\nNo te preocupes, no se trata de ms historias.\n\nCuando abandonamos este lugar dej una... especie de cpsula del tiempo. Podras recuperarla? La dej al fondo del Santuario de Vida Rub, escondida detrs de uno de los pilares.\n\nLa escond con un sigilo. Si lo activas, deberas poder ver mi cpsula del tiempo.', '', '', '', '', '', '', 47187),
(70132, 'esES', 'Qudate un rato', 'Sintate un rato y observa el paisaje.', '<El viejo enano no reacciona ante tu presencia cuando te acercas. Frunce el ceo mientras observa el paisaje. Es una vista agradable. Quiz sea buena idea tomarse un respiro y disfrutarla>.', '', '', '', '', '', '', 47187),
(70129, 'esES', 'Tascopi el Terrible', 'Ayuda a Rowie a matar a Tascopi el Terrible.', 'Tienes razn, no tengo la fuerza suficiente para acabar con este yeti... si voy por mi cuenta.\n\nPero ests aqu!\n\nLa guarida del malvado yeti, Tascopi el Terrible, est ah delante. La cueva es... grande. Pero no da miedo! Bueno, quiz un poco.\n\nPodras entrar ah y machacarlo un poco? Te... te cubrir las espaldas!', '', '', '', '', '', '', 47187),
(70126, 'esES', 'El toque final', 'Convence al cliente de Miguel para que le encargue ms pedidos de fabricacin.', 'Ah, $p, me alegro de verte.\n\nTu ayuda al Consorcio de Artesana, a Thomas y a m ha sido de inestimable valor. Gracias.\n\nHay una cosa ms de la que deberas estar al tanto como profesional: la relacin con tus clientes.\n\nHoy he completado un pedido de fabricacin para uno de ellos. Podras hablar con l de mi parte? Intenta convencerlo para que acuda a m cuando necesite ms cosas. Recurdale que, si quiere productos de la mejor calidad, tiene que hablar conmigo personalmente.', '', '', '', '', '', '', 47187),
(70125, 'esES', 'Dnde est Wrathion?', 'Pregntale a Sendrax cundo se espera que lleguen los dragones.', 'Mm, dnde estar Wrathion?\n\nDijo que nos estara esperando junto a una embajadora de Alexstrasza la Protectora, reina de los dragones.\n\nNo es propio de un dragn romper una promesa.\n\nPero al menos tenemos aqu a esta peculiar dracnida para recibirnos. Podras preguntarle cundo llegarn los dems?', '', '', '', '', '', '', 47187),
(70124, 'esES', 'Materiales de prctica', 'Consigue $1oa escamas de protocra primigenia.', 'Estos protodracos no se parecen a ninguno que haya visto.\n\nSus escamas son resistentes al fuego y ms fuertes que el acero sin perder flexibilidad alguna. Es increble.\n\nLos artesanos me estn pidiendo a gritos que les consiga algunas de esas escamas para trabajar con ellas.\n\nEmpieza por las cras. Sus pequeas escamas deberan ser ms flexibles hasta que hayamos dominado nuestra tcnica trabajndolas.', '', '', '', '', '', 'Renete con Thaelin Yunquenegro en la Embajada Reposo Alado.', 47187),
(70123, 'esES', 'Alimaas primigenias', 'Mata $1oa protodracos primigenios en la Costa Indmita.', '<Azurathel observa con sospecha a los protodragones que acechan en la cresta que hay detrs de l>.\n\nJurara que esos protodragones se acercan un poco ms al campamento cada vez que me doy la vuelta.\n\nEsos no son los dragones que Wrathion nos invit a conocer.\n\nLos protodragones son depredadores despiadados con los que no se puede razonar. Nosotros debemos ser igual de despiadados.\n\nReduce su nmero para mantener a raya sus ambiciones, o esta expedicin terminar antes de empezar.', '', '', '', '', '', 'Renete con el escamandante Azurathel en la Embajada Reposo Alado.', 47187),
(70122, 'esES', 'Exploradores en peligro', 'Rescata a 3 miembros de la Expedicin Dragontina en la Costa Indmita.', 'No confundas los objetivos acadmicos de la expedicin con timidez, $p.\n\nNo somos eruditos recluidos en altas torres para estudiar antiguos tomos.\n\nSomos aventureros, capaces de ir en busca de conocimiento hasta el rincn ms inhspito de Azeroth!\n\nNuestra pasin por la aventura nos lleva por caminos llenos de peligros, y algunos miembros de la expedicin se han llevado algn mordisco ms de los que quieren admitir...\n\nPero, bueno, el peligro lo hace ms divertido!', '', '', '', '', '', 'Renete con Toddy Bigotis en la Embajada Reposo Alado.', 47187),
