(70070, 'esES', 'Pero... yo soy el hroe de los patos', 'Encuentra a Ignogalletita y asegrate de que vuelve con Gracus.', 'Espera... Hay algo...\n\n<Gracus mira alrededor>. \n\nIgnocuaquens! El pequeo debe de haberse ido ro abajo de nuevo! No importa cuntas veces se lo diga, siempre intenta jugar con los cornisapos!\n\nNecesito que vayas a ver cmo est. Espero que no se lo hayan vuelto a tragar.', '', '', '', '', '', 'Habla con Gracus sobre lo que has visto.', 47187),
(70069, 'esES', 'Otros me llaman pastor de patos', 'Da de comer a $1oa patitos y vuelve con Gracus.', 'Mi tiempo se acaba, pero an no he terminado con mis obligaciones.\n\nToda la prole debera estar junto al arroyo. Los dejo all con la esperanza de que se vuelvan ms independientes. Pronto debern valerse por s mismos.\n\nHoy dependen de ti. Por favor, alimntalos con la comida que has conseguido y luego trae a los patitos conmigo. Cuidado con Piloto, siempre est saltando por ah.', '', '', '', '', '', '', 47187),
