(70062, 'esES', 'Algunos me llaman cazabichos', 'Recoge $1oa trozos de desove de alfazaque.', 'Ah, joven $r, me vendra bien tu ayuda. He criado a varias generaciones de criaturas en este lugar.\n\nMis preferidos son los patitos. Pero mi cuerpo se ha vuelto viejo y dbil... Aunque eso no detiene el ciclo.\n\nNecesito que consigas comida para mis queridos patitos.', '', '', '', '', '', '', 47187),
(70061, 'esES', 'Alas en entrenamiento', 'Gua a una cra para que elimine $2oa hierbajos inquietos, $3oa criaguijoneros intrusivos y $4oa soplos incansables.', 'Los dragones se ausentaron de las islas durante bastante tiempo, $p. Si te soy sincera..., algunas de nuestras habilidades se han atrofiado a medida que se transmitan de generacin en generacin.\n\nNo debera ser muy difcil adiestrar a estas cras, pero nos est resultando complicado meterlas en vereda.\n\nVeamos.\n\nHe visto que incluso la mayordoma Selistra te confa las tareas ms importantes. Y si nos echas una mano y ayudas a una de nuestras cras?', '', '', '', '', '', '', 47187),
(70060, 'esES', 'El ascenso avanzado de la academia', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
