(70058, 'esES', 'Amigo en reparacin', 'Recoge $1oa plumas rubes suaves, $2oa trozos de tela y $3oa cuentas de cristal de los alrededores del Vitasagrario Rub para ayudar a reparar el pato feliz.', 'El pato feliz se ha hecho dao mientras volbamos... Estaba perfectamente, pero, de repente..., me he chocado con un rbol!\n\n<Lillistrasza seala con lstima al pato de peluche que tiene en la cabeza>.\n\nSe le est saliendo el relleno! Tiene todas las plumas dobladas! Se le ha saltado un ojo! Noooo!\n\nPuedes arreglar al pato feliz, verdad?', '', '', '', '', '', '', 47187),
(70055, 'esES', 'Sigilo de tormentas', 'Entrega el sigilo de tormentas al cazador de tormentas William en Ventormenta.', '<Alguien con un profundo conocimiento de la magia podra tener inters en estudiar un hallazgo como este>.', '', '', '', '', '', 'Entrega el sigilo de tormentas al cazador de tormentas William en Ventormenta.', 47187),
