(70050, 'esES', 'Persiguiendo tormentas', 'Habla con el cazador de tormentas William en el Puerto de Ventormenta.', 'Conque esos guapetones te van a enviar a la aventura, eh?\n\nMe parece bien. De todos modos, la expedicin no podr zarpar hasta que alguien ponga bajo control esas tormentas elementales.\n\nHabla con el cazador de tormentas William. Lidera los esfuerzos de la expedicin para investigar las tormentas y podr ofrecerte el equipo que necesites.\n\nYo coordinar el resto de los preparativos mientras t te lo pasas en grande por ah.\n\nPero me debes una!', '', '', '', '', '', 'Habla con el cazador de tormentas William en el Puerto de Ventormenta.', 47187),
(70049, 'esES', 'Aplacar las tormentas', 'Recoge $1oa motas de energa primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Los Primalistas son implacables. Han desatado la devastacin elemental a lo largo de los Reinos del Este y Kalimdor.\n\nDebes demostrar la misma determinacin, $n. Es la nica forma de detenerlos.\n\nEncuentra su prxima incursin, acaba con los enemigos de la Tormenta primigenia antes de que sea demasiado tarde y desbarata sus planes.\n\nDebemos proteger Azeroth!', '', '', '', '', '', '', 47187),
(70048, 'esES', 'Una amenaza primigenia', 'Recoge $1oa motas de energa primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Raszageth no ha perdido el tiempo y est preparando sus fuerzas primalistas.\n\nEl Kirin Tor ha detectado unas tormentas enormes en puntos clave de Kalimdor y los Reinos del Este.\n\nLos Primalistas estn desatando los elementos para sumarlos a sus fuerzas. Parece que planean sembrar el caos no solo en las Islas Dragn, sino tambin en las tierras de la Alianza y la Horda.\n\nBusca al enemigo y observa su modo de actuar. Debemos detenerlos antes de que sea demasiado tarde.', '', '', '', '', '', '', 47187),
(70047, 'esES', 'Prisiones heladas', '', '', '', '', '', '', '', '', 47187),
(70042, 'esES', 'Abundancia de oportunidades', 'Consigue varios objetos para Vish el Ratero.', 'Me has asustado, pensaba que me iban a pillar.\n\nMira cuntos expedicionarios valientes listos para conquistar las Islas Dragn... con las mochilas repletas de herramientas y equipo.\n\nPodramos hacernos ricos!\n\nEcha un vistazo a ver si puedes coger algo y compartiremos los beneficios.', '', '', '', '', '', '', 47187),
(70041, 'esES', 'La furia de la Devoradora de Tormentas', 'Monta en el disco volador de Khadgar y mantn a raya el ejrcito primalista.', 'Raszageth est intentando arrancar toda la magia Arcana de la torre para poder destruirla.\n\nKalecgos est haciendo todo lo que puede para contenerla mientas yo utilizo mi magia para intentar reponer la energa Ley.\n\nMe temo que no aguantaremos mucho ms. Mientras hablamos, se acercan ms primalistas para atacarnos.\n\nLlvate mi disco Arcano modificado. Mantn a raya a los primalistas que se acercan... y esperemos que suceda un milagro.', '', '', '', '', '', 'Habla con Kalecgos, que est en la base de Vakthros.', 47187),
(70040, 'esES', 'Cayendo en el tiempo', 'Rene a tus aliados y habla con Nozdormu.', 'El choque de las magias de la dragona bronce Chronormu y la dragona infinita Eternus ha hecho que caigan sin control a travs del tiempo.\n\nConforme caen, rompen el propio tejido del tiempo, lo que provoca innumerables ondas en el tiempo y el espacio. Debemos localizarlas y traerlas de vuelta. Solo entonces podremos impedir que aumenten los daos. Tengo la certeza de que podrs detener la cada de Chronormu.\n\nRene a los aliados que necesites para hacerlo mientras yo me concentro en su magia.', '', '', '', '', '', 'Rene a tus aliados y habla con Nozdormu.', 47187),
(70035, 'esES', 'La carrera en los rpidos del ro de Ruriq', '', '', '', '', '', '', '', '', 47187),
(70034, 'esES', 'Suministros de artesano: escama de salamantra', 'Entrega una escama de salamantra a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, $gdesollador:desolladora;? El Consorcio de Artesana me ha pedido que consiga la escama de una salamantra para sus clientes.\n\nPuede que sea una artesana, pero no una chica de los recados!\n\nEn fin... T podras encontrar una?', '', '', '', '', '', 'Entrega una escama de salamantra a Haephesta en el Vitasagrario Rub.', 47187),
(70033, 'esES', 'Suministros de artesano: botas de cuero de pionero', 'Entrega unas botas de cuero de pionero a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, $gpeletero:peletera;? El Consorcio de Artesana me ha pedido que fabrique unas botas para sus clientes.\n\nSe ve que no saben lo solicitada que estoy. Sabes cuntos expedicionarios han venido hoy a quejarse de que tienen agujeros en los zapatos?\n\nSi tienes tiempo, estas son las medidas. Puede que el Consorcio de Artesana sea una oportunidad de negocio prometedora para ti.', '', '', '', '', '', 'Entrega unas botas de cuero de pionero a Haephesta en el Vitasagrario Rub.', 47187),
(70032, 'esES', 'Suministros de artesano: lentes de joyero', 'Entrega unas lentes de aumento de nice hendido a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, $gjoyero:joyera;? El Consorcio de Artesana me ha pedido que fabrique unas lentes para sus clientes.\n\nA m! Como si tuviera tiempo para esto.\n\nT puedes encargarte, no?', '', '', '', '', '', 'Entrega unas lentes de aumento de nice hendido a Haephesta en el Vitasagrario Rub.', 47187),
(70031, 'esES', 'Suministros de artesano: rodillo liso de chef', 'Entrega un rodillo liso de chef a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, escriba?\n\nMe ha llegado un pedido de una empresa llamada el Consorcio de Artesana.\n\nCreo que es una tarea lo bastante sencilla para $gun aprendiz:una aprendiza; como t.', '', '', '', '', '', 'Entrega un rodillo liso de chef a Haephesta en el Vitasagrario Rub.', 47187),
(70030, 'esES', 'Suministros de artesano: pticas de calidad garantizada', 'Entrega un par de pticas de calidad garantizada a Haephesta en el Vitasagrario Rub.', 'Ah, $gun ingeniero:una ingeniera;! Justo a tiempo.\n\nTengo que corregir algunos esquemas, pero ha visitado una mujer muy alta para pedirme un par de pticas.\n\nT sabes cmo fabricarlas, verdad?\n\nLlvalas al Vitasagrario Rub cuando las hayas fabricado. Dice que trabaja para Consorcio de Artesana o algo as.', '', '', '', '', '', 'Entrega un par de pticas de calidad garantizada a Haephesta en el Vitasagrario Rub.', 47187),
(70029, 'esES', 'Suministros de artesano: varas de serevita rnica', 'Entrega $1oa varas de serevita rnica a Haephesta en el Vitasagrario Rub.', 'Parece que tienes un toque mgico, $gencantador:encantadora;. Podras ayudarme con un pedido?\n\nEl Consorcio de Artesana ha solicitado algunas varas de serevita para un cliente, pero las varas encantadoras no son mi especialidad.\n\nSi ests $gdispuesto:dispuesta; a hacerlo, Haephesta en el Vitasagrario Rub te compensar por tu tiempo y esfuerzo.', '', '', '', '', '', '', 47187),
(70028, 'esES', 'Suministros de artesano: depsitos de sal', 'Entrega $1oa depsitos de sal a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, $gminero:minera;?\n\nEstaba hablando con Haephesta y dice que el Consorcio de Artesana necesita sal para sus clientes.\n\nNormalmente lo hara yo mismo, pero... Bueno, que no me apetece hacerlo.\n\nchame una mano y ve a buscarla, quieres?', '', '', '', '', '', 'Entrega $1oa depsitos de sal a Haephesta en el Vitasagrario Rub.', 47187),
(70027, 'esES', 'Suministros de artesano: braciles de tela de perito', 'Entrega los braciles de tela de perito a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, $gsastre:sastra;? El Consorcio de Artesana me ha pedido que fabrique unos braciles para sus clientes.\n\nAunque agradezco que los expedicionarios se interesen por nuestras labores, no tengo tiempo para un pedido como este.\n\nQuieres encargarte?', '', '', '', '', '', 'Entrega los braciles de tela de perito a Haephesta en el Vitasagrario Rub.', 47187),
(70026, 'esES', 'Suministros de artesano: alfazaques de lava', 'Entrega $1oa alfazaques de lava a Haephesta en el Vitasagrario Rub.', 'Buscas trabajo, herborista? El Consorcio de Artesana me ha pedido que rena alfazaques para sus clientes.\n\nLa tierra tiene mucho que ofrecer, pero no hasta el punto de que pueda ausentarme un rato y volver con su peticin.\n\nSi vas a salir de aventuras, podras recoger un par de alfazaques por el camino?', '', '', '', '', '', 'Entrega $1oa alfazaques de lava a Haephesta en el Vitasagrario Rub.', 47187),
(70025, 'esES', 'Suministros de artesano: hoz de draconio', 'Entrega una hoz de draconio a Haephesta en el Vitasagrario Rub.', 'Parece que no tienes nada que hacer. Te interesa trabajar?\n\nEl Consorcio de Artesana tiene un pedido de fabricacin pendiente: una hoz de draconio. Yo podra encargarme de ello sin problemas, pero como t eres $gel aprendiz:la aprendiza;, creo que la tarea te corresponde.\n\nFabrica la hoz, llvala al Vitasagrario Rub y entrgasela a una draenei llamada Haephesta. Te pagar por tu trabajo.', '', '', '', '', '', 'Entrega una hoz de draconio a Haephesta en el Vitasagrario Rub.', 47187),
