(69981, 'esES', 'A satisfaccin del cliente', 'Pregunta a los clientes del Consorcio de Artesana si estn contentos con sus pedidos de refabricacin.', 'Eh, $c. Tienes ganas de ayudar?\n\nAlgunos de nuestros clientes predilectos enviaron pedidos de refabricacin al Consorcio de Artesana, pero no tenemos noticias de ellos.\n\nSi te los cruzas, podras preguntarles y asegurarte de que estn satisfechos con sus compras? Los clientes siempre deben estar contentos contentos contentos!', '', '', '', '', '', 'Entrega el equipo a Mahra Doblrbol en el Paso de Crucerro.', 47187),
(69980, 'esES', 'Vid marina: el regalo del pescador Tinnak', 'Lleva la cuerda de vid marina a Nunvuq en Iskaara.', '<Ves que la mano espectral del pobre pescador an sujeta una cuerda tejida con algas resistentes aunque ligeras. Puede que Nunvuq le encuentre alguna utilidad en Iskaara>.', '', '', '', '', '', '', 47187),
(69979, 'esES', 'Una digna presa', 'Mata a Milmillar el Anciastado.', 'La sabidura no cae de los rboles, debes cultivarla. Si quieres demostrar tu vala, lo hars a la manera de mi pueblo, aprendiendo mientras actas.\n\nEncuentra y caza a Milmillar el Anciastado. Lleva generaciones escapando en las caceras.\n\nDe este modo, obtendrs la sabidura que buscas.', '', 'Milmillar el Anciastado ha logrado eludir a los cazadores durante generaciones. Quiz t puedas dar caza a esa bestia.', 'Milmillar', '', '', '', 47187),
