(69965, 'esES', 'Controles de calidad', 'Prueba las herramientas de Haephesta en geodas cercanas para el Consorcio de Artesana.', 'Buscas trabajo, $c?\n\nRepresento a una nueva compaa comercial llamada el Consorcio de Artesana. Se encarga de poner en contacto a artesanos y clientes mediante una red de pedidos de fabricacin.\n\nLa Expedicin Dragontina ha hecho un pedido de herramientas de minera encantadas. Las herramientas ya estn fabricadas, pero nos gustara probarlas antes de entregarlas.\n\nTe pagaremos por tus servicios, claro.', '', '', '', '', '', '', 47187),
