(69946, 'esES', 'El maestro de su oficio', 'Busca al maestro Khadin para aprender su sabidura profesional.', 'Mientras viajaba por estas llanuras, conoc a un viejo centauro en una cueva al norte. Me qued claro que haba dominado su profesin y posea sabidura a raudales.\n\nMe ayud a entender lo que aprend en las Islas Dragn.\n\nSi tienes inters en especializarte en tu profesin, bscalo. Se llama Khadin, del Clan Teerai.', '', '', '', '', '', 'Habla con Khadin en la Cueva de Khadin.', 47187),
(69944, 'esES', 'Persiguiendo tormentas', 'Habla con la cazadora de tormentas Suhrakka en la torre de zepelines.', 'Ese mago tiene sentido del espectculo, eh?\n\nNo podremos zarpar hasta que alguien ponga bajo control esas tormentas elementales.\n\nHabla con la cazadora de tormentas Suhrakka. Lidera la expedicin para investigar las tormentas y podr ayudarte a ponerte el equipo que necesites.\n\nMientras t te ocupas de ese asunto, yo coordinar el resto de los preparativos. Al menos me dar tiempo a leer unos cuantos libros sobre la historia de los dragones antes de zarpar.', '', '', '', '', '', 'Habla con la cazadora de tormentas Suhrakka en la torre de zepelines.', 47187),
(69939, 'esES', 'Socorro nemoroso', 'Consigue un cono de granizado y dselo a la nutria alterada.', 'Ah, $n, ests aqu. Te he estado buscando por todas partes.\n\nOtra de nuestras alimaas ha estado sufriendo una triste falta de golosinas ltimamente. Puedes ir a buscarle algo dulce para picar?', '', '', '', '', '', '', 47187),
(69938, 'esES', 'Locos por la pesca!', '', '', '', '', '', '', '', '', 47187),
(69936, 'esES', 'Zambul, Cabecilla de los Vndalos', 'Derrota al sobrestante Zambul.', 'Buen trabajo. Esos herejes no pueden obligar a ms ancestros a luchar por ellos. Pero tenemos que encargarnos del bruto que les da rdenes.\n\nEs su sobrestante, Zambul. Debemos detenerlo.\n\nAcaba con l.', '', '', 'Sobrestante Zambul', '', '', '', 47187),
(69934, 'esES', 'Corazones sangrantes', 'Entrega los suministros mdicos.', 'Las pociones estn listas, y ya solo falta entregarlas.\n\nLleva un cajn a una pequea cueva en el barranco que hay debajo de nosotros. No vers a nadie para recoger la entrega, pero te garantizo que se le dar buen uso.\n\nLleva otra caja a la enfermera del Puesto Gelikyr. All hay alguien de mi confianza que se encarga de los enfermos.\n\nAhora caigo... en que esta tarea no te corresponde. Ni a m. No obstante, has sido sorprendentemente til, y estos medicamentos podran salvar vidas.', '', '', '', '', '', '', 47187),
(69933, 'esES', 'La curiosidad tiene un precio', 'Recoge un trozo de la vid obcecada.', 'Echa un vistazo al barranco, $r. Los Primalistas atacaron el Puesto Gelikyr hace das, y la batalla contina.\n\nEsa gente necesita blsamos y costuras. Puedo fabricarlo todo, pero me estoy quedando sin ingredientes. Como te has colado en mi hogar, quedas a mis rdenes.\n\nVe a mi jardn y encuentra la vid ms grande que veas. Arrncala de raz y tremela.', '', '', '', '', '', '', 47187),
(69932, 'esES', 'Tu granito de arena', 'Recoge ingredientes para sustituir los vendajes de Chorrito.', 'Me paso el da haciendo pociones para todo Gelikyr, as que no tengo tiempo para el resto de mis tareas.\n\nUn pato lleg a mi jardn con una costilla rota. Me he ocupado de la herida, pero hay que cambiarle la gasa. Como tienes tantas ganas de ayudar...\n\n<Szareth te entrega una lista con ingredientes>.\n\nAqu est lo que necesitas. Tremelo.', '', '', '', '', '', '', 47187),
(69930, 'esES', 'Basrikron', '', '', '', '', '', '', '', '', 47187),
(69925, 'esES', 'Aplacar las tormentas', 'Recoge $1oa motas de energa primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Los Primalistas son implacables. Han desatado la devastacin elemental a lo largo de los Reinos del Este y Kalimdor.\n\nDebes demostrar la misma determinacin, $n. Es la nica forma de detenerlos.\n\nEncuentra su prxima incursin, acaba con los enemigos de la Tormenta primigenia antes de que sea demasiado tarde y desbarata sus planes.\n\nDebemos proteger Azeroth!', '', '', '', '', '', '', 47187),
(69924, 'esES', 'Torres de poder llameante', '', '', '', '', '', '', '', '', 47187),
(69923, 'esES', 'Una amenaza primigenia', 'Recoge $1oa motas de energa primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Raszageth no ha perdido el tiempo y est preparando sus fuerzas primalistas.\n\nEl Kirin Tor ha detectado unas tormentas enormes en puntos clave de Kalimdor y los Reinos del Este.\n\nLos Primalistas estn desatando los elementos para sumarlos a sus fuerzas. Parece que planean sembrar el caos no solo en las Islas Dragn, sino tambin en las tierras de la Alianza y la Horda.\n\nBusca al enemigo y observa su modo de actuar. Debemos detenerlos antes de que sea demasiado tarde.', '', '', '', '', '', '', 47187),
(69919, 'esES', 'Necesidades de la profesin', 'Habla con Azley para aprender a realizar pedidos de fabricacin.', 'Tienes pinta de que se te da bien la artesana. Te gustara completar algunos pedidos de fabricacin para otros aventureros y ganar mucho mucho mucho dinero?\n\nTe explicar las normas para trabajar con el Consorcio de Artesana y luego podrs aceptar pedidos de fabricacin en cualquier estacin de fabricacin de las Islas Dragn.', '', '', '', '', '', '', 47187),
(69918, 'esES', 'Sacudir nuestros cimientos', 'Mata a Tokara la Muelepiedras, a Molka la Picadora y a los elementales que han liberado.', 'Los amarrapiedras djaradin amenazan con destruir los cimientos de la Ciudadela! Tenemos que detenerlos!\n\nNi siquiera hemos tenido la oportunidad de reclamar la ciudadela como nuestra, y ya puede que se derrumbe bajo nuestros pies. No podemos permitir que ocurra.\n\nHaz lo que puedas, $n... Y con eso me refiero a que acabes con ellos!', '', 'Al igual que Tokara la Muelepiedras, Molka es una experta manipuladora de la dura piedra obsidiana que hay bajo la ciudadela.', 'Molka la Picadora', '', '', '', 47187),
(69915, 'esES', 'Publicidad agresiva', 'Recupera los folletos de las cabras crucerro y las cabras entrometidas.', 'Hola, hola, hola! Buscas trabajo?\n\nEstamos preparando una gran oferta de apertura para nuestro nuevo puesto de pedidos de fabricacin, y necesitamos llamar la atencin! Pero el viento se llev mis folletos y creo que algunas de las cabras locales huyeron con ellos.\n\nPodras recuperarlos?', '', '', '', '', '', '', 47187),
(69914, 'esES', 'Los Djaradin han despertado', 'Recibe tus rdenes de la mayordoma Selistra.', 'Ojal tuviramos tiempo para presentaciones ms agradables, pero no todos podemos ser Chronormu, verdad?\n\nSoy Selistra, mayordoma de Alexstrasza la Protectora, reina de los dragones.\n\nLa reina Alexstrasza me pidi que te transmitiera sus ms cordiales saludos y que te acompaara a los Estanques de Vida.\n\nPero me temo que debo pedir tu ayuda antes de ir hacia all.\n\nNuestros antiguos rivales, los Djaradin, han despertado de su letargo bajo la tierra y ya han asaltado un puesto de avanzada cercano.', '', '', '', '', '', 'Renete con Sendrax en la Embajada Reposo Alado.', 47187),
(69912, 'esES', 'Mi primera emergencia real!', 'Convence a Sendrax para que lance su bengala de emergencia y avise a los dragones de tu llegada.', '<Sendrax parece desconcertada>.\n\nMe cuesta creer que la mayordoma llegue tarde a nada, y menos a algo tan importante como esto.\n\nEs muy raro...\n\n<De repente, parece tener una idea>.\n\nPodra usar mi bengala de emergencia para avisar de vuestra llegada. As vendran corriendo a recibiros!\n\nAunque nunca he lanzado la bengala de emergencia...', '', '', '', '', '', 'Renete con Wrathion en la Embajada Reposo Alado.', 47187),
(69911, 'esES', 'Perdn por el desastre', 'Ayuda al embajador Fastrasz a arreglar la embajada.', 'Ojal supiera ms sobre cmo daros la bienvenida a las Islas Dragn, pero no soy ms que una centinela.\n\n<Sendrax seala la torre detrs de s>.\n\nPodras intentar hablar con el embajador Fastrasz en el centro de visitantes. Quiz pueda responder ms preguntas antes de que lleguen los dragones.\n\nMira bien dnde pisas. Estaba limpiando los escombros la ltima vez que lo vi.', '', '', '', '', '', '', 47187),
(69910, 'esES', 'Dnde est Wrathion?', 'Pregntale a Sendrax cundo se espera que lleguen los dragones.', 'Qu raro.\n\nEbyssian nos dijo que Wrathion nos estara esperando junto a un embajador de Alexstrasza la Protectora, reina de los dragones.\n\nNo es propio de un dragn romper una promesa.\n\nPero al menos est aqu esta peculiar dracnida para recibirnos. Seras tan amable de averiguar cundo llegarn los dems?', '', '', '', '', '', '', 47187),
(69904, 'esES', 'Silencio sospechoso', 'Encuentra a los aprendices de Noriko en el Campamento de Antonidas.', 'Tienes un momento, $p? Hace tiempo que no s nada de mis aprendices Sidrcido y Tucky.\n\nTengo miedo.\n\nLos envi a buscar suministros para la posada. No pueden andar lejos de aqu...\n\nBscalos, pero ve con ojo... Son de armas tomar.', '', '', '', '', '', '', 47187),
(69902, 'esES', 'Teora en prctica', 'Ayuda a Tyrgon a sanar a la criatura.', '$n, necesito tu ayuda...\n\nEspero que nadie se crea que puedo fabricar cosas, aplacar a la cra, ejercer de sanador y ensear a los nios... a la vez! Qu obsesin con la multitarea...\n\nEn fin, puedes empezar por usar esas flores. Yo necesitar unos minutos para prepararme antes de sanar a la protocra.\n\nCon suerte, los nios sacarn una leccin de este incidente...', '', '', '', '', '', '', 47187),
(69901, 'esES', 'En manos expertas', 'Recoge $1oa flores de luz solar.', 'Te ha dicho Iyali cunto tiempo ha estado sufriendo esta criatura? Si est demasiado herida como para comer, debemos tratarla inmediatamente.\n\nNormalmente, un campamento de la Expedicin Dragontina tendra todo lo que necesito para ayudar a esta cra, pero traer suministros a las Islas Dragn no ha sido tan fcil como pensbamos, y ha habido bastantes retrasos en nuestras rutas de suministros.\n\nPero no temas, las mismas islas nos proveern! Si me traes flores de luz solar, podr elaborar un blsamo que calme al draco mientras lo curo.', '', '', '', '', '', '', 47187),
(69900, 'esES', 'Identificar la fuente', 'Mata al primalista que est experimentando en la Reserva Agreste.', 'A juzgar por lo que han dicho los nios, puede que haya un primalista acechando en la Reserva Agreste.\n\nEsto requiere investigacin inmediata.\n\nDe acuerdo a las investigaciones de mis compaeros, a los Primalistas les encanta robar huevos y cras para imbuirlos de poder y corromperlos. Quienes no se aclimatan al proceso sufren una lenta muerte... Tampoco es que a ellos les importe.\n\nHay que sacarlos de la Reserva. Encrgate y yo intentar distraer a los nios. No deben enterarse de esto.', '', '', '', '', '', '', 47187),
(69899, 'esES', 'Investigacin secreta', 'Ayuda a Iyali y a sus amigos.', 'S... que estoy actuando de forma extraa. Lo siento!\n\nProbablemente hayas adivinado que no estoy siendo sincera.\n\nTe puedo contar mi secreto, si quieres. Pero tienes que prometer que no se lo dirs a los mayores!', '', '', '', '', '', '', 47187),
(69898, 'esES', 'Mtodo carnfico', 'Recoge $1oa trozos de carne de bestia fluvial superdeliciosa.', 'Esto... Tengo ms deberes. S, deberes. Las lecciones del profesor Tyrgon son superdifciles! Quiere que averigemos qu comen las protocras. S...\n\nY ya s la respuesta! Carne de bestia fluvial!\n\nPuedes traerme un trozo de carne de bestia fluvial? Una imagen vale ms que mil palabras para mi proyecto.\n\nPero tiene que ser un trozo muy bueno, vale? Por ejemplo..., de bestia fluvial del lodo. Como el que una mam protodraco le dara a su cra para que creciera fuerte porque... esto... eso alegrara al profesor Tyrgon.', '', '', '', '', '', '', 47187),
(69897, 'esES', 'La \"tarea\" sobre el anlisis de comportamiento', 'Acaricia a $4oa cras adormiladas e informa a Iyali.', 'Necesito hablar con alguien que sepa de protocras. Como las que viven en la Reserva Agreste.\n\nSon tan furiosas como cuando son grandes? Muerden o escupen fuego?\n\nY si yo... eh... Y si t acaricias a una protocra? Sabran que vas en son de paz y que ests intentando ayudarlas?\n\nTe lo pregunto en nombre de la ciencia, por supuesto. Tyrgon siempre dice que probemos nuestras hipa... no... hepo... No. Ay! NUESTRAS TEORAS!\n\nCreo que les gustara que las acariciasen y que les hara sentir bien. Puedes probar por m?', '', '', '', '', '', '', 47187),
(69896, 'esES', 'Desvo desastroso', 'Renete con la elementalista Taiyang en las Ruinas de la Cmara de la Vida.', 'Saba que unirme a la Expedicin Dragontina implicara adentrarme en territorio peligroso. Lo que no esperaba es tener que luchar contra elementales!\n\nNuestra excavacin en las Ruinas de la Cmara de la Vida est sumida en el caos! Unas monstruosidades de piedra se estn alzando de la tierra! Llamamos a una elementalista para pedirle consejo, pero creo que necesitar toda la ayuda posible.\n\nY si vas a ayudarla? Nuestro campamento est al otro lado del ro.', '', '', '', '', '', '', 47187),
