(69870, 'esES', 'Imgenes con propsito', 'Renete con Akunda la Catalogadora y la artillera Fren cerca de los Rpidos Desbordantes.', 'Las imgenes unen a la gente, $p.\n\nSuelen enviar a nuestros catalogadores de dos en dos por seguridad, pero ha sido un placer ver que miembros de facciones y orgenes distintos son capaces de trabajar codo con codo en pos del conocimiento en estas islas tan increbles.\n\nUno de estos dos se encuentra registrando uno de los ros centrales de las Orillas del Despertar.\n\nSi quieres ayudarnos, nete a ellas para catalogar la fauna que hay all.', '', '', '', '', '', 'Renete con Akunda la Catalogadora y la artillera Fren cerca de los Rpidos Desbordantes.', 47187),
(69869, 'esES', 'El paraso de una catalogadora', 'Habla con la catalogadora Coralie en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedicin Dragontina para recibir instruccin. Intenta darte explicaciones con nerviosismo>.\n\nElfo amable. Hombrecito orgulloso. Muchas cmaras. S?\n\n<El doctor Nanners asiente con emocin esperando tu respuesta>.', '', '', '', '', '', 'Habla con la catalogadora Coralie en el Campamento Base Dragontina.', 47187),
