(69862, 'esES', 'Salvar a un astudraco', 'Averigua qu perturba a Sylvie.', 'Ahora que se ha curado, creo que Sylvie quiere mostrarnos algo.\n\nNuestro trabajo an no ha terminado, $n! Veamos qu le pasa.', '', '', '', '', '', '', 47187),
