(69855, 'esES', 'Vocacin de escalador', 'Habla con el abrecaminos Jeb en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedicin Dragontina para recibir instruccin. Intenta darte explicaciones con nerviosismo>.\n\nDel gran Jeb. Buen amigo. Escalar ya. S?\n\n<El doctor Nanners asiente con emocin esperando tu respuesta>.', '', '', '', '', '', 'Habla con el abrecaminos Jeb en el Campamento Base Dragontina.', 47187),
