(69097, 'esES', 'Una cmara sin sellar', 'Habla con la catalogadora Jakes en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedicin Dragontina. Intenta darte explicaciones con nerviosismo>.\n\nEnana ruidosa. Elfa seria. Te esperan. S?\n\n<El doctor Nanners asiente con emocin esperando tu respuesta>.', '', '', '', '', '', 'Habla con la catalogadora Jakes en el Campamento Base Dragontina.', 47187),
(69096, 'esES', 'El propsito de Taivan', 'Intenta calmar a la centuride hurfana Chimei.', 'Ves a esa joven, sentada junto al arrollo?\n\n<Seala al noreste, donde ves a una joven centauro mirando el agua>.\n\nChimei perdi a sus padres durante un ataque de los Nokhud. He curado todas sus heridas fsicas, pero no ha comido ni ha dicho nada desde que la encontramos. Solo se sienta y mira fijamente a la nada.\n\nEsto va ms all de mis habilidades, y no s qu hacer. $n, podras intentar hablar con Chimei?', '', '', '', '', '', '', 47187),
(69095, 'esES', 'Sabueso de vuelta a casa', 'Monta en Taivan y vuelve a Maruukai', 'Hemos podido estabilizarlos a todos gracias a ti y a Taivan, pero muchos de los aldeanos necesitarn ms tiempo en Maruukai para curarse del todo.\n\nPor qu no guiais la caravana de vuelta? Os lo habis ganado despus de vuestras hazaas de hoy!', '', '', '', '', '', '', 47187),
(69094, 'esES', 'Salvando centauros', 'Rescata a centauros heridos en la aldea de Daruukhan.', 'La traicin de los Nokhud no conoce lmites! En la aldea de Daruukhan solo viven artesanos. No tenan ninguna posibilidad contra los asaltantes.\n\nNecesitamos tu ayuda desesperadamente, $n. Los Nokhud siguen cerca y debemos atender a los heridos.\n\nRegistra la aldea y treme a los supervivientes que encuentres. Les ayudaremos cuanto podamos!', '', '', '', '', '', '', 47187),
(69093, 'esES', 'Un nuevo misterio', 'Habla con Naleidea Brillorro en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedicin Dragontina. Intenta darte explicaciones con nerviosismo>.\n\nPuerta sellada. Secretos titnicos. S?\n\n<El doctor Nanners asiente con emocin esperando tu respuesta>.', '', '', '', '', '', 'Habla con Naleidea Brillorro en el Campamento Base Dragontina.', 47187),
(68799, 'esES', 'Retorno al Vitasagrario Rub', 'Vuelve al Vitasagrario Rub.', 'Y esto es solo el principio de tu andadura como jinete de dragones!\n\nMantn los ojos abiertos en busca de nuevas aventuras y experiencias por las Islas Dragn y no olvides visitarnos en cualquiera de nuestras avanzadas.\n\nAhora vuelve con Alexstrasza para seguir explorando estas tierras.', '', '', '', '', '', 'Vuelve con Alexstrasza en el Vitasagrario Rub.', 47187),
(68798, 'esES', 'Los glifos dracnicos y t', 'Recoge el glifo dracnico en el Observatorio Cima Celestial y despus habla con Lithragosa para usar tu talento.', 'Es evidente que no solo Glensera y yo estamos interesados en estas aventuras. Lithragosa tambin est ansiosa por ayudarte a perfeccionar tus habilidades como jinete de dragones y ya has conocido a Celormu, cosa que est muy bien.\n\nHay unos glifos repartidos por las Islas Dragn que te ayudarn a aprender ms trucos y facultades relacionados con la monta de dragones. De hecho, hay uno justo aqu, en el Observatorio Cima Celestial.\n\nCuando lo encuentres, Lithragosa te ayudar a usarlo.', '', 'Los glifos que se encuentran a lo largo de las Islas Dragn te ayudarn a aprender ms trucos y facultades de jinete de dragones.', 'Glifo dracnico', '', '', '', 47187),
(68797, 'esES', 'Cuernos nuevos', 'Renete con Glensera y usa el podio de transformacin para personalizar a tu draco.', 'Al igual que los mortales, los dragones se preocupan mucho por su apariencia. Tu draco tambin puede cambiar segn lo que encuentres y tu experiencia.\n\nHabla con Glensera en el podio de transformacin para comprobarlo con tus propios ojos!', '', '', '', '', '', '', 47187),
(68796, 'esES', 'El Observatorio Cima Celestial', 'Viaja al Observatorio Cima Celestial en las Orillas del Despertar.', 'Y esto es todo lo bsico sobre montar en draco! Lo ests haciendo bastante bien.\n\nAhora me gustara presentarte a otras personas implicadas en esta aventura. Hemos establecido nuestro hogar en el Observatorio Cima Celestial.\n\nCelormu te guiar hasta all. Habla con l cuando quieras surcar los cielos!\n\nNos vemos all!', '', '', '', '', '', 'Renete con lord Andestrasz en el Observatorio Cima Celestial.', 47187),
(68795, 'esES', 'Jinete de dragones', 'Habla con lord Andestrasz en el Vitasagrario Rub.', 'Ya has averiguado algo de este lugar: las Islas Dragn son enormes.\n\nAlgunos dracos han mostrado gran inters por explorar cada rincn y escondrijo secreto de este famoso lugar, incluidos aquellos que no son accesibles desde el suelo. Estn ansiosos por contar con otro par de ojos que los ayuden en sus aventuras y, a cambio, no tendrn inconveniente en llevar un jinete por estas tierras.\n\nHabla con lord Andestrasz en el Vitasagrario Rub. Te contar ms cosas sobre sus intenciones.', '', '', '', '', '', 'Habla con lord Andestrasz en el Vitasagrario Rub.', 47187),
(68794, 'esES', 'Aliado de los dragones', 'Habla con Alexstrasza en el Trono de los Aspectos, que est en Valdrakken.', 'Tu ayuda a las Islas Dragn no ha pasado desapercibida, $n.\n\nLa mismsima Protectora quiere ensearte algo como recompensa por tu servicio a los dragnicos.\n\nVe y habla con ella en lo alto de la torre. Te estn esperando todos los Aspectos.', '', '', '', '', '', 'Habla con Alexstrasza en el Trono de los Aspectos, que est en Valdrakken.', 47187),
(68644, 'esES', 'Azcar, especias y muchas cosas bonitas', 'Ayuda a tratar a Sylvie.', 'Eso es! Ya tengo todo lo que necesito para Sylvie.\n\nY justo a tiempo. Dudo que hubiera aguantado mucho ms.\n\nPero... necesito que alguien me ayude. Se lo pedira a Cally, pero... te importara ayudarme una vez ms?\n\nSi quieres hacerlo, avsame cuando ests $glisto:lista;, $n.', '', '', '', '', '', '', 47187),
(68643, 'esES', 'Vitaminas y minerales', 'Recolecta $1oa viales de agua mineral.', 'Tendra que haber supuesto que Steria se enfadara al pedirte que pelearas contra los animales...\n\nPor supuesto, existen mtodos de investigacin alternativos.\n\nToma estos viales y recoge un poco de agua de los cristales de hielo cercanos.\n\nSegn mi teora, deberan contener minerales imbuidos de energa de cristal Ley, y puede que estn alimentando el brote de la zona.', '', '', '', '', '', '', 47187),
(68642, 'esES', 'Espinas por doquier', 'Recoge $1oa espinas imbuidas de energa Arcana.', 'Quiero ayudar a Sylvie, pero no retrasar ms a Cally.\n\nPara darle a Sylvie la medicina, necesito espinas imbuidas de energa Arcana de los pinocristales. Seguro que no les importa que le arranques unas cuantas.\n\nTen cuidado con los bakars! Comen pinocristales y puede que se enfaden si los tocas. Si te atacan, tambin puedes coger espinas de ellos.\n\nAunque... intenta no hacerlo, por favor.', '', '', '', '', '', '', 47187),
(68641, 'esES', 'Marcando musgo', 'Recolecta $1oa matas de dracomusgo.', 'Pobrecilla...\n\nDebe haber enfermado tras comer algo contaminado.\n\nPor suerte, mi abuelo, que era druida, me ense a tratar enfermedades Arcanas.\n\nNo tengo todos los ingredientes, pero podemos hacer algo con lo que ah por aqu.\n\nPrimero necesitar un poco de dracomusgo. Es un liquen poco comn que solo crece en los huesos de dragn.', '', '', '', '', '', '', 47187),
(68639, 'esES', 'Depredadores polares merodeadores', 'Mata a $1oa gelipieles infectados.', 'La especie que nos han enviado a estudiar son los gelipieles.\n\nLas lneas Ley han contaminado sus terrenos de caza. Las energas Arcanas parasitan el agua, las plantas... y las especies de las que dependen, como los astudracos.\n\nPero, a diferencia de otros organismos, los gelipieles sobreviven al proceso y absorben su poder.\n\nNo obstante, se vuelven agresivos... Y eso es un problema. Enfrntate a unos cuantos mientras yo tomo nota sobre su fuerza y agresividad.\n\nMi informe ayudar al Kirin Tor a decidir qu hacer con ellos.', '', '', '', '', '', '', 47187),
(68087, 'esES', 'Peligro en Daruukhan', 'Habla con el mensajero Teerai para escuchar la peticin urgente de Selbekh.', 'Me parece que no hay nada que hacer. Tendrs que volver con Taivan a Maruukai.\n\nUn momento... Qu es eso que se acerca? Espero que no sea otra persona con un bakar gigante!', '', '', '', '', '', '', 47187),
(68085, 'esES', 'Modelar a un pastor', 'Ensea a Taivan a hacer de pastor con los argales en Mallakh.', 'Quieres que entrene a tu bakar para que sea pastor? Aqu nos dedicamos a eso, pero nunca he entrenado a uno tan grande...\n\nAun as, a los argales se les da bien captar las actitudes y no parece que les moleste su presencia.\n\nEstoy dispuesto a ofrecerle una oportunidad, pero un bakar pastor no solo debe ser cuidadoso, sino tambin inteligente. Si no es capaz de asumir el mando del rebao, los argales no le obedecern. Es ms difcil de lo que parece! Venga, prueba mientras os observo.', '', '', '', '', '', '', 47187),
(68084, 'esES', 'El gigante amable', 'Enva a Taivan al pastor Tevatei en Mallakh para que reciba entrenamiento.', 'Si Taivan es tan \"poco feroz\" como dice Jadar, puede que le vaya mejor como bakar pastor.\n\nLos Aylaag son expertos pastores de argales y no son tan orgullosos como para pedir regalos fastuosos antes de ayudar a otro clan.\n\nLleva a Taivan con el pastor Tevatei en Mallakh, un sitio situado entre dos colinas, al sureste, donde entrenan a sus bakars.\n\nPor Ohn\'ahra, espero que esto funcione. De lo contrario, ya no s qu hacer.', '', '', '', '', '', '', 47187),
(68083, 'esES', 'Vuelve a intentarlo, Taivan!', 'Vuelve con la sanadora Selbekh en Maruukai y comparte las malas nuevas.', 'Vuelve con los Teerai y cuntales que ni siquiera yo he sido capaz de entrenar a Taivan para la caza. No est hecho para esto.\n\nEs el bakar menos feroz que he visto en mi vida. Apuesto a que intentara hacerse amigo de las presas si se lo permitiramos. Ja!', '', '', '', '', '', 'Vuelve con la sanadora Selbekh en Maruukai.', 47187),
(67921, 'esES', 'El can de caza', 'Caza bestias peligrosas con Taivan para demostrar que es digno de comenzar el entrenamiento.', 'Ve y da caza a las bestias cercanas con tu bakar. Cuanto ms grandes sean, mejor. Observar desde aqu y decidir si es digno de recibir la instruccin de los Shikaar.\n\nTe aviso desde ya que solo aceptar lo mejor.', '', '', '', '', '', '', 47187),
(67772, 'esES', 'El problema con Taivan', 'Ayuda a la sanadora Selbekh a preparar a Taivan para su entrenamiento.', 'Hola, $gamigo:amiga;. Te doy la bienvenida de nuevo a Maruukai. Soy Selbekh, sanadora del Clan Teerai.\n\nSe te dan bien los animales, $n? Puede que la influencia de $gun recin llegado:una recin llegada; sea justo lo que necesito.\n\nTe presento a Taivan. Es muy buen compaero, pero se ha convertido en una carga para mi clan. Temo que no podamos darle un buen uso y que tengamos que deshacernos de l. Puedes ayudarme?', '', '', '', '', '', '', 47187),
(67744, 'esES', 'Shezra', '', '', '', '', '', '', '', '', 47187),
(67742, 'esES', 'mbito del archivo avanzado', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67741, 'esES', 'mbito del archivo', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67724, 'esES', 'Llamas para mantener a raya', 'Recoge $1oa de seda de red trmula.', 'Kattigat y yo vinimos aqu con el propsito de derrotar a la Llama Hendida y recuperar el Valthrux para demostrar nuestra vala.\n\nAhora estamos aqu papando moscas y cuidando de esta elfa que se ha llevado un par de picaduras de araa de hielo. An no hemos luchado contra la Llama Hendida y resulta que es posible que unas araas nos impidan hacerlo!\n\nDebemos mantenerlas a raya.\n\nPor suerte, existe un modo natural para hacerlo. Cuando la seda de sus capullos arde, se genera un olor que las repele.\n\nRecoge un poco de seda y la echar al fuego Eso las mantendr lejos!', '', '', '', '', '', '', 47187),
(67717, 'esES', 'La reina de telaraas Ashkaz', '', '', '', '', '', '', '', '', 47187),
(67700, 'esES', 'A las Islas Dragn!', 'Monta en la Dragontina Robusta a las Islas Dragn desde los muelles del Puerto de Ventormenta.', 'Buenas noticias, $p! La punta de lanza de nuestra expedicin ha desembarcado en las Islas Dragn.\n\nGracias a tus esfuerzos y a los de los dems miembros de la Expedicin Dragontina, hemos logrado establecer una zona segura y entrar en contacto con la embajada de los Vuelos.\n\nEstas $glisto:lista; para acompaarnos en nuestro siguiente viaje a las Islas Dragn?', '', '', '', '', '', 'Renete con Toddy Bigotis en las costas de las Islas Dragn.', 47187),
(67606, 'esES', 'El remedio de las drades', 'Consigue una golosina de prole sabrosa y dsela al patito desanimado.', 'Mientras estabas fuera, me enter por una liebre onrica de que uno de los patitos de la zona est bastante triste. Por suerte, s exactamente cmo arreglarlo!\n\nCada vez que estoy triste, me tomo algo dulce y sabroso Como experta en criaturas adorables y achuchables, s que este principio tambin funcionar en este caso.\n\nA este patito en particular le gusta un postre local conocido como golosina de prole sabrosa. Podras encontrar una y llevrsela al pobrecillo? Para eso estamos las drades!', '', '', '', '', '', '', 47187),
(67605, 'esES', 'Llanuras atronadoras', 'Hazte con el cuerno de Ayanga.', 'Hay una gran bestia de tormenta merodeando por este risco. Muchos cazadores Shikaar han intentado darle caza, pero han sucumbido ante su ferocidad.\n\nSi ansas la gloria de una cacera, intenta acabar con ella. Y treme su cuerno como tributo, si lo consigues.', '', 'Un desagradable truenagarto al que le gusta destruir campamentos de centauros.', 'Ayanga', '', '', '', 47187),
(67566, 'esES', 'El recorrido areo avanzado de las Tierras de Escarcha', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67565, 'esES', 'El recorrido areo de las Tierras de Escarcha', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67564, 'esES', 'Mensajera para el consorcio', 'Entrgale la factura del Consorcio de Artesana a Thomas Brillante.', 'Oye, te diriges al vitasagrario?\n\nTe importara entregarle esta factura a Thomas Brillante? Ha encargado unas cuantas botellas hechas a medida, y el vidriero ya nos ha confirmado el precio de los materiales necesarios.\n\nSi sigues el camino deberas encontrrtelo. Lo ms probable es que est dndole la lata a algn infeliz sobre lo fantstico que es su marido...\n\nSeguro que te paga por tu tiempo.', '', '', '', '', '', 'Entrgale la factura del Consorcio de Artesana a Thomas Brillante, que est en el Vitasagrario Rub.', 47187),
(67299, 'esES', 'Repelente de dracos', 'Usa un acribillador Arcano para derrotar a $1oa protodracos.', 'Los primalistas han estado atacando sin cesar el campamento con sus dracos!\n\nHemos podido mantenerlos a raya con nuestros escudos, pero nos vendra bien ms ayuda para borrarlos del cielo.\n\nUsa uno de nuestros acribilladores para acabar con ellos!', '', '', '', '', '', '', 47187),
(67298, 'esES', 'Las maravillas del mundo', 'Descubre cmo obtiene Thomas su inspiracin artesanal.', 'Mi marido Thomas ha aprendido mucho explorando estas tierras primigenias.\n\nQuizs si seguimos sus pasos, alcances la misma inspiracin.', '', '', '', '', '', '', 47187),
(67297, 'esES', 'El recorrido avanzado de Iskaara', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67296, 'esES', 'El recorrido de Iskaara', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67295, 'esES', 'Esa es mi especialidad', 'Habla con Miguel Brillante sobre las especializaciones profesionales.', 'As que has empezado a adoptar una especializacin, eh? Es maravilloso disponer de una habilidad propia.\n\nComo miembro del Consorcio de Artesana, sera un placer para m ayudarte a perfeccionar tu especializacin.\n\nTienes un minuto para escuchar mis sabios consejos y, con suerte, aprender algo til para tus aventuras?', '', '', '', '', '', '', 47187),
(67222, 'esES', 'Nubes oscurecidas', 'Elimina la presencia primalista en el Alto Son del Viento.', 'Los Primalistas han infectado el Alto Son del Viento con sus absurdas enseanzas. nuestros hermanos de all son unos necios por escuchar sus ideas.\n\nSi ayudamos a purificar ese suelo sagrado de su presencia, es posible que el resto de los clanes acudan a ayudarnos en tiempos de necesidad. Nos echas una mano?', '', '', '', '', '', '', 47187),
(67221, 'esES', 'Cabeza para el metal', 'Recoge $1oa de draconio cristalizado en la Veta Fragmento Cenizo.', 'Para usar todo el potencial de la forja del Guardin de la Tierra, antes debes aprender los conceptos bsicos sobre la creacin de la aleacin abrasada de obsidiana. Solo entonces podrs seguir los pasos de los mejores herreros de Neltharion.\n\nTreme una pieza de draconio cristalizado de las profundidades de la Veta Fragmento Cenizo. A cambio, te otorgar el conocimiento que buscas.', '', 'Animado peligrosamente por el poder del draconio de su interior.', 'Duroacero cristalizado', '', '', '', 47187),
(67220, 'esES', '10.0 [DNT] [GAMEPLAY TEST] - [SPAWNTRACKING] (JSS)', '', '', '', '', '', '', '', '', 47187),
(67178, 'esES', 'Ojos blancos, dragn azul', 'Ayuda a Yumodormu a derrotar a Setogosa.', '$PC, puedes ocuparte de que la partida sea lo ms justa posible?\n\nTodos saben que Setogosa manipula las reglas a su capricho.\n\nNo quiero que Yumadormu pierda por sus trampas.', '', '', '', '', '', '', 47187),
(67177, 'esES', 'SE BUSCA: Engullidor', 'Mata a Engullidor y recupera sus cuernos.', 'Si pretendes relacionarte con los colmillarr, haras bien en echar una mano!\n\nHace poco, una criatura a la que llamamos Engullidor ha establecido su guarida por aqu cerca.\n\nParece que otros de su especie estn migrando a esta zona. Es una circunstancia que podemos aprovechar.\n\nMata a Engullidor y treme sus cuernos. Los necesitaremos para crear suministros y ampliar esta avanzada.', '', 'Una bestia enorme lejos de sus terrenos de caza habituales.', 'Engullidor', '', '', '', 47187),
(67175, 'esES', 'Cmo desactivar un barco de juguete explosivo', 'Habla con la madre de Toolk y recupera el barco de juguete.', 'Detesto quitarle un juguete a una nia, pero sera muy til que el Kirin Tor pudiese estudiar cmo absorbi tanta energa Arcana.\n\nUna vez ms..., no quiero ofender a nuestros nuevos aliados colmillarr. Tengo una varita que podra disipar la magia...\n\nHablemos con la madre de Toolk y luego decidiremos qu hacer.', '', '', '', '', '', '', 47187),
(67174, 'esES', 'Deteccin Arcana', 'Investiga los objetos colmillarr en el Punto de Pesca de Khuri para buscar indicios de magia Arcana.', 'Saludos! Me llamo Miva Ojostrella y estoy llevando a cabo investigaciones Arcanas en la zona.\n\nLas Tierras Azures rebosan magia. Parte de ella es benigna..., pero hay otra que puede ser bastante peligrosa.\n\nMe han encargado que me asegure de que no quedan energas Arcanas en las pertenencias de los colmillarr.\n\nTuvimos un incidente en el Campamento de Antonidas en el que una caja de pesca explot de forma espontnea.\n\nTe importara usar mi detector para examinar algunos objetos? Tengo que continuar mi conversacin con Julk.', '', '', '', '', '', '', 47187),
(67173, 'esES', 'Gnolls ladrones', '', '', '', '', '', '', '', '', 47187),
(67167, 'esES', 'Bienvenidos al duelo!', 'Desafa a $1oa dracthyr a una partida de Hearthstone.', 'Ahora que he recuperado el mazo, puedo centrarme en reclutar nuevos socios para mi club. Estaba pensando en hablar con los dracthyr...\n\nAh, $n, esa es otra cosa con la que me puedes ayudar!\n\nVoy a estar un poco ocupado intentando que se apunten otros dragones y tambin quiero contar con los dracthyr.\n\nTe importara hablar con ellos por m? Pero te aviso, muchos de ellos no han jugado nunca.', '', '', '', '', '', '', 47187),
(67154, 'esES', 'Restos entrpicos', 'Recoge $1oa montones de arena vitrificada de criaturas del Mar de Dunas.', 'Cuando una entidad atraviesa las lneas temporales, es posible que se acumulen arenas del tiempo en su cuerpo.\n\nPor lo general, la arena se disipa rpidamente, pero a veces las fluctuaciones entrpicas inherentes a los viajes en el tiempo pueden provocar que la arena se vitrifique. En ese caso, resulta bastante difcil de eliminar. As he estropeado varios pares de zapatos.\n\nLa arena vitrificada puede ser lo bastante poderosa para nuestros propsitos. Lo mejor ser reunir toda lo que podamos.', '', '', '', '', '', '', 47187),
(67143, 'esES', 'Un regalo desde el corazn', 'Fabrica un corazn en botella de calidad |A:Professions-Icon-Quality-Tier3-Small:20:20|a con cualquier profesin de fabricacin.', 'Ahora que hemos reunido la esencia elemental, crees que podras meterla en esta botella?\n\nEs una receta sencilla que puedes elaborar igual que cualquier otra.\n\nSi pierdes o usas todos los componentes de calidad, siempre puedes conseguir ms de los elementales que hay en la Cuenca de los Cornisapos.', '', '', '', '', '', 'Entrgale el regalo a Miguel Brillante, que est en el Vitasagrario Rub.', 47187),
(67142, 'esES', 'Comida de vermis', 'Recoge carne chamuscada por la lava de rondadores de corteza en el Flujo de Ascuas.', 'La defensa de la Ciudadela Obsidiana da mucha hambre, y no sabes cunto comen los dragones. Tenemos que reponer nuestras provisiones.\n\nHay unos gusanos muy sabrosos que recorren el magma bajo la lava endurecida. Puede que no te gusten, pero para un dragn hambriento son una autentica delicia.\n\nLlvate a nuestro sirviente Gulchak y usa esto para dirigirlo hacia las perturbaciones en la lava; el atraer a los gusanos para que puedas recogerlos.', '', '', '', '', '', '', 47187),
(67137, 'esES', 'Equipo profesional', 'Habla con Mahra Doblrbol.', 'Haephesta me ha contado que tambin te dedicas a la artesana.\n\nNos gustara proveerte de equipamiento profesional. Y sin coste alguno. Para eso estn los socios comerciales, sabes?\n\nHabla con nuestra sastra, Mahra Doblrbol, para que te tome las medidas.', '', '', '', '', '', 'Habla con Mahra Doblrbol, que est en el Vitasagrario Rub.', 47187),
(67111, 'esES', 'El aprendiz atribulado', 'Recoge $1oa glndulas de veneno congeladas.', 'Esta misin fue un error desde el principio. Alia Alzasol nos prest su ayuda para impedir que la Llama Hendida se apoderase de un artefacto peligroso. Nuestras pistas sobre este objeto nos han llevado hasta estas ruinas.\n\nPero la Llama Hendida nos derrot y ahora la zona est infestada de araas de hielo. Han envenenado a Alia de gravedad y temo que no dure mucho ms sin un antdoto.\n\nPuedo fabricarlo, pero necesito glndulas de veneno de las araas cercanas. Me da miedo dejarla sola. Me podras traer algunas?', '', '', '', '', '', '', 47187),
(67100, 'esES', 'Un regalo para Miguel', 'Habla con Thomas sobre la calidad, y luego recolecta $2oa espritus gneos cerca de la Cuenca de los Cornisapos para el regalo de Miguel.', 'Podras hacerme un favor, $p?\n\nQuiero conseguir un regalo para mi marido, Miguel.\n\nSignifica mucho para m, pero ltimamente he estado tan ocupado que no he tenido tiempo para hacerle nada.\n\nPuedes ayudarme a hacerle algo de gran calidad?', '', '', '', '', '', '', 47187),
(67099, 'esES', 'Ojos de dragn', 'Habla con Myridian, Zepharion y Evorian en las zonas cercanas.', 'Sabemos que los Djaradin nos atacarn directamente, pero tambin me preocupan los otros peligros. Los que no son tan obvios.\n\nHe enviado a tres dragones para que inspeccionen la zona y busquen cualquier amenaza.\n\nHabla con todos ellos y recoge sus informes para m. Cuando tengas la informacin, vuelve a verme para que podamos prepararnos lo mejor posible contra lo que estn planeando los Djaradin', '', '', '', '', '', '', 47187),
(67096, 'esES', 'El vuelo avanzado del Bosque Fluyente', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67095, 'esES', 'El vuelo del Bosque Fluyente', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67094, 'esES', 'Las drades nunca descansan', 'Ayuda a Thalendra a alimentar a los animales pequeos de Valdrakken.', 'Es maravilloso ver que Valdrakken vuelve a estar tan animada, pero hay muchos que han sufrido tras miles de aos de abandono, como las encantadoras criaturitas de la ciudad. Por desgracia, no hay suficientes drades que cuiden de ellas.\n\nQu te parece si te concedo el ttulo honorario de drade de Valdrakken? Algunos de nuestros amiguitos ms simpticos han pasado demasiado tiempo sin sus aperitivos preferidos. Me ayudas a cuidar de ellos?', '', '', '', '', '', '', 47187),
(67093, 'esES', 'Un santuario anmalo', 'Busca el modo de conseguir la reliquia oculta en el Sagrario Perdido en las Arenas y, despus, devulvesela a Nozdormu en el Trono de los Aspectos, que est en Valdrakken.', 'Mi equipo de investigacin ha localizado un extrao sagrario aqu cerca y hemos podido descifrar algunas escrituras en las afueras. Runas titnicas, para ser exactos. Creemos que hay varios lugares que hacen referencia a Aman\'thul, el Gran Padre y lder de los titanes.\n\nIntentamos investigar ms de cerca, pero creo que hemos activado las defensas del sagrario. Una enorme amalgama de arena nos ha bloqueado el paso y hemos logrado escapar por los pelos.\n\nNo estamos seguros de lo que est protegiendo, pero debe ser importante. Puedes investigar?', '', '', '', '', '', 'Vuelve con Nozdormu a Valdrakken.', 47187),
(67084, 'esES', 'El propsito de la plata', 'Coloca los lingotes de acero titnico ancestral en la forja y termina la tarea encomendada por Tyr.', '<El eco de Tyr se activa ante vuestra presencia>.\n\nY ahora otra tarea, amigos mos.\n\nEchad los lingotes al fuego y activad la forja. Ya he preparado los procedimientos necesarios.\n\nLa escama de plata contiene el esquema. Su propsito se os revelar.', '', '', '', '', '', 'Habla con Alexstrasza en Tyrhold.', 47187),
(67081, 'esES', 'Una infusin de materiales', 'Recupera $1oa lingotes de acero titnico ancestral y derrota al tsunami primigenio en las Salas de Infusin.', '<La imagen de Tyr vuelve a hablar>.\n\nHabis reactivado la forja. La prxima tarea no ser tan sencilla.\n\nEn la escama estn transcritos los esquemas de algo que quiero que forjis. Le he confiado los materiales necesarios para hacerlo a uno de mis vigas, Irideus. Estos materiales tienen un origen especial y quedan pocos en toda la existencia.\n\nBuscad a Irideus en las Salas de Infusin, donde espero que su cuidadosa viga haya mantenido el correcto funcionamiento de la instalacin.', '', '', '', '', '', '', 47187),
(67080, 'esES', 'Suministros de artesano: soluciones alqumicas del dragn', 'Usa la receta de los brebajes de reclamacin para fabricar $1oa botellas de solucin alqumica del dragn para Haephesta, que est en el Vitasagrario Rub.', 'Buscas trabajo, alquimista?\n\nEl Consorcio de Artesana se ha puesto en contacto conmigo y me ha solicitado un \"pedido de fabricacin\" de soluciones alqumicas. Tengo tanta curiosidad como cualquier otro dragonante por estas prcticas comerciales, pero estoy demasiado ocupado.\n\nPodra ser una buena oportunidad para ti, $gaprendiz:aprendiza;. Fabrica algunas soluciones alqumicas a partir de los brebajes anteriores y llvaselas a Haephesta. Est justo al final del camino.', '', '', '', '', '', '', 47187),
(67079, 'esES', 'Una vida dura', 'Recupera el disco de seguridad principal y el disco de seguridad secundario en Tyrhold.', 'La seguridad de la forja es ms estricta que la de cualquier otra zona de Tyrhold. Esto va a ser un desafo para nosotros, $c.\n\nSolo algunas unidades de la ciudadela tienen la capacidad de ignorar la seguridad y, adems, hay protocolos por desbloquear que requieren ms de un cdigo en caso de corrupcin.\n\nSi algunas de estas unidades no permiten su anulacin, debers hacerlo por la fuerza. Ten cuidado, $n.', '', '', '', '', '', '', 47187),
(67078, 'esES', 'ltimas instrucciones', 'Coloca la escama de plata en la forja de Tyrhold.', '<El eco habla con una voz antigua>.\n\nQueridos amigos, os pido perdn por mi repentina marcha.\n\nOs prometo que no os dejar sin ayuda. S que estis en un momento de necesidad, pero, para que este regalo no se use con el fin equivocado, debo pediros algunas tareas.\n\nLa primera es sencilla: reactivad la forja de Tyrhold. La escama de plata es la clave.', '', '', '', '', '', 'Habla con Koranos en Tyrhold.', 47187),
(67077, 'esES', 'Recuerdos del pasado', 'Habla con Nozdormu para presenciar el recuerdo del pasado.', 'Este es el ltimo lugar donde vimos a nuestro amigo Tyr.\n\nNo entendimos los motivos que lo llevaron a marcharse, pero s nos dimos cuenta de que era importante.\n\nAunque nos rompa el corazn, creo que esta chispa nos ha convocado para que podamos presenciar ese momento una vez ms. Con la ayuda de Nozdormu, quiz podamos revivir ese momento y averiguar si Tyr nos dej alguna otra pista.', '', '', '', '', '', '', 47187),
(67076, 'esES', 'La chispa del descubrimiento', 'Investiga la chispa de titn en Tyrhold.', 'Aunque esta chispa tiene un origen peculiar, me resulta familiar. No tengo claro su propsito, pero creo quiz sea el siguiente paso para resolver este misterio.\n\nSguela dondequiera que te gue y tal vez averiges ms sobre su propsito. Mientras, yo ver qu puedo descubrir.', '', '', '', '', '', 'Habla con Kalecgos en Tyrhold.', 47187),
(67075, 'esES', 'La magia interior', 'Extrae la magia oculta de las consolas de Tyrhold para descubrir el misterio de la escama de plata.', 'Qu interesante. Esta ciudadela alberga muchos misterios que, salvo el guardin Tyr, nadie entiende. Si pretendemos averiguar ms, debemos seguir explorando Tyrhold.\n\nCreo que la escama arrojar algo de luz sobre los secretos que esconde este lugar.\n\nNo obstante, existe una complicacin. Los guardianes de Tyrhold siguen siendo... inestables. Es posible que se tomen tus tareas de exploracin como una perturbacin e intenten interferir. Ten este conducto. Te ayudar si te dan problemas.', '', '', '', '', '', '', 47187),
(67074, 'esES', 'La ofrenda de la plata', 'Habla con Alexstrasza para revelar el regalo de Tyr.', 'Poco antes de su muerte, el guardin Tyr nos regal una escama de dragn forjada con la plata ms pura. La guardamos en las cmaras de Valdrakken en nuestra ausencia, pero creo que es hora de compartirla una vez ms.\n\nAunque no tenemos ni idea de cul es el propsito de este recuerdo, siempre ha sido un smbolo de unidad y amistad para nosotros. Como $gverdadero aliado:verdadera aliada; de los dragones que eres, nos gustara compartirla contigo. Habla conmigo cuando ests $glisto:lista;, $n.', '', '', '', '', '', '', 47187),
(67073, 'esES', 'Alba roja', 'Localiza a Alexstrasza.', 'Estamos a un paso de recuperar nuestros poderes... Si Raszageth tiene xito antes de que los recuperemos, las lneas temporales derivarn en un futuro oscuro para todo Azeroth.\n\nNo debemos permitirlo, $n!\n\nRpido, debes encontrar y ayudar a Alexstrasza antes de que todo est perdido!', '', '', '', '', '', '', 47187),
(67067, 'esES', 'Explorar el acechamaz', 'Recoge $1oa tallos de acechamaz salvaje.', 'Hay una chef dragn en Valdrakken? De verdad? Tendr que pedirle que pruebe mi sopa arcoluz! Es una vieja receta familiar.\n\nConozco la planta de la que hablas. Crece cerca de los arroyos de la zona, pero ha causado algunos problemas.\n\nLos tallos de acechamaz parecen ser el alimento natural de alfazaques y pequeas salamandras, que a su vez son la presa preferida de los cornisapos. No tendrs problemas si puedes detectarlos, pero hay algunos que son increblemente sigilosos.\n\nYo en tu lugar tendra cuidado.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festn Rub de Valdrakken.', 47187),
(67066, 'esES', 'Delicias que merecen la pena', 'Consigue un pinopez desviado sabroso.', 'Rumi y Bocado?\n\nUf, ha pasado mucho tiempo. Eso de comer pescado con un dragn y un pato parece el principio de una de las historias que la anciana Poa cuenta a los jovenzuelos. Cmo olvidar algo as!\n\nEl pescado era un pinopez desviado sabroso, muy apreciado entre los colmillarr, No son muy comunes, pero se encuentran cerca de la costa.\n\nPor cierto, que sepas que es temporada de apareamiento del dienteazur. Esos demonios sedientos de sangre te darn un buen mordisco si tocas su tentempi favorito.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festn Rub de Valdrakken.', 47187),
(67065, 'esES', 'Hongos frescos del futuro', 'Hazte con 7 trufitas devastadas por el tiempo en el Futuro Primalista.', 'Una seta deliciosa? Los futuros alternativos no son despensas que saquear para matar el gusanillo.\n\nPero... mentira si dijera que jams he soado con volver a comer los platos de Rumi y Bocado.\n\nVale! Tienes mi permiso para atravesar el portal, aunque te aconsejo que busques a otros para que te lleven.\n\nLos celadores han mencionado en alguna ocasin estas setas oscuras. Al parecer, no se quedan en el mismo sitio mucho tiempo. Interprtalo como quieras.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festn Rub de Valdrakken.', 47187),
(67064, 'esES', 'Una delicia errante', 'Consigue $1oa bulbos de algaerrante titilante.', 'Oh, Rumiastrasza! Yo y las hermanas drades, Celina y Felina, hemos pasado una tarde encantadora cocinando para ella.\n\nEl alga que hemos comido es de una variedad especial llamada algaerrante titilante. Los pecesfranja que hay por toda la costa la devoran; no me sorprendera que te atacaran mientras intentas arrancarles la comida del fondo marino.\n\nDales a los chefs recuerdos de mi parte. Siempre son bienvenidos en nuestro santuario.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festn Rub de Valdrakken.', 47187),
(67063, 'esES', 'Diez mil aos al fuego', 'Recoge $1oa especias de lava picantes.', 'Ehpeciah? Ah, debeh de ehtar con la cocinera dragn. La que lleva un patete en la cabeza.\n\nLoh djaradin recogen un polvo, ehpeciah de lava picanteh de loh elementaleh gneoh de ah. \n\nNo me mireh as! El nombre se lo han puehto elloh, no yo!\n\nBuena suerte ah abajo. Yo que t no ira solo:sola;.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festn Rub de Valdrakken.', 47187),
(67053, 'esES', 'Una oportunidad para la paz', 'Presntate ante los representantes de la Horda.', 'Que la Luz te acompae, $p.\n\nEsta expedicin est bajo la proteccin de la Horda y la Alianza. Nuestras rdenes son claras, dar apoyo a cualquier miembro de la expedicin, independientemente de sus otras lealtades.\n\nLos representantes de la Horda, la seora de la guerra Hacha Macabra y su hija Shuja, montan guardia al otro lado del campamento.\n\nLuch con la seora de la guerra Hacha Macabra contra la Plaga. Es honorable y servir bien a esta expedicin.\n\nOfrcele tu ayuda. Demustrale que la Alianza honra sus promesas.', '', '', '', '', '', 'Habla con la seora de la guerra Breka Hacha Macabra en la Embajada Reposo Alado.', 47187),
(67050, 'esES', 'Congelamiento: causas y sntomas', 'Coloca los ttems para liberar a los cazadores colmillarr atrapados en las Tierras Azures.', 'Elementos vivir en ttems, $r. Liberarlos y destruir el hielo. Liberar tus amigos colmillarr!', '', '', '', '', '', '', 47187),
(67047, 'esES', 'Hay que entrar en calor', 'Recoge $1oa hojas de sagittata muerdescarcha.', 'Creo que la planta que ests buscando tiene un tallo fino y est cubierta de hojas rojas.\n\nSer complicado que no te encuentres con ninguno de esos viles reptadores viles mientras recoges flores. Te aconsejo que los evites, si puedes, y que tengas un arma lista en caso de que no.\n\nY dile a tu amiga dragona que puede compensarme invitndome a una o dos tazas la prxima vez que visite la ciudad.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festn Rub de Valdrakken.', 47187),
(67044, 'esES', 'Historia de un hroe: Yanikk', 'Escucha la historia de Yanikk.', 'Deja que te cuente la historia de Yanikk.', '', '', '', '', '', '', 47187),
(67039, 'esES', 'Un viaje asombroso', 'Encuentra a los animales desaparecidos.', 'Algunas de las mascotas del clan acabaron perdindose en el ltimo viaje entre campamentos. No son animales de caza, as que dudo que puedan cuidarse por s solos ah fuera!\n\nCrees que podras ir a buscarlos? Puede que no sean compaeros de caza, pero siguen siendo miembros importantes del clan.', '', '', '', '', '', '', 47187),
(67036, 'esES', 'La clera del Kirin Tor', 'Usa el acribillador Arcano para ayudar a Khadgar a derrotar a los primalistas.', 'He montado las piezas del dispositivo que has recuperado.\n\nColcalo cerca de Khadgar y salo para rechazar a los Primalistas. \n\nSolo tenemos que aguantar un poco ms hasta que llegue Kalecgos.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(67035, 'esES', 'La preservacin del conocimiento', 'Encuentra $1oa tomos antiguos en los alrededores del Campamento de Antonidas.', 'Saludos, $r. Soy Althanus. Ojal nos hubiramos conocido en circunstancias menos... caticas.\n\nEstbamos ayudando al Kirin Tor a estudiar la historia de este lugar unos instantes antes de que atacaran los Primalistas.\n\nMe temo que an quedan libros por ah que pueden ser destruidos por culpa de este terrorfico ataque.\n\nPor favor, debes recuperarlos! Si se destruyen, la historia de este lugar se perder.', '', '', '', '', '', '', 47187),
(67034, 'esES', 'De viento y agua', 'Recoge componentes en las Fuentes de Dragn Rugientes.', 'Al este hay un gran manantial de dragones donde anidan las guilas salvajes. Las plumas que sueltan siguen conteniendo su magia durante bastante tiempo y se emplean en muchos rituales.\n\nLa zona tambin alberga espritus elementales furiosos, cuyos ncleos tambin son de cierta utilidad.\n\nTreme un poco de todo..., y recuerda que las guilas son sagradas. No aceptar plumas que les hayas arrancado a la fuerza.', '', '', '', '', '', '', 47187),
(67033, 'esES', 'Preparar las defensas', 'Recupera $1oa piezas del acribillador Arcano.', 'Los Primalistas han estado dando caza al Kirin Tor desde que llegamos a las Tierras Azures. Detestan nuestras prcticas de la magia Arcana.\n\nInformar a Kalecgos para que vuelva del Archivo Azur. Mientras tanto debemos contenerlos.\n\nAl parecer, una de nuestras defensas Arcanas principales fue destruida durante su ataque inicial. Treme las piezas y podr reconstruirla.', '', '', '', '', '', '', 47187),
(67032, 'esES', 'El ascenso Vakthros avanzado', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67031, 'esES', 'El ascenso Vakthros', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
