(67012, 'esES', 'Cuando las bestias fluviales vuelen', '', '', '', '', '', '', '', '', 47187),
(67007, 'esES', 'Ayuda en los archivos', 'Habla con Kemora en los archivos de Valdrakken.', '<La letra, ntida y limpia, escrita con un toque elegante, se desvanece rpidamente en la tinta hmeda y manchada del pergamino con un olor que recuerda a una bebida fermentada derramada>.\n\nBUSCADORES DE AVENTURAS, ENTUSIASTAS DE LOS ARCHIVOS...\n\nLos archivos llaman a quienes buscan respuestas, a quienes anhelan descubrir y a quienes desean revelar los secretos del pasado y, quizs, del futuro.\n\nEste llamamiento no es para los dbiles de corazn, ni de flaca voluntad.\n\nSolo deben presentarse aventureros curiosos y valientes.\n\n- Kemora', '', '', '', '', '', '', 47187),
(67006, 'esES', 'Apagar la llama', '', '', '', '', '', '', '', '', 47187),
(67005, 'esES', 'Cmo entrenar a tu protodraco', '', '', '', '', '', '', '', '', 47187),
(67004, 'esES', 'Las cosas buenas van en cajas grandes', 'Encuentra un cofre del Guardin de la Tierra. Si lo traes de vuelta, podremos compartir el botn.', 'Con nuestros esfuerzos, hemos creado todo lo necesario para abrir un cofre del Guardin de la Tierra. Hay varios bajo la ciudadela. Encuentra uno y te recompensar.\n\nHe fabricado unas cadenas que te ayudarn a moverlo. Si me lo traes, podremos compartir sus riquezas.\n\nAunque cuidado al trasladarlo, porque hay ms aventureros buscndolos.', '', '', '', '', '', 'Regresa con el fogonero Volrax con o sin el cofre del Guardin de la Tierra.', 47187),
(67003, 'esES', 'El eslalon avanzado de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67002, 'esES', 'El eslalon de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66998, 'esES', 'Combate el fuego con... agua', 'Mata elementales de lava en la Cueva en Erupcin.', 'En todos los aos que llevo ocupndome de los elementales de lava, nunca los haba visto actuar as! Apenas podemos contenerlos en la cueva.\n\nTienes un momento? Nos ocuparemos de la salida mientras t reduces su nmero ah dentro.\n\nTen, llvate este elemental de agua embotellado.\n\nSiempre llevo unos cuantos cuando me toca cuidar a los elemental de lava. Los enemigos naturales son una distraccin excelente!', '', '', '', '', '', '', 47187),
(66997, 'esES', 'La direccin de la guardera', 'Renete con Vaeros en los jardines de los Estanques de Vida Rub.', 'Cunto me alegro de que Lasztak haya aceptado su vocacin como cuidador de cras! Sobre todo, teniendo en cuenta que a muchos de estos pequeines les estn saliendo los dientes justo ahora.\n\nAdems, ese no es el nico problema que tiene este jardn. Las cras estn bastante ansiosas y los cuidadores, pues... an ms estresados de lo normal.\n\nPor favor, renete conmigo en los jardines de abajo cuando tengas un momento. Tu ayuda nos vendra muy bien!', '', '', '', '', '', '', 47187),
(66987, 'esES', '[DNT] 10.0 Explorers - Ch2 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66972, 'esES', 'El viejo Colmiptreo', 'Acaba con el viejo Colmiptreo cerca del Campamento de Antonidas.', 'Tengo una tarea macabra para ti, $p. No todas las muertes son por gusto. Algunas son actos de bondad.\n\nHay un viejo mamut que merodea por el bosque al este del Campamento de Antonidas. Lo vi de lejos hace un tiempo y an puedo or sus gemidos de vez en cuando. Est claro que est sufriendo.\n\nHa empezado a destrozar la maleza y me preocupa que se convierta en un peligro para los dems.\n\nDaras una alegra a este viejo corazn si ayudaras a descansar un alma tan anciana como la suya. Treme su colmillo para que podamos honrarlo.', '', 'Un mamut dominante anciano que se ha convertido en un peligro para s mismo y para otros.', 'El Viejo Colmiptreo', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66971, 'esES', 'La cara de la muerte', 'Da caza a Faucescarcha al norte de la Cuenca Pelaje Invernal.', 'Dime, alguna vez has visto el rostro de la muerte?\n\n<Nesingwary hace una pausa dramtica>.\n\nQu estoy diciendo? Pues claro que lo has hecho.\n\nA fin de cuentas, la muerte tiene muchas rostros distintos. \n\nDicen los colmillarr de Imbu que uno de esos rostros vive en estas colinas. Hasta pronunciar su nombre es abrir la puerta a una muerte violenta y glida.\n\nFaucescarcha.\n\n<Nesingwary mira a su alrededor con cautela>.\n\nBueno, ahora tienes que cazarlo, por mi bien al menos!', '', 'Un augurio legendario sobre la muerte en el hielo.', 'Faucescarcha', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66970, 'esES', 'Ty\'foon el Ascendido', '', '', '', '', '', '', '', '', 47187),
(66969, 'esES', 'Los clanes de las llanuras', 'Presntate ante la khan Sansok en Maruukai.', 'Mientras esperas a que llegue el emisario, la khan Sansok ha mostrado inters en saber cmo ha ido la reunin de los clanes. Me ha enviado a buscarte para que te renas con ella en el centro de Maruukai para hablar.', '', '', '', '', '', '', 47187),
(66968, 'esES', 'Diezmar la manada', 'Da caza a Yetor cerca del Escudo de Rhonin.', '<Nesingwary hace un gesto hacia el lado del camino>.\n\nVes esas huellas sobre la nieve? \n\nSon de yeti.\n\nAlgo debe de haberlos hecho enfadar para obligarlos a cazar tan cerca del camino. Ve y acaba con el lder de la manada. No queremos que empiecen a atacar a los viajeros desprevenidos!\n\nSi es especialmente agresivo, recoge su cabeza. Eso debera disuadir a los dems.', '', 'Lo nico peor que un yeti grande es un yeti grande con amigos.', 'Yetor', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66964, 'esES', 'Artefactos en las manos equivocadas', 'Encuentra a Alia Alzasol en las Ruinas Perdidas, que estn en las Tierras Azures.', 'Tenemos miles... No, un incalculable nmero de problemas!\n\nAy, no s ni por dnde empezar!\n\nEl Kirin Tor ha descubierto uno de los planes de la Llama Hendida. Van en busca de un artefacto llamado \"Valthrux\".\n\nSu poder es inmenso y tiene... consciencia... El peligro aumenta exponencialmente, dadas las circunstancias.\n\nUna tal Alia Alzasol parti al sur con un par de colmillarr para investigar a la Llama Hendida. Ya debera haber vuelto.\n\nEncuntrala e impide que la Llama Hendida se haga con el artefacto!', '', '', '', '', '', '', 47187),
(66963, 'esES', 'En ruta de entrega', 'Ve al campamento base cercano y dile al catalogador Wulferd que no espere recibir suministros pronto.', 'He intentado decirle a Vevesi que soy capaz de sacar el carromato del barro.\n\nPero no, tena que insistir en usar magia para sacarlo... Y ahora mira lo que ha pasado.\n\n<La transportista Bennet suspira>.\n\nMientras intento que Vevesi entre en razn, te importara subir por la colina hasta el campamento base y decirle al catalogador Wulferd que quiz tenga que pedir otro cajn de suministros para la cmara desde Boralus?', '', '', '', '', '', 'Dale al catalogador Wulferd la mala noticia. Se encuentra en el Campamento Base Dragontina.', 47187),
(66962, 'esES', '[DNT] 10.0 Explorers - Ch1 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66961, 'esES', 'Unirse a la cacera', '', '', '', '', '', '', '', '', 47187),
(66960, 'esES', 'Klozicc el Ascendido', '', '', '', '', '', '', '', '', 47187),
(66958, 'esES', 'Proteger y reunir', 'Da caza al cuernosangre que hay al este de Iskaara.', 'El otro da estuve hablando con unos cazadores de Iskaara y me comentaron que se haban encontrado con una escena bastante espeluznante.\n\nAl parecer, Cuernosangre, un rinoceronte especialmente agresivo, ha estado atacando a los brfalos ms pequeos de la zona.\n\nLos brfalos ya tienen suficiente competencia en las Tierras Azures como para tener que preocuparse de que sus rebaos se vean atacados por un invasor brutal.\n\nTreme su cuerno. Me gustara causar una buena impresin a nuestros amigos colmillarr!', '', 'Una bestia malvada que est diezmando la poblacin de brfalos locales.', 'Cuernosangre', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66957, 'esES', 'Una sombra en el hielo', 'Investiga la cima del glaciar sobre el Campamento de Antonidas.', 'He odo rumores al pasar por el Campamento de Antonidas. Hablaban de que se haba encontrado fauna mutilada por las estepas heladas. En algunos casos no eran ms que charcos de sangre.\n\nSea lo que sea, tiene asustados a los magos y ha acabado con parte de la fauna local.\n\nEcha un vistazo en lo alto del glaciar. Si me gustase apostar, apostara lo que fuera a que ese sera el escondrijo perfecto para cualquier depredador alfa digno de ese nombre.\n\nTreme un trozo suyo para que podamos apaciguar al Kirin Tor.', '', 'Un gigante malicioso que se deleita jugando con su presa.', 'Puoscarcha', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66956, 'esES', 'Cazador de dragones Igordan', '', '', '', '', '', '', '', '', 47187),
(66952, 'esES', 'Trapos de gnolls', 'Recolecta 20 telas usadas por los gnolls de las Islas Dragn para Dothenos del Acuerdo de Valdrakken.', 'Los gnolls son una amenaza constante, siempre estn lanzando asaltos y ataques sangrientos contra las expediciones y los pueblos de las Islas Dragn. Entonces, cmo es que su ropa est tan limpia?\n\nTras enfrentarte a ellos, podras recoger una muestra de la tela que usan para que la pueda analizar?', '', '', '', '', '', '', 47187),
(66950, 'esES', 'Corazn de gigante', 'Recolecta 5 ncleos gigantes de los gigantes monteses, de hielo o fundidos de las Islas Dragn para Temnaayu de los Colmillarr de Iskaara.', 'Se dice que hay gigantes en las Islas Dragn que contienen unas gemas preciosas en su interior. Por lo general no damos caza a las criaturas de las islas para conseguir riquezas, pero estos gigantes nos han dado problemas.\n\nPodramos hacernos con estas gemas mientras eliminamos a esas criaturas tan destructivas.', '', '', '', '', '', '', 47187),
(66948, 'esES', 'La llegada del emisario', 'Infrmate sobre la situacin en los Jardines Esmeralda.', 'Admito que no he salido de los Jardines Esmeralda en toda mi vida y, por eso, nunca haba conocido a un centauro, y mucho menos a un ser mortal del continente.\n\nSin embargo, no estoy aqu por cortesa. Quiero pedir la ayuda de los centauros para proteger nuestra piedra de juramento y nuestras responsabilidades.\n\nMe alegro de que tambin hayas venido a ayudar. Tenemos mucho de lo que hablar.', '', '', '', '', '', '', 47187),
(66947, 'esES', 'El sprint avanzado de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66946, 'esES', 'El sprint de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66944, 'esES', 'Pigmentos de pavo real', 'Recolecta 8 plumas de pavo real de los pavos reales de las Islas Dragn para Gnoklin Bobinavagante de la Expedicin Dragontina.', 'Los pavos reales de las Islas Dragn tienen unas plumas muy coloridas! Seguro que podemos fabricar pigmentos con ellas para que los escribas las usen como tinta.', '', '', '', '', '', '', 47187),
(66943, 'esES', 'Madera para escribir', 'Recolecta 15 pergaminos de corteza de los antrboles en descomposicin de las Islas Dragn para Dothenos del Acuerdo de Valdrakken.', 'Hemos encontrado cierta informacin inusual en nuestros estudios de las Islas Dragn. Por ejemplo, la corteza de los antrboles afectados por la magia de descomposicin acta de forma similar al papiro de pellejo.\n\nEste extrao papiro es capaz de mantener la magia para las inscripciones ms poderosas, lo que resulta muy til. Puedes ayudarnos a reunir algo de esa corteza?', '', '', '', '', '', '', 47187),
(66940, 'esES', 'Experimentos con elixires', 'Recolecta 15 muestras de mucosidad de los grlocs de las Islas Dragn para Dhurrel de los Centauros Maruuk.', 'Hace poco, nuestros alquimistas han investigado varios ingredientes nuevos con los que podramos experimentar. Su ltima fijacin es... interesante, por as decirlo.\n\nParece que la mucosidad de los grlocs tiene propiedades que pueden ser beneficiosas para determinados elixires.', '', '', '', '', '', '', 47187),
(66939, 'esES', 'Cazar al maestro de caza', 'Da caza al maestro de caza Krakle en las inmediaciones del Escudo de Imbu.', 'Uno de los guardias del Campamento Desubicado me ha contado que hay un desgraciado que se dedica a mutilar a la fauna local. Se hace llamar \"maestro de caza\".\n\nUna cosa es la caza, pero no puedo tolerar que se torture a los seres vivos. \n\nAdems, a mi carromato le vendra bien un talismn de la suerte.\n\n<Nesingwary escupe a un lado>.\n\nTreme su zarpa.', '', 'Un gnoll perverso que disfruta torturando a la fauna inocente.', 'Maestro de caza Krakle', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
