(66929, 'esES', 'Hazte con todas... las cartas', 'Recupera el mazo de Yumadormu.', '$PC, te importara ayudarme a recuperar mis cartas?\n\nLe dije a Setogosa que las necesitaba para ensear a otros estudiantes a jugar a Hearthstone. Quiero formar un club, pero no me las devuelve!\n\nSiempre se ha portado fatal conmigo, pero esto ya es pasarse.', '', '', '', '', '', '', 47187),
