(66897, 'esES', 'Combustible para la forja', 'Recolecta 10 ncleos de arrabio de las criaturas de lava de las Islas Dragn para Dhurrel de los Centauros Maruuk.', 'Para hacer las mejores hojas, necesitas el calor que solo un ncleo de arrabio puede proporcionar. Intentamos tener algunos a mano como fuente de combustible para nuestras forjas. ltimamente nos estamos quedando sin ncleos y nos vendra bien reabastecernos.\n\nLos ncleos de arrabio se pueden obtener de la mayora de las criaturas de lava de las Islas Dragn.', '', '', '', '', '', '', 47187),
(66895, 'esES', 'Igual que el viejo jefe', 'Elimina a Vyzos la Profetisa.', 'Los dragonantes rompemundos son muy confiados. Hemos seguido a muchos lderes diferentes durante aos y hemos credo que con todos llegara la Hora del Crepsculo y presenciaramos el regreso de Alamuerte.\n\nSin embargo, Alamuerte no ha regresado, y an no hay ni rastro del Crepsculo.\n\nNecesitamos un nuevo lder. T puedes ayudarnos a conseguir el cambio.', '', 'El ltimo en una larga sucesin de lderes.', 'Vyzos la Beneficiosa', '', '', '', 47187),
(66893, 'esES', 'Venganza picuda', 'Sana a $1oa zancacuernos heridos en los Rpidos Desbordantes.', 'Puede que no sepa nada sobre elementales de agua, pero s sobre zancacuernos!\n\nHe fabricado un ungento que mantendr a los zancos sanos y listos para luchar. Nunca he tenido ocasin de aplicrselo a un zancacuerno real, pero he estudiado todos sus efectos.\n\nEs hora de echarle valor y enjabonarlos!', '', '', '', '', '', '', 47187),
(66892, 'esES', 'El dilema del diluvio', 'Mata a $1oa elementales de agua en los Rpidos Desbordantes.', 'Los elementales estn matando a los zancacuernos! S cmo pelear contra bichos grandes, pero nunca pens que tendra que enfrentarme a un elemental. No se parecen en nada a los enormes bebs de truenagarto...\n\n<Dazakros suspira con angustia>.\n\nPor favor, acaba con unos cuantos de esos elementales. Los zancacuernos son ms listos de lo que creemos. Si tienen los medios, contraatacarn!', '', '', '', '', '', '', 47187),
(66891, 'esES', 'Ceniza explosiva', 'Recolecta 20 de ceniza explosiva de los fnix de las Islas Dragn para Gnoklin Bobinavagante de la Expedicin Dragontina.', 'Los fnix de magma de las Islas Dragn generan una ceniza inusual cuando mueren. Se puede usar para crear algunas mejoras materiales para maquinaria compleja y esencial, aunque probablemente yo la usara para fabricar explosivos.', '', '', '', '', '', '', 47187),
(66890, 'esES', 'Herramientas robadas', 'Recolecta 20 herramientas robadas de los gnolls de las Islas Dragn para Dothenos del Acuerdo de Valdrakken.', 'Los gnolls no dejan de asaltar nuestras caravanas de suministros. Parecen obsesionados por las diversas herramientas de ingeniera que hay en ellas. No podemos arriesgarnos a que esos salvajes descubran nuestra artesana especializada! Adems, los robos han retrasado nuestro calendario de produccin ms de lo que me gustara admitir.\n\nSi recuperas algunas de las partes robadas, podremos ponernos al da.', '', '', '', '', '', '', 47187),
