(66884, 'esES', 'Equipamiento ignfugo', 'Recolecta 10 piezas de equipamiento ignfugo de los Djaradin de las Islas Dragn para Temnaayu de los Colmillarr de Iskaara.', 'Las armaduras de los Djaradin pueden resistir las llamas ms feroces. Una cualidad as sera de gran utilidad para combatir contra ellos!\n\nA ver qu puedes arrebatarles. Podramos estudiarlas y aplicar los mismos encantamientos a nuestras armaduras.', '', '', '', '', '', '', 47187),
