(66879, 'esES', 'Estragos entre los zancacuernos', 'Renete con Dazakros en los Rpidos Desbordantes.', 'Esos Zancacuernos... Tienen un pico que rompe los huesos, patas rpidas para escapar del peligro y estmago para comer cualquier cosa de las islas.\n\nEsta vocacin es la ms fcil! Solo yo y mis pajarracos favoritos, pasando el rato. Y si surge algo, s manejar a todas las alimaas de la isla.\n\nTe importara seguirme hasta las mesetas de zancacuernos del norte? Me vendra bien un par de manos ms mientras me instalo.', '', '', '', '', '', '', 47187),
(66878, 'esES', 'Vuelo avanzado del pantano', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
