(66875, 'esES', 'Conservando el pasado: Academia Algeth\'ar', 'Consigue el sueo fatuo de recuerdos enredados de la directora en la Academia Algeth\'ar.', 'Qu maravilla! La Academia Algeth\'ar vuelve a abrir sus puertas. La directora Doragosa debe de estar encantada de volver a sus clases.\n\nHace mucho que no tengo ocasin de hablar con mi querida amiga. Y si vas y averiguas si est disponible para tomar el t? Tambin ser una buena oportunidad para apuntarte a la academia: tengo entendido que ahora acepta todo tipo de estudiantes.\n\nPens que esto te podra interesar, habida cuenta de lo mucho que vienes a vernos a los archivos y a m.', '', '', '', '', '', '', 47187),
(66874, 'esES', 'Conservando el pasado: Salas de Infusin', 'Consigue el distribuidor hologrfico del tsunami primigenio en las Salas de Infusin.', 'Sabas que en lo ms profundo de Tyrhold hay una instalacin gigante llamada... las Salas de Infusin? Qu misterioso! Qu intrigante! Qu de posibilidades!\n\nEl guardin Tyr ocultaba muchos de sus secretos all. Qu podran ser? No cabe duda de que era el ms brillante de todos los guardianes.\n\n<Kemora parece estar sumida en una ensoacin>.\n\nSin embargo, los Primalistas estn causando estragos. Seguro que provocarn daos a todas las maravillas del guardin Tyr si no se les detiene. Por favor, deshazte de ellos antes de que siembren el caos.', '', '', '', '', '', '', 47187),
(66868, 'esES', 'Conservando el pasado: Legado de Tyr', 'Consigue el bibelot perdido en el tiempo del cronolord Deios, que est en Uldaman.', 'He estado repasando los archivos intentando buscar informacin sobre el guardin Tyr y, sorprendentemente, se ha eliminado toda mencin a Uldaman a excepcin de media pgina que mencionaba algo sobre un secreto oculto en el lugar.\n\nEs fascinante, verdad? Seguro que all escondi otros secretos. Quiz t y algunos de tus amigos podis ir a investigar. Me gustara atesorar cualquier cosa que puedas traerme.', '', '', '', '', '', '', 47187),
(66864, 'esES', 'Recuperacin de reliquias: Hondonada Frondacuero', 'Consigue el fetiche de la descompotriarca Ojoiracundo en la Hondonada Frondacuero.', 'Ah! Necesito tu ayuda. Se dice que los gnolls de la Hondonada Frondacuero usan la descomposicin, una poderosa herramienta en las manos adecuadas.\n\nEs un asunto importante y deberamos estar investigndolo. Ve a la Hondonada y treme un poco de su magia para que pueda... para que podamos ver qu clase de poderes han dominado.\n\nTen cuidado y llvate algunos amigos. Los Frondacuero tienen la habilidad de marchitarte hasta los huesos.\n\nEso sera una lstima.', '', '', '', '', '', '', 47187),
(66860, 'esES', 'Recuperacin de reliquias: Legado de Tyr', 'Consigue el reloj de arenas cambiantes del cronolord Deios, que est en Uldaman.', 'Kemora me ha encargado buscar alguna referencia sobre el guardin Tyr y Uldaman. Tengo montones de recortes de todos los libros que he repasado intentando encontrar lo que busca.\n\nCasi todas las menciones estn desgarradas o destruidas. Menos esta que he... guardado para ensersela ms tarde. Por lo visto, hay algo valioso oculto en Uldaman. Me interesara mucho que me lo trajeras.\n\nEs para ayudar mejor a Kemora con su investigacin, por supuesto.', '', '', '', '', '', '', 47187),
(66848, 'esES', 'Augurios del viento', 'Ayuda a Ohn Seshteng con su ritual.', 'Ohn\'ahra no habla mediante un idioma como nosotros. Su voz se transmite a travs de los mismos vientos. A los msticos nos entrenan para sentir su presencia, seguir su llamada e interpretar sus mensajes.\n\nHe usado los materiales que has reunido para vincular ttems a esta llamada en concreto. Aydame con un ritual para concentrar su voz de modo que pueda interpretar su cancin.', '', '', '', '', '', '', 47187),
(66847, 'esES', 'Cmara de las Encarnaciones: La furia de la Devoradora de Tormentas', 'Entra en la Cmara de las Encarnaciones y derrota a Raszageth.', 'No! Encerramos a las Encarnaciones para salvar el mundo, y ahora Raszageth quiere liberarlas!\n\nNo debemos permitir que lo consiga, $n. Toda la vida en Azeroth corre grave peligro si no la detienes!\n\nDebo regresar con Nozdormu en el Trono de los Aspectos para tomar medidas contra lo que est por llegar. No te preocupes, no me marchar sin dejarte ayuda. Kalecgos y Khadgar se unirn a ti cuando te adentres en la cmara.\n\nBuena suerte, adalid.', '', '', '', '', '', 'Habla con Kalecgos en el Trono de los Aspectos, que est en Valdrakken.', 47187),
(66846, 'esES', 'El corazn de la coleccin', 'Ayuda a la aparicin a crear una nueva carta.', 'El da en el que las Islas Dragn entraron en letargo, deba jugar mi ltima partida. El destino fue cruel y perd mi carta ms poderosa justo antes, as que no pude competir.\n\nLa carta de Guo-Hee era de mi propiedad. No s cmo lleg a manos de sus ancestros.\n\nPor desgracia, no puedo decir que sea ma; lleva en su familia durante generaciones. He cometido una estupidez.\n\nQuiz podamos crear una nueva, t y yo. Una carta nica... S! Me ayudars?\n\nHabla conmigo cuando quieras comenzar.', '', '', '', '', '', '', 47187),
(66845, 'esES', 'Brillo legendario', 'Encuentra el fantasma dracnido y recupera la carta legendaria.', 'Anoche estaba tumbada en mi saco de dormir, dando vueltas, cuando un escalofro antinatural inund la posada.\n\nEn ese momento sali de la nada el fantasma de un dracnido! Atraves mi equipaje y se esfum!\n\nPero lo peor lleg cuando me despert... El fantasma se haba llevado mi carta preferida!\n\nSeras tan amable de ir a buscarlo y recuperar mi carta? Es mi posesin ms preciada.', '', 'Sea cual sea el motivo, siempre hay opciones mejores y ms inteligentes que robar.', 'Una aparicin misteriosa', '', '', '', 47187),
(66844, 'esES', 'El gran Shokhari', 'Mata a la raposa del cielo Shokhari.', 'De todoh loh animaleh que he vihto aqu, Shokhari, la gran raposa del cielo, era la mh orgullosa.\n\nEh una pena que se haya cebao con un chamn gnoll y enloquecido por culpa de la dehcomposicin. Cuando la vi comerse a una de suh crah, supe que algo no iba bien.\n\nMe llev al rehto de lah crah y lah traje aqu, pero Shokhari me atac y me dio pal pelo. Casi no sobrevivo.\n\nHay que acabar con ella. Si la dehcomposicin sigue deteriorando su mente, ser cuehtin de tiempo que venga pa comernoh.', '', 'Este astudraco majestuoso dominaba los bosques en su da, pero ahora ha enloquecido por culpa de la descomposicin.', 'Raposa del cielo Shokhari', '', '', '', 47187),
(66843, 'esES', 'Lukh ya no est', 'Encuentra el paradero de Lukh.', 'Has visto a mi ayudante, Lukh?\n\nEl chaval quera dar una vuelta, pero hace una hora que se fue!\n\nLe tengo dicho que no es seguro y que no debe irse muy lejos, pero es terco como una mula.\n\nNo lo culpo. Los alrededores son bonitos, y a l le gustan mucho las flores.\n\nMe ayudas a encontrarlo? Me necesitan de vuelta con mi carromato en la Atalaya de Tres Cascadas!', '', '', '', '', '', '', 47187),
(66841, 'esES', 'Un fragmento del pasado', 'Recupera el artefacto y llvaselo a Thanessa Florargenta.', 'Te he visto corriendo por todas partes ayudando a la gente. Crees que podras ayudar al viejo Gannar?\n\nHe inspeccionado la zona y hay algo que me ha llamado la atencin. Parece un tiesto antiguo o un jarrn. Est al sur, en el borde de la cascada.\n\nA m no se me da muy bien nadar, pero te dar algo de oro si le llevas lo que descubras a Thanessa Florargenta.', '', '', '', '', '', 'Lleva el artefacto a Thanessa Florargenta.', 47187),
(66840, 'esES', 'Seguridad del agua', 'Llvale tres muestras de agua a Manny Read.', 'Mi mayor responsabilidad es asegurarme de que todo el mundo tenga acceso al agua potable.\n\nDebo garantizar que el campamento es seguro, sobre todo con los gnolls del este y su maldita descomposicin.\n\nNo quiero alarmar a nadie tomando muestras personalmente, pero creo que deberamos asegurarnos.\n\nTreme muestras de las tres cascadas cercanas y te recompensar con generosidad.', '', '', '', '', '', '', 47187),
(66839, 'esES', 'Hora del bebercio!', 'Recolecta bayas de sangre, bayas de cuerno de bronce y flores de hoja de dragn.', 'Los muchachos tenan algo de tiempo libre y ganas de tomarse una pinta, as que nos acercamos a la posada.\n\nPero te lo puedes creer? No les quedaba cerveza! Qu clase de posada no tiene cerveza? Pues una posada de los Goznepetra, claro!\n\nAs que vamos a coger el toro por los cuernos! En el bosque al este hay flores y hierbas que podramos usar para destilar un poco de hidromiel. Te importara ayudarnos y recoger algunas flores? No temas, no te irs con las manos vacas!', '', '', '', '', '', '', 47187),
(66838, 'esES', 'Aqu hace fro', 'Consigue pelambres de oso gruesas de osos melenagruesa.', 'Ser una buena tabernera significa anticiparse a las necesidades de tus huspedes. Por desgracia, no anticip que las noches aqu fueran tan fras. Ay!\n\nMis huspedes van a necesitar mantas, y bien gruesas. Puede que nos sirvan unas pieles de oso.\n\nHe visto unos bien grandotes en el bosque al este de aqu. Te pagar si me traes algunas de sus pieles! \n\nPor favor. Piensa en los aventureros y en sus pies helados...', '', '', '', '', '', '', 47187),
(66837, 'esES', 'Nada para desayunar', 'Consigue carne de vorquin zancador y de brfalo a rayas al sur de la Atalaya de Tres Cascadas.', 'Se supona que mi hermano Valdo iba a pedir ms suministros. Pero ya ha pasado una semana y no ha llegado nada.\n\nNo me sorprende. Seguramente el muy vago se haya tumbado a la bartola! Ahora casi no nos queda comida, y ya tengo bastantes cosas que hacer como para encima salir a cazar! \n\nPodras cazar por nosotros? Al sur de aqu hay vorquin zancadores y brfalos a rayas, cuya carne nos bastara para mantener la cocina abierta hasta que pueda pedir ms suministros.', '', '', '', '', '', '', 47187),
(66836, 'esES', 'Circuito avanzado del Soto Llamanzana', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
