(66834, 'esES', 'Rellen el Erudito', 'Presenta tus ofrendas en la guarida de las ofrendas y presencia cada una de las enseanzas de Rellen.', 'Lleva las ofrendas a la guarida del centro. Podrs presenciar la leyenda de Rellen el Erudito, que estableci el modo de vida de los centauros tal y como lo conocemos.', '', '', '', '', '', '', 47187),
(66833, 'esES', 'Marmonis en apuros', '', '', '', '', '', '', '', '', 47187),
(66831, 'esES', 'El hogar est donde estn las ranas', 'Renete con Keshki en los Estanques de Vida para liberar a las ranas rescatadas.', 'Ranas reunidas, $n! Supongo que se las llevaremos a Akora de todas formas. Estarn a salvo en los Estanques de Vida hasta que los cornisapos se aburran y se marchen.\n\nHum, bueno, al final no llegamos a encontrar nada para animar a Akora. Espero que lo entienda...', '', '', '', '', '', '', 47187),
(66830, 'esES', 'Cornisapos!', 'Usa el tarro de lucirnagas de Keshki para poner a $1oa ranas abusadas a salvo.', 'Los cornisapos me sacan de quicio!\n\n<Keshki, enfadada, da un fuerte pisotn y las gafas se le tuercen>\n\nSon unos abusones enormes y avariciosos! El mero hecho de que el lugar lleve su nombre no significa que puedan invadir la zona y comerse todo lo que sea ms pequeo que ellos!\n\nTen, usa mi tarro de lucirnagas. Es la mejor herramienta de una cuidadora de ranas. Las calma lo suficiente como para recogerlas y alejarlas del peligro.\n\nY si alguno de esos falsarios se interpone en tu camino, no te cortes y dale su merecido!', '', '', '', '', '', '', 47187),
(66828, 'esES', 'Acurrucarse en la cuenca', 'Renete con Keshki en la Cuenca de los Cornisapos.', 'Nunca haba visto a Akora tan disgustada. Por lo general suele estar tan radiante como sus flores, pero esa leyenda significa mucho para ella. Habla de ella sin parar. Mmm...\n\n<Keshki juguetea con sus gafas>.\n\nNo s mucho sobre plantas y no creo que las ranas puedan animar a nadie ms que a m.\n\nAhora bien, al norte hay un lugar tranquilo donde me dedico a meditar, la Cuenca de los Cornisapos. Puede que all encontremos algo que la anime. O, al menos, nos ayudar a planear algo.', '', '', '', '', '', '', 47187),
(66827, 'esES', 'Flores de nuestro trabajo', 'Recoge $1oa piezas de frutadragn madura, $1oa flores de dragn aromticas y $1oa vainas de semilla exuberante por todo el jardn para ofrecrselas al espritu dragn.', 'La leyenda dice que solo la oyen aquellos que demuestran su devocin por la vida.\n\nHe cuidado este jardn durante aos y... creo que mis plantas y yo por fin estamos listas.\n\nComenzar a prepararlo todo junto al estanque. Puedes ayudarme con la cosecha.\n\nRecolecta vainas de semilla de los arbustos, flores de dragn en los campos soleados y frutadragn de los rboles. Puedes tomar prestado mi viejo rastrillo para facilitarte las cosas. Ten cuidado, a veces a la maleza le da por morder!', '', '', '', '', '', '', 47187),
(66825, 'esES', 'La convocavida rub', 'Participa en la ceremonia convocavida en el Vitasagrario Rub.', '$p! Llegas en el momento justo. Estamos a punto de comenzar una ceremonia convocavida y sera un honor contar con tu ayuda.\n\nLa vocacin de un dragauro es algo muy especial. Algunos se convierten en maestros jardineros y otros se ocupan de una fauna particular.\n\nEstos jvenes dragauros han terminado su entrenamiento y estn listos para elegir sus primeras vocaciones. S que estarn encantados de que participes. Cuando lo tengas todo listo, presntales cada uno de los objetos en esta mesa.', '', '', '', '', '', '', 47187),
(66805, 'esES', 'Llaves de lealtad', 'Recoge $1oa llave obsidiana superior.', '', '', '', '', '', '', 'Entrega la llave a Sabellian, que est en la Ciudadela Obsidiana.', 47187),
(66788, 'esES', 'Ovocionados por el futuro', 'Ayuda a la madre Elion a restaurar la zona.', 'Apenas doy crdito! Huevos del Vuelo Negro! Despus de tanto tiempo!\n\nPero mira el estado de este lugar! Esto no sirve! Para estos huevos, cualquier cosa es poco.\n\nEst claro que esos dos cabezotas no han pensado en nosotros mientras rean como cros por el favor de la Protectora! T, en cambio, no dejaras sola a una anciana cuidadora de huevos, verdad?', '', '', '', '', '', '', 47187),
