(66785, 'esES', 'La ltima Cuidadora', 'Habla con la madre Elion.', 'Entiendo tu preocupacin, $c, pero pronto se arreglar todo. Parece que estamos a punto de tener compaa.\n\nNo dudes en quedarte y presenciar lo que ocurre. Ser bastante catrtico.\n\nHabla con nuestra cuidadora de huevos cuando tengas un momento. Sin duda necesitar todo el apoyo posible.', '', '', '', '', '', 'Habla con la madre Elion', 47187),
(66784, 'esES', 'Matar de hambre a la tormenta', 'Mata invocatormentas primalistas para cerrar el portal del corredor de tormentas.', 'Luchas bien para ser alguien que debe mantener el equilibrio con dos piernas!\n\nNo importa lo bien que luchemos si no dejan de llegar refuerzos para los Primalistas. Debemos cerrar ese portal, el corredor de tormentas!\n\nbrete camino hasta la caverna cercana y mata a los invocatormentas primalistas que lo mantienen abierto. Te ayudar en la medida de lo posible.', '', '', '', '', '', '', 47187),
(66783, 'esES', 'Renovacin de votos', 'Ayuda a la khan Sansok, a la khan Tigari, a la khanam Matra Sarest y a Merithra a intercambiar regalos.', 'Hace siglos, hice un juramento de amistad y cooperacin con el primer centauro. Aunque las cosas han cambiado mucho, me parece que es hora de renovar dicho juramento.\n\nSe compuso un recitado para ayudar a las generaciones futuras de centauros a recordar su vnculo con el Vuelo Verde. Hay que responder a cada verso con una ofrenda de los khanes. Espero que los centauros sigan recordando el significado original de la ceremonia.\n\nLa eleccin de la ofrenda es de suma importancia. Elige la ofrenda adecuada y nuestra lealtad quedar vinculada.', '', '', '', '', '', '', 47187),
(66781, 'esES', 'Cuestin de gustos', 'Encuentra una roca en el Rincn del Ballenero para que Mordigan Quijahierro pueda lamerla.', 'Qu falta de respeto!\n\nUn par de grlocs apestosos nos roban el equipo y tenemos que cerrarlo todo... Ja! Llevo lamiendo rocas desde antes de que t fueras un beb! Y no necesitaba cachivaches gnmicos tan sofisticados.\n\nTreme una roca y te lo demostrar!', '', '', '', '', '', 'Vuelve con Mordigan Quijahierro.', 47187),
(66780, 'esES', 'Aspirante al trono', 'Habla con los seguidores de Wrathion.', 'He consagrado mi vida a salvar Azeroth de la destruccin una y otra vez y este necio cree que puede aparecer de la nada y hacerse con el ttulo de Aspecto? Ni hablar.\n\nHabla con mi gente, $n. Veamos que opinan sobre m y sobre lo que he hecho por este mundo.', '', '', '', '', '', '', 47187),
(66779, 'esES', 'Heredero aparente', 'Habla con los seguidores de Sabellian.', 'Como heredero de Neltharion y lder del nico Vuelo superviviente de dragones negros, no esperaba encontrarme una disputa por mi derecho de nacimiento. Y menos contra una cra con aires de grandeza y ms joven que t, mortal.\n\nDicho esto, si necesitas algo ms que estos hechos incontrovertibles, no dudes en hablar con los miembros de mi Vuelo. No tienes por qu aceptar mi palabra en este asunto.', '', '', '', '', '', '', 47187),
