(66737, 'esES', 'Un mejor comienzo', 'Planta $1oa semillas en parcelas de tierra frtil y deja que crezcan.', 'Vaeros es diligente, pero las cras saben cmo crear problemas. Las mas no, claro, pero supongo que no todos los dragones educan a su nidada para comprender la gravedad de su situacin.\n\nAunque no me gusta fomentar el juego al aire libre cuando hay que estudiar, te ayudar a proteger el jardn de forma ms eficiente. Coge estas semillas y plntalas por aqu cerca. Cuando maduran, las flores producen una fragancia que los insectos encuentran desagradable.\n\nLos jardineros pueden ayudarte..., y quiz tambin mis hermanos bronce, si cuidas tus modales.', '', '', '', '', '', '', 47187),
(66735, 'esES', 'Cortar solo las puntas', 'Poda $1oa arbustos cubiertos de maleza.', 'Que las abejas asusten a las cras no es el nico problema. Aunque la polinizacin suele ser algo bueno, el reciente enjambre ha provocado que la flora crezca sin control.\n\nTe importara coger mis tijeras de jardinera y cortar los arbustos? Han empezado a surgir unos azotadores peligrosos, pero creo que podemos evitar que crezcan ms. Ms vale prevenir que curar, ya sabes.\n\nY me vendra bien un poco de prevencin ahora mismo, $n.', '', '', '', '', '', '', 47187),
(66734, 'esES', 'Las mieles de la calma', 'Usa el difusor de humo para calmar y recoger $2oa abejas molestas. Luego libralas cerca del lago.', 'Oh, gracias a la Protectora! Alguien con las manos vacas!\n\nEstos jardines suelen ser un precioso patio de recreo para nuestras cras, pero las abejas se han multiplicado de forma descontrolada. Ahora hay cada vez ms flores... y ms abejas. Las cras estn aterrorizadas, y los dragones, hartos... Ayer mismo picaron a una de las cras y...\n\n<Vaeros respira hondo para centrarse y luego te lanza una mirada suplicante>.\n\nPodras recoger las abejas y llevarlas al lago? Coge este difusor de humo, te ayudar a calmarlas.', '', '', '', '', '', '', 47187),
