(66730, 'esES', 'Autnticos supervivientes', 'Busca al viejo Colmigrima en el lago congelado de las Tierras Azures y habla con l.', 'S que estamos bastante mal, pero no podemos olvidar por qu estamos aqu. Nuestra gente cuenta con nosotros, y no pienso defraudarlos. Tenemos que encontrar un refugio temporal para nosotros en este lugar salvaje, y conozco el lugar idneo.\n\nAhora deja de lloriquear y en marcha.', '', '', '', '', '', 'Busca al viejo Colmigrima en el lago congelado de las Tierras Azures y habla con l.', 47187),
