(66724, 'esES', 'La Escamabrillante', 'Consigue $1oa brillopeces y colcalos en la cesta de ofrenda.', 'Siento que te hayan metido en esto, $gviajero:viajera;. \n\nMi hermano tiende a.. dejarse llevar. Esta no es ms que la ltima de sus locuras. Y me temo que podra acabar con l. \n\nNunca me presta atencin. Quiz ni a ti te har caso.\n\nNuestra antepasada, Kauriq la Escamabrillante, es el centro de su fijacin. Ella s podra conseguirlo.\n\nPor favor, pesca unos brillopeces y trelos aqu. Los usar para comunicarnos con su espritu, que perdura en esta piedra.', '', '', '', '', '', '', 47187),
