(66719, 'esES', 'Un paso atrs', 'Protgete de La llamada.', '$gAmigo mo:Amiga ma;, con gran pesar debo decir que conozco bien la situacin a la que se enfrentan los tuyos en estas ruinas. Si sigues adelante, seguramente tambin sucumbas a su locura.\n\nSea como sea, esa llamada que oyes es puro instinto. En ti habita un anhelo que debe ser saciado.\n\nMe avergenza afirmar que poseo los medios para sanar maldicin. No ser lo mismo, pero funcionar... por ahora.', '', '', '', '', '', '', 47187),
