(66715, 'esES', 'La extraccin', 'Rescata a los colmillarr del Campamento Nievepiel en las Tierras Azures.', 'Ahora mismo, lo ms importante es traer de vuelta a mi gente. De una pieza, a ser posible.\n\nY, por mucho que me duela reconocerlo, no estoy en condiciones de luchar solo.\n\nNos ayudars?', '', '', '', '', '', 'Habla con Muerdefro para obtener ms informacin sobre los cazadores colmillarr.', 47187),
