(66711, 'esES', 'Una exquisitez en la oscuridad', 'Recoge $1oa buccinos de ro para Hadari.', 'Debido a la naturaleza de nuestro clan, algunos recursos escasean. No podemos permitirnos el lujo de reclamar los recursos metlicos de la tierra.\n\nLa difunta khan estableci diversas conexiones comerciales con particulares, y no veo motivos para interrumpir sus servicios.\n\nEn la baha cercana hay unos cubos donde capturamos buccinos. Algunos de nuestros vecinos los consideran un manjar. Treme unos cuantos para que pueda comerciar con ellos.', '', '', '', '', '', '', 47187),
