(66709, 'esES', 'Fundamentos de medicina de campo', 'Ayuda al viejo Colmigrima a recuperarse de sus heridas.', '<Es difcil saber cunto tiempo lleva aqu este colmillarr herido en medio del bosque, pero lo que est claro es que no aguantar mucho sin ayuda>.', '', '', '', '', '', '', 47187),
(66708, 'esES', 'Jinetes en la nieve', 'Encuentra a los cazadores colmillarr desaparecidos en las Tierras Azures.', 'Saludos, $c. La cpula mgica es extraordinaria, verdad? Pero, aunque nos proteja del fro y la naturaleza, no podemos contar con el Kirin Tor toda la vida.\n\nHace unos das, algunos de nuestros cazadores ms veteranos salieron a los bosques en busca de comida y suministros, pero no regresaron. Aunque s que su lder, el viejo Colmigrima, es un montaero y cazador veterano, no puedo evitar preocuparme por l y su grupo de caza.\n\nPodras salir a buscarlos?', '', '', '', '', '', 'Encuentra a los cazadores colmillarr desaparecidos en las Tierras Azures.', 47187),
