(66704, 'esES', 'Mugurlglrlgl!', 'Murglgulglrrglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<No tienes claro lo que est diciendo, pero apuala el aire repetidas veces. Parece que el mrloc quiere que mates algo>.', '', '', '', '', '', '', 47187),
(66703, 'esES', 'Efecto bola de nieve', 'Recupera $1oa ttems Nievepiel de los chamanes Nievepiel en las Tierras Azures.', 'Gnolls Nievepiel listos. Saben guardar comida en hielo, y comida durar ms tiempo. Pero hielo normal no servir. Hielo mgico mejor!\n\nChamanes hacer el trabajo. Ellos dejar a Muerdefro aqu para matarlo de hambre junto a toda esta rica carne de colmillarr.\n\nSi $r quiere ayudar a colmillarr, quedarse sin tiempo.\n\nPero Muerdefro saber cmo romper hechizo.\n\nPor qu Muerdefro ayudar? l tampoco gustar chamanes.', '', '', '', '', '', '', 47187),
(66700, 'esES', 'El enclave negro', 'Devuelve el enclave negro a la telemntica Aerilyn.', 'Es muy tentador, verdad? El enclave era demasiado para la Llama Hendida. Sin embargo, encaja a la perfeccin en mis manos. Qu curioso.\n\n<Adenedal sacude la cabeza>.\n\nO quiz no. Hoy no. Otra vez no. Llvatelo. No me corresponde llevar esta carga.\n\nAdis, $gamigo:amiga;.', '', '', '', '', '', '', 47187),
(66699, 'esES', 'Preguntar a los lugareos', 'Habla con los colmillarr en torno al Campamento de Antonidas.', 'Kalecgos hace bien en pedir consejo a los colmillarr. Posees generaciones de experiencia con esta tierra.\n\nMuchos se paran a descansar de camino a los diferentes campamentos que hay en las tierras.\n\nPregunta por ah! Alguno debe saber ms cosas sobre las lneas Ley locales.', '', '', '', '', '', '', 47187),
(66698, 'esES', 'Contando argales', 'Habla con el pastor Aylaag y devuelve la oveja perdida al clan.', 'Uno de nuestros recursos fundamentales es nuestro rebao de argales. Cada prdida merma la fuerza de nuestro clan.\n\nUnos cuantos argales se han separado y se han alejado del rebao. Nuestros pastores agradeceran toda ayuda posible para recuperarlos.', '', '', '', '', '', '', 47187),
