(66691, 'esES', 'Waking Shores - Race 01 - Intermediate', 'Atraviesa los anillos planeando.', 'Este recorrido tiene un diseo similar al anterior, excepto que sus anillos de control estn dispuestos de una forma ms variada.\n\nSi te atascas, toca el silbato y reiniciar la carrera.', '', '', '', '', '', '', 47187),
(66690, 'esES', 'La Ofensiva Nokhud: El ancestro final', 'Derrota a Balakar Khan y consigue el medalln de los ancestros en la Ofensiva Nokhud.', 'Has demostrado ser $gun aliado:una aliada; con un inters genuino por nuestros valores y modo de vida. Quiero hablarte de un ancestro ms, pero ser peligroso.\n\nMata al traidor Balakar, lder de los Nokhud e hijo de nadie. No se separa de un medalln muy valioso. Tremelo y estar en deuda contigo eternamente.', '', '', '', '', '', '', 47187),
(66689, 'esES', 'Ms que una piedra', 'Muestra los fragmentos tocados por la tormenta a Watu.', '<Los fragmentos son suaves y estn ligeramente calientes al tacto. Unos relmpagos chispean en lo ms profundo de sus ncleos>.\n\n<Quiz Watu o Olekk tengan ms informacin>.\n\n<La idea de separarte de los fragmentos te inspira el impulso de mantenerlos cerca. Para siempre>.', '', '', '', '', '', 'Vuelve con Watu en el Puesto del Pinar.', 47187),
(66688, 'esES', 'Seales del viento', 'Recoge ofrendas de viento y colcalas en el recipiente de ofrendas que hay cerca de la piedra cantarina.', 'Cuando los elementos, los verdaderos primigenios del mundo, desafiaron a los centauros, Himia fue a su encuentro con nuestro don. El viento.\n\nUna piedra cantarina se mantiene firme en las llanuras. All podrs entregar ofrendas de viento para evocar su recuerdo. Estas ofrendas estn por todas partes: las plumas de un ave, las esporas de una planta, los juncos del ro...', '', '', '', '', '', '', 47187),
(66687, 'esES', 'La tierra de los alfas', 'Recoge $1oa telaraas de hilasombra, $2oa garfas de astudraco y $3oa escamas de espinatrueno.', 'Fue Rellen el Erudito quien dio a los centauros las herramientas para sobrevivir en esta tierra inmisericorde. Sus recuerdos requieren ofrendas de bestias dignas.\n\nTen cuidado. No son tan peligrosas como las de eras pasadas, pero siguen siendo los depredadores alfa de las llanuras.', '', '', '', '', '', '', 47187),
(66684, 'esES', 'En pos de tormentas', 'Destruye a los primalistas y la fuente de su magia de tormenta.', '<Watu arranca el fragmento y toma aire>.\n\nPerd completamente el control... Olekk tena razn. Esta terrible magia tiene que ser obra de los Primalistas. Detenlos, por favor!\n\nDebo llevar a mi hermano de vuelta al campamento.', '', '', '', '', '', '', 47187),
(66683, 'esES', 'Anlisis desesperado', 'Pregunta por el fragmento tocado por la tormenta en el Puesto del Pinar.', '<Watu murmura para s con los ojos cerrados y los brazos cruzados>.\n\nDe todas las criaturas, tena que cornearme un ciervo, precisamente. Y ahora solo soy otro desvalido ms. Mi hermano se llevar todo el mrito, cosa que no sorprender a nadie en casa.\n\n<Watu mira hacia arriba> Eh? Qu tienes ah? Piedras resplandecientes? Le echar un vistazo a una de ellas, pero llvale el resto a otro. Soy cazador, no arquelogo. <Watu resopla y mira su pierna>. Quiz esto sea una seal para que cambie de profesin. Anda, ponte en marcha. Has demostrado ser ms til que yo.', '', '', '', '', '', '', 47187),
(66681, 'esES', 'Tempestades abundantes', 'Mata a $1oa bestias tocadas por la tormenta en el Pinar Sabiacresta.', 'Si piensas aventurarte entre los pinos, mata a cualquier animal tocado por la tormenta que veas. No me resulta fcil pedrtelo, pero est claro que estn sufriendo y no hay nada que podamos hacer por ayudarlos. As impediremos que se extienda su agresividad.\n\nSospecho que es obra de los Primalistas. Seguro que el altar que han construido en su puesto de avanzada cercano es la fuente de todos estos problemas. Emanaba una magia extraa.\n\nIr a investigar de nuevo. Si no he vuelto para cuando hayas regresado, Watu podr encargarte otras tareas. Agradecemos cualquier ayuda.', '', '', '', '', '', '', 47187),
(66680, 'esES', 'Contar ovejas', 'Traba amistad con Deseo y usa el silbato de Deseo para salvar a $3oa argales perdidos en el Pinar Sabiacresta.', 'Qu frustrante. Un ciervo rabioso me hizo esto mientras mi hermano Olekk y yo explorbamos.\n\n<Watu seala su pierna ensangrentada y hace una mueca de dolor>.\n\nHas venido a ayudar? Cuando atacaron esos primalistas, nuestro rebao de argales se dispers entre los pinos. La lana y la leche que producen son fundamentales para poner en marcha el campamento.\n\nLlvate este silbato. Puedes usarlo para que Deseo gue a los argales de vuelta a casa. El carnicero Sondo tiene sus golosinas preferidas, por si necesita algn incentivo.', '', '', '', '', '', '', 47187),
(66679, 'esES', 'El circuito del Vitasagrario Rub', 'Atraviesa los anillos planeando.', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66676, 'esES', 'Colndose a escondidas', 'Vuelve con Radiya a los Manantiales Ohn\'iri.', 'Esta es Lizi..., mi amiga secreta. Me he ocupado de ella desde que su madre la rechaz.\n\nEsto no tiene buena pinta. Sea lo que sea lo que le hicieran, escapa a mis conocimientos. Tengo que llevrmela a casa. Mi Ohn me castigar severamente, pero Lizi necesita ayuda. Y agradezco la tuya, $p. Siento haberte dado ms problemas de los que esperabas.\n\nSi todava te quedan ganas para una aventura ms..., podras acompaarme a enfrentarme a la ira de mi Ohn? Renete conmigo en los manantiales!', '', '', '', '', '', 'Vuelve con Radiya a los Manantiales Ohn\'iri.', 47187),
(66675, 'esES', 'Poder de Aspecto', 'Ayuda a Alexstrasza en la piedra de juramento madre.', 'La piedra de juramento madre es un antiguo regalo de los titanes a nuestros Vuelos. Si lo que hemos descubierto es cierto, puede que sea capaz de reactivarla para recuperar nuestros poderes de Aspecto.\n\nAunque no podemos anticipar con certeza el resultado, si hay una nfima posibilidad de que esto funcione, debo intentarlo.\n\n$n, me gustara que me acompaaras mientras lo hago.', '', '', '', '', '', '', 47187),
(66671, 'esES', 'Camino a ninguna parte', 'Renete con Maddy Tirodisperso en el Campamento Desubicado de las Tierras Azures.', 'Tienes pinta de ser muy capaz! Qu te parecera echar una mano a la Expedicin Dragontina?\n\nTenemos un campamento magnfico en medio de la naturaleza.\n\nHay mucho que hacer all si quieres hacer el viaje.\n\nHabla con mi hermana Maddy cuando llegues. Ella te ayudar a instalarte.', '', '', '', '', '', 'Renete con Maddy Tirodisperso en el Campamento Desubicado de las Tierras Azures.', 47187),
(66660, 'esES', 'Preparados, listos...', 'Renete con Andantenormu y Siaszerathel en el pasado.', '<Nozdormu no enfoca la mirada>.\n\nCuanto ms lejos caen, ms rpido viajan. Perforan agujeros en el tejido del tiempo que generan grandes ondas. Tendrs que ser veloz para atraparlas.\n\n<La atencin de Nozdormu se centra en ti>.\n\nEnviar a mis Caminantes del Tiempo para que te ayuden a navegar por las lneas temporales y aceleren tus esfuerzos. No te enzarces con los lugareos ni te detengas hasta que hayas encontrado a Chronormu!\n\nVete. Apenas tenemos tiempo.', '', '', '', '', '', '', 47187),
(66658, 'esES', 'La ofensiva Nokhud: Quien lo encuentra se lo queda', 'Entra en la Ofensiva Nokhud, derrota a Teera y a Maruuk, y coloca sus armas en el kurgan de Teerakai.', 'Se llevaron las armas de Teera y Maruuk antes de que pudiramos detener al invocatumbas Arban. Es posible que nuestros ancestros ms importantes estn luchando de nuevo en estas llanuras... junto a los Nokhud.\n\nVe a la Ofensiva Nokhud. Encuentra a Maruuk y a Teera. Cuando los hayas derrotado, lleva sus armas al tmulo funerario de los Teerakai. Volveremos a otorgarles descanso con el honor que merecen, donde podamos protegerlos ms fcilmente.', '', '', '', '', '', '', 47187),
(66657, 'esES', 'Y no te levantes!', 'Entra en el kurgan principal y derrota al invocatumbas Arban.', 'El invocatumbas Arban se ha atrincherado en el kurgan ms grande, donde yacen los primeros ancestros Maruuk. Detenlo antes de que resucite a Maruuk y a Teera!', '', '', '', '', '', '', 47187),
(66656, 'esES', 'Sueo eterno, sin duda', 'Derrota a cada uno de los espritus de renombre de los centauros y luego usa el ttem de descanso de Zorig para liberarlos.', 'La magia oscura est atenazada a los ancestros. Lucharn antes de seguir. Los Ukhel han resucitado a nuestros guerreros y cazadores ms feroces; no ser fcil detenerlos.\n\nNecesitars mi ayuda. Es hora de que vuelva a usar la lanza de mi madre.\n\nUna vez que los derrotes, usa este ttem que he fabricado para ayudar a los espritus subyugados a encontrar el camino de vuelta a los kurgans.', '', '', '', '', '', '', 47187),
(66655, 'esES', 'Componentes de vivomancia', 'Recolecta $1oa calaveras intactas de compaeros resucitados y $2oa montones de tierra sagrada.', 'Me temo que los espritus no podrn encontrar el camino a sus tumbas aunque los liberemos del yugo de los Ukhel.\n\nLos Ukhel tambin estn resucitando a los compaeros animales de los ancestros, que los guiaron y protegieron en vida.\n\nTreme los crneos de esos animales y la tierra sagrada perturbada por nuestros enemigos. Si combinamos estos componentes, deberamos poder ayudar a los ancestros a encontrar la paz.', '', '', '', '', '', 'Renete con Zorig en lo profundo de los Kurgans Eternos.', 47187),
(66654, 'esES', 'Aniquilacin de profanadores', 'Mata a los profanadores Nokhud y a los agitatumbas Ukhel, y recupera las armas ancestrales que han tomado.', 'Mi madre era una herona. Se merece paz y descanso, no esta... esclavitud! Ninguno de nuestros hroes la merece.\n\nDeben pagar por esto. Nuestros ancestros deben descansar de nuevo con sus armas y honor. Recupera las armas de esos profanadores!', '', '', '', '', '', 'Renete con Zorig en lo profundo de los Kurgans Eternos.', 47187),
(66652, 'esES', 'Volver con la ensalmadora', 'Investiga el ritual Ukhel que se celebra en el tmulo cercano.', 'Desde aqu no veo lo que estn haciendo, pero me temo que estn profanando los kurgans.\n\nVe a la tumba ms cercana e intenta poner fin al ritual que estn llevando a cabo.\n\nSi encuentras algo que nos revele su propsito, tremelo.', '', '', '', '', '', 'Devuelve la lanza a Zorig.', 47187),
(66651, 'esES', 'Algo estn tramando', 'Renete con el iniciado Zorig en los Kurgans Eternos.', 'Los clanes Nokhud y Ukhel se han apoderado de los Kurgans Eternos. Solo pueden tener intenciones malignas. Nuestros ms estimados ancestros estn enterrados all.\n\nEnvi al iniciado Zorig a que investigara, pero an no ha regresado.\n\nEs competente, pero le falta confianza. Aydalo a acabar con sus horribles acciones!', '', '', '', '', '', '', 47187),
(66650, 'esES', 'Desenlace del destino', 'Derrota a $1oa jefes de bandas predestinadas distintos.', '<Ests en calma. La naturaleza de esta experiencia sigue revestida de misterio, pero ya no te resulta desconocida. Ahora, tu maestra sobre estas pruebas es tan clara como la recompensa definitiva>.\n\n<Avanzas con la mente clara y manos firmes una ltima vez. Crea tu propio destino y observa cmo se desvela a tu paso>.', '', '', '', '', '', '', 47187),
(66647, 'esES', 'Desenfoque elemental', 'Recupera el enfoque elemental.', 'Kalecgos y yo estamos sufriendo un duro ataque en los cielos sobre la montaa. Los Primalistas son implacables y su ejrcito no parece tener fin.\n\nA este paso, nos veremos superados por sus tropas.\n\nPero tengo un plan.\n\nEn la base de la montaa hay una orca perturbada llamada Ruvin Machacapiedras. El Kirin Tor ha luchado contra ella muchas veces.\n\nTiene un dispositivo que puede absorber y redirigir las energas elementales.\n\nQutaselo y luego renete conmigo ms adelante.', '', 'Ruvin es el propietario del poderoso enfoque elemental.', 'Ruvin Machacapiedras', '', '', 'Renete con la proyeccin de Khadgar dentro del Coto de Vakthros.', 47187),
(66646, 'esES', 'Reduccin de las causalidades', 'Mata a los elementales de tiempo.', 'El Infinito ha provocado que las energas del tiempo se vuelvan agresivas. Eso no augura nada bueno.\n\nPor favor, mata a cualquier elemental de tiempo que te encuentres mientras echas una mano a la embajadora Chronormu. Yo me quedar aqu y la ayudar a mantener presa a Eternus.', '', '', '', '', '', '', 47187),
(66633, 'esES', 'Las cosas claras', 'Coloca un estandarte de dragn negro en los cadveres de $1oa djaradin.', 'Los Djaradin creen que el Vuelo Negro est acabado. No temen ni respetan la autoridad de Wrathion.\n\nNecesitamos una demostracin que les recuerde que el Vuelo Negro ha vuelto, y que somos ms fuertes que nunca.\n\nMata a esos djaradin y marca cada cadver para que no olviden quin gobierna aqu.', '', '', '', '', '', '', 47187),
(66622, 'esES', 'Las herramientas extraviadas', 'Rescata $1oa herramientas extraviadas.', 'Es terrible! Mis... hip! herramientas parecen haberse ido cuando no estaba mirando. No soporto... hip! la idea de que estn solas por ah. Seguro que estn aterradas!\n\nPodras ir a buscarlas en mi lugar? Ten paciencia, trata de... hip! calmarlas y seguro que te cogen cario.', '', '', '', '', '', '', 47187),
(66612, 'esES', 'El dilema de la cuidadora de cangrejos', 'Mata a $1oa grlocs en el Campamento Gotarrisco.', 'Los cangrejos estn en peligro!\n\nEstos en particular han pasado por una racha bastante mala. Los Primalistas saquearon su anterior hbitat, y luego los traje a esta zona... justo cuando la iban a invadir los grlocs!\n\nPens que estaran a salvo aqu, pero los grlocs no dejan de ensaarse con ellos, y cada vez son menos.\n\nPor favor, derrota a algunos de ellos para que los cangrejos puedan escapar!', '', '', '', '', '', '', 47187),
(66611, 'esES', 'Despejando los cielos', 'Mata $1oa insectos.', 'Oyes eso? Son bichos! Por todas partes. Algunos se estn poniendo enormes.\n\nY si t y tu colega planeador usis esta trmica que hay detrs de m para encargaros de ellos?', '', '', '', '', '', '', 47187),
(66598, 'esES', 'Conocimiento Nocheterna', 'Localiza a la taumaturga de distorsin Delandra en el Campamento de Antonidas, que est en las Tierras Azures.', 'Los smbolos antiguos no son lo mo. Pero...\n\n<Thaelin rebusca en sus pertenencias y acaba sacando un mapa. En la parte superior del pergamino aparece el nombre de Antonidas, garabateado en letras grandes y chapuceras>.\n\nAj! Aqu est!\n\nEs un paseo, pero encontraremos varios usuarios de magia antigua... aqu.\n\n<Seala un punto en el mapa>.\n\nQuiz puedan darnos informacin.', '', '', '', '', '', '', 47187),
(66597, 'esES', 'Esta vieja piedra', 'Inspecciona el monolito antiguo grabado.', 'La piedra que tengo detrs es parte de lo que llamis... tecnologa ancestral, y se encuentra aqu, en las islas.\n\nLa cuestin es que no estamos muy seguros de lo que es en realidad. Resulta desconcertante, la verdad.\n\nHemos enviado un informe a algunos amigos para ver si pueden ayudar. Mientras tanto, trata de averiguar cmo se utiliza.', '', '', '', '', '', '', 47187),
(66596, 'esES', 'Susurros en el viento', 'Habla con el archimago Khadgar en Ventormenta.', 'Hola, $p. Cunto tiempo. Ay, me encantara tener ms tiempo para ponernos al da.\n\nPero vers, acabo de tener una esclarecedora... No, digamos premonitoria..., s, premonitoria, conversacin con un viejo amigo.\n\nA veces una revelacin puede ser ambas cosas, claro.\n\nTengo que contarte todo lo que he descubierto.', '', '', '', '', '', '', 47187),
(66595, 'esES', 'Descubrimiento latente', 'Entrega el mensaje a Thaelin Yunquenegro en la Avanzada Escama Rub, que est en las Orillas del Despertar.', '<No importa cmo ha llegado este curioso papiro a tus bolsas. Lo importante es su contenido>.\n\nMiembros de la Expedicin Dragontina:\n\nSe requiere vuestra ayuda! Os necesitamos cuanto antes en la Avanzada Escama Rub!\n\n<Antes de que se pueda leer la firma, la caligrafa mgica de la nota se disipa en una nube de polvo blanquecino y azulado dejando tras de s un papiro en blanco y un delicioso aroma a flores>.', '', '', '', '', '', '', 47187),
(66589, 'esES', 'Coordinacin expedicionaria', 'Recluta exploradores, artesanos y eruditos por todo Ventormenta para la expedicin a las Islas Dragn.', 'Me llamo Toddy. Dirigir a nuestro grupo de alegres aventureros bajo el estandarte de la Expedicin Dragontina. Luego nos ocuparemos de los detalles. Por ahora, centrmonos en reunir al equipo.\n\nToda expedicin que se precie cuenta con un grupo diverso. Necesitaremos eruditos, artesanos y, cmo no, exploradores.\n\nY bien? A qu esperas? Rene al equipo!', '', '', '', '', '', 'Comunica tu xito a la Toddy Bigotis en el Puerto de Ventormenta.', 47187),
(66586, 'esES', 'Legado de Tyr: secretos del pasado', 'Entra en Uldaman, en las Tierras Inhspitas. Descubre la causa de las perturbaciones.', 'Debemos restaurar el poder de los Aspectos para impedir que Raszageth libere al resto de las Encarnaciones.\n\nNo ser nada fcil. Los titanes guardan silencio, y el guardin Tyr muri hace mucho tiempo.\n\nLa reina Alexstrasza ha elaborado un plan. En las Tierras Inhspitas hay una instalacin titnica llamada Uldaman, y la reina cree que los compaeros de Tyr escondieron all un disco con sus recuerdos.\n \nLleva a tus aliados a Uldaman y consigue el disco para la reina de dragones. Esperemos que se pueda usar el conocimiento de Tyr para devolver el poder a los Aspectos.', '', '', '', '', '', '', 47187),
(66582, 'esES', 'Adquisicin de poder', 'Rene energa con el recipiente para la taumaturga de distorsin Delandra en el Campamento de Antonidas.', 'En circunstancias normales, la captura de energa no supone un problema. No obstante, la que queremos conseguir es inmensa e inestable. Este recipiente encantado debera servir para transportarla de forma segura.\n\nAl suroeste hay una regin llena de criaturas rebosantes de una energa anmala, poderosa pero inestable.\n\nHazte con ella y vuelve conmigo. Despus puede que emprendamos el resto de este viaje.', '', '', '', '', '', '', 47187),
(66578, 'esES', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'esES', 'La invitacin de los Aspectos', 'Habla con Wrathion para averiguar ms cosas sobre la reunin del consejo.', 'Ah, $p. Justo a tiempo!\n\nAcabo de reunirme con el lord comandante Turalyon y sus aliados: han aceptado la invitacin de los Aspectos para ir a las Islas Dragn.\n\nEntiendo que nos acompaars, no? Esto no sera lo mismo sin ti!\n\nSupongo que te habrs dado cuenta de que hay algunas nuevas caras por aqu. Los de las alas son dracthyr. Me conocen desde hace poco, pero ya sienten una gran admiracin por m.\n\nAh, y mis modales? Deberamos charlar un momento.', '', '', '', '', '', '', 47187),
(66575, 'esES', 'Objeto como asignador de misin: vial', 'Entrega el objeto a la oteadora Alvi.', '<El extrao vial que se esconde entre los cachivaches del alijo de los tarasek parece estar repleto de un fluido viscoso y burbujeante>.\n\n<Sera aconsejable mostrrselo a Alvi>.', '', '', '', '', '', '', 47187),
(66559, 'esES', 'De vuelta al campamento', 'Vuelve con el examinador Rowe, que est en el Rincn del Ballenero.', 'Vi a Mordigan salir corriendo como un enano posedo. Ir tras l y me asegurar de que vuelva con los dems de una pieza.\n\nSi te enganchas al acantilado y saltas por las cataratas, no despertars ms grlocs.\n\nNos vemos en el campamento.', '', '', '', '', '', '', 47187),
(66558, 'esES', 'Rowie', 'Encuentra a Rowie.', 'T fuiste quien volvi con el resto de Frondacuero, no? Entonces quiz ya sepas lo que le ocurri a Kaqiata...\n\nRowie, su hijo, lleva angustiado desde que Brena y los dems volvieron sin ella. Me quedar aqu por si vuelve, pero podras ir buscarlo? \n\nCreo que se ha ido hacia la cueva de hielo del este. Dijo algo de que iba a luchar contra los yetis que hay en ella!', '', '', '', '', '', '', 47187),
(66557, 'esES', 'Conocidos acuadmicos', 'Busca a otro experto en lenguas frbolgs en el Campamento Desubicado.', 'S, el dialecto del frbolg de los Pelaje Invernal es realmente complicado incluso para m.\n\nTengo algunos colegas en el Campamento Desubicado que podran ayudar. He odo que hay otras tribus frbolgs en la zona, y comparando notas con sus dialectos, puede que consigamos algo por donde empezar.', '', '', '', '', '', '', 47187),
(66556, 'esES', 'Acento grotesco', 'Investiga la cueva.', 'Bueno, tienes un acento atroz, y diez mil aos de aislamiento y deriva lingstica nos han hecho un flaco favor, pero, al menos, creo que tengo una ligera idea.\n\nEl hilo general de lo que intentaban decir era algo sobre un \"viento de la cueva mala\" o una \"cueva de la tormenta malvada\". O eso, o que hacen la colada los jueves...\n\nMira, esto no es como aprender gnmico; habr algunos contratiempos. Ahora bien, estoy bastante seguro de que en la cueva hay algo, as que empecemos por ah.', '', '', '', '', '', '', 47187),
(66555, 'esES', 'Ten paciencia conmigo', 'Colabora en la traduccin de Sonova.', 'S, parece que se ha liado all, como si hubiera pasado una tormenta y hubiera arrasado con todo. Entiendo por qu han tomado las armas, pero por qu nos atacan?\n\nEsto sera mucho ms fcil si pudiramos discutirlo, pero los Pelaje Invernal son muy hermticos y no parece que hablen ninguno de los dialectos comunes del frbolg. O era furbligo? Bueno, ya me entiendes.\n\nSupongo que no habrs hablado con nadie mientras les estabas echando un vistazo, verdad?', '', '', '', '', '', '', 47187),
(66554, 'esES', 'Autodefensa agresiva', 'Derrota a $1oa frbolgs Pelaje Invernal.', 'Con los Pelaje Invernal tan alterados, no creo que les guste que andes por ah.\n\nNo tengas miedo de defenderte si hacen algo; quiz entren en razn si les haces entender que vas en serio.\n\nIntenta no matar a nadie, vale? S cmo pueden ser los aventureros.', '', '', '', '', '', '', 47187),
(66553, 'esES', 'Cuenca bajo lupa', 'Descubre $1oa pistas en la Cuenca Pelaje Invernal.', 'Los Pelaje Invernal son un caso especial entre los frbolgs.\n\nDira que son un poco \"aislacionistas\". Su pelaje les ayuda a camuflarse perfectamente con la nieve.\n\nAntes eran bastante reservados, pero ahora son totalmente agresivos. Atacaron nuestro campamento sin que los provocsemos!\n\nAlgo ha debido de empujarlos a hacerlo. No puedo preguntarles lo que ha pasado..., pero quizs t puedas encontrar alguna pista en su poblado.', '', '', '', '', '', '', 47187),
(66550, 'esES', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'esES', 'Rally de las Orillas del Despertar', '', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66534, 'esES', 'De permiso', 'Explora Orgrimmar.', 'Parece que nuestra llegada se ha hecho notar. Puede que an haya esperanza para esta gente.\n\nMe reunir con Ebyssian y los lderes de la Horda para calmar la situacin. Ests en misin de reconocimiento.\n\nAverigua qu ofrece este lugar. Al fin y al cabo, puede que pasemos aqu un tiempo.\n\nVen a buscarnos cuando hayas terminado. Espero que para entonces ya hayamos zanjado todos los temas aburridos.', '', '', '', '', '', '', 47187),
(66529, 'esES', 'Mil palabras', 'Fotografa a Derviche cerca del esqueleto de protodragn.', 'Con todo lo que hemos aprendido aqu, no puedo irme sin un recuerdo. \n\nSeras tan amable de hacerme una foto junto a estos fsiles de protodragn?', '', '', '', '', '', '', 47187),
(66528, 'esES', 'Rey sin corona', 'Investiga el esqueleto de protodragn.', 'Este protodragn anciano debe haber sido una criatura gloriosa cuando estaba vivo; tal vez la ms grande que se haya visto en la Reserva Agreste.\n\nPero no fue suficiente. Observa el esqueleto ms de cerca para que podamos conocer que ocurri durante sus ltimos momentos.', '', '', '', '', '', '', 47187),
(66527, 'esES', 'Protografa profesional', 'Usa el aparato de mejora vertical y fotografa al protodragn durmiente.', 'Nunca haba entrenado a nadie con tanto talento para la fotografa como t... que siga con vida, claro. Es una profesin peligrosa.\n\nY hablando de peligro, nuestro objetivo final es un enorme protodragn que creemos que puede ser uno de los prximos depredadores alfa de la reserva. Acerqumonos y hagmosle una foto!', '', '', '', '', '', '', 47187),
(66526, 'esES', 'Proteger lo salvaje', 'Libera a 5 protocras capturadas o protodracos capturados.', 'La Reserva Agreste es una de las pocas zonas en las que prosperan los protodragones. Pero los Primalistas estn perturbando sus nidos para capturarlos y experimentar con los protodracos y las protocras.\n\nNo tengas piedad. Localiza a los cazadores furtivos primalistas, acaba con ellos y libera a sus presas. El futuro de los protodragones depende de ello.', '', '', '', '', '', '', 47187),
(66525, 'esES', 'Protografa competitiva', 'Fotografa un huevo de protodragn imbuido y un protodraco imbuido.', 'Bueno, ahora que ya te has curtido con fotos de principiante, qu te parece si pasamos a algo con ms chicha?\n\nHe visto a un hermoso protodraco volando por ah detrs, con unos cuernos preciosos y unas escamas que crepitan con electricidad... Seguramente sea obra de los Primalistas, pero el arte sigue siendo arte!\n\nA ver si puedes conseguir una foto de ese protodraco y de algunos de sus huevos. Puede que tengas que trepar un poco para conseguir la imagen perfecta!', '', '', '', '', '', '', 47187),
(66524, 'esES', 'Protografa de aficionados', 'Saca fotos de protodragones.', 'As que quieres seguir los pasos de un catalogador tan increble como yo, eh? Pues has venido al lugar adecuado!\n\nLa Reserva Agreste est repleta de conocimientos que esperan ser encontrados y archivados! Y cmo lo hago? Pues con mi Catalogador 3000 Edicin Islas Dragn, ahora con captura de movimientos mejorada!\n\nPara aprender a usarlo, haz fotos a un huevo de protodragn, a un vstago que est aprendiendo a volar y a un protodraco mientras caza. Luego renete conmigo en el esqueleto del protodragn anciano que hay al oeste de aqu, y yo evaluar lo que me traigas.', '', '', '', '', '', '', 47187),
(66523, 'esES', 'Cuidar la forja', 'Rene componentes para la forja recogiendo pellejos de cornisapo, bellotas brasales latentes y ncleos de particin en torno al Campamento de Antonidas.', 'Si buscas un instructor, siento decirte que... Ah, no eres $gun:una; aprendiz! Mis disculpas. Permite que me presente.\n\nSoy la custodia Vernagos y formo parte de los custodios que hay en estas ruinas. En concreto, ha recado sobre mis cansados hombros la tarea de devolver su antigua gloria a este espacio de trabajo.\n\nPodras echarme una mano? Todos los componentes que necesito estn por aqu: ncleos elementales de hielo, bellotas brasales, cuero de cornisapo...\n\nMateriales bastante corrientes y fciles de conseguir. Qu me dices?', '', '', '', '', '', 'Vuelve con la custodia Vernagos, que est en el Campamento de Antonidas.', 47187),
(66517, 'esES', 'Una nueva fuente de armas', 'Consigue 25 armas dracthyr intactas de miembros de la Llama Hendida de las Islas Dragn para Dhurrel de los Centauros Maruuk.', 'La Llama Hendida suponen una gran amenaza para nuestras fronteras, y sus armas son de lo ms preocupante. Consigue cuantas puedas para que podamos estudiar sus debilidades e incluso utilizarlas para defendernos.\n\nTengo fe en ti. Si realizas esta tarea para nosotros, te ensear algunos secretos de nuestra herrera.', '', '', '', '', '', '', 47187),
(66516, 'esES', 'Gemas normales? Mejor no!', 'Rene 25 gemas \"normales\" de los Djaradin de las Islas Dragn para Gnoklin Bobinavagante de la Expedicin Dragontina.', 'Qu desperdicio. Los djaradin de estas tierras usan poderosas gemas como mero adorno Como simples joyas! Y eso que tienen infinidad de aplicaciones: telescopios, espejos, indicadores de enfoque... Por no mencionar la mirada de propiedades mgicas que poseen.\n\nDebemos rectificar esta situacin. Qutales las gemas a los djaradin y tremelas, me asegurar de que se les d mejor uso. Pero ten cuidado, los djaradin son guerreros feroces.', '', '', '', '', '', '', 47187),
(66513, 'esES', 'De permiso', 'Explora Ventormenta.', 'Si esta ciudad va a ser nuestro nuevo hogar, quiz debamos conocerla mejor. Una misin de exploracin, por as decirlo.\n\nVe a ver qu ofrece este lugar. Yo seguir a Wrathion e intentar ayudar en lo que pueda.\n\nIntenta no molestar a los lugareos ms de lo necesario. Dudo que muchos de ellos estn acostumbrados a ver dragones caminando por sus calles.\n\nRenete con nosotros cuando te hayas familiarizado con el terreno.', '', '', '', '', '', '', 47187),
(66511, 'esES', 'Mucho renombre con los Colmillarr de Iskaara', 'Habla con Murik en Iskaara.', 'Sigues demostrndonos que eres parte fundamental de nuestra comunidad.\n\nPara honrar ese vnculo, ven a verme en Iskaara. He preparado una mochila con suministros que te sern de ayuda.', '', '', '', '', '', '', 47187),
(66509, 'esES', 'Paranoico 1', '', 'Agura me ha enviado aqu para recoger FLORES para mi ANSIEDAD, pero hay CRIATURAS y tengo mucho miedo.', '', '', '', '', '', '', 47187),
(66504, 'esES', 'Un fragmento de man cristalizado', 'Llvale el cristal a Lathos.', '<El pequeo cristal azul vibra ligeramente al tocarlo y, a continuacin, produce una meloda sorda que suena como una cancin lejana. Puedes or en tu cabeza las palabras que resuenan como una suave meloda>.\n\nPuede que a Lathos le parezca interesante.', '', '', '', '', '', 'Llvale el cristal a Lathos.', 47187),
(66503, 'esES', 'Por el amor de otros', 'Investiga lo alto de la torre en ruinas del Campamento de Antonidas.', 'Ah, veo que mis aprendices te han enredado en sus jueguecitos. \n\n<Noriko se re>.\n\nParece que os habis encontrado con algo. El propsito de estas ruinas se nos revela poco a poco y guardan algo ms que canciones e imgenes borrosas...\n\nAlgo clama desde lo alto de esta torre.\n\nVeo la intriga en tus ojos. Ve. Tienes mi permiso.\n\nDime qu es lo que ves.', '', '', '', '', '', 'Vuelve con Noriko, que est en el Campamento de Antonidas.', 47187),
(66500, 'esES', 'Formas de ver', 'Encuentra imgenes antiguas en el Campamento de Antonidas.', 'No estamos haciendo nada! Nada en absoluto!\n\nEspera un segundo...\n\nPareces $gun:una; $r importante... Te cuento un secreto?\n\nResulta que en estas rutinas hay arte mgico, y nosotros podemos verlo!\n\n<Sidrcido saca pecho con orgullo>.\n\nPuedo ensearte a verlo. Pero... no se lo digas a Noriko an.', '', '', '', '', '', '', 47187),
(66493, 'esES', 'Enviadlo!', 'Lanza paquetes a los aprendices del Kirin Tor en el Campamento de Antonidas.', '<Oyes un murmullo sordo que procede del otro lado del portal>.\n\nEh! Eh, t!\n\nTengo correo para nuestros aprendices: botiquines, regalos y ms cosas que han pedido por correo mgico.\n\nTodo de lo ms normal, la verdad.\n\nTe importara hacerme un favor y entregarlos?', '', '', '', '', '', '', 47187),
(66489, 'esES', 'Preparar la defensa', 'Potencia a los defensores azur en el Campamento de Antonidas.', 'El custodio Cynegos y yo estbamos hablando del impacto que ha tenido el ataque primalista en los planes de asaltar la Galera Cobalto, y se me ha ocurrido una idea. \n\n<Celeste saca una varita de los pliegues de su toga>.\n\nCoge mi varita y potencia sus armas!\n\nUn poquito de fuego debera servir...', '', '', '', '', '', '', 47187),
(66488, 'esES', 'SE BUSCA: Frigellus', 'Mata a Frigellus cerca del Campamento de Antonidas.', '<La escritura de la hoja despide una suave luz azul>.\n\nEl elemental Frigellus, en su momento un juguete muy querido de Malygos, acab sufriendo el abandono de su amo.\n\nMientras este asentamiento, antao rebosante de felicidad, se desmoronaba, la malhumorada y traviesa criatura se fue deformando y retorciendo por los males que asolan esta tierra.\n\nPor favor, asegrate de neutralizarlo.\n\nY cuando lo consigas, informa de ello al custodio Cynegos.', '', '', 'Frigellus', '', '', '', 47187),
(66484, 'esES', 'Conoce a tu enemigo: protodragones', 'Caza varios protodragones alrededor de la Fronda de la Cspide.', 'La zona est repleta de bestias poderosas. Por suerte, la mira de reconocimiento te ha permitido detectar varios puntos dbiles en sus duras escamas. Tambin puedes idear diferentes trucos para evitar sus colmillos y sus afiladas garras.', '', '', '', '', '', '', 47187),
(66482, 'esES', 'A la caza del trofeo: Fauceterra', '', '[PH] Get rid of that annoying flying lizard!', '', '', 'Fauceterra', '', '', '', 47187),
(66473, 'esES', 'La tierra despierta', 'Derrota a la clera primigenia y a la lluvia primordial en el Mirador Gelikyr.', 'Los monstruos de esta cueva son demasiado peligrosos para m.\n\n<Sharnax tose con dificultad>.\n\nHe visto de lo que eres capaz.\n\nNecesito que mates a esos elementales antes de que alcancen todo su potencial. No podemos permitir que los Primalistas se hagan con el control de Tyrhold!', '', '', '', '', '', '', 47187),
(66472, 'esES', 'Lista primigenia', 'Lleva el fardo de rdenes primalistas al comandante Thadezus, que est en el puente del Mirador Gelikyr.', 'Los portales cerrados, los elementales asesinados y los Primalistas detenidos... por ahora.\n\n<Sharnax se re>.\n\nHay algo que no podamos hacer, $c? Supongo que solo el tiempo lo dir.\n\nEntrgale los planes al comandante. Seguro que se alegrar de saber que hemos tenido xito.', '', '', '', '', '', 'Habla con el comandante Thadezus en el puente del Mirador Gelikyr.', 47187),
(66471, 'esES', 'Planificacin de primera', 'Recoge $1oa rdenes primalistas de los primalistas cercanos que hay en el bancal superior del Mirador Gelikyr.', 'El comandante me orden establecer una base avanzada y acabar con cualquier resistencia. Cuando acab con todos, me di cuenta de algo.\n\n<Sharnax suelta un largo suspiro>.\n\nLos primalistas estaban hablando sobre Tyrhold.\n\nA menos que seas excepcionalmente hbil con los interrogatorios, necesito que descubras sus planes.', '', '', '', '', '', 'Renete con Sharnax fuera de la cueva del Mirador Gelikyr.', 47187),
(66470, 'esES', 'Un empujn ms', 'Consigue piedras de portal tocadas por la bruma, terrneas y creadas del hielo. Despus, cierra $7oa portales elementales.', '<Sharnax se rasca la barbilla>.\n\nEl comandante tena razn. Los Primalistas estn trayendo refuerzos desde los planos elementales.\n\n<Sharnax sonre>.\n\nSera una pena que les ocurriera algo a sus portales, $c.', '', '', '', '', '', 'Renete con Sharnax fuera de la cueva del Mirador Gelikyr.', 47187),
(66468, 'esES', 'Lo que una vez fue nuestro', 'Derrota a los Primalistas que ocupan el Mirador Gelikyr.', '<Thadezus resopla al ver que te acercas>.\n\nVas a pasar a la accin o vas a apartarte, $c?\n\nHe perdido muchos soldados buenos a manos de esos primalistas que se encuentran ms adelante.\n\nCreemos saber cules son sus planes, pero antes debemos echar al enemigo y rescatar a los que estaban bajo mis rdenes.', '', '', '', '', '', 'Habla con Sharnax en el Mirador Gelikyr.', 47187),
(66467, 'esES', 'El arte imita a la vida', 'Mata al chorronocivo superior.', 'La ltima vez que estuve en esta cueva, bosquej una flor enorme que goteaba una savia vil y viscosa. Es uno de mis mejores dibujos, no podra olvidarlo aunque quisiera.\n\nEsa savia es lo que cubre las lanzas de los tarasek, no cabe duda. Deben de haber empezado a recolectarla para envenenar sus armas.\n\nLa planta es hermosa, y sera una pena matarla, pero no podemos permitir que los tarasek sigan recolectando su savia. $n, deshazte de ella y pon fin a todo este desastre.', '', '', 'Chorronocivo superior', '', '', '', 47187),
(66465, 'esES', 'Alijo y liberacin', 'Destruye $1oa alijos de lanzas envenenadas.', 'Incluso sin lder, es improbable que los tarasek dejen de usar sus lanzas envenenadas tan solo porque se lo pidamos educadamente. No puedo arriesgarme a que se use una de estas armas en viajeros desprevenidos.\n\nHay que destruirlas todas. Si no has visto ninguna en los alijos de los estanques, seguramente los Dientebrasa guarden las lanzas ms cerca de la fuente.\n\nNo habr ms heridos por culpa de mi descuido. Entra en la cueva y destruye cualquier alijo de armas que encuentres.', '', '', '', '', '', '', 47187),
(66464, 'esES', 'El Campo de Ferocidad: la maestra de la caza!', 'Derrota a la maestra de caza Amaa.', 'Lo conseguihteis. Tuh colegah y t habih llegado a lo mh alto: un combate contra la campeona, la maehtra de caza Amaa. No oh deih palmaditah en la ehpalda an. Eh implacable. Ha sido un placer conoceros.\n\nCuando oh mate, puedo quedarme con vuestrah cosah?', '', '', '', '', '', '', 47187),
(66463, 'esES', 'El Campo de Ferocidad: ronda de venganza elemental!', 'Derrota al campen primalista.', 'Ha habido un cambio de participantes a ltima hora. Un pez gordo de los Primalistas quiere unirse a la competicin y enfrentarse a ti. Y quin soy yo para decirle que no a un dragn elemental enfadado?\n\nSeguro que todo sale bien. Y si no, pues... Has firmado el consentimiento, verdad?', '', '', '', '', '', '', 47187),
(66462, 'esES', 'El Campo de Ferocidad: perdido en el Sueo!', 'Derrota a Sherath y Taresh.', 'La verdad es que, para estar en las Islas Dragn, tampoco es que haya visto muchos dragones. Pero aqu tenemos a un do de dragonantes que solicitaron unirse a la competicin juntos.\n\nParece que se mueren de ganas por demostrar lo que valen, as que buena suerte!', '', '', '', '', '', '', 47187),
(66461, 'esES', 'El Campo de Ferocidad: un enemigo desde el volcn!', 'Derrota a Ceeqa el Tomatreguas.', 'Uno de los primeros voluntarios en apuntarse a esta competicin viene de las Orillas del Despertar. Un djaradin grandulln, no tan furioso como suelen ser.\n\nParece disfrutar de este deporte. Y mira, me conformo con eso.', '', '', '', '', '', '', 47187),
(66460, 'esES', 'El Campo de Ferocidad: el Seor de la Descomposicin!', 'Derrota a Podrenoche.', 'Intent conseguir uno de esos asquerosos gnolls para esta competicin. Pero, por desgracia, ninguno de mis socios sabe cmo hablar con ellos.\n\nAunque s que hemos conseguido atrapar a una de sus extraar creaciones. Servir como oponente! Avsame cuando quieras empezar la segunda ronda!', '', '', '', '', '', '', 47187),
(66459, 'esES', 'El Campo de Ferocidad: el Terror del Pantano!', 'Derrota a Maneet.', 'Sean todos bienvenidos a los Campos de la Ferocidad!\n\nAunque este campo de entrenamiento se usa para eventos ms tradicionales, los centauros me han permitido amablemente instalarme una temporada. Dicen que pone a prueba su fuerza y que es un acto honorable.\n\nQuieres llevarte a casa el ttulo de $gcampen:campeona;? Pues avsame cuando quieras unirte a la competicin.', '', '', '', '', '', '', 47187),
(66458, 'esES', 'Legado de Tyr: secretos del pasado', 'Entra en Uldaman: Legado de Tyr, que est en las Tierras Inhspitas, y recupera el disco.', 'Debemos restaurar el poder de los Aspectos para impedir que Raszageth libere al resto de Encarnaciones.\n\nPor desgracia, los titanes estn bastante preocupados y el guardin Tyr muri hace mucho tiempo.\n\nLa reina Alexstrasza ha propuesto un plan. En lo profundo de las Tierras Inhspitas hay una instalacin titnica llamada Uldaman. Al parecer, es posible que los aliados de Tyr hayan escondido all un disco con sus recuerdos.\n \nDicen que los troggs han invadido el lugar. Rene a tus aliados, dirgete a Uldaman y consigue el disco en nombre de la reina de dragones!', '', '', '', '', '', '', 47187),
(66457, 'esES', 'El final del periodo azul', 'Mata a Escamazul.', 'Los Dientebrasa siguen a una criatura descomunal que he empezado a llamar Escamazul. Siempre ha sido agresivo, pero hasta ahora mantena a su grupo de carroeros alejados de los caminos principales. Por supuesto que eran territoriales, pero hostiles? Hasta ahora no.\n\nEscamazul debe ser responsable de esta escalada repentina. Encuntralo y acaba con l.', '', 'Lder de los Dientebrasa. No se le dan muy bien las negociaciones.', 'Escamazul', '', '', '', 47187),
(66456, 'esES', 'Una paleta venenosa', 'Rene 8 lanzas envenenadas.', 'Puede que no sea excepcional en mi trabajo, pero al menos prestaba atencin cuando estaba aprendiendo a hacerlo. Cualquier oteadora que merezca sus escamas sabe cmo hacer un antdoto. Solo necesito veneno suficiente para mezclarlo como es debido.\n\nNori dijo que el tarasek que la atac tena lanzas cubiertas del veneno. Encuntralos y treme sus lanzas. Si mi corazonada es correcta, podr preparar un antdoto con el residuo de las puntas de lanza.\n\nEspero que tengamos tiempo suficiente.', '', '', '', '', '', '', 47187),
(66449, 'esES', 'Operacin Manos Libres', 'Salva a $1oa cras en peligro y elimina a $2oa fnix garrabrasa y a la vinculaceniza Tornecha.', 'Los vinculapolvos qalashi estn intentando encarcelar a nuestras cras. Parece que su lder pretende usarlas con algn propsito malvado. No podemos permitirlo!\n\nPero los Djaradin no son el nico enemigo. Los fnix tambin estn atacando a nuestras cras y suponen un peligro an mayor.\n\nDebes protegerlas y eliminar a los enemigos que las amenazan. Osoria te ayudar.', '', 'Una peligrosa oponente, experta en la manipulacin de cenizas y holln.', 'Vinculaceniza Tornecha', '', '', '', 47187),
(66448, 'esES', 'La oteadora dscola', 'Encuentra a la oteadora Alvi.', 'Los oteadores han protegido los caminos de Thaldraszus para los viajeros desde que tengo memoria. Es un deber que mi familia ha cumplido con honor durante generaciones.\n\nPor desgracia, ltimamente mi hermana Alvi parece menos interesada en dicho honor. Se supone que tiene que presentarse ante m cada maana, pero no s nada de ella desde hace ms de un da. \n\nSi te encuentras con una dracnida bronce al este de aqu, holgazaneando y con la cabeza en las nubes, te ruego que me la enves. Si no, tendr que ir yo a buscarla.', '', '', '', '', '', '', 47187),
(66447, 'esES', 'Ms all de la barrera', 'Investiga la Cmara de la Vida en las Ruinas de la Cmara de la Vida.', 'Ahora que la barrera ha cado, ya podemos explorar la cmara!', '', '', '', '', '', '', 47187),
(66445, 'esES', 'Honrar a nuestros cados', 'Recupera los siguientes objetos robados por los Djaradin.', 'Los Djaradin no sienten ningn respeto por la santidad de la ciudadela ni por nuestros camaradas cados! Rompen los huesos de sus cadveres y se los llevan como trofeo.\n\nEsta falta de respeto es un golpe terrible para cada dragn negro. Nuestros cados merecen un trato honorable.\n\nRecupera estos objetos que les han arrebatado los Djaradin a nuestros cados.', '', '', '', '', '', '', 47187),
(66442, 'esES', 'Toca teora', 'Ayuda a probar los orbes contra la barrera titnica en las Ruinas de la Cmara de la Vida.', 'Ya tenemos cuatro orbes elementales! Veamos qu hiptesis es ms certera.', '', '', '', '', '', '', 47187),
(66441, 'esES', 'Esfuerzo destilado', 'Mata a Acequian en la cueva este de las Ruinas de la Cmara de la Vida.', 'El orbe de piedra primigenia es un hallazgo fortuito, pero Acadia y Tae\'shara tienen hiptesis contradictorias sobre la barrera.\n\nYo tengo la ma. Y puede que, con ms orbes elementales, encuentre una respuesta clara.\n\nUno de los expedicionarios ha visto a un elemental de agua descomunal en una cueva cercana. Derrtalo y quizs encuentres otro orbe.', '', 'Los exploradores informan de que este elemental est aumentando de tamao rpidamente.', 'Acequian', '', '', '', 47187),
(66439, 'esES', 'Planes de fuego rpido', 'Consigue fragmento de llama primigenia de las fuerzas primalistas en la Cuenca de los Cornisapos.', 'Orbes elementales, dices? Si hay de tierra..., debe de haber de fuego!\n\nLos Primalistas que estn cerca de los nidos de cornisapos estn reformando la tierra con lava. Si a alguien le interesa el orbe de llamas primigenias, es a ellos.\n\nAcaba con ellos y descubre si tienen alguna informacin que nos sirva.', '', '', '', '', '', '', 47187),
(66438, 'esES', 'Propsitos elevados', 'Encuentra a la exploradora Ri\'tal en la Cuenca de los Cornisapos.', 'El aire es un elemento poderoso. Corta la piedra y llena las velas para llevarnos donde necesitamos ir.\n\nMi hiptesis es que el aire ser el elemento ms eficaz para eliminar esta barrera. Es sencillo, en serio.\n\nMis exploradores informan que han encontrado el orbe de vendavales primigenios. La exploradora Ri\'tal puede llevarte hasta l. Puedes encontrarla cerca de la Cuenca de los Cornisapos. Rpido!', '', '', '', '', '', '', 47187),
(66437, 'esES', 'Un elemento clave', 'Devuelve el orbe de piedra primigenia a la elementalista Taiyang en las Ruinas de la Cmara de la Vida.', '<Este orbe despide energa.>\n\n<La elementalista Taiyang sabr qu hacer con l>.', '', '', '', '', '', '', 47187),
(66436, 'esES', 'Alborotadores desenterrados', 'Mata $1oa elementales de tierra en las Ruinas de la Cmara de la Vida.', 'Los elementales de tierra no solo estn intentando echarnos: tambin estn destrozando artefactos y equipamiento! Es como si los hubiesen programado para destruir todo lo que sea de origen titnico...\n\nLos estamos reteniendo, pero no podemos seguir estudiando este lugar mientras sigan aqu. Aydanos a hacerlos retroceder para que dispongamos de algo de margen!', '', '', '', '', '', '', 47187),
(66435, 'esES', 'Recuperacin del sitio', 'Rescata a $1oa expedicionarios atribulados en las Ruinas de la Cmara de la Vida.', 'Soy chamn, por lo que estoy acostumbrada a trabajar con elementales, pero nunca haba visto ninguno tan agresivo.\n\nLa Expedicin descubri una cmara de los titanes aqu, pero una barrera protege la cmara interior. Creo que activamos algn tipo de sistema de seguridad al intentar disiparla porque, de repente, nos atacaron un montn de elementales furiosos.\n\nMuchos expedicionarios seguan trabajando en la excavacin cuando atacaron los elementales. Muchos de ellos siguen atrapados, y ninguno sabe luchar!\n\nDesciende a la excavacin y aydalos!', '', '', '', '', '', '', 47187),
(66429, 'esES', 'Lo recordar', 'Renete con Rannan fuera del Campamento Desubicado.', 'Solo necesito un momento, por favor.\n\nVuelve al Campamento Desubicado, $p. Nos veremos all.', '', '', '', '', '', '', 47187),
(66428, 'esES', 'Amistad descuidada', 'Utiliza el S.U.P.E.R.C.H.A.C.H.I.G.U.A.Y. para disipar la barrera Arcana.', 'Vale! El S.U.P.E.R.C.H.A.C.H.I.G.U.A.Y. ya est calibrado y listo... para ti!\n\nQue por qu no lo uso yo? Es muy sencillo.\n\nHay que tener en cuenta todas las posibilidades.\n\nDigamos que explota. Quin lo arregla si estoy herido o incluso muero? Te imaginas?\n\nAhora vete y disipa la barrera para que podamos volver al campamento y curar a Lathos. Yo me quedar... aqu atrs.', '', '', '', '', '', '', 47187),
(66427, 'esES', 'Una amenaza ominosa', 'Mata a Tharohn.', 'Las heridas Arcanas que he sufrido no pueden sanarse tan fcilmente. Me temo que no podr ayudar en la lucha.\n\nDebo pedirte ayuda de nuevo, $n.\n\nTienes que encontrar a Tharohn y evitar que sobrecargue ms consolas.\n\nEso le dara a Rannan unos momentos muy valiosos para calibrar el G.U.A.Y..., el C.H.A.C.H.I.G.U.A.Y. o comoquiera que lo llame ahora.\n\nQuizs as podamos frustrar los planes de la Llama Hendida.', '', 'La lder de la Llama Hendida no se detendr ante nada hasta tomar el poder de las Ruinas de Karnthar.', 'La manipuladora Arcana Tharohn', '', '', '', 47187),
(66426, 'esES', 'Se agota el tiempo', 'Llega a la torre este.', 'Puedo sentir cmo aumenta la oleada Arcana mientras hablamos.\n\nSospecho que no queda mucho tiempo antes de que las ruinas conviertan la M.A.S. de Rannan en algo parecido a una estrella lejana en el firmamento.\n\nDebemos ir all y poner fin a esto.\n\nTen cuidado, $p.\n\nRenete con nosotros junto a la torre este. All veremos cul es la situacin.', '', '', '', '', '', 'Renete con Rannan y Lathos en la torre del este.', 47187),
(66425, 'esES', 'Sobrecarga Arcana', 'Ayuda a Rannan a disipar las burbujas Arcanas.', 'Ya est! Terminado!\n\nTe presento... el C.H.A.C.H.I.G.U.A.Y.!\n\nTA-TA-CHAAAAN!\n\nLo he calibrado con la frecuencia de la energa que rodea las consolas de dragn y le he inscrito un glifo para disipar magia.\n\nEl C.H.A.C.H.I.G.U.A.Y. disipar la energa Arcana y desactivar la consola de dragn, pero el glifo se debilitar con cada uso.\n\nNo est nada mal, verdad?\n\nDetecto cuatro consolas cerca. A por ellas!', '', '', '', '', '', '', 47187),
(66423, 'esES', 'Preocupaciones y validaciones', 'Encuentra pistas sobre el origen de las ruinas.', 'Las muertes de los miembros de la Llama Hendida dejan claro lo peligrosas que son las Ruinas de Karnthar.\n\nPero Rannan cree que, con algunos retoques el G.U.A.Y., podra contener estas energas.\n\nPero as solo estamos tratando los sntomas, no la verdadera causa del problema.\n\nInvestiga las ruinas para encontrar pistas e intenta averiguar su funcin original. Y date prisa, $n. Puede que no tengamos mucho tiempo.', '', '', '', '', '', '', 47187),
(66422, 'esES', 'La expedicin contina!', 'Renete con Rannan y Lathos en la torre.', 'Un lugar ancestral, una organizacin con unos objetivos inescrutables... Incluso el G.U.A.Y. de Rannan y sus anlisis...\n\nTodo emociona al expedicionario que llevo dentro.\n\nDebemos averiguar ms cosas sobre lo que est ocurriendo aqu.\n\nAl sur hay unas escaleras que llevan a una torre. Deberamos continuar.', '', '', '', '', '', '', 47187),
(66421, 'esES', 'La Cicatriz de la Tormenta', '', '', '', '', '', '', '', '', 47187),
(66419, 'esES', 'Lealtad a uno mismo', '', '', '', '', '', '', '', '', 47187),
(66412, 'esES', 'Adelante, Albahcaton', 'Habla con Albahcaton en los Jardines.', 'Hay algo ms que este viejo dracnido querra pedirte antes de que te vayas.\n\nCuando lord Albahcaton y yo nos conocimos, vivamos juntos en todo tipo de aventuras. Creo que por eso se aleja y deambula. Echa de menos explorar.\n\nYo ya no puedo hacerlo, pero t s. Puedes llevarlo a ver lugares que jams habra soado, lo presiento.\n\nSin embargo, deberamos preguntarle antes a Albahcaton qu piensa de todo esto.', '', '', '', '', '', '', 47187),
(66391, 'esES', 'A las ruinas!', 'Renete con Rannan y Lathos en las Ruinas de Karnthar.', 'Quieres que te cuente cosas sobre mi invento, el G.U.A.Y.? No?\n\nBueno, te las contar de todos modos porque he descubierto algo.\n\nHoy ha detectado una ENORME oleada de energa Arcana en las ruinas de Karnthar. Lathos cree que la culpa la tiene la Llama Hendida. Es la oportunidad perfecta para demostrar la utilidad del G.U.A.Y.!\n\nVienes? Va a ser genial.', '', '', '', '', '', '', 47187),
(66369, 'esES', 'El resguardo terrneo', 'Activa el resguardo terrneo.', 'He potenciado un resguardo con los anillos que has conseguido. Ha reunido las piedras de la tierra a su alrededor y ha dado forma a un defensor terrneo viviente que se encargar de proteger este territorio.\n\nPrueba el resguardo terrneo para comprobar que es funcional.', '', '', '', '', '', '', 47187),
(66368, 'esES', 'Una isla en medio de una tormenta', 'Elimina $1oa manifestaciones ardientes y al fundidor Igneus.', 'No ha habido apenas tiempo para descansar. El asalto elemental es implacable!\n\nSera de agradecer un respiro, porque me permitira fabricar ms resguardos para defendernos.\n\nA ver qu puedes hacer para disminuir los ataques contra nuestro permetro.', '', '', 'El fundidor Igneus', '', '', '', 47187),
(66364, 'esES', 'Cmo hacer volar una cometa', 'Recolecta 10 alas de protodragn recin cortadas de los protodracos y protodragones de las Islas Dragn para Temnaayu de los Colmillarr de Iskaara.', 'Permite que te cuente algo que te interesar.\n\nLos protodracos y los protodragones disponen de una amplia libertad de movimiento en las alas. El tejido elstico es de lo ms extensible. Normalmente fabricamos nuestras cometas con pellejos que estiramos, pero ahora que los dracos estn sembrando el caos, te dir que, si me traes algunas de sus alas, me encargar de fabricar unas cometas que sern la envidia de la tribu.', '', '', '', '', '', '', 47187),
(66363, 'esES', 'Rodelas de basilisco', 'Recolecta 20 pellejos de crocolisco rgidos de los basiliscos de las Islas Dragn para Dhurrel de los Centauros Maruuk.', 'Las escamas entrelazadas son la clave para detener una flecha. Las rodelas que fabricamos son las mejores de las llanuras, pero me estoy quedando sin pellejos de basilisco para mi prximo pedido. \n\nVeo que te interesa conocer nuestra profesin. Treme pellejos de basilisco de las Islas Dragn, y te ensear nuestras tcnicas.', '', '', '', '', '', '', 47187),
(66356, 'esES', 'Troncoferro', '', '', '', '', '', '', '', '', 47187),
(66354, 'esES', 'La chispa', 'Reforma las partes daadas de la piedra de juramento.', 'La forja est lista. Ahora lo nico que necesita es llamas.\n\nColoca los fragmentos de piedra de juramento daados en ella y Wrathion nos ofrecer la chispa que hace falta para comenzar.', '', '', '', '', '', '', 47187),
(66353, 'esES', 'Anomalas G.U.A.Y.', 'Utiliza el G.U.A.Y. para disipar tres anomalas Arcanas.', 'Aqu hay un montn de energa Arcana...\n\nNo obstante, el G.U.A.Y. puede hacer algo al respecto. Es uno de los increbles artilugios de Rannan. Es capaz de detectar y disipar energa Arcana.\n\nTen... Cgelo! Sientes el poder en tus manos? No?\n\nBueno, ya lo tienes, ahora ve y disipa las anomalas!', '', '', '', '', '', '', 47187),
(66352, 'esES', 'Lo que sabe el enemigo', 'Busca documentos de la Llama Hendida y llvaselos a Lathos.', 'Es vital que descubramos la misin de la Llama Hendida en estas ruinas y su relacin con la oleada Arcana.\n\nLo haremos a la antigua usanza: reconocimiento y espionaje.\n\nLas ruinas estn infestadas de devotos de la Llama Hendida. Seguro que alguno de ellos lleva rdenes que arrojarn luz sobre sus misteriosos objetivos.\n\nHaz lo que sea necesario para hacerte con esos documentos.', '', '', '', '', '', '', 47187),
(66351, 'esES', 'Humo sobre la montaa', 'Encuentra el avin de la abrecaminos Yips.', '<El abrecaminos Jeb observa la cresta de la montaa que se extiende ms all del campamento y olfatea el aire>.\n\nEsto no me gusta. La abrecaminos Yips debera haber vuelto aqu hace das. Iba a ayudarme a ensear a este nuevo grupo de expedicionarios a escalar esos pilares sin peligro.\n\nVeo humo a lo lejos.\n\nNo tiene buena pinta.', '', '', '', '', '', '', 47187),
(66349, 'esES', 'Roca de instruccin', 'Retira $1oa piedras.', 'Retira esas piedras!', '', '', '', '', '', '', 47187),
(66344, 'esES', 'Con el viento a la espalda', 'Monta con Gerithus y Merithra.', 'Conque los Primalistas han reclutado al Clan Nokhud como aliados...\n\nLos hemos contenido hasta ahora, pero los Nokhud han trado un arma nueva: una balista matadragones. Temo que Solethus no ser el ltimo dragn en caer debido a esa infame magia de tormenta.\n\nVen. Te llevar al Santuario Sombreado, un refugio de los dragones. Podrs contarme lo que sabes de los Nokhud mientras la khanam Matra rene sus fuerzas. Debemos prepararnos para el siguiente paso.', '', '', '', '', '', '', 47187),
(66340, 'esES', 'Hacia el azur', 'Renete con Masud el Sagaz en el Paso de Crucerro.', 'Hemos hecho nuestra parte. Aunque debo quedarme aqu para vigilar la piedra de juramento y guiar al Vuelo Verde, quiero que sepas que partes con nuestra gratitud y nuestra fe.\n\nHe odo que el Kirin Tor busca ayuda para reclamar la piedra de juramento azur. Si los ayudas, estaremos un paso ms cerca de sanar Azeroth.\n\nBusca a Pakina y a Masud el Sagaz del Kirin Tor. Ellos podrn darte ms informacin. Buen viaje y sueos gratos, $n.', '', '', '', '', '', '', 47187),
(66339, 'esES', 'La Ofensiva Nokhud: El viento pertenece al cielo', 'Derrota a Balakar Khan y rescata a Ohn\'ahra en la Ofensiva Nokhud.', 'Acaba aqu tu viaje con nosotros, $n, o nos ayudars una vez ms?\n\nMis exploradores dicen que Balakar se ha retirado a su fortaleza, donde tienen a Ohn\'ahra. Es inaceptable!\n\nMientras tanto, sus asaltantes Nokhud asaltan las llanuras causando estragos. Mientras nos enfrentamos a ellos, podras infiltrarte en el bastin de Nokhud y rescatar a Ohn\'ahra. Haras esto por nosotros?', '', '', '', '', '', '', 47187),
(66337, 'esES', 'Rompetormentas', 'Derrota a Koroleth.', '$n, a m! La victoria est a nuestro alcance!\n\nLas filas de los Primalistas estn rotas, y su derrota es segura. Todo lo que hemos logrado depende de la batalla final contra su lder, Koroleth.\n\nAcabemos con esto $gjuntos:juntas;. A la batalla, $Ghermano:hermana;!', '', 'Este lder primalista quiere destruir el santuario de los dragones verdes.', 'Koroleth', '', '', '', 47187),
(66336, 'esES', 'La isla de esmeralda', 'Renete con Merithra en la Rama Ancestral.', 'Tu papel en todo esto no ha pasado desapercibido, mortal. Hemos podido derrotar a los Primalistas gracias, en gran medida, a tu valenta.\n\nHe invitado a los centauros a reunirse conmigo bajo la Rama Ancestral. T, la khanam Matra y su pueblo sois bienvenidos en nuestro hogar.\n\nSigue este camino por el arco que atraviesa el agua hasta los rboles que hay ms all. Yo esperar all.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66335, 'esES', 'Deconstruir ms pilones', 'Marca los pilones de los Primalistas con las semillas encantadas.', 'Ahora que esas malditas armas han sido destruidas, el Vuelo Verde puede unirse a la contienda.\n\nConocemos mucho mejor la situacin en tierra que ellos. Debemos iluminar objetivos para que Merithra y sus dragones puedan atacarlos desde el cielo.\n\nMerithra me dio estas semillas encantadas. Colcalas cerca de los pilones de los Primalistas y usaremos la luz que emiten para dirigir los ataques de los dragones que estn en el aire.', '', '', '', '', '', '', 47187),
(66333, 'esES', 'Justicia para Solethus', 'Mata a $1oa belicistas Nokhud y destruye $2oa balistas matadragones.', 'Mientras haya un dragn verde en pie, los Primalistas no profanarn la Rama Ancestral sin tener que luchar.\n\nEstamos ansiosos por cumplir nuestro papel en esta batalla, pero mientras haya balistas matadragones en el campo de batalla, no podremos acercarnos. Los guerreros Nokhud ms fuertes las custodian, as que tambin tendrs que acabar con ellos.\n\nDestruye las balistas y a los belicistas Nokhud. Elimina esta amenaza y los dragones verdes cambiarn el curso de la batalla.', '', '', '', '', '', '', 47187),
(66331, 'esES', 'El Frente de los Primalistas', 'Habla con la exploradora Tomul, Ari y Belika, Ohn Seshteng y Merithra en la Cicatriz de la Tormenta.', 'La khanam Matra ha enviado la noticia de que ella y sus fuerzas han llegado a los Jardines Esmeralda. Han localizado a Koroleth y a sus Primalistas. Parece que se est reuniendo una enorme fuerza invasora en una playa al norte.\n\nPor suerte, ha colocado varios exploradores en lugares estratgicos alrededor del campo de batalla. Ve, recoge sus informes y luego renete conmigo y mis fuerzas en el frente. En la batalla nos aguarda la gloria y, si tenemos xito, nos cobraremos nuestra venganza.', '', '', '', '', '', '', 47187),
(66329, 'esES', 'Soplar el cuerno', 'Presencia los planes de Balakar y Koroleth.', 'Por qu traeran a Ohn\'ahra aqu? A menos que... \n\n$n! No creo que Balakar pretenda destruir el cuerno. Creo que es una trampa! Debemos encontrar una manera de atravesar este viento, rpido!', '', '', '', '', '', '', 47187),
(66328, 'esES', 'Dragn verde cado', 'Renete con la khanam Matra en el Abrevadero.', 'Esos dragones han cado en las llanuras al oeste. Debemos llegar antes de que lo hagan los Nokhud.\n\nNo queremos que piensen que todos los Maruuk son sus enemigos por culpa de las acciones de Balakar.', '', '', '', '', '', '', 47187),
(66327, 'esES', 'Persiguiendo el viento', 'Escucha el informe de la exploradora Tomul.', 'Debemos darnos un momento para pensar en nuestra estrategia.\n\nNecesitamos la bendicin de Ohn\'ahra para hacer sonar el Cuerno de Drusahl e invocar a los dragones verdes. Sin su ayuda, no podemos ganar esta guerra. Los Nokhud ya superan en nmero a los otros clanes, y encima ahora cuentan con la ventaja de los Primalistas. Y, por si fuera poco, Koroleth ha capturado a nuestra madre del viento! Debemos encontrar a Ohn\'ahra antes de que los Nokhud puedan lanzar su ataque final y asediar Maruukai.\n\nEnviar a todos nuestros exploradores. Solo espero que podamos localizarla a tiempo.', '', '', '', '', '', '', 47187),
(66326, 'esES', 'Las herramientas de la profesin', 'Recoge $4oa martillos de escamas de precisin, $3oa yunques obsidiana, $2oa tenazas de acero negro y $1oa puos de garra de dragn.', 'Una forja de este poder necesita herramientas especializadas, herramientas que puedan soportar semejante calor.\n\nPero los Djaradin han saqueado el lugar y han robado muchas de las que necesitamos para este trabajo.\n\nSi puedes, recupralas para que podamos continuar fabricando armas para nuestros aliados.', '', '', '', '', '', '', 47187),
(66324, 'esES', 'No caern en el olvido', 'Recupera los objetos y ayuda a los supervivientes en el Nido de Apoyo.', 'El antdoto est listo. Utilzalo para buscar supervivientes en el Nido de Apoyo. Date prisa. El efecto no dura mucho, as que puede que tengas que volver a aplicarlo.\n\nDebes rescatar a todos los que an respiren.\n\nSi no lo hacen, te pido que recuperes sus sellos de cuerno para que podamos recordar sus nombres con honor.\n\nPuede que all dentro encuentres pruebas sobre el origen de esta infestacin.', '', '', '', '', '', '', 47187),
(66320, 'esES', 'El flujo del tiempo', 'Viaja al Mar de Dunas y habla con Cromi.', 'Los hilos del tiempo fluyen como un ro, con recodos y ramificaciones por todas partes. A veces, las corrientes pueden cambiar. Sin embargo, una anomala sin resolver puede condenar nuestro destino dentro de una falsa lnea temporal.\n\nNos acercamos rpidamente a una de ellas. He enviado a Chronormu al Mar de Dunas para que investigue y corrija cualquier problema en la nica lnea temporal verdadera.\n\nPreveo que tu ayuda ser de gran valor.\n\nAydanos y renete con Chronormu.', '', '', '', '', '', '', 47187),
(66308, 'esES', 'Alimentar el fuego', 'Recoge $1oa pedazos de carbn de fragmento cenizo.', 'La creacin de nuevas armas y armaduras en la Forja del Guardin de la Tierra garantizar nuestra victoria final sobre los Djaradin.\n\nNo obstante, debemos seguir alimentando las llamas de la forja sin parar. El carbn de fragmento cenizo genera ms calor que ninguno y lo necesitamos para forjar armas.\n\nPuedes encontrar el carbn en los depsitos y elementales que hay en la Veta Fragmento Cenizo.', '', '', '', '', '', '', 47187),
(66299, 'esES', 'La esperada ovoexplosin', 'Mata a la matriarca alachirrido.', 'El prototipo ha funcionado! Excelente!\n\nAhora viene el plato principal. Y esta vez te toca a ti cocinar.\n\nCon unos pocos ajustes, podrs volver a usar el disfraz. Despus, toma nuestra explosiva obra maestra, chala en este estofado tan rancio, vete a la cueva de la matriarca, empltalo all y luego vuelve planeando mientras todo explota a tus espaldas.\n\nSi todo va segn lo previsto, ser ella la que acabe estofada. Por la explosin. Que la dejar bien chamuscada.', '', 'La esquiva matriarca de las arpas alachirrido! Satisfars su apetito voraz con un explosivo de Chirridos o con tu propia carne?', 'Matriarca Avethyra, lder de las arpas alachirrido', '', '', '', 47187),
(66279, 'esES', 'El reloj del nuevo', 'Llvale el reloj de bolsillo a Orizmu, que est en los Jardines.', 'Ah, s, este reloj de bolsillo pertenece a uno de los administradores que me ayudan a cuidar los jardines. \n\nUno de los de Nozdormu. Orizmu, creo... Siempre se me olvidan los nombres de esos jovenzuelos. La mayora de los das no se aleja del reloj de arena que hay cerca del rbol de Alexstrasza. No mueve ni un msculo, ni siquiera parpadea.\n\nLa prole de Nozdormu siempre ha sido bastante extraa, si quieres saber mi opinin. Pero te agradecer que le hayas trado esto.', '', '', '', '', '', 'Llvale el reloj de bolsillo a Orizmu, que est en los Jardines.', 47187),
(66278, 'esES', 'Lo que es basura para un dracnido...', 'Llvale el reloj de bolsillo a Gryrmpech en los Jardines.', '<Entre los montones de chatarra yace un reluciente reloj de bolsillo. Quizs Gryrmpech sepa qu hacer con l>.', '', '', '', '', '', 'Llvale el reloj de bolsillo a Gryrmpech en los Jardines.', 47187),
(66277, 'esES', '[DNT] Making Quest', 'Mata a $1oa bandidos.', 'Te doy la bienvenida a tu primera misin! Hoy se trata de matar a unos bandidos asquerosos. Ve y mtalos!', '', '', '', '', '', '', 47187),
(66270, 'esES', 'Golpea al gnoll', 'Derrota a los aspirantes a seores de la guerra.', 'Oh, por la Luz... Vienen ms! Cmo es posible?\n\nToda mi cuidadosa planificacin! Los das que he pasado escondindome en este apestoso lago! Los asesinatos!\n\nEsto debera haberlos sumido en el caos y provocado el derrumbe de su sociedad, pero apenas los hemos ralentizado.\n\nQuiz... quiz tengas razn, $n. Estaba equivocado...\n\nNo, imposible! De todas formas, ya estamos metidos hasta el cuello en esto.\n\nVe y ocpate de los recin llegados. Necesito tiempo para serenarme.', '', '', '', '', '', '', 47187),
(66269, 'esES', 'Ms vale asegurarse', 'Mata a $1oa elementalistas colmitormenta.', 'T... mata a cualquiera que parezca tener afinidad por la magia. O que posea habilidades organizativas. O que parezca demasiado ambicioso.\n\nMira, a partir de ahora, guate por tu criterio.\n\nQue segn tu criterio deberas dejar de hablarme? Venga, $c! Obviamente estn planeando... algo malvado!', '', '', '', '', '', '', 47187),
(66268, 'esES', 'A la tercera...', 'Mata a Garrasangre.', 'Cmo? Que otro se ha hecho con el poder? Qu pas con lo de detestar el vaco? O lo de mantener un luto respetuoso durante un tiempo para disimular?\n\nNo tienen decencia? Carecen de sentido de la propiedad? No respetan un plan bien diseado? Si haba hecho unas quinielas!\n\nEncrgate de ese tal Garrasangre. Necesito un minuto.\n\nEn cambio, lo que no necesito son tus mordaces comentarios, muchas gracias.', '', 'Quin ha muerto y lo ha nombrado lder de guerra?', 'Garrasangre', '', '', '', 47187),
(66267, 'esES', 'M.T.E.A.', 'Libera a $1oa animales maltratados.', 'Malditos! Una cosa es saquear y asesinar, pero maltrato animal?! Eso no lo voy a permitir.\n\nLos gnolls han colocado trampas para atrapar animales y alimentar a esas hienas babeantes. Encuentra el modo de liberar a sus peludos prisioneros y ensea a esos rufianes cmo tratan los magos a los animales!\n\nPor supuesto que esta tica tiene sentido a la luz de mis recientes actos. Qu estas tratando de insinuar?', '', '', '', '', '', '', 47187),
(66266, 'esES', 'Gusanos inmundos', 'Mata a $1oa matriarcas hiena y a $2oa hienas sabueso.', 'Esas bestias pulgosas de las hienas sabueso que cran los gnolls deben desaparecer! No solo carecen de modales (no creeras los lugares en los que las he visto evacuar), sino que encima son capaces de detectar mi olor ignorando mis prstinas ilusiones.\n\nHaz un favor al mundo civilizado y acaba con ellas.', '', '', '', '', '', '', 47187),
(66265, 'esES', 'Siguiente!', 'Mata a Rompediente.', 'Aj, parece que otro gnoll ha decidido asumir el mando. Tal y como esperaba. S.\n\nLo cierto es que contar con un viceseor de la guerra leal para garantizar la continuidad del gobierno tiene sentido, verdad? Tendremos que golpear un poco ms fuerte para que se venga abajo toda su burocracia.\n\nQu? Que si voy a tomarme un momento para reflexionar si me he precipitado al juzgar a estos gnolls? Qu ridiculez! Son gnolls \n\nApresrate a matar a Rompediente antes de que se calmen las cosas o, lo que es peor, organicen unas elecciones.', '', 'Cuntas hienas puede comerse un gnoll?', 'Rompediente', '', '', '', 47187),
(66264, 'esES', 'Desarmado y dcil', 'Consigue $1oa armamentos Roehuesos.', 'Hay una inquietante cantidad de armamento amontonado all. Si les arrebatamos algo, las cosas deberan calmarse un poco. Al menos calmar mis nervios.\n\nQu podrn hacer sin armas? Atacarte con las manos? Ja!', '', '', '', '', '', '', 47187),
(66263, 'esES', 'Un enfoque preciso', 'Mata a Azotapuo.', 'Los gnolls son criaturas horribles y malolientes que se pasan el da rascndose y rindose de ti. Aqu hay una multitud y, encima no paran de llegar ms. Podramos, o ms bien podras, matarlos como moscas y no servira para nada. No podemos permitir que se queden.\n\nDebemos cortar la cabeza de la serpiente! Elimina a su lder y quedarn paralizados por la indecisin y la desesperacin.\n\nQu quieres decir con \"por qu\"? No es evidente? Son gnolls! Qu otro motivo necesitas?', '', 'Qu posibilidades tienen sin su amado lder?', 'Azotapuo', '', '', '', 47187),
(66262, 'esES', 'Limpieza de aguas contaminadas', 'Limpia $1oa pilas hediondas del lago.', 'Lo primero es lo primero. Necesito recuperar mi base de operaciones! Pero, con los elementales causando estragos por la zona, ha sido imposible establecerse.\n\nY todo es culpa de esos malditos gnolls, claro.\n\nLos gnolls han tirado al lago tanta basura, vsceras y la Luz sabe qu ms que los elementales locales han empezado a enfurecerse.\n\nSeras tan amable de limpiar los restos ms repugnantes antes de que la cosa pase a mayores? Y, sobre todo, antes de que se me manche la toga sin remedio!', '', '', '', '', '', '', 47187),
(66261, 'esES', 'Un pequeo revs', 'Alcanza a Detry.', 'Ah! Justo la clase de persona bien armada que esperaba encontrarme.\n\nVers, estaba yo aqu, ocupndome de asuntos muy importantes para el Kirin Tor en este lugar perdido, cuando, mientras montaba el campamento, me han empezado a perseguir unos gnolls sarnosos.\n\nDe hecho, cerca de aqu se ha reunido una cantidad preocupante de ellos; los suficientes como para suponer una amenaza para las Tierras Azures.\n\nNo temas, tengo un plan. Renete conmigo en aquel lago de all y te lo explicar todo.', '', '', '', '', '', '', 47187),
(66259, 'esES', 'Una tormenta de malos presagios', 'Entrgale tu informe a la khanam Matra en Maruukai.', '$n, tenemos que informar a la khanam Matra de todo lo ocurrido, incluida la captura de Ohn\'ahra.\n\nDebes ir a Maruukai lo antes posible. Tendrs que ir $gsolo:sola;. Me lastim durante la cada, y solo te retrasara.\n\nNo te preocupes por m. Ya te alcanzar. Vete!', '', '', '', '', '', '', 47187),
(66258, 'esES', 'Oh, no! Ohn\'ahra!', 'Derrota a enemigos mientras Boku intenta liberar a Ohn\'ahra.', 'Esa primalista tiene apresada a Ohn\'ahra, aunque a duras penas. No parece que se haya percatado de nuestra presencia.\n\nPuedo or las palabras de la khan Tigari: \"Hasta la brisa ms suave puede derribar una piedra que se tambalea\". Si puedo interrumpir su hechizo, por poco que sea, Ohn\'ahra podra liberarse.\n\nT mantn a los guardias distrados. Tengo una idea.', '', '', '', '', '', '', 47187),
(66257, 'esES', 'Brujera a-vl-cola', 'Utiliza el ttem de viento de Boku para destruir los carros Nokhud.', 'Se dice que Ohn\'ahra imbuy la lanza de nuestro ancestro, Maruuk, de su poder. Balakar Khan debe de haberle contado esa leyenda a los Primalistas.\n\nHan robado la magia de los nios de Ohn\'ahra, la han contaminado con su brujera de tormenta y han imbuido con ella los proyectiles de las balistas. Para qu necesitaran los Nokhud armas as?\n\nNo debemos quedarnos de brazos cruzados a averiguarlo. Estn cargando los proyectiles de tormenta en carros para transportarlos. Coge mis ttems y coloca uno en cada carro que encuentres. Mi magia de viento los romper en pedazos.', '', '', '', '', '', '', 47187),
(66256, 'esES', 'Aguilitario', 'Libera a $1oa nios de Ohn\'ahra y elimina a $2oa primalistas en el Alto Son del Viento.', 'Hemos descubierto por qu los Nokhud quieren ttems msticos. Se pueden usar para capturar a los nios de Ohn\'ahra. Aunque los Nokhud han robado los ttems, son los Primalistas los que estn detrs de esta blasfemia.\n\nLos nios de Ohn\'ahra son ohuna sagrados y estn bendecidos por la mismsima madre del viento. Libera a cualquier ohuna que veas, $n. Y si te encuentras con algn primalista...\n\n<Boku se serena, pero su expresin muestra una firme determinacin>.', '', '', '', '', '', '', 47187),
(66254, 'esES', 'Mstico pesimista', 'Coloca los ttems de potenciacin alrededor de Boku.', 'Guerra? Dragones? Que necesitas que me ponga en contacto con Ohn\'ahra?\n\nNo puedo! No oigo a Ohn\'ahra. No soy ms que un iniciado, y parece que Ohn\'ahra me ha retirado sus bendiciones. Quizs no sea lo suficientemente bueno...\n\n<Boku empieza a rebuscar en su bolsa>.\n\nCuando mi mentora me asign a este clan, me regal estos pequeos ttems. Dijo que me dara fuerza si alguna vez dudaba de m mismo.\n\nMe ayudars a colocarlos? Intentar invocar a Ohn\'ahra una vez ms.', '', '', '', '', '', '', 47187),
(66252, 'esES', 'A la orden', 'Vuelve a Valdrakken e informa al capitn Drine.', 'La amenaza primalista ha sido eliminada, $n. Dentro de poco llegarn las fuerzas de Valdrakken y acabarn con lo que quede.\n\nDeberas volver a la ciudad e informar a la capitana Drine. Le interesar saber qu ha ocurrido aqu con el comandante Eranog.\n\nGracias de nuevo por todo, $n.', '', '', '', '', '', '', 47187),
(66251, 'esES', 'Luchador de fuego', 'Mata a Garfamagma.', 'El comandante Eranog nos traicion y dej a esta bestia al mando.\n\nYa has hecho mucho por m, pero no puedo con ese monstruo en mi estado actual.\n\nPor favor, hazme un ltimo favor y asegrate de que la Puerta del Fuerte Sur no caiga en manos de los Primalistas.\n\nTenemos que matar a su lder!\n\nAydame, $n.', '', 'El lder de los Primalistas que ha atacado la Puerta del Fuerte Sur.', 'Garfamagma', '', '', '', 47187),
(66250, 'esES', 'Dnde est el jefe?', 'Acompaa al guardin Velomir e inspecciona la torre de vigilancia en la Puerta del Fuerte Sur.', 'Esta es la nica parte de la fortaleza que an no hemos registrado, $n. Si el comandante Eranog est en algn lugar, tiene que ser aqu.\n\n<Velomir mira hacia la puerta cercana>.\n\nA ver qu averiguamos.', '', '', '', '', '', '', 47187),
(66249, 'esES', 'Despejar el cielo', 'Controla un escorpin de asedio y salo para derribar a los veranatos juramagma.', 'Has hecho bien en reunir todo esto, con ello podremos expulsar a los altaneros Primalistas del cielo!\n\nHay una plataforma al final de las escaleras con algunos escorpiones de asedio. Si usas las lanzas con cuerda como municin, podrs derribar a los dragones juramagma!\n\nCuando despejes el camino a la torre, podremos podamos continuar la bsqueda del comandante Eranog.', '', '', '', '', '', 'Renete con el guardin Velomir sobre la torre de vigilancia de la Puerta del Fuerte Sur.', 47187),
(66248, 'esES', 'Atando cabos', 'Rene $1oa rollos de cuerda pesada.', 'Este rollo de cuerda pesada parece en buen estado.\n\nEl guardin Velomir pidi que buscramos materiales tiles. Si encuentras unos cuantos rollos ms, podran venirle bien.', '', '', '', '', '', '', 47187),
(66247, 'esES', 'Armas ligeramente usadas', 'Rene $1oa lanzas de los juramagma.', 'La lanza parece en buen estado pese a la condicin de su antiguo dueo.\n\nEl guardin Velomir mencion que estuviramos atentos por si veamos materiales tiles. No estara mal obtener un par de lanzas ms de los juramagma.', '', '', '', '', '', '', 47187),
(66246, 'esES', 'La niebla de la batalla', 'Busca a los miembros de la unidad del guardin Velomir en la Puerta del Fuerte Sur.', 'Los Primalistas atacaron de repente y sin previo aviso. Mi unidad intent encontrar a nuestro lder, el comandante Eranog, pero antes de que pudiramos llegar al otro lado de la ciudadela, nos cortaron el paso.\n\nEn la batalla, el lder de mi unidad, el sargento Tagrik, contuvo a tres primalistas mientras Kaora, Mikor y yo luchbamos a su lado.\n\nLos gritos son lo ltimo que recuerdo antes de caer.\n\nPor favor, $r, si ves algn rastro de mi unidad, cuntame lo que ha sido de ellos.', '', '', '', '', '', '', 47187),
(66245, 'esES', 'Recuerda a los cados', 'Rene $1oa sellos de la guarnicin del Fuerte Sur.', 'Muchos de mis camaradas han cado.\n\nPor favor... Recoge sus sellos de identificacin para que sus nombres no caigan en el olvido.', '', '', '', '', '', '', 47187),
(66244, 'esES', 'A Valdrakken', 'Viaja a Valdrakken y renete con Alexstrasza la Protectora.', 'Gracias a ti, hemos evitado una catstrofe por los pelos.\n\nNo obstante, deberamos ir a ver a los dems Aspectos y contarles lo que ha ocurrido aqu.\n\nRenete conmigo en el Trono de los Aspectos de Valdrakken. Seguro que los dems saben algo sobre lo que traman Raszageth y los Primalistas.\n\nHay un cruce hacia Thaldraszus al norte, ligeramente al este de aqu. Las vistas desde el aire no estn nada mal, pero no tardes mucho en llegar.', '', '', '', '', '', '', 47187),
(66242, 'esES', 'Control del clima', 'Mata a $1oa esencias vinculadas a la tormenta y a $2oa iniciados clamatormentas.', 'Esta tormenta antinatural est cargada de magia. Parece que los Nokhud estn aprendiendo a manipular la esencia sagrada del Alto Son del Viento para crear elementales de tormenta. Algunos han tenido ms xito que otros...\n\n<Boku seala al desafortunado iniciado Nokhud que an desprende humo por las quemaduras de un rayo>.\n\n$n, no podemos permitir que sigan.', '', '', '', '', '', '', 47187),
(66241, 'esES', 'Rally de Thaldraszus', '', 'Vuela a travs de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66239, 'esES', 'Descomposicin en expansin', 'Renete con Brena en la avanzada comercial.', '<Brena examina el ttem de Kargozarpa una y otra vez con sus gruesas manos>.\n\nKargozarpa es un pen. No es el origen de esta descomposicin. Debemos encontrarlo antes de que se propague ms.\n\nEl enclave de colmillarr ms cercano es una avanzada comercial, justo al otro lado del puente que hay de camino a Iskaara.\n\nDeberamos hablar con ellos... y rpido.', '', '', '', '', '', '', 47187),
(66237, 'esES', 'Aliados espirituales', 'Habla con las autoridades.', 'Nuestra llegada no habr pasado desapercibida.\n\nDeja que hable con ellos antes de entrar. Me he relacionado con el consejo en el pasado.\n\nYa habr tiempo para presentaciones ms tarde.', '', '', '', '', '', '', 47187),
(66236, 'esES', 'Presencia detectada', 'Renete con Boku en el Alto Son del Viento.', 'Los Nokhud estn recogiendo ttems. Los Primalistas estn capturando ohunas. Y Ohn\'ahra guarda silencio.\n\nSean cuales sean los planes de los Nokhud, debemos frustrarlos. Boku y t tenis que viajar hasta el Alto Son del Viento. Seguramente nuestros enemigos ya estn all.\n\nBusca a Ohn\'ahra. Si sus hijos estn en peligro, sin duda ir a por ellos, y debemos ayudar. La madre del viento es poderosa, pero temo lo que pueden hacer los Primalistas.', '', '', '', '', '', 'Renete con Boku en el Alto Son del Viento.', 47187),
(66232, 'esES', 'La sal to\' frontal', 'Recolecta $1oa escamas de cristal en la Orilla Grloc.', 'No nos importa alojaros en nuestro pequeo hogar aunque nadie lo haya preguntado. Si subes a los manantiales, podras recoger unas escamas de cristal? Las usamos para conservar todo tipo de cosas. Y eso es algo crucial para conservar la comida en este lugar.\n\nLos grlocs ms grandes estn totalmente cubiertos de ellas. Te importara cogerles unas cuantas?', '', '', '', '', '', '', 47187),
(66230, 'esES', 'Un esbozo de peticin', 'Recupera el \"libro de contabilidad\" de Alvi y llvaselo a la oteadora Alvi.', 'Los tarasek se llevaron todo lo que pudieron, incluso mi libro de contabilidad.\n\nEsos lagartos gigantescos acaparan abalorios y trofeos a docenas. Estoy segura de que ocultaron mi libro de contabilidad en algn sitio. Podras echar un ojo mientras atraviesas el paso?\n\nPor cierto, $n. Si consigues encontrarlo, no lo abras. El contenido es... ms bien personal.', '', '', '', '', '', '', 47187),
(66228, 'esES', 'El Campamento de Antonidas', 'Renete con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 'El Kirin Tor ha establecido su campamento principal al sur de aqu: el Campamento de Antonidas, lo llaman.\n\nCreo que Noriko y Khadgar estn all, reuniendo aventureros para ayudar a Kalecgos a reclamar la piedra de juramento azur.\n\nSi quieres ayudarnos con esta labor, ve all.', '', '', '', '', '', 'Renete con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 47187),
(66227, 'esES', 'Una buena pesca', 'Atrapa $3oa pezqueines de cola azul en el Punto de Pesca de Khuri.', 'Otro par de manos! Me vendra bien algo de ayuda para pescar suficientes peces y llevarlos a casa para comer.\n\nLa gente del Kirin Tor parece preocupada por algo que hay en la zona y a lo que llaman anomalas mgicas, signifique lo que signifique.\n\nPuedes quedarte, siempre y cuando arrimes el hombro.\n\nCoge una caa de pescar y ponte manos a la obra. Cuantas ms manos, menos trabajo!', '', '', '', '', '', '', 47187),
(66226, 'esES', 'Compaeros de apoyo emocional', 'Rescata a las criaturas inocentes de los Nokhud en el Retiro Crestagua.', 'Por favor, no me hagas dao...\n\nQu? Que has venido a ayudar? Debes salvar a los animales!\n\nLos Nokhud nos atacaron por sorpresa. Tuvimos que huir para salvar el pellejo! Yo me zambull en el lago para evitar que me mataran.\n\nPero tuvimos que abandonar a nuestros animales! Por favor, te lo ruego, resctalos. Quin sabe qu atrocidades piensan cometer los Nokhud con ellos.', '', '', '', '', '', '', 47187),
(66225, 'esES', 'Todos los ttems', 'Recupera $1oa fardos de ttems de los Nokhud en el Retiro Crestagua.', 'Boku me pregunt por qu convoqu a todos los msticos al Retiro Crestagua.\n\nPero yo no envi mensaje alguno. Balakar atrajo a mis msticos a propsito a una trampa para debilitar al Clan Ohn\'ir.\n\nY puede que haya algo ms. Los Nokhud estn reuniendo ttems msticos, todos los que pueden. Estn bendecidos por Ohn\'ahra.\n\nLos motivos de los Nokhud no estn claros, pero no podemos permitir que se lleven los dones de Ohn\'ahra. Recupera tantos ttems como puedas.', '', '', '', '', '', '', 47187),
(66224, 'esES', 'El misterio mstico', 'Renete con Boku y viaja al Retiro Crestagua.', 'Lo siento, pero no he logrado entrar en comunin con Ohn\'ahra. Necesitars a alguien ms para cumplir la peticin de la khanam Matra.\n\nHace varios das, la khan Tigari convoc de urgencia a mis compaeros msticos al Retiro Crestagua. An deberan estar all.\n\nRenete conmigo fuera de la ciudad. Lo menos que puedo hacer es mostrarte el camino.', '', '', '', '', '', '', 47187),
(66223, 'esES', 'Nos lo quedamos?', 'Llvale a Neelo $1oa peces glidos de los vendedores de Iskaara o pscalos en las aguas ocenicas de las Islas Dragn.', 'Solo intenta comernos porque est muy hambriento!\n\nPescado! Nadie se resiste a un poco de fro y delicioso pescado crudo.\n\nLos peces glidos son los mejores. Los puedes atrapar por todo el ocano! Si no te ves capaz de pescarlos por tu cuenta, Jinkutuk, que est en Iskaara, te los puede vender.\n\nTreme tantos como para saciar su hambre eternamente!', '', '', '', '', '', '', 47187),
(66222, 'esES', 'La calma antes de la tempestad', 'Entrega las rdenes de Jebotai a los habitantes de Teerakai.', 'Los Nokhud son poderosos y cuentan con muchos aliados. Necesitaremos todo lo que tenemos para resistir su ataque.\n\n$n, cuentas con la confianza de la khanam Matra. Sus rdenes eran reunir a nuestros amigos y preparar a nuestro pueblo.\n\nNecesito tu ayuda. Busca a Hojin para movilizar al resto de la guardia del khan. Alerta a la exploradora Khenyug de posibles incursiones Nokhud. Dile a Agura para que espere heridos y a Gensai que prepare nuestras provisiones.\n\nY en cuanto a los msticos, creo que se han ido hace poco. Ver si queda alguno en Teerakai.', '', '', '', '', '', '', 47187),
(66221, 'esES', 'Hacia adelante', 'Habla con Alexstrasza en el Trono de los Aspectos, que est en Valdrakken.', 'Ahora que la piedra de juramento bronce ha sido restaurada, Alexstrasza podr continuar con su plan.\n\nViaja a Valdrakken, $n. Querr or las noticias de tu xito.', '', '', '', '', '', '', 47187),
(66218, 'esES', 'Malandrines escurridizos', 'Encuentra a Neelo y a Nau.', 'Hola de nuevo.\n\nPodras hacernos un favor a Norukk y a m? Nuestros hijos Neelo y Nau se han ido a jugar. Saben que ya deberan haber vuelto.\n\nEstoy ocupada. Podras buscarlos? Dudo que estn en peligro. Saben cmo cuidarse.', '', '', '', '', '', '', 47187),
(66217, 'esES', 'SE BUSCA: Krojek el Acechacostas', 'Mata a Krojek el Acechacostas.', 'Hemos estado observando durante muchos aos al gran tiburn que conocemos como Krojek a la espera del mejor momento para darle caza. \n\nSu terreno de caza est cada vez ms cerca de la costa. Eso significa que ha llegado el momento. Rene tu grupo de caza y acaba con l!', '', 'En su da fue indispensable para el ecosistema local, pero ahora los terrenos de caza del Acechacostas se estn acercando demasiado a Iskaara.', 'Krojek el Acechacostas', '', '', '', 47187),
(66213, 'esES', 'La trama de una historia', 'Cuntale a la anciana Poa una historia sobre peces.', 'Mi amada esposa Poa es una gran narradora.\n\nPero han pasado treinta aos y cuenta las mismas historias una y otra vez. Por favor, $c, habla con ella y ofrcele una historia nueva.\n\nCmo dices? Contarle una historia sobre tus aventuras? No digas bobadas... Eso no me interesa. Las historias ms importantes siempre hablan de peces. Cuntale una historia sobre peces, aunque tengas que inventrtela!', '', '', '', '', '', '', 47187),
(66212, 'esES', 'Pesca: polilla marina con alern', 'Pesca $1oa polillas marinas con alern en el ocano que rodea las Islas Dragn.', 'Es que ya nadie sabe pescar en condiciones?\n\n<Lukoturukk agita el bigote con furia>.\n\nT, rostro, ve a pescar. Pero hazlo bien. Y nada de grungles!', '', '', '', '', '', '', 47187),
(66211, 'esES', 'Hondonada Frondacuero: hasta el origen', 'Entra en la Hondonada Frondacuero y enfrntate a la descompotriarca Ojoiracundo.', 'Te estamos muy agradecidos por ayudarnos a rechazar a los gnolls Frondacuero.\n\nSin embargo, siguen reunindose y usando la hedionda magia de descomposicin que extraen de algn sitio situado en lo profundo de la Hondonada Frondacuero. Y lo que es peor, no tenemos noticias de los colmillarr de esa zona desde hace semanas!\n\nMe temo que all est ocurriendo algo terrible. Debemos proteger nuestro hogar. Por favor, rene a tus tropas, encuentra a los nuestros y haz lo que puedas con la descomposicin!', '', '', '', '', '', '', 47187),
(66210, 'esES', 'Reunir a la familia', 'Recoge $1oa ofrendas funerarias de los alrededores de Iskaara y luego colcalas en el barco funerario.', 'Tu amigo Kalecgos quiere hablar de las lneas Ley, pero debemos realizar los preparativos para el funeral.\n\nMientras me reno con l, podras recoger las ltimas ofrendas de Iskaara y colocarlas en el barco funerario junto al viejo Ponoliak?\n\nEspero que aproveches para disfrutar de la ciudad! Mi pueblo te dar una clida bienvenida, sobre todo despus de tu ayuda en Frondacuero.', '', '', '', '', '', '', 47187),
(66206, 'esES', 'Nozdormu, he venido a negociar', '', '', '', '', '', '', '', '', 47187),
(66201, 'esES', 'Pezuas de guerra', 'Entrega el mensaje de la khanam Matra al guardin del khan Jebotai, que est en Teerakai.', 'Balakar reunir a sus tropas para la guerra. Yo har lo mismo, pero nos superan en nmero.\n\nLos dragones nos han pedido ayuda, y podemos usar la suya para equilibrar la balanza. Para responder a su llamada, debo soplar el Cuerno de Drusahl, pero necesito la bendicin de Ohn\'ahra. Me ayudars?\n\nVe a Teerakai y entrega mi declaracin de guerra a mi teniente Jebotai. l reunir a mis tropas y te dirigir hacia los msticos que pueden encontrar a Ohn\'ahra.', '', '', '', '', '', 'Entrega el mensaje de la khanam Matra al guardin del khan Jebotai, que est en Teerakai.', 47187),
(66196, 'esES', 'Un graznido de ayuda', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este patito se agita frenticamente dentro de la burbuja y grazna con miedo>.\n\n<Quizs los eclogos sepan cmo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(66187, 'esES', 'Mordigan el Loco y el rey de cristal', 'Descristaliza a Mordigan Quijahierro en la Orilla Grloc.', 'He explorado el permetro. Si Mordigan est en algn sitio, es en esta cueva.\n\n<Unas maldiciones e insultos ahogados resuenan en la entrada de la cueva>.\n\nEst en esta cueva, no hay duda.\n\nLOU-C dijo que estos cristales tienen propiedades de deshidratacin muy peligrosas. A ver si puedes separarlo de sus... hallazgos geolgicos. Intenta no hacerle demasiado dao.\n\nSe le respeta bastante en su campo.', '', '', '', '', '', 'Habla con Aelnara.', 47187),
(66177, 'esES', 'Hasta el ltimo enano', 'Sigue la senda de Mordigan Quijahierro a lo largo de la Orilla Grloc.', 'Los niveles de sal superan los valores mximos de las grficas. Tenemos que encontrar a Mordigan y sacarlo de ah. Ya debe de estar peligrosamente deshidratado.\n\nSe fue hace solo un par de horas. A ver si puedes averiguar qu camino tom ese viejo enano grun!', '', '', '', '', '', 'Encuentra a Aelnara en la Orilla Grloc.', 47187),
(66176, 'esES', 'Experimentacin elemental', 'Lleva a cabo $1oa experimentos con elementales en la Orilla Grloc.', 'Ve a realizar experimentos con los elementales de agua que acosan a los grlocs.', '', '', '', '', '', 'Buen trabajo!', 47187),
(66175, 'esES', 'Experimento de campo', 'Ayuda a LOU-C con sus pruebas en el Rincn del Ballenero.', 'Gracias a ti, nuestra investigacin geolgica funciona ahora con casi un noventa y seis por ciento de eficiencia. \n\n<LOU-C frunce el ceo>.\n\nSon cifras de novatos.\n\nAydame a analizar las muestras que has obtenido con mi geoescner 289-07. Nos darn una referencia clara para saber qu est pasando exactamente en la meseta.', '', '', '', '', '', 'Habla con LOU-C Fitzcog, que est en el Rincn del Ballenero.', 47187),
(66169, 'esES', 'La venganza se sirve caliente', 'Mata a $1oa primalistas juramagma en la Puerta del Fuerte Sur.', 'Los Primalistas nos pillaron completamente desprevenidos.\n\n<Velomir escupe con indignacin>.\n\nEstos monstruos despedazaron a mis compaeros, y yo habra sido el siguiente si no hubieras aparecido.\n\nAn puedo or a lo lejos los sonidos de la batalla. Es posible que todava haya otros vivos, incluido el comandante Eranog.\n\nPrstame tu ayuda. Necesito que crees una distraccin para que pueda acercarme ms.\n\nSi matases a unos cuantos \"juramagma\", como se hacen llamar, sera perfecto.', '', '', '', '', '', '', 47187),
(66167, 'esES', 'Exposicin al sur', 'Viaja a la guarnicin del Fuerte Sur.', 'Segn tus descubrimientos, sospecho que los Primalistas estn atacando la guarnicin del comandante Eranog en el Fuerte Sur. Mis Juraescama no pueden dejar la ciudad porque eso sera exactamente lo que esperan esos malvados.\n\nNecesito tu ayuda de nuevo, $n.\n\nViaja al Fuerte Sur, averigua a qu tipo de fuerzas nos enfrentamos y, si es posible, ponte en contacto con la guarnicin.', '', '', '', '', '', '', 47187),
(66166, 'esES', 'Ojos y orejas', 'Busca pistas por Valdrakken.', 'Los Primalistas han estado difundiendo su asquerosa propaganda entre la ciudadana de Valdrakken.\n\nPero nuestros enemigos son demasiado astutos como para decir algo en presencia de mis Juraescama; quizs t puedas acercarte lo suficiente como para espiar sus conversaciones y ver si podemos descubrir algo de valor.\n\nHe sealado ubicaciones en tu mapa para que sigas investigando. \n\nToma esta piedra encantada. Mientras la tengas a mano, podremos comunicarnos.\n\nTodo listo para empezar?', '', '', '', '', '', '', 47187),
(66164, 'esES', 'Fingers de pescado', 'Recupera $1oa piezas robadas en la Orilla Grloc.', 'Ahora que Mordigan est lamiendo rocas, podemos llegar al meollo del asunto...\n\nEsos malditos peces con patas me han robado las piezas!\n\nNo llevbamos ni una hora en esta pequea aldea y, BUM!, los grlocs se nos echaron encima. Rowe y Aelnara solo se dedicaron a gritar mientras yo esgrima mi llave inglesa como una loca! \n\nA ver si puedes arreglar todo este embrollo y recuperar algunas de mis piezas!', '', '', '', '', '', '', 47187),
(66163, 'esES', 'No hay donde esconderse', 'Mata a $2oa primalistas infiltrados en Valdrakken.', 'Te doy la bienvenida a Valdrakken, $r. \nEl clima de la ciudad se ha caldeado un poco ltimamente, y no me refiero al tiempo atmosfrico.\n\nLos Primalistas merodean por aqu, lo que ha azuzado los desencuentros entre los ciudadanos.\n\nNuestros enemigos son astutos. Se disfrazan de ciudadanos para esconderse de los Juraescama. Saben cmo evitar a mis guardias, pero no sospecharn de alguien de fuera.\n\nToma esta gema de ojo de dragn. Con ella podrs verlos a pesar de sus disfraces.\n\nVe, averigua quines son los infiltrados y mtalos!', '', '', '', '', '', '', 47187),
(66159, 'esES', 'Un mensaje peliagudo', 'Habla con Alexstrasza en el Trono de los Aspectos, que est en Valdrakken.', 'Kalecgos no quera contarnos lo que ocurri en las Tierras Azures hasta que llegaras.\n\nNo s de qu se trata, pero tengo un terrible presentimiento sobre ello, $n.', '', '', '', '', '', '', 47187),
(66156, 'esES', 'Renombrado con la Expedicin Dragontina', 'Habla con la catalogadora Jakes en el Campamento Base Dragontina.', 'Tus hazaas no han pasado desapercibidas, y sigues demostrando que eres $gun expedicionario:una expedicionaria; de renombre!\n\nVuelve al Campamento Base Dragontina. He preparado suministros que te ayudarn en tus aventuras.', '', '', '', '', '', '', 47187),
(66155, 'esES', 'La carrera en los rpidos del ro de Ruriq', 'Navega ro abajo con el Zancalejana.', 'No esperaba la aprobacin de mi hermano..., pero la agradezco, claro. \n\nHa llegado la hora de ver si nuestro arduo trabajo ha valido la pena!\n\nMonta conmigo en el Zancalejana, $n, y pesquemos para Iskaara mientras navegamos por el ro!', '', '', '', '', '', '', 47187),
(66154, 'esES', 'Muestras de saliva', 'Recoge $1oa muestras de saliva en la Orilla Grloc.', '<El no-muerto se pelliza el puente de la nariz y suspira fuertemente>.\n\nEsto va a ser una mancha muy gorda en mi historial. De alguna manera, en un solo da hemos conseguido agitar a los grlocs locales y perder la mitad de nuestro equipo, y ahora, encima, nos falta un enano.\n\nEn esta situacin, el protocolo dicta que seamos tan eficientes como sea posible. Acaba con algunos de nuestros enemigos y treme su saliva para realizar ms pruebas.\n\nPero solo la saliva buena, claro.', '', '', '', '', '', '', 47187),
(66152, 'esES', 'Sin sitio al que ir', 'Renete con Garz en el Campamento Desubicado.', 'No podemos quedarnos aqu.\n\nNo s qu hacer ni adnde ir...\n\nVolveremos al Campamento Desubicado. Los colmillarr deben saber lo ocurrido en Pinoherrumbre.\n\nSi continuamos contando nuestra historia, quizs no vuelva a suceder...', '', '', '', '', '', '', 47187),
(66151, 'esES', 'Su corazn de piedra', 'Mata a Corazn ptreo.', 'Gritamos de dolor por nuestro jefe, pero an vive.\n\nLo que queda de Corazn Ptreo est en aquella cueva. Muchos han intentado razonar con l.\n\nLos ha matado. Y casi mata a Narn.\n\nEs un monstruo! Este es el objetivo de los Primalistas: convertirnos en piedra y llamas para ser sus sirvientes.\n\nNo queda nada de Pinoherrumbre en l. Debemos destruirlo antes de que otros corran la misma suerte.', '', 'El regalo de los Primalistas transform el cuerpo del jefe Pinoherrumbre en piedra endurecida.', 'Corazn ptreo', '', '', '', 47187),
(66150, 'esES', 'Rescatar a Radza', 'Rescata a Radza Garratrueno.', 'Radza Garratrueno es nuestra guardiana espiritual. Conserva puras nuestra tradicin y nuestra historia.\n\nLas creencias de los Primalistas van en contra de todo lo que nuestro clan defiende. Saba que desafiara a Corazn Ptreo!\n\nCorazn Ptreo har lo que sea para doblegarla. Nadie puede llegar a ser jefe sin la bendicin de Radza!\n\nNarn dice que Khargall Cinco Colmillos, guardia del jefe, est intentando someterla. Si Radza muere, nuestro clan morir con ella.\n\nVe a ayudarla, $n, y preprate. No la dejar marchar sin luchar.', '', '', '', '', '', 'Renete con Radza Garratrueno en la Guarida Pinoherrumbre.', 47187),
(66149, 'esES', 'Influencia elemental', 'Destruye $1oa ttems Nexo Terrestre de primalista y luego renete con Narn en la Guarida Pinoherrumbre.', 'Narn dice que no todos los miembros del clan Pinoherrumbre siguieron a Corazn Ptreo o a los Primalistas.\n\nLos que se han resistido son ahora sus prisioneros. Unos ttems que escupen roca y barro los retienen... para obligarlos a obedecer. \n\nDestruye los ttems. Libralos!', '', '', '', '', '', 'Renete con Narn en la Guarida Pinoherrumbre.', 47187),
(66148, 'esES', 'Antigua familia frbolg', 'Mata a $1oa elementales y frbolgs Pinoherrumbre, y luego renete con Narn en la Guarida Pinoherrumbre.', 'Vinieron los Primalistas. Nos ofrecieron un poder nuevo... El dominio de los elementos.\n\nNo pens que Corazn Ptreo aceptara sus dones. Nuestro clan no necesitaba poder. No consider el precio a pagar.\n\nEsa terrible decisin no se puede deshacer. La magia ha corrompido a mi clan como la enfermedad pudre una raz.\n\nMe parte el corazn, pero la nica opcin es acabar con los corruptos.', '', '', '', '', '', 'Renete con Narn en la Guarida Pinoherrumbre.', 47187),
(66147, 'esES', 'Cristales en el agua', 'Recoge $1oa muestras de cristal en la Orilla Grloc.', 'Puede que no lo parezca, pero somos profesionales. La expedicin nos encomend la bsqueda de unos extraos cristales por esta zona..., un estudio geolgico, por as decirlo.\n\nTodava me estoy recuperando del ataque de los grlocs. Seras tan amable de ir a buscar esos cristales? Trae unas muestras, si puedes.', '', '', '', '', '', '', 47187),
(66141, 'esES', 'Tradiciones y cuerpos quebrados', 'Renete con Garz y Narn en el camino a la Guarida Pinoherrumbre.', 'Mis compaeros frbolgs ya no son ellos mismos. Han hecho cosas... malas. Y ahora se han convertido en cosas peores.\n\nLos frbolgs nunca se han enfrentado entre s!\n\nMi hermano y yo escapamos. Vine aqu en busca de ayuda. l sigue junto a la guarida de nuestro clan.\n\nAydanos antes de que perdamos a nuestro clan!', '', '', '', '', '', '', 47187),
(66139, 'esES', 'Al fin una llama', 'Usa la esencia de agua concentrada para derrotar al inferno llameante en los Jardines.', 'Toma, joven, he colocado todas las esencias elementales de agua en este tarro.\n\nSi se lo lanzas al grande, debera funcionar. O sea, cundo no ha vencido el agua al fuego? Es un plan infalible.\n\nEl calor, eh... no es bueno para mis articulaciones, as que yo me quedar aqu. Confo en que puedas hacerlo.\n \nBuena suerte, joven!', '', '', '', '', '', '', 47187),
(66138, 'esES', 'Como arena en un reloj', 'Recoge $1oa montones de arena del tiempo arrastrada por el viento en los Jardines.', 'Como el resto de los jardines, el reloj de arena de Nozdormu ha tenido que soportar la agitacin elemental. Han aparecido unos elementales de viento turbulentos y han desperdigado la arena mgica del reloj.\n\nSin esta, la influencia de Nozdormu se reduce enormemente.\n\nComo administrador, tengo encargado supervisar el reloj de arena en todo momento. Si pudieras recoger la arena por m, te estara eternamente agradecido.', '', '', '', '', '', '', 47187),
(66137, 'esES', 'Un buen azote', 'Mata a $1oa muertenflor invasivas y esquejes azotadores en los Jardines.', 'Estoy seguro de que los vainetes no son los nicos seres que se comportan como gamberros.\n\nEl rbol de Alexstrasza siempre ha sido una gran molestia. Su magia vital atrae todo tipo de plantas y animales, buenos y malos. Y adivina quin tiene que encargarse de los malos? El viejo Gryrmpech, ni ms ni menos.\n\nPor los Aspectos, estoy demasiado mayor para esto.\n\nLos administradores no estn entrenados en combate, as que te toca resolver el problema con las malas hierbas de la Protectora.', '', '', '', '', '', '', 47187),
(66136, 'esES', 'Extracto de elemental', 'Recoge $1a de esencia acutica de los Jardines.', 'Un gran elemental de fuego destruy el estanque hace unos das. Creo que es el responsable de todo este alboroto, pero es demasiado grande como para luchar contra l. Tenemos que debilitarlo de alguna forma.\n\nNo descartis an al viejo Gryrmpech, porque tiene un plan.\n\nUnos elementales de agua decidieron instalarse en el pabelln del Vuelo Azul. Quizs podamos usar su magia contra ellos si consigues reunir esencia suficiente.\n\nSe dice que hay que combatir el fuego con el fuego, no? Pues en este caso vamos a combatir el agua...\n\nEn fin, deberas ponerte en marcha.', '', '', '', '', '', '', 47187),
(66135, 'esES', 'El aprendiz de jardinero', 'Busca a Lord Albahcaton en el cobertizo del jardn limpiando los montones de basura.', 'Albahcaton! Dnde ests, lord Albahcaton?\n\nMi ayudante ejecutivo y aprendiz, lord Albahcaton, ha desaparecido. Le encanta explorar, aunque lo de defenderse se le da peor que a m. Soy jardinero, no guerrero.\n\nPodras buscar a ese holgazn? Necesito que est aqu para poder pensar. Suele estar en el cobertizo, hurgando entre montones de basura.\n\nTen cuidado, puede ser una tarea... espinosa.', '', '', '', '', '', '', 47187),
(66134, 'esES', 'Control de plagas de Azeroth', 'Mata a $1oa esquejes perturbados en los Jardines.', 'T! Retoo!\n\nchame una mano, quieres? Estos vainetes me estn destrozando las plantas.\n\nLos jardines han sido invadidos por todo tipo de elementales, y parece que eso... est afectando a la fauna. Es como si su energa hubiese vuelto locos a esos pacficos vainetes. Ms que de costumbre!\n\nNo doy abasto con estos tres. Aydame antes de que arranquen todos mis lechos de flores.', '', '', '', '', '', '', 47187),
(66133, 'esES', 'Llaves de lealtad', 'Recoge $1oa llave obsidiana superior.', '', '', '', '', '', '', 'Entrega la llave reconstruida en la Ciudadela Obsidiana.', 47187),
(66131, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Treme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier faccin que haya en la Ciudadela del Dragn Negro.', 47187),
(66130, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Treme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier faccin que haya en la Ciudadela del Dragn Negro.', 47187),
(66129, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Treme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier faccin que haya en la Ciudadela Obsidiana.', 47187),
(66126, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Treme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier faccin que haya en la Ciudadela Obsidiana.', 47187),
(66124, 'esES', 'Salida triunfal', 'Escapa del Enclave Raudoescarcha con la mayordoma Selistra.', 'Por lo que vi, la reina se retir al Criadero Salvaje. Es una avanzada que sirve para vigilar a los protodracos de la zona... Espero que sus defensas sean suficientes.\n\nDebemos acudir all de inmediato!', '', '', '', '', '', '', 47187),
(66123, 'esES', 'Que le corten la cabeza', 'Derrota a Jadzigeth en el Enclave Raudoescarcha.', 'Jadzigeth, uno de los infames tenientes de Raszageth, gua con orgullo a los Primalistas hasta aqu.\n\nEnsemosles lo que les pasa a quienes se enfrentan a nosotros.', '', 'La teniente de Raszageth traer consigo un aluvin de problemas si nadie la detiene.', 'Jadzigeth', '', '', '', 47187),
(66122, 'esES', 'Protolucha', 'Derrota a $2oa protodragones en el Enclave Raudoescarcha.', 'Los protodragones nos aborrecen. Creen que somos una versin retorcida de los dragnicos, meras marionetas y esclavos de los titanes. No lo entienden.\n\nPor eso se sienten a salvo mientras lanzan sus fuerzas contra nuestros muros.\n\nSe equivocan.\n\nToma esta lanza, $p. Acaba con nuestros enemigos.', '', '', '', '', '', 'Renete con la mayordoma Selistra en el Enclave Raudoescarcha.', 47187),
(66121, 'esES', 'Evacuacin de los huevos', 'Rescata 4 huevos del Enclave Raudoescarcha.', 'Los Primalistas nos han robado los huevos para sus perversos rituales! Hay que detenerlos.\n\nAydanos a recuperarlos antes de que sea demasiado tarde. Marca cada huevo conforme los vayas encontrando, $p. Me asegurar de sacarlos de la zona sin peligro.', '', '', '', '', '', 'Renete con la mayordoma Selistra en el Enclave Raudoescarcha.', 47187),
(66119, 'esES', 'Estanques de Vida Rub: invasin primalista', 'Accede a los Estanques de Vida Rub y detn el ataque de los Primalistas.', 'Los Primalistas se han abierto paso hasta nuestro hogar. No estbamos preparados para un ataque tan feroz..., as que algunos de ellos lograron atravesar nuestras defensas.\n\nUno de nuestros dracnidos se adelant para seguirlos, pero an no hemos tenido noticias suyas. Me temo lo peor.\n\nEstar alerta. No permitiremos que crucen nuestros muros ms enemigos, pero debes detener a quienes ya lo han conseguido.\n\nVamos!', '', '', '', '', '', '', 47187),
(66118, 'esES', 'Asalto de basalto', 'Destruye $1oa acantilados enfurecidos en el Asalto Raudoescarcha.', 'Raszageth y los Primalistas han invocado unos enormes elementales de tierra para derribar las murallas. Debemos detenerlos!', '', '', '', '', '', '', 47187),
(66117, 'esES', 'Despejar el campo de batalla', '', '', '', '', '', '', '', '', 47187),
(66116, 'esES', 'La amenaza principal', 'Encuentra al comandante Lethanak en el Asalto Raudoescarcha.', 'Hay demasiados huevos vulnerables que proteger. Lo perderemos todo si logran abrirse paso!\n\nSeguro que nuestros guardias se estn reuniendo en el campo de batalla para hacerlos retroceder. Habla con el comandante Lethanak para que pueda dirigir tu fuerza all donde sea ms necesaria.', '', '', '', '', '', '', 47187),
(66115, 'esES', 'El mandato del Rojo', 'Habla con los cuidadores del Vitasagrario Rub.', 'Nuestra vocacin es el cuidado y la compasin. Ayudamos a los otros Vuelos no solo por su propio bien, sino por el de todos los dragnicos.\n\nTal vez lo entenderas mejor si hablaras con los dragauros del Vitasagrario Rub.', '', '', '', '', '', '', 47187),
(66114, 'esES', 'Por el beneficio de la reina', 'Monta con la mayordoma Selistra hasta el Vitasagrario Rub.', 'Protegemos nuestros valiosos huevos para salvaguardar el futuro de todos los Vuelos. Los Primalistas no solo quieren provocarnos dolor o angustia con sus actos.\n\nNos amenazan con la extincin misma.\n\nDebo informar a nuestra reina de inmediato.', '', '', '', '', '', '', 47187),
(66113, 'esES', 'Un transporte discreto', 'Repara el carro prestado.', '[DNT] Our foes watch the skies. I will risk no harm to the future of my flight, so we must travel by less traditional mean.\n\nI ordered a more... down to earth means of transport be acquired, but it seems to have suffered some damage during the exchange. You are undoubtedly more familiar with such things than I, $r, so your assistance in repairing the wagon would be most appreciated.', '', '', '', '', '', '', 47187),
(66112, 'esES', 'No hay que parar de fabricar', 'Consigue un ncleo terrneo primigenio y un ncleo de magma primigenio.', 'Alguna vez habas visto unos elementales tan poderosos?!\n\n<Grun vitorea>.\n\nNo dejo de or las quejas de los guardias por tener que enfrentarse a ellos constantemente, pero carecen de perspectiva... De los elementales ms grandes se sacan los mejores componentes de fabricacin!\n\nMientras ests por ah acabando con los elementales por nuestra seguridad y esas cosas, procura recoger los restos de los ms grandes que encuentres para que pueda fabricar algo con ellos.', '', '', '', '', '', '', 47187),
(66111, 'esES', 'Elementales invasores', 'Mata a $1oa elementales primigenios en la Embajada Reposo Alado.', 'Los forjadores, artesanos y exploradores de la Expedicin Dragontina no son aptos para el fragor de la batalla.\n\nT y yo s, $p.\n\nUsemos esa fuerza en las Islas Dragn para proteger a aquellos que no pueden protegerse por s mismos.\n\nElimina a los elementales que se aproximan desde el norte para que la expedicin pueda centrarse en sus nobles quehaceres.', '', '', '', '', '', '', 47187),
(66110, 'esES', 'Una oportunidad para la paz', 'Presntate a los representantes de la Alianza.', 'Aka\'Magosh, $p.\n\nEsta expedicin est bajo la proteccin de la Horda y la Alianza. Nuestras instrucciones son claras: dar apoyo a cualquier miembro de la Expedicin Dragontina, independientemente de sus otras lealtades.\n\nLos representantes de la Alianza, la capitana Garrick y su hijo, hacen guardia al otro lado del campamento.\n\nLuch con la capitana Garrick contra la Plaga. Es honorable y servir bien a esta expedicin.\n\nOfrcele tu ayuda. Demustrale que la Horda honra sus acuerdos.', '', '', '', '', '', 'Habla con la capitana Garrick, que est en la Embajada Reposo Alado.', 47187),
(66108, 'esES', 'Una solucin machacante', 'Mata a Charcolmoggl, rey de los Faucecharco, y a Torbelliglgurgl, rey de los Aletaviento.', 'Aunque me alegro de que Tharu vea mi punto de vista, tambin agradezco que te haya puesto a rescatar a la fauna mientras yo perda el tiempo.\n\nLa situacin es mucho ms grave de lo esperado. Hizo bien en actuar. Con lo que hemos aprendido, temo que este bombardeo elemental no se detendr hasta que nos hayamos ocupado de los grlocs.\n\nSi yo fuera Tharu y pensara en actuar, ira directamente a por sus lderes. Sin nadie que los lidere, la lucha se disipar y dejarn de ser una amenaza para los Humedales.', '', '', '', '', '', '', 47187),
(66107, 'esES', 'Rescate de la fauna', 'Rescata a la fauna de los Humedales Inquietos.', 'No hace falta ser ecologista para ver que los Humedales estn en verdaderos problemas.\n\nPero Iskha nos tiene atrapados aqu, examinando criaturas muertas, cuando lo que deberamos hacer es evitar que mueran! A eso se dedica el Vuelo Rojo, a preservar la vida, no a diseccionarla!\n\nMe encanta Iskha, y es bueno en lo que hace, pero si esperamos hasta que haya terminado de perder el tiempo, no quedarn Humedales que salvar.\n\nYo me encargar de convencerlo, t sal ah fuera y rescata a la fauna.', '', '', '', '', '', '', 47187),
(66106, 'esES', 'No te enconches', 'Recoge $1oa caparazones imbuidos de agua y $1oa caparazones imbuidos de viento entre los grlocs Faucecharco y Aletaviento.', 'Fui un tonto al dudar de Iskha cuando insisti en que haba algo ms. No sera mi compaero si no estuviera siempre dos pasos por delante de m.\n\nPodemos compensarlo... pasando a la accin, claro. Si los caparazones son los que estn causando todo este caos elemental, por qu no te adentras en su campamento y se los arrebatas de sus viscosas manos?\n\nTrae unos cuantos caparazones de viento y agua, los suficientes para que Iskha investigue a su gusto.', '', '', '', '', '', '', 47187),
(66105, 'esES', 'Una solucin cortante', 'Mata a $1oa aguas desenfrenadas y a $1oa vientos desenfrenados.', 'Creo que desde aqu reunimos datos suficientes con seguridad, pero...\n\nTharu es un ecologista excepcional y es de los que prefieren actuar. Aun as, el ecosistema es frgil y podemos daarlo si no tenemos cuidado. Estoy de acuerdo en que no tenemos mucho tiempo.\n\nNo obstante, quiz merezca la pena hacerle caso. Un poco.\n\nAcabar con los elementales desenfrenados nos debera dar algo de tiempo sin que ello entorpezca nuestra investigacin. Procura reducir sus efectivos por igual; no queremos provocar ms desequilibrios.', '', '', '', '', '', '', 47187),
(66104, 'esES', 'Ecologa forense', 'Disecciona los cadveres de los grlocs.', 'Estoy desesperado, $n. Tharu y yo hemos inspeccionado casi todos los cadveres, pero, al final, no terminamos de ponernos de acuerdo con la metodologa. Ojal le diera la gana de hacerme caso!\n\n<El ecologista Iskha suspira>.\n\nEl estrs de esta situacin nos est afectando. Ni siquiera tengo una hiptesis clara.\n\nTienes pinta de tener buen estmago. Te encargas de los dos ltimos grlocs? Puedes usar mi escalpelo.', '', '', '', '', '', '', 47187),
(66103, 'esES', 'Deseos de agradar', 'Pon a prueba las habilidades de $1oa asesinos y vengadores Garranegra en el Baluarte Obsidiana.', 'Necesitamos ms tropas para defender la Ciudadela Obsidiana. Ahora que tenemos una posicin, es importante asegurarnos de tener ojos frescos y fuerzas renovadas.\n\nTenemos ms tropas de reserva en el Baluarte Obsidiana que podran ayudarnos.\n\nEstn bien entrenadas, pero se les vendra bien una prctica de combate con alguien con tanta habilidad y experiencia como t. As sabremos que estn listas.', '', '', '', '', '', 'Renete con Fao el Implacable, que est en el Baluarte Obsidiana.', 47187),
(66101, 'esES', 'Desde tan altas alturas', 'Usa el disco de perito para saltar al cielo y explorar la zona.', 'Toddy y Naleidea han solicitado un informe de reconocimiento inmediato de los alrededores.\n\nPor suerte, he conseguido un telescopio encantado y un disco de perito que nos ayudarn a explorar las zonas cercanas con seguridad desde las nubes.\n\nLo malo es que tengo un miedo atroz a las alturas y no puedo ni tocar el artilugio.\n\nT vrtigo no tienes, verdad?', '', '', '', '', '', '', 47187),
(66100, 'esES', 'Suministros en peso', 'Recoge $1oa bolsas de suministros de oteador.', 'Esta vez he metido la pata hasta el fondo. Me alej del campamento un momento y, al volver, pill a los tarasek robando todo lo que quedaba intacto.\n\nEsos suministros son caros y me es imposible pedir ms! Mi hermana Nori cree ya me tiene por una inepta.\n\nSi de verdad quieres adentrarte en el valle, te importara estar al tanto por si ves las bolsas de suministros?', '', '', '', '', '', '', 47187),
(66087, 'esES', 'Hora de cerrar', 'Ayuda a los Caminantes del Tiempo matando enemigos perdidos en el tiempo, potenciando a vuestros aliados bronce, devolviendo artefactos perdidos y cerrando fallas temporales en el Mar de Dunas.', 'Estas incursiones ponen a prueba la resistencia de esta lnea temporal hasta el punto casi de romperla. Ojal pudiera contar con todo un contingente de Caminantes del Tiempo!\n\nAunque acabas de aprender a usar el bastn, tengo entendido que ya te las has apaado para ayudarnos mucho. Si te doy un empujoncito, seguro que podras hacer an ms por nosotros.\n\nEn condiciones normales, te sometera a un entrenamiento completo, pero los tiempos son... poco convencionales. Llvate este pergamino de conocimiento avanzado y salo para repeler a los invasores! Los efectos son temporales, as que date prisa.', '', '', '', '', '', '', 47187),
(66085, 'esES', 'Si pudiramos retroceder en el tiempo', 'Cierra las fallas temporales en el Mar de Dunas con Siaszerathel.', 'Un verdadero Caminante del Tiempo nunca deja una crisis sin resolver. Por qu esperar y estudiar cuando ya tenemos las herramientas que necesitamos?\n\nComo tienes mi bastn original, yo he conseguido otro de repuesto. Seguro que nadie lo echar en falta. Te cuento el plan: unimos nuestras fuerzas y solucionamos lo de esas fallas. Todo el tema temporal an me confunde un poco.\n\nQu me dices? No puede ser muy difcil, verdad?', '', '', '', '', '', '', 47187),
(66084, 'esES', 'Tiempos como estos', 'Recoge $1oa de residuo temporal de enemigos perdidos en el tiempo en el Mar de Dunas.', 'A pesar del pequeo contratiempo del entrenamiento, creo que ests $gpreparado:preparada; para ayudarnos.\n\nLas distorsiones del valle estn permitiendo que se crucen varios perodos temporales con el nuestro. No sabemos cmo estn conectados y eso nos preocupa. Necesitamos ms informacin.\n\nTrata de averiguar ms cosas sobre las criaturas que salen de las distintas lneas temporales. Seguro que su paso ha dejado algn tipo de residuo. Si los estudiamos, es posible que encontremos el modo de anticiparnos a esta crisis.', '', '', '', '', '', '', 47187),
(66083, 'esES', 'Como si fuera la primera vez', 'Habla con Andantenormu y participa en el entrenamiento de los Caminantes del Tiempo.', 'Guiar las lneas temporales es una tarea peligrosa.\n\nAunque no eres $gun:una; Caminante del Tiempo, la embajadora Chronormu cree que sers de gran ayuda. No obstante, para garantizar tu seguridad debemos entrenarte como es debido.\n\nPor desgracia, todos nuestros instructores siguen desaparecidos. Har lo que pueda para ayudar. A ver cmo se nos da. S que la embajadora Chronormu cuenta con nosotros.', '', '', '', '', '', '', 47187),
(66082, 'esES', 'Tiempo embotellado', 'Recoge energa temporal de la fauna cada cargada de tiempo que hay en el Bosque Fluyente de Thaldraszus.', 'Genial! El bastn de Caminante del Tiempo est intacto! Pero no tiene energa.\n\nYa s! Podras recargarlo usando la energa temporal que se acumula entre la fauna local. Por desgracia, eso implica que debes destruir a las criaturas afectadas en el bosque. Las energas las vuelven peligrosas e inestables y habramos tenido que acabar con ellas de todos modos...\n\nA veces, hay que realizar sacrificios por un bien mayor. Puedes ayudarnos? Sigo necesitando descansar.', '', '', '', '', '', '', 47187),
(66081, 'esES', 'Se acaba el tiempo', 'Recoge $1oa recolectores temporales en el Bosque Fluyente de Thaldraszus.', 'Ahora que el Templo Bronce est bajo ataque, la energa temporal se est filtrando por todas partes.\n\nLos Caminantes del Tiempo han colocado recolectores por todo el bosque para tratar de reunir toda la magia errante. Todo lo que se recupere se puede usar como poder extra! Nos hace mucha falta porque esta crisis nos est dejando sin recursos.\n\nYo deba encargarme de recuperar los recolectores, pero necesito un respiro.\n\nPodras ir t a por ellos?', '', '', '', '', '', '', 47187),
(66080, 'esES', 'Problemas temporales', 'Encuentra a la recluta desaparecida en el Bosque Fluyente, que est en Thaldraszus.', 'Hola, $c. Llegas justo a tiempo!\n\nHay algunos problemas en el templo que estn desestabilizando las lneas temporales y provocando que se dispersen por el valle. Y eso no es todo, porque han desaparecido varios Caminantes del Tiempo.\n\nHemos pedido ms ayuda, pero una de las nuevas reclutas sigue sin aparecer.\n\nPuedes ir a buscarla? Eso s, ten cuidado. Dado el estado fluctuante del tiempo en el valle, nunca se sabe qu peligros puede haber!', '', '', '', '', '', '', 47187),
(66079, 'esES', 'Wrathion espera', 'Renete con Wrathion, que est en el Baluarte Obsidiana.', 'Estos huevos representan una nueva generacin de dragonantes. Hay que protegerlos protegerse y deben disponer de un hogar. No obstante..., mi preocupacin por Wrathion hace que se me parta el corazn. Temo que su cabezonera lo lleve a la locura. \n\nMe has sido leal a lo largo de los aos, $n. Quiz puedas ir a ayudarlo en mi nombre. \n\nBscalo en el Baluarte Obsidiana. Por favor, cuida de l. Quedan muy pocos en su Vuelo.', '', '', '', '', '', 'Renete con Wrathion, que est en el Baluarte Obsidiana.', 47187),
(66078, 'esES', 'Prctica afilada', 'Pon a prueba las habilidades de $1oa asesinos y vengadores Garranegra.', 'Durante aos, he cuidado de los Garranegra ensendoles y animndoles a alcanzar las mismas cotas que has conseguido t.\n\nPuede que no hayan logrado los mismos propsitos elevados, pero han cumplido sus propias expectativas. Estoy orgulloso de ellos.\n\nSera un honor que pusieras a prueba sus habilidades. Creo que vers algo de ti reflejado en ellos.', '', '', '', '', '', '', 47187),
(66076, 'esES', 'Cornisapo anciano', '', '', '', '', '', '', '', '', 47187),
(66074, 'esES', 'La reina guadido primigenia', '', '', '', '', '', '', '', '', 47187),
(66071, 'esES', 'Rocs voladores', 'Ayuda a $1oa rocs plumazul heridos.', 'Soy la profesora Harleen Chirridos, eminente ornitloga. He venido a estudiar a los mticos rocs plumazul de las Islas Dragn, pero supongo que tenemos cosas ms importantes entre manos.\n\nCreo que estas arpas volaron desde Kalimdor cuando las islas se despertaron. Son bastante invasivas, y estn arrasando con todo como una manada de ogros en el buf del Casino Pantoque.\n\nDemos a los rocs una oportunidad para defenderse. Toma este botiqun y ayuda a los que estn heridos a recuperarse.', '', '', '', '', '', '', 47187),
(66070, 'esES', 'Los huesos de Hoja Brillante', '', '', '', '', '', '', '', '', 47187),
(66057, 'esES', 'Restaurar la fe', 'Repara la piedra de juramento obsidiana.', 'Los fragmentos destrozados se han vuelto a formar. Estamos listos para reparar la piedra de juramento.\n\nVe y ayuda a Wrathion a acabar de repararla.', '', '', '', '', '', 'Renete con Wrathion en el Trono Obsidiana.', 47187),
(66056, 'esES', 'Forjar un nuevo futuro', 'Prepara la forja del Guardin de la Tierra.', 'La forja del Guardin de la Tierra es la ms poderosa de todas las forjas de los dragones que existen. Nuestros antepasados la usaron para forjar las armas y armaduras ms poderosas posibles para defender Azeroth.\n\nEn lo ms profundo de ella se halla el poder necesario para volver a formar los fragmentos destrozados de la piedra de juramento.\n\nPongmonos en marcha y preparemos la forja para todo el trabajo que queda por hacer.', '', '', '', '', '', 'Entrega el carbn de fragmento cenizo al maestro de forja Bazentus.', 47187),
(66055, 'esES', 'Un pasado destrozado', 'Recupera $2oa fragmentos de piedra de juramento.', 'La piedra de juramento est daada. Le faltan piezas.\n\nHaz lo que puedas para recuperar los fragmentos. Puede que haya un modo de reparar la piedra!', '', '', '', '', '', '', 47187),
(66049, 'esES', 'Piedra de juramento obsidiana', 'Encuentra la piedra de juramento obsidiana.', 'Cuando Neltharion se convirti en el Guardin de la Tierra, jur proteger este mundo, $n. Jur proteger las profundidades de la tierra y defender Azeroth junto a su Vuelo. La piedra de juramento obsidiana representa esa promesa. \n\nDebemos activar la piedra y dejar que las Islas Dragn sepan que el Vuelo Negro ha regresado.\n\nSgueme, $n.', '', '', '', '', '', '', 47187),
(66048, 'esES', 'Los mejores planes e intenciones', 'Revisa los planes con los distintos miembros de las fuerzas de Wrathion.', 'No ser fcil atacar a los djaradin que controlan la Ciudadela Obsidiana. Incluso con Wrathion y sus fuerzas Garranegra, ser una batalla encarnizada. Puede que Wrathion est convencido, pero yo no lo tengo tan claro.\n\nTal vez podamos hablar con quienes elaboran la estrategia y ver si se puede mejorar algo.', '', '', '', '', '', 'Informa de tus descubrimientos a Wrathion, que est en el Baluarte Obsidiana.', 47187),
(66044, 'esES', 'Tomar las murallas', 'Elimina las tres arbalestas de asedio y al campen Choruk.', 'Sabellian y los dems dragones estn frenando a los Djaradin por ahora. Debemos actuar con rapidez para asegurar las torres altas y nuestra victoria.\n\nT y yo eliminaremos las arbalestas de asedio que nos amenazan desde arriba.\n\nAvsame cuando lo tengas todo listo.', '', '', '', '', '', 'Renete con Wrathion', 47187),
(66040, 'esES', 'Regreso al futuro', 'Defiende a tus aliados contra el Imperio Negro hasta que se haya creado el portal temporal.', 'Ya no seguiremos cayendo a travs del tiempo, pero nos hemos adentrado demasiado en el pasado. Un pasado muuuy lejano. Pero lejano en plan \"los titanes an no han visitado Azeroth\". Volver a casa ser... complicado.\n\nPero la especie de los dragones puede con esto y ms. \n\nEso s, vamos a necesitar que contengas a esos esbirros del Imperio Negro. No nos llevar mucho tiempo. \n\nCreo.\n\nEspero.\n\nNo te preocupes. T mantn alejados a esos monstruos y nos ocuparemos del resto. Es pan comido!', '', '', '', '', '', '', 47187),
(66039, 'esES', 'Tiempo de Cromi', 'Encuentra a Cromi y completa el ritual de estabilizacin temporal.', 'Esto... es el Imperio Negro. Hemos viajado muy atrs en el tiempo, sin duda.\n\nMira! Veo a la embajadora Chronormu y a Eternus. Tenemos que darnos prisa y completar el ritual. \n\nNo tengo tanta curiosidad por saber cul puede ser su siguiente destino.', '', '', '', '', '', '', 47187),
(66038, 'esES', 'Una carrera a travs del tiempo!', 'Participa en una carrera a travs del tiempo tras los pasos de Cromi y Eternus.', '$n, debemos actuar rpido para alcanzar a la embajadora Chronormu, y me refiero a ser rpidos literalmente.\n\nZera y yo haremos lo que podamos para acelerar nuestro progreso, pero es fundamental que evitemos enredarnos en este tiempo todo lo posible. Eso nos ralentizara y quiz nos impedira atrapar a la embajadora antes de que se pierda y no pueda alcanzarla ni la magia de Nozdormu.\n\nNo hay tiempo que perder.\n\n|cFF0000FF(Si aceptas esta misin, se iniciar un temporizador)|r', '', '', '', '', '', '', 47187),
(66037, 'esES', 'De vuelta a la realidad', 'Vuelve con Nozdormu al presente.', 'Hemos podido aumentar la conexin de la embajadora Chronormu con nuestro tiempo. Estoy seguro de que, cuando la encontremos, podremos terminar el ritual.\n\nPor ahora, volvamos a nuestro presente y a un mundo con... muchos menos mrlocs.', '', '', '', '', '', '', 47187),
(66036, 'esES', 'Mugurlglrlgl!', 'Murglgulglrrglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<No tienes claro lo que est diciendo, pero apuala el aire repetidas veces. Parece que el mrloc quiere que mates algo>.', '', '', '', '', '', '', 47187),
(66035, 'esES', 'Motas mrloc', 'Drena $1oa motas temporales.', 'Una lnea temporal alternativa nacida de los mrlocs?!\n\nPerdn por mi egosmo, pero podras conseguirme unas motas de energa temporal mientras localizas a Chronormu?\n\nSolo tienes que acercarte a ellas y el bastn har el resto. Examinar los datos ms tarde, cuando no estemos en pleno viaje entre las diferentes realidades de Azeroth.', '', '', '', '', '', '', 47187),
(66033, 'esES', 'Al... pasado?', 'Usa el portal y renete con Andantenormu, que est en Azmerloth.', 'Es lamentable que no pudiramos estabilizar a Chronormu, pero hay otro posible lugar en el que podramos atraparla y terminar con su cada en el tiempo.\n\n<Nozdormu frunce el ceo>.\n\nLas visiones de esta lnea temporal son... extraas. Incluso comparadas con algunas con las que me he encontrado en mi vida.\n\nNo bajes la guardia, $n. No tengo claro a qu te vas a enfrentar, pero s s que es algo poderoso y extraamente familiar.', '', '', '', '', '', 'Usa el portal y renete con Andantenormu, que est en Azmerloth.', 47187),
(66032, 'esES', 'Regreso al presente', 'Vuelve con Nozdormu al presente.', 'Esta lnea temporal es oscura y catica. La perturbacin ha sido grave. Creo que me quedar un rato ms para ver qu ondas pueden quedar.\n\nVuelve con Nozdormu. Querr estar al tanto de nuestro xito aunque haya sido menor del que nos gustara.', '', '', '', '', '', '', 47187),
(66031, 'esES', 'Recuperar el tiempo perdido', 'Rene esencia elemental para el campamento de los supervivientes.', 'Supongo que no debera sorprenderme de estar aqu.\n\nEste no es el Azeroth que quera, pero es el que tengo. Luchamos para preservar lo que queda y recuperar el mundo, pero tu llegada ha causado algunos problemas.\n\nUsamos la esencia de esos elementales para alimentar nuestras protecciones y mantenernos a salvo. Ves ese escudo? Es lo nico que impide que nos descubran y nos aniquilen, y t has agotado nuestros recursos. Treme parte de esa esencia y podremos sobrevivir un da ms.', '', '', '', '', '', '', 47187),
(66030, 'esES', 'La resistencia no es ftil', 'Sana a los combatientes de la Resistencia que hay en el Futuro Primalista.', 'Las ondas temporales han causado problemas a la gente de aqu. Aparecen enemigos donde antes no haba o son mucho ms fuertes de lo que deberan. Son cambios pequeos pero desastrosos.\n\nTe pido que ayudes a los combatientes de la Resistencia. Sana sus heridas para que puedan volver a la batalla. Devuelve su lnea temporal al lugar correcto, como si nunca hubieran interactuado con nosotros. No es mucho, pero es lo que podemos hacer por ellos.', '', '', '', '', '', '', 47187),
(66029, 'esES', 'Ajuste temporal', 'Utiliza el cronocristal con Eternus y Cromi en el Futuro Primalista para evitar que caigan a travs del tiempo.', 'Chronormu y Eternus estn cayendo a travs del tiempo, pero siento que se detienen de vez en cuando. Estos instantes son nuestra oportunidad de encontrarlas.\n\n<Nozdormu conjura un cronocristal pequeo>.\n\nHe imbuido este cristal de poder y de mi propia resonancia temporal. Han viajado a un... posible futuro muy problemtico. Encuntralas y salo. Espero que puedas estabilizar su posicin en el tiempo antes de que vuelvan a desaparecer.', '', '', '', '', '', 'Vuelve con Nozdormu al presente.', 47187),
(66028, 'esES', 'Al futuro!', 'Viaja al Futuro Primalista.', 'He rastreado a Chronormu y a Eternus hasta un posible futuro. No s qu encontrars all, solo s que reina la oscuridad y el caos.\n\nSoridormi se ha adelantado con algunos de nuestros Caminantes del Tiempo para mantener estable nuestra conexin con este tiempo. Necesitaremos su considerable poder para mantener el portal abierto, as que debe confiar en tus talentos.\n\nSoridormi podr darte ms indicaciones cuando la veas all.\n\nDeprisa, $n. Encuentra a Chronormu.', '', '', '', '', '', 'Habla con Soridormi en el Futuro Primalista.', 47187),
(66027, 'esES', 'Llamar a los dragones azules', 'Observa la llamada de Kalecgos al Vuelo Azul.', 'Ya no me da miedo reunir a los dragones azules, $n. Es mejor ser una familia... que un fragmento de lo que ramos.\n\nAunque no pueda reclamar la piedra de juramento, puedo usar su poder para enviar un mensaje a todos los dragones azules. \n\nEs hora de que reciban noticias... de su Aspecto.', '', '', '', '', '', '', 47187),
(66026, 'esES', 'Accin urgente necesaria', 'Renete con Brena en Frondacuero.', 'El origen de estos ataques debe de estar en Frondacuero.\n\nHemos luchado contra los gnolls de Frondacuero durante generaciones, pero hasta ahora no han resultado ms que un incordio.\n\nAhora no tenemos ms opcin que tomar medidas urgentes. Esta repugnante descomposicin destruir las Tierras Azures, incluido lo que sea que ests buscando.\n\nNos vemos en las afueras de Frondacuero. Vamos a necesitar toda la ayuda posible.', '', '', '', '', '', '', 47187),
(66025, 'esES', 'La amenaza Nokhud', 'Habla de los siguientes pasos.', 'El ejrcito del Clan Nokhud est tomando el control de Maruukai.\n\nDebatiremos los pasos a seguir en las cmaras de los khanes. Debemos proteger a los Maruuk.', '', '', '', '', '', '', 47187),
(66024, 'esES', 'Cubrir la retaguardia', 'Mata a la guardia Bahir.', 'A los Nokhud les pirran las historias de guerra del pasado ancestral de nuestro pueblo. En realidad son unos cros dbiles y teatrales. Ha bastado un relmpago para que corten su conexin con Ohn\'ahra.\n\nEst bien! Si recorren el camino de la corrupcin en busca de guerra, los complaceremos.\n\nPor supuesto, dejaron a Bahir al mando para cubrir su retirada. Pronto, su sangre teir la tierra.', '', 'Bahir, dejada al mando por Balakar, lleva mucho tiempo esperando este momento.', 'La guardia Bahir', '', '', 'Vuelve con la khanam Matra Sarest.', 47187),
(66023, 'esES', 'Rompetreguas', 'Mata a $1oa Nokhud.', 'Balakar es una desgracia para su clan. Cegado por su ansia de poder, los lleva de cabeza a la tormenta.\n\nSu traicin revela su fragilidad. Acaba con ellos.', '', '', '', '', '', '', 47187),
(66022, 'esES', 'La khanam Matra', 'Presntate ante el guardia del khan Akato para asistir a la audiencia de Gemisath con la khanam Matra.', 'No puedo quedarme en las tierras de los centauros, debo volver a los jardines tan pronto como pueda.\n\nLa khanam Matra ha accedido a escuchar nuestra peticin de ayuda. Espera mi llegada en lo alto del krutal, el edificio central de Maruukai.\n\nAunque debo ser yo quien hable con ella, eres ms que $gbienvenido:bienvenida; a unirte a nosotros.', '', '', '', '', '', '', 47187),
(66021, 'esES', 'Una visita inoportuna', 'Derrota a $1oa centauros Nokhud.', 'Ja! Mrate. Eres dbil. Igual que esos insignificantes cazadores que te trajeron aqu.\n\nQuieres conocer a los Nokhud? Nuestro idioma es la batalla.\n\nNuestro ritual de batalla se llama \"tabarr\". Entrenamos y nos hacemos fuertes. No hay debilidad en nuestro clan.\n\nYa basta de charla. Ve a entrenar.', '', '', '', '', '', 'Vuelve con la exploradora Tomul.', 47187),
(66020, 'esES', 'Augurios e incienso', 'Recoge $1oa flores de madreselva, machcalas para convertirlas en incienso de madreselva y ayuda a Ohn Seshteng en el ritual.', 'He compartido con la khan Tigari el presagio que recibimos antes de entrar a Maruukai. Ha expresado su preocupacin, y tambin ha sentido el fro del viento.\n\nAqu cultivamos ciertas flores, que molemos y quemamos para provocar un efecto de trance. Las utilizamos para conectar an ms con los presagios.\n\nTe pido que recojas algunas de ellas para que podamos elaborar el incienso. Con la ayuda de la khan, tal vez podamos averiguar ms cosas sobre la situacin de Ohn\'ahra.', '', '', '', '', '', '', 47187),
(66019, 'esES', 'Honrar a nuestros ancestros', 'Ayuda a Qariin Dotur a cocinar para los ancestros.', 'Nuestros ancestros caminan a nuestro lado a travs de los vientos de Ohn\'ahra. Nos guan y nos protegen. Todos los Maruuk, muertos y vivos, se renen con una tregua en el Khural.\n\nEl aroma de esta comida llama a los ancestros para que se renan en torno a nuestro fuego. Cuando lleguen, comenzar el Khural.', '', '', '', '', '', '', 47187),
(66018, 'esES', 'El Clan Nokhud', 'Acompaa a Tomul a ver a la guardia Bahir.', '<Okir pone voz a las seales de la khan Sansok>.\n\nEl Clan Nokhud es el ltimo que ha ascendido al poder. Su difunto khan, Jhakan, alz un poderoso ejrcito para hacerse con el territorio de sus predecesores. Este es el camino de nuestro pueblo.\n\nJhakan se gan el respeto de su gente, pero su hijo no. Balakar mat a su padre y se hizo con el control del clan. Desde entonces se han aislado cada vez ms. Pero para conocer a los Maruuk, tambin debes conocerlos a ellos.', '', '', '', '', '', 'Renete con la exploradora Tomul en el campamento Nokhud.', 47187),
(66017, 'esES', 'El Clan Ohn\'ir', 'Renete con Ohn Seshteng en las pozas msticas.', '<Okir pone voz a las seales de la khan Sansok>.\n\nLos msticos de nuestras tierras, como Ohn Seshteng, pertenecen al Clan Ohn\'ir. Este clan no est formado por familias, sino por centauros de las llanuras que tienen una conexin innata con Ohn\'ahra. Se pasan la vida fortaleciendo esa conexin y perfeccionando sus habilidades. Con el tiempo reciben la tarea de aconsejar a otros clanes y proteger nuestras tierras.\n\nOhn Seshteng se ha ido a hablar con su khan sobre los presagios que presenci. Ve con ella para saber ms sobre los Ohn\'ir.', '', '', '', '', '', 'Renete con Ohn Seshteng en las pozas msticas.', 47187),
(66016, 'esES', 'El Clan Teerai', 'Presntate ante Qariin Dotur.', '<Okir pone voz a las seales de la khan Sansok>.\n\nLa khanam Matra pertenece al Clan Teerai, que es nuestra conexin directa con los ancestros de los Maruuk. Son los representantes de nuestras tradiciones y nuestros narradores.\n\nPara comprender a los Maruuk, debes comprender al Clan Teerai. Una de las hijas de la khanam Matra, Qariin Dotur, est preparando comida para nuestros ancestros. Aydala. Ella te ensear cosas sobre nuestro pueblo.', '', '', '', '', '', 'Presntate ante Qariin Dotur.', 47187),
(66015, 'esES', 'La piedra de juramento del dragn azul', 'Acompaa a Kalecgos a reclamar la piedra de juramento del dragn azul.', 'Por ahora, las Tierras Azures se han estabilizado y han aparecido ms dragones azules... justo a tiempo.\n\nEs hora de volver al Archivo Azur y reclamar la piedra de juramento.\n\nNecesitara que estuvieses all, $n. Has sido una enorme bendicin en este calvario.', '', '', '', '', '', '', 47187),
(66011, 'esES', 'En recuerdo de Ysera', 'Vuelve a buscar a Theramus.', 'Oh, no! Creo que ahora lo entiendo. Theramus... echa de menos a Ysera, y ella no puede volver.\n\nVen! Sospecho que s adnde ha ido. No volveremos a molestarlo, pero no estar de ms decirle que lo sentimos y que le daremos el espacio que necesita.\n\nEstamos aqu para cuidarnos, como la naturaleza que nos rodea.', '', '', '', '', '', '', 47187),
(66009, 'esES', 'En defensa de Vakthros', 'Derrota a Korthrox el Destructor.', 'Es el momento, $n. Al ocuparte del asunto en tierra, las fuerzas primalistas que hay en el aire estn decayendo.\n\nGracias a ti, Razageth quiere reforzar sus tropas con una de sus lugartenientes.\n\nNecesito que te encargues de ese monstruo mientras yo avanzo para luchar contra Razageth y ayudar a Khadgar.\n\nBusca mi magia durante la lucha. Har lo que pueda para ayudarte.\n\nHa llegado la hora de que Razageth se enfrente a la furia del Aspecto de la Magia!', '', 'Uno de los tenientes de Raszageth, empeado en destruir a los dragones azules.', 'Korthrox el Destructor', '', '', 'Habla con Khadgar ms arriba, en Vakthros.', 47187),
(66007, 'esES', 'Aire libre', 'Destruye $1oa balizas de lava.', 'Los Primalistas estn usando esos enormes orbes para contener a Kalecgos.\n\nA este ritmo, sus heridas sern demasiado graves como para que pueda seguir luchando. Si cae, no podr rechazar a Raszageth.\n\nLa gema potenciada que llevas te permitir disfrazarte de elemental y pasar sin que noten tu presencia.\n\nsala para destruir los orbes. Eso dar margen a Kalecgos para desatar su poder.\n\nYo me centrar en proteger la torre de Raszageth.', '', '', '', '', '', 'Renete con Kalecgos en una cueva que en el interior de la Cumbre de Vakthros.', 47187),
(66006, 'esES', 'Volver con Roscha', 'Devuelve los suministros a la herradora Roscha.', 'Baba ha descansado, y hemos recuperado los suministros de Roscha. Podemos regresar sin irritarla ms.\n\nLlvate algunas cajas. Enviar guerreros a recoger el resto.', '', '', '', '', '', '', 47187),
(66005, 'esES', 'Medalln de una camarada cada', 'Devuelve el medalln de una camarada cada a Khasar.', '<Este trozo de metal mordisqueado era un bonito ornamento de gran importancia para un centauro Shikaar.\n\nPuede que Khasar sepa a quin pertenece>.', '', '', '', '', '', 'Devuelve el medalln de una camarada cada a Khasar.', 47187),
(66004, 'esES', 'Galgresh', '', '', '', '', '', '', '', '', 47187),
(66003, 'esES', 'Anillos para atarlos', 'Consigue $1oa anillos de vnculo de magma.', 'Los djaradin de aqu se han vuelto audaces, han vinculado los elementales de llamas y han dejado que arrasen la zona. La fauna ha huido y los elementales se acercan peligrosamente a nuestros campamentos.\n\nPor suerte, he podido construir un pequeo bastin de piedra para resistir la violencia que han desatado los djaradin... y no fracasaremos!\n\nRene los anillos mgicos que vinculan a estos elementales de llamas. Los usaremos para reforzar nuestras defensas contra ellos.', '', '', '', '', '', '', 47187),
(66001, 'esES', 'Una ltima esperanza', 'Rescata el ltimo huevo de dragn imbuido.', 'Un linaje entero de vstagos, perdido...\n\n<Sendrax se endereza y levanta la cabeza>.\n\nQueda una ubicacin que an no hemos comprobado. El escenario del ritual donde ese protodragn dej caer los huevos.\n\nLuchemos codo con codo contra sus crueles defensas, $p, y salvemos lo que podamos.', '', '', '', '', '', '', 47187),
(66000, 'esES', 'Biblioteca de Alexstrasza', 'Salva $1oa obras con valor cultural.', '<Las pginas del libro estn carbonizadas.\n\nLos Primalistas parecen estar quemando los antiguos escritos que hay aqu para destruir la propia historia de los Vuelos. Es como si quisieran borrar cualquier referencia a los Vuelos de la historia.\n\nSalva lo que puedas>.', '', '', '', '', '', '', 47187),
(65999, 'esES', 'Garras y dientes rojos', 'Mata a $1oa invasores primalistas.', 'El comandante Lethanak nos advirti de que, segn sus informes, la Devoradora de Tormentas, Raszageth, haba escapado de su prisin. Parece que sus sirvientes la han seguido y ahora amenazan todo lo que amamos.\n\nSe mueven rpido. El ltimo informe indicaba que estas ruinas estaban abandonadas.\n\nDebemos detener a los Primalistas.\n\nPor la Protectora y por todos los Vuelos!', '', '', '', '', '', '', 47187),
(65998, 'esES', 'El futuro de los Vuelos', 'Rescata los huevos de dragn rub.', 'No hay mayor honor que pueda recibir un dracnido al graduarse que defender cada huevo de dragn con su vida.\n\nPara eso entrenamos. Es la razn de nuestra existencia.\n\nNo puedo seguir aqu sin hacer nada, $p. Al robar e imbuir esos huevos, los Primalistas amenazan el futuro de todos los Vuelos!\n\nNos superan en nmero, pero luchars a mi lado? Luchars por salvar los Vuelos?', '', '', '', '', '', '', 47187),
(65997, 'esES', 'En pos de Sendrax', 'Encuentra a Sendrax en las ruinas del Invernadero de la Protectora.', 'La cadete Sendrax pas por aqu hace poco.\n\nNos inform de que el comandante Lethanak ordenaba que todos los dracnidos se reagrupasen en los Estanques de Vida. Todo nuestro regimiento parti hacia all poco despus.\n\nPero nuestros exploradores estaban patrullando en las viejas ruinas, as que Sendrax fue a informarles.', '', '', '', '', '', 'Renete con Sendrax en el Invernadero de la Protectora.', 47187),
(65996, 'esES', 'Refuerzos veteranos', 'Ayuda a los guardias heridos y encuentra a Sendrax.', 'El comandante Lethanak ha demostrado su perspicacia de costumbre. Necesitaremos la ayuda de nuestros guardias ms veteranos si queremos frenarlos su amenaza. Reunirlos es la tarea perfecta para una joven cadete como Sendrax, pero puede que necesite ayuda.\n\nSu misin la llevar hacia el oeste, que puede haber sido abrumado por esta creciente amenaza. All tambin necesitarn ayuda. Toma este brebaje y ofrceles tu apoyo.', '', '', '', '', '', 'Renete con Sendrax en la Avanzada del Invernadero', 47187),
(65995, 'esES', 'La Ciudadela Obsidiana', 'Entrega los planes qalashi a Wrathion.', '<A primera vista, parecen mensajes internos entre campamentos djaradin.\n\nLas palabras \"Ciudadela Obsidiana\" te llaman la atencin.\n\nQuizs a Wrathion le interese>.', '', '', '', '', '', '', 47187),
(65994, 'esES', 'Justicia djaradin', '', '', '', '', '', '', '', '', 47187),
(65993, 'esES', 'Aguafiestas', 'Mata a la muelecarnes Sotok en el Castillo Quiebrascama.', 'Ah, s.\n\nVi a la lder de los gigantes volver de un ataque poco despus de mi llegada. Est celebrando su victoria en algn lugar del campamento.\n\nSera una pena que alguien le arruinara la juerga, no crees?', '', 'Gerifalte del ataque a la Avanzada Corazn de Dragn.', 'Muelecarnes Sotok', '', '', 'Renete con Wrathion en el Castillo Quiebrascama.', 47187),
(65992, 'esES', 'Informacin Garranegra', 'Habla con los espas de Wrathion escondidos en el Castillo Quiebrascama.', 'Mientras Selistra y yo atraamos sus miradas hacia el cielo, mis sombras se colaban a travs de sus defensas.\n\nMis agentes, los Garranegra, vigilan y escuchan por toda la fortaleza. Renete con ellos y hazles saber que ests de nuestro lado. Te darn informacin valiosa sobre nuestros enemigos.', '', '', '', '', '', 'Renete con Wrathion en el Castillo Quiebrascama.', 47187),
(65991, 'esES', 'Hora de ajustar cuentas', 'Renete con Wrathion y la mayordoma Selistra en el Castillo Quiebrascama.', 'La cadete Sendrax me ha informado de los planes de nuestra mayordoma. Gracias a la Protectora por su ayuda. Esto nos da el respiro que necesitamos para llevar a nuestros heridos de vuelta a los Estanques de Vida, donde podrn recibir tratamiento.\n\nOjal pudiera enviar refuerzos a Selistra, pero debo mantener mis guardias cerca de los heridos. Dirgete a la fortaleza enemiga y renete con ellos.\n\nSi existiera otro modo de lidiar con los Djaradin, recurrira a ello. Pero tal y como est la cosa...\n\nDebes hacer lo que debe hacerse.', '', '', '', '', '', '', 47187),
(65990, 'esES', 'Lbralos del mal', 'Salva a $1oa vstagos sollozantes en la Avanzada Corazn de Dragn.', 'Se abalanzaron sobre nosotros antes de que pudiramos responder. Mis guardias aguantaron todo lo que pudieron mientras evacubamos a los jvenes e indefensos, pero me temo que an quedan algunos en la avanzada.\n\nCruza ese puente y busca supervivientes.', '', '', '', '', '', '', 47187),
(65989, 'esES', 'Invasin djaradin', 'Acaba con $1oa djaradin en la Avanzada Corazn de Dragn.', 'Puede que no tengamos el poder necesario para recuperar nuestra avanzada, pero no podemos rendirnos sin luchar.\n\nDemustrales que an tenemos dientes.', '', '', '', '', '', '', 47187),
(65977, 'esES', 'Recuperacin del Kirin Tor', 'Rescata a $1oa magos moribundos.', 'Cuando los Primalistas atacaron a nuestra expedicin, tem haber perdido a muchos de nuestros magos.\n\nPero parece que se los llevaron para torturarlos!\n\nPor favor, debes rescatar a esos magos. Tal vez no puedan ayudarnos en esta lucha, pero no podemos dejarlos atrs.', '', '', '', '', '', 'Renete con la proyeccin de Khadgar ms adelante, en el Coto de Vakthros.', 47187),
(65962, 'esES', 'La interminable cuenta atrs', 'Habla con Cromi cuando ests a punto.', 'Nunca pens que salvara nuestro templo desmantelando las mismas medidas de seguridad que habamos creado para protegerlo, pero aqu estamos!\n\nAhora que los elementales de tiempo han sido purgados, los Caminantes del Tiempo son libres y los celadores estn listos, ha llegado el momento de desactivar la burbuja de estasis y encargarnos de Eternus.\n\nAvsame cuando quieras empezar. S que nada puede salir mal contigo a mi lado.', '', '', '', '', '', '', 47187),
(65958, 'esES', 'Poder primigenio', 'Utiliza el enfoque elemental para absorber la energa elemental de los primalistas y elementales asesinados.', 'Me temo que cada vez es ms difcil mantener mis reflejos exactos. Los Primalistas estn centrando sus esfuerzos en derribarme.\n\nNo te preocupes... Tengo un plan.\n\nNecesito que tomes el orbe que has recuperado y renas la magia elemental de los primalistas muertos. \n\nNecesitaremos ese poder elemental ms adelante para alejar a sus fuerzas de m.', '', '', '', '', '', 'Renete con la proyeccin de Khadgar ms adelante, en el Coto de Vakthros.', 47187),
(65957, 'esES', 'No hay tiempo para hroes', 'Mata a Modak la Escupellamas, a la Perforadora Gigra y a Olphis el Fundido.', 'Por lo que hemos visto, la sociedad djaradin se basa en la fuerza. Los ms fuertes sirven de ejemplo para que los dems luchen con ms ahnco. \n\nEntre los djaradin de ah abajo hay tres ms poderosos que el resto... Esos son tus objetivos.\n\nT, $n, los eliminars personalmente. Esto debera asestar un golpe devastador a su moral.', '', '', '', '', '', '', 47187),
(65956, 'esES', 'Golpe de garfa', 'Defensas djaradin desbaratadas.', 'Con tu ayuda, mis asesinos Garranegra acabarn con los djaradin que defienden el permetro exterior. Marca a cualquier objetivo con una pequea bomba aturdidora y acudirn en tu ayuda.\n\nProcede con rapidez y elimina todo lo que pueda entorpecer nuestro avance.', '', '', '', '', '', '', 47187),
(65955, 'esES', 'El mejor amigo del centauro', 'Libera a Khasar y renete con l en la cueva.', 'No es seguro quedarnos al descubierto, $p.\n\nLos grlocs llevaron a la fuerza a Baba, mi compaero de caza, a una cueva al este.\n\nLibrame y aydame a rescatar a Baba. Nos veremos en la cueva cuando el camino est despejado.', '', '', '', '', '', '', 47187),
(65954, 'esES', 'Liberar a los canes', 'Libera a los bakars Shikaar.', 'He odo los familiares aullidos y ladridos de unos bakars que han desaparecido del campamento.\n\nNuestros queridos perros estn atrapados en jaulas, esperando a que esas... cosas los hagan pedazos.\n\nEs nuestro deber proteger a nuestros compaeros. Libralos y presencia el verdadero poder de un bakar Shikaar!', '', '', '', '', '', '', 47187),
(65953, 'esES', 'Destruct-orculo', 'Recoge $1oa ttems de chamanes grloc.', 'De todas las locuras de esta aldea de grlocs, la ms inquietante es la de los chamanes.\n\nSon especialmente feroces y juegan imprudentemente con la magia de tormenta sin pensar en las consecuencias. \n\nHay que poner fin a esto. Mtalos y treme sus ttems. A nuestros msticos les interesarn mucho.', '', '', '', '', '', '', 47187),
(65952, 'esES', 'Un jefe legendario', 'Mata al jefe Grrlgllmesh.', 'Antes, los grlocs de este pantano eran criaturas sencillas. Alimaas, tal vez, pero nunca asaltantes, ladrones ni comeperros.\n\nEs su jefe, Grrlgllmesh, quien los ha alejado de su naturaleza.\n\nAcaba con l y los grlocs dejarn de atacarnos.', '', 'Grrlgllmesh, el ms poderoso de los grlocs, no tiene nada ms que conquistar que su propia desesperacin.', 'Jefe Grrlgllmesh', '', '', '', 47187),
(65951, 'esES', 'Proveedor exclusivo', 'Busca a Khasar en el bosque.', 'Pobre Roscha! Ha trabajado sin descanso para prepararse para la caravana, y ahora van los asquerosos grlocs y le roban los suministros.\n\nYa ha perdido muchsimo. Voy a hacer lo que pueda por ayudarla.\n\nEs probable que Khasar haya ido a recuperar los suministros solo, sin decrselo a nadie. Ha sido decisin suya, pero lleva fuera demasiado tiempo. Adems, faltan muchos perros.\n\nPodras buscar a Khasar y a los perros, $p?', '', '', '', '', '', 'Habla con Khasar en la Aldea Aletalodo.', 47187),
(65950, 'esES', 'Grlocs ladrones', 'Recupera los suministros robados de la Aldea Aletalodo y devulvelos.', 'Han invitado a la herrera Roscha a la caravana? Nooo! Quin debe proporcionar zapatos a la caravana? La herradora Roscha. Y a quin roban los Aletalodo? A la herradora Roscha. A quin si no?\n\nEnviara a Khasar, pero cualquiera sabe por dnde andar ahora. \n\nBusca mis suministros. Ensea a esas criaturas a no robar a la herradora Roscha.\n\nAdelante!', '', '', '', '', '', 'Habla con Khasar en la Aldea Aletalodo.', 47187),
(65949, 'esES', 'Reparaciones', 'Devuelve el medalln a la herradora Roscha.', 'Cuando nos unimos a Ohn\'ahra en el viento, nos desprendemos de esos medallones.\n\nSi bien ayud a fabricar este medalln, no me pertenece.\n\nHay que devolvrselo a Roscha. Es el ltimo recuerdo de su prometido.\n\nLlvaselo para que pueda llorar su muerte y estar en paz.', '', '', '', '', '', '', 47187),
(65948, 'esES', 'Grietas en el tiempo', 'Usa los cristales del este y del oeste para potenciar an ms tu bastn de Caminante del Tiempo.', 'Cuando el templo se cerr, los celadores se quedaron atrapados con las puertas del templo. Debemos eliminar esa burbuja de estasis para liberarlos! Por desgracia, necesitamos un bastn de Caminante del Tiempo a pleno poder...\n\nYa s! Puedes drenar los cristales de estas plataformas! Eso debera bastar para potenciar el bastn.\n\nTienen sus propios campos de estasis, as que solo debes arrancarlos y absorber su energa con tu bastn.\n\nY no te preocupes si se rompen. El poder sigue ah, incluso en pedazos!', '', '', '', '', '', '', 47187),
(65947, 'esES', 'Caminantes del Tiempo anclados en el tiempo', 'Libera a $1oa Caminantes del Tiempo de sus burbujas temporales.', 'Me alegra verte aqu! Necesito que estabilices la situacin en las plataformas mientras Dante y Zera me ayudan a mantener en su sitio a nuestra amiga la dragona infinita.\n\nLas medidas de seguridad del templo encerraron a Eternus en una burbuja de estasis cuando intent hacerse con la piedra de juramento. Por desgracia, tambin atraparon a los dems Caminantes del Tiempo.\n\nTu bastn de Caminante del Tiempo debera liberarlos sin problemas. Asegrate de lidiar con los vstagos temporales que puedan aparecer!', '', '', '', '', '', '', 47187),
(65944, 'esES', 'Rfaga de lava', 'Destruye $1oa orbes de lava.', 'Los Primalistas han destrozado la montaa para enviar sus fuerzas a Vakthros!\n\nHe visto algunos orbes de lava en el pasillo inicial que estn usando para propagar su caos elemental.\n\nDestryelos para frenar su avance. Har lo que pueda desde aqu para ayudar a Kalecgos.', '', '', '', '', '', 'Renete con la proyeccin de Khadgar dentro del Coto de Vakthros.', 47187),
(65943, 'esES', 'Ofensiva primigenia', 'Derrota a $1oa primalistas en Vakthros.', 'Khadgar y yo estamos haciendo todo lo posible para mantener a raya a los Primalistas en el cielo, pero no podemos avanzar ms hacia la torre.\n\nNecesitamos que debilites sus fuerzas terrestres para que podamos acercarnos a Raszageth y detenerla antes de que sea demasiado tarde.\n\nbrete paso entre los Primalistas. Si puedo mantener mi concentracin, habr otro reflejo exacto esperndote.', '', '', '', '', '', 'Renete con el reflejo exacto de Kalecgos que se encuentra ms adelante, en el Coto de Vakthros.', 47187),
(65940, 'esES', 'El camino roto', 'Viaja con la caravana Shikaar hasta el cruce del ro.', 'Espero que no te importe mojarte los pies. La siguiente etapa de nuestro viaje nos llevar a travs de dos ros.\n\nOhn Seshteng quiere compartir una historia contigo sobre nuestra bendita viga, Ohn\'ahra. Con mucho gusto te dejo bajo su vigilancia.', '', '', '', '', '', '', 47187),
(65939, 'esES', 'El coraje de las convicciones', 'Hazte con el control de la Ciudadela Obsidiana.', 'La prxima batalla ser feroz, pero nuestro coraje y determinacin podrn contra su superioridad numrica.\n\nCuento con tus excepcionales habilidades para liderar las tropas hacia la victoria.\n\nComenzaremos el asalto cuando lo ordenes.', '', '', '', '', '', '', 47187),
(65938, 'esES', 'Equipo de hoy y de maana', 'Usa tu bastn de Caminante del Tiempo para hacer estallar la burbuja de estasis de la puerta del templo.', 'Vale! Vamos a reventar la burbuja de estasis que rodea las puertas del templo y a liberar a nuestros celadores! $gListo:Lista; para una enorme batalla de tira y afloja contra el mismsimo tiempo?\n\nTira de la burbuja de la puerta como hiciste antes con los cristales. Pero ten cuidado, toda la energa temporal que liberes te atacar. No tengo claro qu habr all, pero los celadores liberados te ayudarn pase lo que pase.\n\nBuena suerte, $n!', '', '', '', '', '', '', 47187),
(65937, 'esES', 'Prueba de negligencia', 'Encuentra las pruebas de los daos al Paseo Lila y mustraselas a Theramus.', 'No podemos rendirnos. Debe saber lo que est pasando aqu fuera. Si no quiere salir de la cueva, se lo ensearemos directamente.\n\nCualquier cosa servir, estoy segura. Todo va mal! La flora corrupta, la fauna en lucha constante...', '', '', '', '', '', '', 47187),
(65935, 'esES', 'Ponerse al da con Cromi', 'Renete con Cromi en las plataformas de la Confluencia Temporal.', 'Nos has ayudado a recuperar el control de las arenas, pero puedo sentir que ocurre algo de mayor importancia en las plataformas del templo. Emprendamos el vuelo y reunmonos con la embajadora Chronormu all arriba.\n\nComo siempre, el tiempo es oro.', '', '', '', '', '', '', 47187),
(65930, 'esES', 'Un pulso de viento y agua', 'Enfrntate al espritu de aire Kraunot cerca del Destello Kauriq.', 'Ahora podremos enfrentarnos a los espritus.\n\nRuriq no lo mencion? Segn las tradiciones de nuestra tribu, debemos enfrentarnos a los espritus en combate antes de pedir su bendicin, y la fuerza de esta depender de lo mucho que los impresionemos. \n\nQuizs por eso la Escamabrillante insisti en que trabajramos juntos.\n\nT te encargars de Kraunot, el espritu de aire, y yo de Otu\'rorq, el espritu de agua.\n\nEstn en la cueva detrs de la cascada cercana. Nos veremos all.', '', 'El espritu de los vientos caprichosos de la zona rodea al Destello Kauriq. Se sabe que disfruta de enfrentarse a los jvenes colmillarr que quieren demostrar su vala.', 'Kraunot', '', '', '', 47187),
(65929, 'esES', 'Rompehielos', 'Libera las aguas heladas del hielo cerca del Destello Kauriq.', 'Saba que lo aprobara!\n\nNo s mucho de espritus... El chamn es Kauj. Pero tendremos que apaciguar a los grandes espritus de aire y de agua antes de que se nos aparezcan. \n\nCualquiera podra ver a los elementales de agua congelarse lentamente en la montaa. Y no parece para nada natural. ltimamente el fro ha estado bajando de las montaas ms de lo habitual. Si esto sigue as, todo el ro podra acabar congelado.\n\nLibralos de sus prisiones heladas!', '', '', '', '', '', '', 47187),
(65928, 'esES', 'Vientos obstinados', 'Recoge $1oa motas de viento inquieto de los vientos inquietos cerca del Destello Kauriq.', 'Bah! Trabajar juntos, dice? \n\nPero... si la Escamabrillante cree que hay alguna posibilidad de que podamos ayudar a las dems tribus..., debemos intentarlo. \n\nPara que el espritu de viento Kraunot nos reconozca, primero tendremos que atender a su elemento. Los elementales de viento cercanos han estado inquietos desde que la tierra comenz a despertarse.\n\nVete y encrgate de esos elementales mientras yo inspecciono este barco que habis construido, y treme sus motas inquietas. Eso debera devolver la calma a la zona.', '', '', '', '', '', '', 47187),
(65926, 'esES', 'Navegando por las cascadas', 'Ayuda a Ruriq a construir el Zancalejana.', 'Has odo la historia de la Escamabrillante? Construy un barco tan resistente que poda bajar por las cascadas del ro!\n\nA la anciana Nava le encanta contar esta historia.\n\nCreo que los nobles espritus de los mamuts on\'tuq se sentiran honrados si utilizramos sus restos para fabricar un barco como el de la leyenda.\n\nMi hermano se opone a ello, pero si lo conseguimos, podremos llevar pescado a nuestras tribus hermanas en apuros.\n\nHas demostrado gran habilidad y pasin! Seguro que podemos construir algo grande.', '', '', '', '', '', '', 47187),
(65925, 'esES', 'Diezmando a los diezmadores', 'Mata a los deslizadores de hielo y a los cavapozos de hielo cerca del Destello Kauriq.', 'Esas vermis no deberan estar aqu. No s qu las ha sacado de sus guaridas subterrneas, pero ahora no hay forma de ayudarlas.\n\nNo podemos permitir que destruyan la fauna local.\n\nMata a las vermis, $n. Qudate sus pedazos, si es necesario, y renete conmigo en el Destello Kauriq cuando hayas terminado.', '', '', '', '', '', 'Renete con Ruriq en el Destello Kauriq.', 47187),
(65921, 'esES', 'Retribucin refti', 'Mata primalistas y rescata a las refti en la Reserva de Tyrhold.', 'No puedo sacrmelo de la cabeza, $p. Tantas de mis hermanas, masacradas... Tantas vidas perdidas... Sus muertes no quedarn impunes!\n\nMis soldados han localizado a los primalistas responsables y dicen que algunas de nuestras hermanas siguen vivas.\n\nDebemos rescatarlas y asegurarnos de que esos primalistas conocen mi ira!', '', '', '', '', '', '', 47187),
(65920, 'esES', 'Por los resguardos!', 'Usa las piedras angulares perdidas para reparar los resguardos de la reserva y luego activa la consola.', 'Por fin podemos restaurar los resguardos. Hemos sufrido grandes prdidas, pero debemos completar nuestro trabajo.\n\n$p, necesitamos tu ayuda una vez ms.Lleva cada piedra angular al lugar que le corresponde para que los resguardos vuelvan a estar completos.\n\nCuando lo hayas hecho, vuelve para que podamos activar la consola y restaurar el orden en la reserva.', '', '', '', '', '', '', 47187),
(65918, 'esES', 'Mantenimiento preventivo', 'Mata a $1oa elementales desatados en la Reserva de Tyrhold.', 'Los elementales primigenios se estn reproduciendo de manera descontrolada. Normalmente, mis hermanas y yo nos ocuparamos de ellos, pero no estamos en condiciones de hacerles frente. Han eliminado a muchos de nuestros soldados.\n\nAdems, tenemos otros asuntos que atender.\n\n<Zuttiki hace una mueca de dolor>.\n\nAh es donde entras t, $p. Podras encargarte de los elementales?', '', '', '', '', '', '', 47187),
(65916, 'esES', 'No negociamos con los Primalistas', 'Mata al lder primalista Ko\'jo y recupera las piedras angulares perdidas en la Reserva de Tyrhold.', 'Los Primalistas crean que podran superar el poder de Tyr. Se equivocaban. \n\nMis refti han podido rastrearlos hasta una cueva no muy lejos de aqu. Y como pensaba, tienen las piedras angulares que faltan.\n\nAdalid, si queremos restaurar la reserva, debemos recuperar esas piedras angulares.\n\nAdems, tenemos que acabar con su lder para impedir que ataquen una segunda vez.', '', '', '', '', '', '', 47187),
(65914, 'esES', 'Los mamuts mandan', 'Consigue trocitos de pellejo de on\'tuq y colmillos de on\'tuq de los mamuts on\'tuq cados cerca del Destello Kauriq.', 'Nuestra tribu ha cuidado con orgullo a las manadas de mamuts on\'tuq durante generaciones. Y ahora ya... no queda ni uno.\n\nSus almas permanecen cautivas de la ira tras la masacre. Debemos honrar sus vidas haciendo buen uso de sus restos.\n\nHay demasiados como para reunirlos sin ayuda. Por favor, consigue los materiales que puedas, tanto de los jvenes como de las matriarcas, y luego renete conmigo en el Destello Kauriq.', '', '', '', '', '', 'Renete con Ruriq en el Destello Kauriq.', 47187),
(65913, 'esES', 'Qu vigilas, viga?', 'Rescata a la viga Mara de los Primalistas en la Reserva de Tyrhold.', 'Gracias a los titanes! $C, necesitamos tu ayuda!\n\nLos Primalistas nos acaban de atacar. Mis hermanas y yo pudimos defendernos, pero con graves prdidas...\n\nHabr tiempo para llorar cuando mi viga est a salvo! Un grupo de primalistas se escap mientras luchbamos. Te juro que, si hacen dao a nuestra viga...\n\nDebes ayudarla antes de que sea demasiado tarde!', '', '', '', '', '', '', 47187),
(65911, 'esES', 'Alineacin azur', 'Vuelve con Kalecgos, que est en el Archivo Azur.', 'Los lazos de esta comunidad... La amistad y la familia que comparten.\n\nNunca... he tenido algo as. El Vuelo Azul nunca haba tenido eso. Y tal vez sea porque nunca tuvimos la oportunidad de intentarlo.\n\nAhora es el momento. Debo reunir a los mos.\n\nRenete conmigo en el Archivo Azur. Queda mucho por hacer.', '', '', '', '', '', 'Vuelve con Kalecgos, que est en el Archivo Azur.', 47187),
(65907, 'esES', 'Fruta favorita', 'Recoge forraje salvaje en los Giseres Ohn\'iri y alimenta a $1oa pisafango indolentes.', 'El entrenamiento de los msticos es muy aburrido. La mitad de los das, me dedico a ver cmo se moja el agua. Mientras tanto, mis hermanos ya estn ah fuera cazando dracos y primalistas para salvar el mundo.\n\nEn fin, te promet que te enseara algo chulo! Sabas que a los pisafango les encanta el forraje? Crece cerca de aqu, entre los giseres. Ve a recoger un poco y podremos alimentarlos.', '', '', '', '', '', '', 47187),
(65906, 'esES', 'Una iniciada contrariada', 'Habla con la iniciada Radiya en los Manantiales Ohn\'iri, que estn en las Llanuras de Ohn\'ahra.', 'He recibido una carta interesante de los Manantiales Ohn\'iri.\n\nEn cuanto a la carta, detalla, y cito: \"una horrible prisin, con mentores controladores y aburrimiento extremo\". Lleva la firma de la iniciada Radiya. Tambin hay un boceto de un guila... tirando por un acantilado a un centauro llamado Meluun de una patada.\n\nBueno, supongo que es una peticin de ayuda, por si quieres ir a investigar por tu cuenta. Si te digo la verdad, creo que Radiya est bien. No es la primera carta con este tono que me enva.', '', '', '', '', '', 'Habla con la iniciada Radiya en los Manantiales Ohn\'iri, que estn en las Llanuras de Ohn\'ahra.', 47187),
(65905, 'esES', 'Ms que malas hierbas', 'Elimina la vegetacin y mata a los monstruos del Paseo Lila.', 'Quizs sea mejor que le demos a Theramus algo de espacio.\n\nPero no podemos quedarnos de brazos cruzados. La arboleda se est destruyendo a s misma rpidamente. Aydanos!', '', '', '', '', '', '', 47187),
(65904, 'esES', 'Ya est bien', 'Lleva las pruebas de los daos al Paseo Lila a Theramus.', 'Grun o no, Theramus tiene un trabajo que hacer. Mientras se esconde ah dentro, no puede ver las consecuencias de su ausencia.\n\nVamos $gjuntos:juntas;. Se las ensearemos.', '', '', '', '', '', '', 47187),
(65903, 'esES', 'El poderoso Peludn', 'Atrapa $1oa saltarines del claro.', 'Pobre Theramus. Tengo una idea para animarlo!\n\nToma esta red y atrapa algunos saltarines cercanos. Son dciles pero rpidos. Los encontrars por la costa.\n\nSe los llevaremos a Theramus. No podr con tanta esponjosidad!', '', '', '', '', '', '', 47187),
(65902, 'esES', 'Comida o pelusa', 'Llvale a Theramus la carne de tortuga a las hierbas y los saltarines del claro.', 'Qu carne de tortuga a las hierbas ms jugosa y deliciosa! Desde un punto de vista objetivo, claro. Yo soy vegetariana.\n\nSigue! Seguro que no ha comido en todo el da.', '', '', '', '', '', '', 47187),
(65901, 'esES', 'Salir a hurtadillas', 'Coloca los ttems de aire en los Manantiales Ohn\'iri e informa a Radiya.', 'Me han castigado indefinidamente! Es que no sabe mi Ohn que cumplo diecisis aos la prxima primavera? Debera poder largarme cuando me diese la gana.\n\nT tienes pinta de poder ayudarme. Tengo un plan para escapar. Puedo canalizar estos ttems para concentrar el aire y crear un gran revuelo. Pero no puedo colocarlos porque estoy bajo mxima vigilancia. Ni siquiera Togo quiere ayudarme.\n\nPero si t me ayudas... Por favor! Te prometo que te ensear una cosa chulsima.', '', '', '', '', '', 'Renete con Radiya junto al Espejo del Cielo.', 47187),
(65900, 'esES', 'Filete sospechosamente especiado', 'Recoge $1oa trozos de carne de tortuga perfectamente tierna, $2oa cscaras de huevo reptiliano y $3oa vinagretas.', 'La idea de mi hermana es encantadora, pero Theramus necesita un verdadero estmulo.\n\nY me refiero a una buena dosis de vinagreta. Podemos hacer una pasta con ella y untarla en su comida favorita: la carne de tortuga!\n\nPodras ayudarme a conseguir los ingredientes?', '', '', '', '', '', '', 47187),
(65899, 'esES', 'Buscar a Theramus', 'Busca a Theramus en las cuevas cercanas.', '$R! Has venido a visitar el maravilloso Paseo Lila? Me disculpo por su estado actual. Te prometo que no suele estar tan desatendido.\n\nTheramus, el cuidador del jardn, tena que haber venido hoy para que resolviramos esto juntos. ltimamente tiene problemas con el mantenimiento, as que Felina y yo estamos arrimando el hombro. Pero no podemos con todo.\n\nNos ayudars a buscarlo? Quizs se haya olvidado.', '', '', '', '', '', 'Vuelve con Celina Hojaseca.', 47187),
(65898, 'esES', 'Protoproblemas', 'Hazte con el Enclave y derrota al protodraco que lo protege.', 'La Llama Hendida no me cae lo que se dice muy bien, pero no puedo quedarme de brazos cruzados mientras se hacen pedazos unos a otros. Me trae demasiados recuerdos.\n\nSea lo que sea el enclave, estar mejor en nuestras manos que en las suyas. Sospecho que lo encontraremos si sigues el rastro de cuerpos.\n\nTen cuidado, $p. Me preocupa que el nido no est tan abandonado como parece.', '', '', '', '', '', '', 47187),
(65896, 'esES', 'Que comience la sanacin', 'Ayuda a la gente de Ventormenta a sanar.', 'Te crees que podras entrar en esta ciudad sin que me diera cuenta? Pues no!\n\nYa tena toda la razn antes sobre los tuyos, y que me parta un rayo si dejo que los dragones vuelvan a destruir mi hogar.\n\nEsto era un parque lleno de paz y alegra hasta que vino tu padre, Alamuerte. Ah, s, lo s todo sobre l. \n\nPuedes ver con tus propios ojos el legado de destruccin que dej. El dolor que an camina por estas calles.', '', '', '', '', '', '', 47187),
(65895, 'esES', 'Compaa competidora', 'Rene informacin sobre la Llama Hendida.', 'Bah! La muerte de unos obreros no nos ayudar a averiguar nada.\n\nBusca a sus lderes. Uno de ellos tendr la informacin que necesitamos.\n\nAh, $n. Esta vez, escucha lo que tengan que decir antes de matarlos. Puede que averiges algo til.', '', '', '', '', '', 'Renete con Adenedal cerca de la parte alta de las ruinas.', 47187),
(65893, 'esES', 'La investigacin de la reliquia', 'Recolecta $1oa fragmentos de artefacto de Nelthazan.', 'La Llama Hendida est aqu. T le confiaras artefactos valiosos a una gente que va por ah hendiendo cosas?\n\nClaro que no. En cualquier caso, debemos averiguar qu hacen aqu si queremos entrar en accin. Rene lo que puedas de ellos y cuntame lo que descubras.\n\nEste rompecabezas tiene ms piezas de las que vamos a encontrar en el suelo.', '', '', '', '', '', '', 47187),
(65892, 'esES', 'Los extremos hendidos', '', '', '', '', '', '', '', '', 47187),
(65891, 'esES', 'Herramientas de diatriba', 'Despliega las herramientas encantadas en $1oa pilas de escombros.', 'Bien. Justo estaba pensando que me vendra bien $gun aventurero:una aventurera; como t. Fuerte, resistente y con $gdispuesto:dispuesta; a trabajar por una suma insignificante.\n\nEs como si mi voluntad te hubiese manifestado. Qu bien me las apao, eh? Estas ruinas parecen haber captado la atencin de ms gente. No podemos confiar en que excavarn como es debido. Echarn a perder las muestras!\n\nToma esto. Despligalo alrededor de los artefactos de inters que hay por las ruinas. Est encantado para realizar cualquier tarea necesaria.', '', '', '', '', '', '', 47187),
(65890, 'esES', 'Las Ruinas de Nelthazan', 'Renete con el escriba del cielo Adenedal en las Ruinas de Nelthazan.', 'La Expedicin Dragontina requiere tu ayuda.\n\nEnviamos un escriba del cielo a las ruinas para que reuniera informacin. Deberan estar deshabitadas, pero puedo or sus gritos desde aqu.\n\nDebe de estar en grave peligro para poder escucharlo a tanta distancia.\n\nEn esta expedicin cuidamos de los nuestros. Aunque sean insufribles. Bscalo y protgelo del peligro que haya encontrado.', '', '', '', '', '', '', 47187),
(65887, 'esES', 'A las montaas', 'Renete con los reflejos exactos de Khadgar y Kalecgos en la base del Coto de Vakthros.', 'Lo de ah arriba es un espectculo digno de ver, Khadgar y Kalecgos combatiendo contra los Primalistas en el cielo!\n\nHan invocado varios reflejos exactos de s mismos para ayudarte a atravesar el monstruoso agujero que han creado los Primalistas.\n\nHay un par de ellos esperndote en la base de la montaa. \n\nSi las cosas empiezan a ir mal..., bueno, avisar al resto en las Tierras Azures.', '', '', '', '', '', 'Renete con los reflejos exactos de Khadgar y Kalecgos en la base del Coto de Vakthros.', 47187),
(65886, 'esES', 'Al Escudo de Rhonin', 'Renete con Drok Pualapergaminos en el Mirador de la Torre.', 'Raszageth y los Primalistas estn lanzando un ataque a gran escala en la torre llamada Vakthros, al norte. No podemos dejar que se salga con la suya!\n\nKhadgar y yo nos adelantaremos para ocuparnos de la situacin desde los cielos.\n\nDirgete al Escudo de Rhonin, uno de los ltimos campamentos del Kirin Tor en la zona.\n\nLlegars ah ms rpido si montas sobre tu draco desde lo alto del archivo.\n\nUna vez all, asegrate de que los miembros del Kirin Tor estn a salvo y luego dirgete a Vakthros.\n\nContamos contigo para que nos ayudes desde tierra.', '', '', '', '', '', 'Renete con Drok Pualapergaminos en el Escudo de Rhonin.', 47187),
(65875, 'esES', 'El da libre de un dragn', 'Encuentra las diferentes bebidas para Vazallia.', 'Una vida en Terrallende... luchando a todas horas. As no hay quien tenga tiempo de relajarse!\n\nA veces, una dragona solo necesita un da de descanso con una bebida fresquita entre las garras.\n\nOye, igual t puedes ayudarme a relajarme! Hazme un favor e intenta encontrar algunas de esas bebidas para reabastecernos.', '', '', '', '', '', '', 47187),
(65874, 'esES', 'Una revelacin podrida', 'Habla con Hanu, con la anciana Poa y con Norukk.', 'Mmm...\n\n<Brel observa atentamente al extrao ttem mientras le da la vuelta con sus gruesas manos>.\n\nTenemos que recomponernos el bigote y averiguar qu significa esto.', '', '', '', '', '', '', 47187),
(65873, 'esES', 'El lder de la manada zarpasombra', 'Mata a Kargozarpa y recupera su ttem.', 'Kargozarpa es el verdadero lder de los gnolls en esta parte del bosque. Hemos tenido... encuentros desagradables en el pasado.\n\nEsta vez fue distinto. Llevaba un extrao ttem que pareca retorcer su propia esencia.\n\nHay que detener a Kargozarpa y recuperar el ttem. Me temo que los gnolls estn metidos en algo ms oscuro de lo que imaginamos.', '', 'Kargozarpa siempre ha sido malo, pero se ha vuelto ms agresivo desde que lleva un ttem ftido.', 'Kargozarpa el Ftido', '', '', '', 47187),
(65872, 'esES', 'Gnolls enfermos con intenciones enfermizas', 'Mata a $1oa gnolls zarpasombra en el Cubil de Kargozarpa.', 'Estoy captando un olor extrao en el viento. Algo no va bien...\n\nHanu describi a los gnolls que hay en esta cueva como extraos... y enfermos.Deberamos averiguar lo que est provocando esta situacin.\n\nNo bajes la guardia. A pesar de su aspecto enfermizo, no dejan de ser taimados y peligrosos.', '', '', '', '', '', '', 47187),
(65871, 'esES', 'Gnoll hay salida', 'Rescata a Norukk y a otros $1oa colmillarr cautivos.', 'He seguido el rastro de los colmillarr capturados, entre ellos mi marido Norukk, hasta esta cueva.\n\nNorukk no suele cuidarse mucho, as que esa responsabilidad es ma. Pero no soy tan orgullosa como para rechazar ayuda.\n\nDebemos rescatarlos!', '', '', '', '', '', '', 47187),
(65870, 'esES', 'Suministros!', 'Recupera los alijos de suministros de caza.', 'No haba rastro de nuestros suministros de caza en las Colinas del Gran rbol. Deben de estar en esa cueva.\n\nBusca contenedores de suministros y preprate para cualquier cosa.\n\nNo creo que los gnolls dejen la mercanca sin vigilar.', '', '', '', '', '', '', 47187),
(65869, 'esES', 'Otra emboscada', 'Habla con Akiun y examina $2oa cadveres cercanos.', 'Qu tragedia. Y puede que sea la primera de muchas.\n\nAverigua qu sabe Akiun y examina a los cados durante el ataque.\n\nTengo una corazonada sobre lo que ocurri aqu. Veamos si las pistas refrendan mi teora.\n\nMientras tanto, intentar templar los nimos por aqu.', '', '', '', '', '', '', 47187),
(65868, 'esES', 'No son para masticar', 'Recupera $1oa ofrendas funerarias.', 'He encontrado una de las ofrendas funerarias de Ponoliak. Esos gnolls zarpasombra le han dado un mal uso y luego la han desechado... Tiene marcas de mordiscos.\n\nNecesitamos esa ofrenda y unas cuantas ms para la ceremonia funeraria en honor del jefe de Iskaara.\n\nEs una ofensa que algo tan sagrado sea usado como un mordedor de juguete. Busca ms ofrendas.', '', '', '', '', '', 'Renete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran rbol.', 47187),
(65867, 'esES', 'Aullidos en las Colinas del Gran rbol', 'Mata a Durgun, a Kerwal y a Bakra.', 'Los gnolls que atacaron nuestra caravana estaban a las rdenes de tres lugartenientes.\n\nA Durgun lo acompaaba una docena de hienas.\n\nKerwal se rea como un manaco cada vez que lo perseguamos y caamos en sus trampas dentadas.\n\nBakra nos provocaba sin piedad.\n\nSi queremos recuperar lo que han robado, deben morir.', '', '', '', '', '', 'Renete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran rbol.', 47187),
(65866, 'esES', 'Romper las trampas', 'Activa $1oa trampas dentadas.', 'Las colinas estn llenas de insidiosas trampas dentadas.\n\nPodrs localizarlas si te fijas bien. Actvalas con mucho cuidado y con el viejo truco colmillarr: un palo largo. Aunque tambin se pueda hacer pisndolas, no te lo recomiendo.\n\nCuando hayas eliminado las suficientes, busca a Hanu. La anciana Poa y yo os alcanzaremos cuando podamos.', '', '', '', '', '', 'Renete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran rbol.', 47187),
(65865, 'esES', 'Nos tienen inmovilizados!', 'Mata tiradores certeros gnoll.', 'Los tiradores certeros gnoll son despiadados... y sorprendentemente precisos.\n\nNo podemos plantearnos partir hacia las Colinas del Gran rbol mientras tengan sus armas preparadas para atacarnos.\n\nReduce su nmero y hazles saber que no nos usarn para prcticas de tiro!', '', '', '', '', '', 'Renete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran rbol.', 47187),
(65864, 'esES', 'Alcanzar la caravana', 'Alcanza a Brena cerca de las Colinas del Gran rbol.', 'Deberas alcanzar a Brena. Su caravana pas por aqu hace un par de horas.\n\nViajaban recogiendo las posesiones ms valiosas del difunto jefe para llevar a cabo un funeral en su honor.\n\nIban bastante cargados, as que no creo que anden lejos.', '', '', '', '', '', '', 47187),
(65855, 'esES', 'Al socorro de las Tierras Azures', 'Vuelve con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 'No se puede reclamar la energa de la piedra de juramento hasta que se reparen las lneas Ley de las Tierras Azures.\n\nSolo se puede llegar a algunas lneas Ley si se dispone de las habilidades de Kalecgos..., pero quiz puedas ayudarnos en esto.\n\nSi han sobrevivido, busca a los colmillarr. En mis tiempos vivan aqu y conocen la tierra a fondo.\n\nHabla con uno de nuestros soportes Arcanos para volver con tus aliados.', '', '', '', '', '', 'Habla con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 47187),
(65854, 'esES', 'Reclamar la piedra de juramento', 'Observa cmo Kalecgos reclama la piedra de juramento azur.', 'Buen trabajo. Parece que hemos logrado reparar las lneas Ley del Archivo Azur.\n\nCuando el Vuelo Azul estaba unido, les deca a mis hermanos y hermanas que nunca deban dudar de la fuerza de los mortales.\n\nRenete conmigo en la piedra de juramento que hay al sur de aqu. La reclamar y volver a Thaldraszus.', '', '', '', '', '', 'Habla con Sindragosa.', 47187),
(65852, 'esES', 'Directo a la cima', 'Busca la roca pisoteadora Arcana en la bolsa de cosas tiles y sala en un punto de enfoque Arcano para llegar a lo alto del Archivo Azur.', 'Parece que algo est debilitando las energas Arcanas en la cspide de la torre.\n\nAhora que has estabilizado las energas aqu abajo, deberas poder \"montar\" la magia Arcana de la zona.\n\nBusca en tu bolsa algo llamado \"roca pisoteadora Arcana\" y sala para reunirte conmigo all arriba.', '', '', '', '', '', 'Renete con Kalecgos en lo alto del Archivo Azur.', 47187),
(65850, 'esES', 'El ciclo del mar', 'Habla con Brena para presenciar la ceremonia funeraria.', 'Gracias, $n. He averiguado lo que necesito de nuestros nuevos amigos.\n\nLa ceremonia funeraria en honor de su antiguo jefe est a punto de empezar. Como los habitantes de Iskaara han sido tan amables y hospitalarios, lo adecuado es que los acompaemos antes de volver a los archivos.\n\nHabla con Brena y dile que estamos preparados.', '', '', '', '', '', '', 47187),
(65849, 'esES', 'A Iskaara', 'Renete con Brena en Iskaara.', 'Gracias por tu ayuda, $n. Mi familia est a salvo gracias a ti.\n\nAl fin podemos volver a Iskaara y ver cmo devuelven al mar al viejo Ponoliak. Fue mi mentor y un buen jefe. \n\nAcompanos, por favor. La celebracin del ciclo del mar es algo en lo que puede participar todo el mundo.', '', '', '', '', '', 'Renete con Brena en Iskaara.', 47187),
(65848, 'esES', 'Vnculo de tomo y lomo', 'Habla con Kalecgos para abrir el portal y luego usa lo que invoque para eliminar a los putrefactores Frondacuero y para destruir al anciano retorcido.', 'Debemos pararle los pies a ese rbol! Ahora que tengo estos cristales Ley, por fin podr ayudar.\n\nAvsame cuando quieras empezar. Abrir un portal al Archivo Azur e intentar invocar algo til.\n\nAtrs, puede que sea un poco inestable.', '', '', '', '', '', 'Habla con Kalecgos en la cueva de cristal Ley.', 47187),
(65847, 'esES', 'Realineacin', 'Concntrate en el cristal Ley y destruye 3 infecciones de descomposicin.', 'Ahora, a por la lnea Ley. Parece que ha sucedido lo que me tema: la descomposicin se ha propagado a ella.\n\nTendremos que purgarla y acelerar el proceso de sanacin, pero no puedo canalizar suficiente energa solo con mi reflejo exacto.\n\nConcntrate en este cristal Ley. Mi conexin contigo me ayudar a teletransportarme fsicamente a este lugar. Cuando lo consiga, tendr las fuerzas suficientes.', '', '', '', '', '', 'Encuentra a Kalecgos en el exterior de Frondacuero.', 47187),
(65846, 'esES', 'Basura Ley', 'Recoge $1oa cristales Ley en las Afueras de Frondacuero.', 'La lnea Ley est aqu... La noto!\n\nPero antes debemos detener a los gnolls. Ese anciano ser su arma ms poderosa.\n\nLos gnolls han reunido algunos cristales Ley. Por suerte, no parecen entender el poder que albergan.\n\nTreme tantos como puedas. Potenciarn mi reflejo exacto y me ayudarn a invocar algo til del archivo para acabar con ese monstruo.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65845, 'esES', 'Ecos de los cados', 'Coloca el ttem de Brena cerca de $1oa cadveres colmillarr para contactar con los espritus.', 'Aqu hay colmillarr! Mis amigos, mi gente..., mi familia. Se fueron a cazar hace apenas una semana.\n\nEstn demasiado descompuestos para recuperarse.\n\nSus espritus siguen aqu. Estn sumidos en la ira y el arrepentimiento. Kaqiata, Lutokk, Tuyuki...\n\nPor favor, $n, toma este ttem y colcalo cerca de sus restos. Se pondr en contacto con sus espritus y les ayudar a encontrar la paz.', '', '', '', '', '', '', 47187),
(65844, 'esES', 'Arrancar la podredumbre', 'Mata a $1oa antrboles putrefactos y a $2oa lanzapodredumbres Frondacuero.', 'La descomposicin les debe de haber podrido tanto los cerebros como los cuerpos a los gnolls!\n\nSon una especie destructiva, pero son nativos de esta tierra..., como nosotros.\n\nNo obstante, ya les hemos visto propagar la descomposicin a la tribu del Gran rbol. A este ritmo, consumirn toda la zona y se acabarn destruyendo a s mismos.\n\nNo podemos permitir que ocurra. Es una pena, pero... acaba con ellos.', '', '', '', '', '', '', 47187),
(65842, 'esES', 'Comportamiento desarmador', 'Elimina a la maestra de armas Vordak y consigue $1oa armas rompemundos.', 'No siento mucho aprecio por los dragonantes rompemundos. Creen errneamente que Alamuerte regresar algn da, y no nos ayudarn a proteger el Trono Obsidiana.\n\nLa maestra de armas Vordak, que antao jur lealtad al Prncipe Negro, ha robado muchas armas fabricadas aqu, en la ciudadela, para entregrselas a los rompemundos. No permitir tal robo ni tal traicin.\n\nVe a la Cima Humeante y recupralas... Usa la fuerza, si es preciso.', '', '', 'La maestra de armas Vordak', '', '', '', 47187),
(65841, 'esES', 'Detener la propagacin', '', '', '', '', '', '', '', '', 47187),
(65838, 'esES', 'Destruir a los Frondacuero', 'Investiga las Afueras de Frondacuero.', 'Si los gnolls han descubierto la magia de descomposicin, entonces tanto la lnea Ley como la propia tierra estn en grave peligro. \n\nMis reflejos exactos apenas dan abasto para hacer frente a una perturbacin elemental a esta escala. Ve al bosque e investiga la descomposicin.\n\nColaborar con nuestros nuevos amigos colmillarr para encontrar un lugar en el que pueda mantener este reflejo y luego te ver en el interior del bosque.\n\nDebemos acabar con esto!', '', '', '', '', '', 'Habla con Kalecgos en las Zarzas Frondacuero.', 47187),
(65837, 'esES', 'Problemas en los pinos', 'Habla con el centinela Olekk en el Puesto del Pinar, que est en las Llanuras de Ohn\'ahra.', 'Se ha producido un ataque de los Primalistas en las Tierras Altas de Shikaar.\n\nSi tienes informacin o crees que puedes ayudar, dirgete al Puesto del Pinar y busca a Olekk. Dile que te envo yo. <Tirren se re>. Espero que ese pezuas sucias se acuerde de m.\n\nNo te alejes de los caminos, $p. Las llanuras no son tan pacficas desde que han ocurrido todos estos cambios.', '', '', '', '', '', 'Habla con el centinela Olekk en el Puesto del Pinar, que est en las Llanuras de Ohn\'ahra.', 47187),
(65836, 'esES', 'Una exhibicin de tormentas', 'Renete con Watu en el Pinar Sabiacresta.', '<Watu se levanta con facilidad, como si no estuviese herido>.\n\nM-me he clavado el fragmento. Ya no me duele nada. Me siento bien. Genial. Hasta eufrico.\n\nOlekk an no ha vuelto. Le habr pasado algo. No tendra que haberse ido sin m!', '', '', '', '', '', '', 47187),
(65834, 'esES', 'Regicidio de ocho patas', 'Mata a la reina de red trmula.', 'Vamos all! Un peln de educacin formal, una pequea conjetura educada, un toque de runas recinceladas y... obtenemos un desinfusor de magia. Desinyector? Desimbuidor?\n\nNo importa! A la reina no le gustar un pelo, de eso estoy seguro. Tiene que morir si queremos conjurar esta amenaza. Aplastar a las pequeitas solo ralentizar a esos seres; hay que acabar con ellos desde el origen.', '', 'Nunca debe haber una reina araa.', 'Reina de red trmula', '', '', '', 47187),
(65833, 'esES', 'Manipulacin primalista', 'Recupera las tres piedras rnicas de los clamaventiscas.', 'Los Primalistas estn imbuyendo las araas de Hielo elemental y piensan usarlas como tropas de choque para superar las defensas de los dragones en las Tierras Azures. No podemos permitirlo.\n\nLos tres que parecen helados estn al mando. Elimnalos y treme las piedras rnicas que estn usando para concentrar la magia primigenia. As podremos cortar ese flujo.', '', '', '', '', '', '', 47187),
(65832, 'esES', 'Anticongelante enano', 'Encuentra $1oa frascos de anticongelante enano.', 'Estoy en un buen aprieto, $Umuchacho:muchacha;! Esos Primalistas chupahielos me han encerrado en este enorme cubo de hielo y la nica razn por la que no me he congelado del todo es por mi alijo secreto de material de primera.\n\nPor desgracia, cuando esa escoria ladrona me atac, me quit lo que no llevaba escondido y me estoy quedando sin nada.\n\nTendras la bondad de traerme unos frascos antes de que se me congele la sangre?\n\nAh, y $Umuchacho:muchacha;, si tienes que sacar alguno del innombrable de una de esas araas, no me lo digas. Prefiero no saberlo.', '', '', '', '', '', '', 47187),
(65806, 'esES', 'Maruukai', 'Viaja a Maruukai.', '<Okir pone voz a las seales de la khan Sansok>.\n\nMaruukai se encuentra junto a la montaa que hay cerca de esta arboleda. Nuestro viaje casi ha terminado.\n\nDurante el Khural, los Maruuk mantienen una tregua, pero los presagios de Ohn Seshteng son preocupantes. Debemos mantenernos alerta.', '', '', '', '', '', '', 47187),
(65805, 'esES', 'Conexin con Ohn\'ahra', 'Recoge $1oa juncos fluviales, $2oa plumas de cola de ave y un corazn de salamantra en la orilla del ro.', 'El viento est inquieto, $n. Ohn\'ahra trata de decirnos algo, y yo debo responder a la llamada.\n\nNecesito componentes para mi ritual: juncos de la orilla del ro, plumas de cola de nade real y el corazn de una salamantra. Rene estos materiales del ro para que pueda escuchar su voz.', '', '', '', '', '', '', 47187),
(65804, 'esES', 'En la comida y la guerra', 'Recoge $1oa trozos de carne de caza fresca de la fauna en la Estepa del Errante.', 'Los Maruuk viajan desde todas las llanuras para asistir al Khural, y la reunin dura bastantes das.\n\nAlimentar a tantos centauros no es tarea fcil. Los cazadores del Clan Shikaar se encargan de conseguir la carne para todas las comidas que compartimos. La caza de camino a Maruukai forma parte de nuestra tradicin.\n\nT tambin debes contribuir.', '', '', '', '', '', '', 47187),
(65803, 'esES', 'Hacia la ciudad', 'Viaja junto a la caravana Shikaar hasta la Estepa del Errante.', 'El Khural marca un tiempo para que los clanes debatan. Adems, se comparten historias. Hay muchos clanes de centauros en las llanuras, pero todos somos Maruuk.\n\nLa caravana est lista para emprender la marcha. Como Maruukai est un poco lejos, haremos algunas paradas.\n\nCuando quieras partir, bscame en la caravana. No nos hagas esperar.', '', '', '', '', '', '', 47187),
(65802, 'esES', 'Suministros para el viaje', 'Recoge $1oa provisiones del campamento en los alrededores de la Avanzada Pasoleo y $2oa vainas de flor feral en los bosques cercanos.', '<Okir pone voz a las seales de la khan Sansok>.\n\nDebers ayudar si vas a viajar con nosotros. ltimamente, unos grlocs han estado robndonos los suministros mdicos, y debemos conseguir ms. Recoge las flores naranjas alrededor de la avanzada para que podamos crear ms cataplasmas.\n\nTambin hay suministros alrededor de la avanzada que hay que llevar a la caravana. Me gustara que los recogieras mientras estas fuera.\n\nCuando lo tengas todo, llvaselo a Tomul.', '', '', '', '', '', 'Informa a la exploradora Tomul.', 47187),
(65801, 'esES', 'Hacer las presentaciones', 'Presntate ante los miembros del Clan Shikaar.', '<Okir pone voz a las seales de la khan Sansok>.\n\nHan pasado innumerables generaciones desde que un forastero:una forastera; como t llegara a nuestras tierras. Con los Primalistas merodeando por nuestras tierras y usando magias prohibidas, entenders que mi gente est un poco alarmada.\n\nDebes darte a conocer si quieres viajar con nosotros. Presntate ante los miembros de mi clan.', '', '', '', '', '', 'Informa a la exploradora Tomul.', 47187),
(65798, 'esES', 'Un enfoque oportunista', 'Recupera armas y destruye las fuerzas de los Nokhud en la Vereda de Nokhud.', 'Los Shikaar han formado una lnea ofensiva contra los Nokhud al norte. Aunque no me gusta la idea de detenernos para saquear, es un mal necesario para reponer nuestros suministros. Sal al campo de batalla, vuelve con armas y te recompensar.\n\nQuiz los ancestros me juzguen con menos dureza si te centras en el bando Nokhud para esta tarea.', '', '', '', '', '', '', 47187),
(65796, 'esES', 'La mejor defensa...', 'Mata a Sirena la Quiebracolmillos.', 'Nuestro siguiente camino atraviesa el territorio de los Nokhud. Siempre hemos mantenido una frgil paz con su clan, pero los tiempos han cambiado. \n\nSi no actuamos primero, quedaremos sin proteccin y seremos vulnerables. Mis exploradores me han informado de que se ha avistado a una de sus lderes de guerra cerca del Concilio del Dragn. Lucha con ella directamente, no permitas que rena fuerzas para atacarnos por el camino.', '', '', '', '', '', '', 47187),
(65795, 'esES', 'La siguiente estepa', 'Renete con la embajadora Taurasza en la Avanzada Escama Rub.', 'El Vuelo Verde solicita tu ayuda, adalid. La hija de mi hermana y su Vuelo han entrado en el Sueo Esmeralda para potenciar la piedra de juramento, pero no tenemos noticias desde que comenz su sueo.\n\nBusca a los centauros que gobiernan las Llanuras de Ohn\'ahra. Puede que necesites su conexin con la tierra y los espritus si quieres despertar a los verdes.\n\nSon un pueblo orgulloso y territorial, y no se toman los insultos a la ligera. Habla con nuestra embajadora, ella te asesorar.', '', '', '', '', '', 'Renete con la embajadora Taurasza en la Avanzada Escama Rub.', 47187),
(65794, 'esES', 'El deber del cuidado', 'Presencia la devolucin de los huevos de dragn negro a los Estanques de Vida.', 'Te doy las gracias, $c, y mis condolencias por tener que lidiar con esa pareja durante tanto tiempo.\n\nEl Vuelo Rojo tiene el deber de conservar y cuidar a todos los dragones verdaderos, por muy fastidiosos que puedan ser.\n\nAhora que hemos recuperado los huevos del Vuelo Negro, los dragnicos estn unidos como nunca desde hace diez mil aos. Creo que esto es lo que encender la piedra de juramento rub.\n\nHabla conmigo cuando ests listo:lista; para traer los huevos a los Estanques de Vida Obsidiana.', '', '', '', '', '', '', 47187),
(65793, 'esES', 'El vuelo del carro negro', 'Escolta los huevos a los Estanques de Vida.', 'Ahora que hemos potenciado de nuevo la piedra de juramento, debemos transportar el futuro de los nuestros a los Estanques de Vida. Nutrir los huevos con sus aguas es un derecho de todo Vuelo que se precie.\n\nPor desgracia, nuestros enemigos estarn vigilando los cielos ahora que hemos aparecido. Llevaremos a cabo la ltima parte del viaje a pie para evitar que nos detecten.\n\nRenete conmigo cerca del Baluarte Obsidiana, $c. Como adalid de la Protectora, te invito a que me acompaes.', '', '', '', '', '', 'Habla con Sabellian en lo alto del Vitasagrario Rub.', 47187),
(65792, 'esES', 'Diente por diente', 'Mata a $1oa colmillorrocas con Toluijin.', 'Toliqui ha estado contando por ah que el otro da mat un colmillorroca sin ayuda. Puesto que nuestras almas estn conectadas, no quiero llamarla mentirosa. As que, en lugar de eso... \n\nQuiero demostrarle a ella y al resto que, de nuestra alma, soy la mejor mitad. La misin de colmillorrocas ms cercana est al noreste. Nos vemos all!', '', '', '', '', '', '', 47187),
(65791, 'esES', 'Patrona de la Vida de servicio', 'Renete con Alexstrasza junto a la piedra de juramento rub.', 'Pronto, los Estanques de Vida volvern a estar completos.\n\nGracias por tu ayuda, $n, es ms importante de lo que puedo expresar con palabras.\n\nVe a ver a la Protectora junto la piedra de juramento y dile que est todo listo para los huevos.', '', '', '', '', '', 'Renete con Alexstrasza junto a la piedra de juramento rub.', 47187),
(65789, 'esES', 'Donde duermen los ros', 'Recoge componentes del Fangal Leanudo.', 'El Leanudo contiene componentes clave que suelen utilizarse para hablar con los ancestros. Por desgracia, la tribu Aletalodo ha infestado la zona, lo que nos dificulta su bsqueda.\n\nSi pudieras recoger algunas de las flores de la marisma, junto con algunos de los recursos de los Aletalodo, te lo agradecera.', '', '', '', '', '', '', 47187),
(65783, 'esES', 'Te damos la bienvenida a nuestro fuego', 'Renete con la exploradora Tomul en la Avanzada Pasoleo.', 'Has luchado junto a nuestros cazadores y te has ganado un lugar en nuestro fuego.\n\nNuestra khan se encuentra en nuestro puesto de caza en el pantano, preparando nuestra prxima caravana. Le informar de tu llegada y de tu propsito.\n\nEstoy segura de que te las apaars para volver.', '', '', '', '', '', 'Renete con la exploradora Tomul en la Avanzada Pasoleo.', 47187),
(65782, 'esES', 'Bajo triple llave', 'Hazte con la llave de la celda del rompemundos y libera a Ayasanth.', 'Cuando omos rumores sobre un culto de Alamuerte, la mayordoma Selistra me orden que trajera a esos antiguos escamosos de vuelta al redil. Esperbamos que se tratase de un simple malentendido.\n\nEst claro que nos equivocamos.\n\nHay que ocuparse de su lder, pero antes tengo que salir de esta jaula. Busca la llave y tremela.', '', '', '', '', '', '', 47187),
(65780, 'esES', 'A prueba', 'Mata al protodragn llameante.', 'Puede que un regalo de los dragones impresione a algunos centauros, pero el Clan Shikaar necesita ver cmo se te da cazar.\n\nUno de nuestros grupos de caza acaba de eliminar a un protodragn imbuido del poder de la llama. Demuestra tus habilidades ayudando a acabar con l.', '', 'Cuando un centauro joven alcanza la madurez, se espera que participen en su primera cacera de protodracos.', 'El protodragn llameante', '', '', '', 47187),
(65779, 'esES', 'Hacia las llanuras', 'Renete con la exploradora Shikaar en las Llanuras de Ohn\'ahra.', 'El Vuelo Verde ha vuelto a sus jardines en las llanuras cercanas. La reina Alexstrasza desea que contactes con Merithra del Sueo.\n\nLos centauros de esas llanuras son cazadores feroces. Para llegar a los Jardines Esmeralda, antes tendrs que establecer relaciones diplomticas con ellos.\n\nTrtalos con respeto, pero no muestres debilidad.', '', '', '', '', '', 'Renete con la exploradora Shikaar en las Llanuras de Ohn\'ahra.', 47187),
(65778, 'esES', 'Gastronoma alachirrido', 'Ponte el disfraz y usa el prototipo de \"huevo\" con la chef personal de la matriarca.', 'Todo listo para hacer uso de tus dotes interpretativas, $n?\n\nQu? Cmo que no tienes ni idea? Pues menos mal que he creado este disfraz de alachirrido im-PO-cable con los materiales que me has trado!\n\nSegallia y yo necesitamos ms tiempo para terminar de fabricar el \"huevo\" final que eliminar a la matriarca, pero he creado una versin ms pequea como prototipo para que la pongas a prueba con la chef.\n\nY no te preocupes! Te garantizo un doce por ciento ms de seguridad frente a explosiones bajo todas esas plumas!', '', '', '', '', '', '', 47187),
(65777, 'esES', 'Collar embarrado', 'Localiza a alguien experto en artefactos de cacera hechos a mano.', '<Las antiguas marcas del collar resultan bastante difciles de leer, pero los materiales parecen hechos de pellejo de animal y fragmentos de hueso tallados.\n\nPuede que alguien experto en caza pueda obtener informacin sobre el valor de este objeto>.', '', '', '', '', '', '', 47187),
(65770, 'esES', 'Una promesa es una promesa', 'Promete a la iniciada Radiya que guardars su secreto.', 'Parece que los animales se sienten cmodos contigo. Eso indica que tienes un buen espritu.\n\nLa verdad es que... Puedes guardar un secreto? Quiero presentarte a mi amiga. Nadie sabe que existe.\n\nTienes que prometerme que esto quedar entre $gnosotros:nosotras;. Mi Ohn me expulsara de las llanuras si se enterara.', '', '', '', '', '', 'Habla con el ohuna Godoloto.', 47187),
(65769, 'esES', 'Telaraas heladas', 'Libera a $1oa supervivientes en capullo en el Valle Red Trmula.', 'Muchos de mis amigos y colegas fueron capturados cuando los arcnidos y sus seores primalistas atacaron.\n\nVi que los envolvan con telaraas heladas y se los llevaban a un destino que no me atrevo ni a imaginar.\n\nPor favor, libera a todos los que puedas!', '', '', '', '', '', '', 47187),
(65761, 'esES', 'Ms aventuras de lo esperado', 'Colabora con Godoloto para encontrar y rescatar a Radiya.', '<Godoloto te mira fijamente y con semblante acusador. Resopla>.\n\n<Quizs el ohuna pueda ayudarte a encontrar y rescatar a Radiya>.', '', '', '', '', '', '', 47187),
(65760, 'esES', 'A sus rdenes', 'Sigue a Sendrax hasta la Avanzada Corazn de Dragn.', 'Solo conozco a los Djaradin por los libros.\n\nAntiguos rivales de los dragones, poderosos gigantes que dominaban la tierra y la lava... dedicados en cuerpo y alma a cazar dragones hasta extinguirlos.\n\n<Sendrax frunce el ceo mirando el lejano volcn>.\n\nMe contaron que nadie los volvi a ver cuando se fueron los dragones, y que dorman en las profundidades de la tierra.\n\nSi han despertado, todos los vstagos de las islas estn en peligro!\n\nSgueme, iremos a ver al comandante Lethanak en la Avanzada Corazn de Dragn.', '', '', '', '', '', 'Habla con el comandante Lethanak en la Avanzada Corazn de Dragn.', 47187),
(65758, 'esES', 'Grungir el expedicionario', 'Encuentra a Grungir Picohierro.', '$N! Mi homlogo de la Liga de Expedicionarios, Grungir Picohierro, no se encontraba entre los que rescataste. Al principio consigui escapar, pero, cuando vio que solo unos pocos conseguimos salir, se dio la vuelta y volvi a entrar. Solo!\n\nEl patn es tan valiente como impulsivo y no merece el destino que le ha tocado.\n\nPor favor, encuntralo.', '', '', '', '', '', '', 47187),
(65752, 'esES', 'Molestias arcanas', 'Mata a $1oa vermis devoradoras.', 'Muchas vermis de man estn absorbiendo la magia Arcana salvaje que sale del archivo.\n\nLa velocidad a la que lo hacen est alterando el equilibrio de las lneas Ley y eso impide reclamar la piedra de juramento azur.\n\nUsar parte de la Arcana inestable que has recogido para formar una especie de gancho.\n\nUtilzalo para matar unas cuantas vermis. Un breve retraso bastar para ajustar las energas de abajo.', '', '', '', '', '', '', 47187),
(65751, 'esES', 'Ajustes de la plataforma', 'Disipa $1oa de energa Arcana inestable en la parte superior del Archivo Azur.', 'Parece que la ltima perturbacin Arcana est aqu arriba.\n\nSeguir ajustando las energas Ley. Usa algunas de las Arcanas que has recuperado para disipar las perturbaciones.', '', '', '', '', '', '', 47187),
(65750, 'esES', 'La amenaza de ocho patas', 'Mata $1oa trepadores de red trmula o reptadores de red trmula y $2oa primalistas cuidadores en el Valle Red Trmula.', '$C!\n\nNecesito tu ayuda, si tienes la bondad...\n\nEsta expedicin conjunta tena el objetivo de estudiar a los arcnidos nicos que habitan la zona, pero, como puedes ver, nuestros planes se han ido al traste. \n\nLo que al principio creamos que era una adaptacin evolutiva ha resultado ser una perversin del orden natural por parte de los Primalistas.\n\nComo conservacionista que soy, me tomo muy en serio mis responsabilidades, pero el momento de estudiar especmenes vivos ha pasado. No podemos dejar que su perversin se extienda. Y siempre podemos estudiar sus cadveres. \n\nPodras ayudarnos?', '', '', '', '', '', '', 47187),
(65711, 'esES', 'Robar el trueno', 'Mata a los extractores de tormentas y rescata a la espinatrueno Lizi en el Campamento Kaighan.', 'Eres t! Bendita sea Ohn\'ahra. Fing que estaba herida para engaar al siguiente bruto que se acercara. Uf, esos chupapezuas me han lanzado un hechizo de vinculacin. Lo aguantar.\n\nTienen a Lizi en la cueva. Slvala, por favor. Ya ver cmo liberarme.\n\nHaz lo que tengas que hacer.', '', '', '', '', '', '', 47187),
(65709, 'esES', 'Poda Arcana', 'Busca el cetro Ley en la bolsa de cosas tiles y salo para reparar 2 plataformas.', 'No podemos activar la piedra de juramento del Archivo Azur hasta que solucionemos el problema de la energa Ley descontrolada.\n\nLa Arcana inestable est asfixiando dos de las tres runas dracnicas que deben controlarla.\n\nSiento que tengas que encargarte t debido a las responsabilidades de Khadgar y a la ausencia de mis hermanos.\n\nHay un cetro Ley en la bolsa de cosas tiles que tienes.\n\nsalo para ayudarnos a reparar las runas cercanas.', '', '', '', '', '', '', 47187),
(65702, 'esES', 'Enloquecedor', 'Recupera $1oa de energa Arcana inestable.', 'El Archivo Azur fue en su da un lugar donde los dragones azules se reunan para hablar de magia.\n\nAhora soy el nico de los mos que queda aqu.\n\nEste lugar controla las lneas Ley que hay bajo las Tierras Azures, pero sus sirvientes han perdido el control.\n\nCreo que, si restauramos el orden en este lugar, puedo recuperar la piedra de juramento azur.\n\nLos diversos ensamblajes y elementos rebosan energa Arcana inestable que se debe redirigir.\n\nDestryelos y recoge lo que puedas.', '', '', '', '', '', '', 47187),
(65701, 'esES', 'Preservacin o Devastacin', 'Elige una especializacin.', 'Si lo que dicen estos dragones es cierto, se avecina una gran batalla. Necesitamos tu concentracin y tu fortaleza, $gevocador:evocadora;.\n\nEs hora de elegir tu especializacin de batalla. Te dedicars a cuidar a tus aliados o a devastar a tus enemigos? \n\nPara perfeccionar tus habilidades de combate, elige Devastacin.\n\nPara maximizar tu potencial de sanacin, toma el camino de la Preservacin.\n\nCualquiera de las dos te dar buenos resultados. Y recuerda que puedes cambiarla o adaptarla ms adelante.', '', '', '', '', '', '', 47187),
(65691, 'esES', 'La sombra de sus alas', 'Enfrntate a Cygenoth, la Voz de Neltharion.', 'La Voz de Neltharion reside en lo profundo y propaga mentiras entre sus seguidores.\n\nParece ser un dragauro como yo, pero su dracnico es muy tosco, digno de un sin escamas.\n\nSospecho que hay algo falso: una ilusin, quizs. Si podemos subyugarlo, sabremos la verdad.', '', 'Autoproclamada Voz de Neltharion y lder de los rompemundos.', 'Cygenoth', '', '', '', 47187),
(65690, 'esES', 'Recelo de cultor', 'Encuentra a Ayasanth en el Nido Humeante.', 'Ayer lleg otra forastera. Dijo ser una \"emisaria\" del Vuelo Rojo y pidi una audiencia con nuestro lder, la Voz de Neltharion.\n\nPero la Voz se enfad mucho. Dijo que el Guardin de la Tierra nos estaba poniendo a prueba y que debamos ejecutarla!\n\nS que no debemos confiar en los forasteros, pero tampoco hay por qu matarlos. Por favor, aydame a salvarla.', '', '', '', '', '', 'Habla con Ayasanth en el Nido Humeante.', 47187),
(65689, 'esES', 'Las muchas imgenes de Kalecgos', 'Usa el piln de cristal para llegar al Archivo Azur.', 'Encantado de conocerte formalmente, $n. Me llamo Kalecgos, soy un archimago del Kirin Tor y el Aspecto de los dragones azules.\n\nEstoy teniendo dificultades para reparar el Archivo Azur y reclamar la piedra de juramento azur. Me vendra bien que me echaras una mano.\n\nAhora mismo estoy en el archivo, as que tendrs que subir hasta all. He podido reactivar el piln de fuera; eso debera permitirte cruzar hasta aqu arriba.', '', '', '', '', '', 'Habla con Kalecgos en el Archivo Azur.', 47187),
(65688, 'esES', 'Encuentro con Kalecgos', 'Consigue la bolsa de cosas tiles y llvasela a Kalecgos en la base del Archivo Azur.', 'Me temo que tendremos que dividir nuestra atencin. Hay que ocuparse de la amenaza primalista del este.\n\nDebo pedirte que viajes por m al Archivo Azur para ayudar a Kalecgos a reclamar la piedra de juramento azur.\n\nTendrs que recoger suministros que te sirvan de ayuda con lo que sea que est pasando all.\n\nHabla con nuestro intendente del portal, te dar algo que te ayude en el camino.\n\nBuena suerte, $n. Kalecgos agradecer tu ayuda.', '', '', '', '', '', 'Renete con Kalecgos en la base del Archivo Azur.', 47187),
(65687, 'esES', 'La hora de las tortas', 'Mata a $1oa dragonantes rompemundos.', 'Algunos de los discpulos son... muy crueles.\n\n<Lingote se frota una herida reciente en el hocico>.\n\nAntes no era as. Cuando Cygenoth lleg, dijo: \"Deberamos valorar la fuerza por encima de todas las cosas\". Ahora todos luchan continuamente.\n\nIntento defenderme, pero sus pellejos son demasiado fuertes... y mi altura es muy inferior a la suya.\n\nPero no a la tuya! Debes luchar con abusones todo el rato. Podras ayudarme?', '', '', '', '', '', '', 47187),
(65686, 'esES', 'Hacia las Tierras Azures', 'Renete con Glania de los Benditos en las Tierras Azures.', 'Saludos, $n! \n\nPakina y yo estamos buscando ayuda aqu en nombre del Kirin Tor.\n\nEl Kirin Tor est trabajando para proteger la magia Arcana salvaje de todas las Tierras Azures.\n\nKalecgos, el Aspecto del Vuelo Azul y uno de nuestros lderes, necesita ayuda para recuperar la piedra de juramento azur.\n\nSi quieres ayudar, sigue recorriendo el camino hasta encontrar a Glania de los Benditos.\n\nPodr decirte dnde ser ms necesaria tu ayuda.', '', '', '', '', '', 'Renete con Glania de los Benditos en las Tierras Azures.', 47187),
(65615, 'esES', 'Intrusin Arcana', 'Investiga la baliza.', 'Esa baliza de ah delante... Estoy seguro de que no estaba all cuando nos encarcelaron.\n\nLa hechicera no es mi punto fuerte, pero reconozco la magia Arcana cuando la veo. La misma magia que us el dragn azul en el nido.\n\nDijo un nombre... Malygos. Me resulta familiar, pero las enseanzas del Guardin de la Tierra se me antojan lejanas y fragmentadas.\n\nSi ese Malygos fue quien nos puso en estasis, quizs tambin orden que colocaran la baliza Arcana.\n\nInvestiga la zona y luego infrmame. Asegrate de que no se pueda usar la baliza para pedir refuerzos al enemigo.', '', '', '', '', '', '', 47187),
(65613, 'esES', 'Referente de la moda dracnica', 'Adopta una forma de rostro.', 'Seguro que tu llegada a Orgrimmar ha llamado la atencin de sus ciudadanos. Algunos estarn ms cmodos que otros ante tu presencia.\n\nCuando yo era un dragn joven, adopt el rostro mortal que ves. Eso me permiti vivir entre los tauren Monte Alto como aliado.\n\nAunque tu camino es distinto al mo, la esencia de los dragnicos tambin fluye por tus venas, $p. Tal vez sea eso lo que te permite asumir un rostro propio.\n\nVamos a dar un paseo.', '', '', '', '', '', '', 47187),
(65606, 'esES', 'Renombrado con los Maruuk', 'Habla con Agari en Maruukai.', 'Tus hazaas en beneficio de los intereses del clan no han pasado inadvertidas.\n\nVuelve a Maruukai. He preparado algunos suministros que te permitirn ayudarnos.', '', '', '', '', '', '', 47187),
(65595, 'esES', 'Una manzana podrida', 'Mata la raz de decadencia.', 'Gnolls pasar hambre por podredumbre.\n\nPodredumbre daar amigos.\n\nAhora nosotros matamos podredumbre. Eso hace monarca.', '', 'Este antrbol malo ensea magia de descomposicin a gnolls. Y higiene mala.', 'Raz de decadencia', '', '', '', 47187),
(65594, 'esES', 'Mucho ruido y pocos gnolls', 'Destruye $2oa ttems de descomposicin.', 'Estpida descomposicin creer que manda, pero yo mando. La matamos ahora. Yo convertir moco en amigo.', '', '', '', '', '', '', 47187),
(65490, 'esES', 'Excrementos explosivos', 'Llena el autorrecolector de excrementos de la profesora Chirridos.', 'Las arpas son toda una sorpresa, pero he venido a estas montaas con un nico objetivo: excrementos!!\n\nEn concreto, los excrementos de rocs plumazul y que luego se comen y digieren los bichos. La bilis de los escarabajos multiplica por diez la potencia del nitrgeno explosivo! Como mnimo!\n\nCoge este autorrecolector de excrementos de Chirridos. Aplasta los escarabajos que hay en la cueva y usa el autorrecolector para recoger el botn.\n\nDevulvemelo lleno, y podr comenzar la autntica diversin: LAS EXPLOSIONES!', '', '', '', '', '', '', 47187),
(65486, 'esES', 'La foto perfecta', 'Monta en la balsa de catalogador con Fren y saca fotos de la fauna local.', 'Perdona si hah ehperado mucho. El telehcopio me dihtrae a veceh.\n\nNo te parece que eh mh fcil entender el mundo dehde la dihtancia? Nada de interferenciah externah, solo la naturaleza haciendo suh cosah sin nosotroh...\n\n<Akunda la Catalogadora suspira>.\n\nVeo que Coralie te ha dado una cmara. Bien.\n\nVe ro abajo con Fren y saca fotografah de la fauna en suh hbitath naturaleh pa que pueda ehtudiarla.', '', '', '', '', '', 'Vuelve con Akunda la Catalogadora, que est en su campamento.', 47187),
(65475, 'esES', 'Aguantando los chirridos', 'Lleva el pergamino de alachirrido a Harleen Chirridos, que est en los Riscos Plumazul.', '<Sacas un trozo de pergamino de la bolsa pegajosa y ensangrentada de la Zamparrocs. Lo mximo que llegas a distinguir son imgenes de unas arpas devorando huevos enormes.\n\nTienes la certeza de que tu ornitloga jefa preferida, Harleen Chirridos, entender estas marcas de araazos ininteligibles y profundas>.', '', '', '', '', '', 'Lleva el pergamino de alachirrido a Harleen Chirridos, que est en los Riscos Plumazul.', 47187),
(65453, 'esES', 'Alimaas primigenias', 'Mata $1oa protodracos primigenios en la Costa Indmita.', '<Trillaceniza observa con sospecha a los protodragones que acechan en la cresta que hay detrs de ella>.\n\nJurara que esos protodragones se acercan un poco ms al campamento cada vez que me doy la vuelta.\n\nEsos no son los dragones que Ebyssian nos invit a conocer.\n\nLos protodragones son depredadores despiadados con los que no se puede razonar. Nosotros debemos ser igual de despiadados.\n\nReduce su nmero para mantener a raya sus ambiciones, o esta expedicin terminar antes de empezar.', '', '', '', '', '', 'Renete con la escamandante Trillaceniza en la Embajada Reposo Alado.', 47187),
(65452, 'esES', 'Exploradores en peligro', 'Rescata a 3 miembros de la Expedicin Dragontina en la Costa Indmita.', 'No confundas los objetivos acadmicos de la expedicin con timidez, $p.\n\nNo somos eruditos recluidos en altas torres para estudiar antiguos tomos.\n\nSomos aventureros, capaces de ir en busca de conocimiento hasta el rincn ms inhspito de Azeroth!\n\nNuestra pasin por la aventura nos lleva a caminos llenos de peligros, y algunos miembros de la expedicin se han llevado algn mordisco ms de los que quieren admitir...', '', '', '', '', '', 'Renete con Naleidea en la Embajada Reposo Alado.', 47187),
(65451, 'esES', 'Materiales de prctica', 'Consigue $1oa escamas de protocra primigenia.', 'Estos protodracos no se parecen a ninguno que haya visto antes en Azeroth.\n\nSus escamas son resistentes al fuego por naturaleza y ms fuertes que el acero sin perder flexibilidad alguna. Es increble.\n\nTodos mis artesanos me estn pidiendo a gritos que les consiga algunas de esas escamas para trabajar con ellas.\n\nEmpieza por las cras. Sus pequeas escamas deberan ser ms flexibles hasta que hayamos dominado nuestra tcnica trabajndolas.', '', '', '', '', '', 'Renete con el jefe Magor en la Embajada Reposo Alado.', 47187),
(65444, 'esES', 'A las Islas Dragn!', 'Monta en la Dragontina Desafiante a las Islas Dragn desde la torre de zepelines a las afueras de Orgrimmar.', 'La expedicin preliminar ha desembarcado en las Islas Dragn.\n\nGracias a los valerosos esfuerzos de la Expedicin Dragontina, hemos logrado establecer una zona segura en estas islas y entrar en contacto con la embajada de los Vuelos.\n\nEsts $gpreparado:preparada; para acompaarnos en nuestro siguiente viaje a las Islas Dragn?', '', '', '', '', '', 'Renete con Naleidea Brillorro en las costas de las Islas Dragn.', 47187),
(65443, 'esES', 'Coordinacin expedicionaria', 'Recluta exploradores, artesanos y eruditos por todo Orgrimmar para la expedicin a las Islas Dragn.', 'Encantada de conocerte, me llamo Naleidea Brillorro.\n\nQue nos inviten a visitar las Islas Dragn es muy emocionante, a que s?!\n\nEl Relicario ha unido fuerzas con sus homlogos expedicionarios para coordinar nuestros esfuerzos. Como miembro de la Expedicin Dragontina, es un honor darte la bienvenida.\n\nAunque primero debemos reunir unos cuantos miembros ms para nuestro viaje. Empezamos?', '', '', '', '', '', 'Renete con Naleidea en la torre de zepelines a las afueras de Orgrimmar.', 47187),
(65439, 'esES', 'Susurros en el viento', 'Habla con el archimago Khadgar a las afueras de Orgrimmar.', 'Hola, $p. Cunto tiempo. Ay, me encantara tener ms tiempo para ponernos al da.\n\nPero vers, acabo de tener una esclarecedora... No, digamos premonitoria..., s, premonitoria, conversacin con un viejo amigo.\n\nA veces una revelacin puede ser ambas cosas, claro.\n\nTengo que contarte todo lo que he descubierto.', '', '', '', '', '', '', 47187),
(65438, 'esES', 'Inicio de misin increble', '', 'El comienzo de las Tierras Azures.', '', '', '', '', '', '', 47187),
(65437, 'esES', 'La invitacin de los Aspectos', 'Habla con Ebyssian.', 'Llegas justo a tiempo, $p.\n\nAcabo de reunirme con el consejo de la Horda, y han aceptado la invitacin de los Aspectos a las Islas Dragn.\n\nLa invitacin tambin te incluye a ti, claro.\n\nPuede que tambin te hayas dado cuenta de que hay algunas nuevas caras por Orgrimmar. Los dracthyr son recin llegados que conocers en el viaje que te espera.\n\nVen, hablemos.', '', '', '', '', '', '', 47187),
(65436, 'esES', 'Las Islas Dragn te esperan', 'Renete con Wrathion en Ventormenta.', 'Maravillosas noticias! Las Islas Dragn estn despertando!\n\nMi pueblo abandon estas tierras tras el Hendimiento, pero ahora, por fin, sentimos que nos llaman de vuelta a casa.\n\nAunque las islas albergan muchas maravillas, tambin es un lugar muy peligroso. Necesitaremos la ayuda de nuestros aliados mortales para recuperar nuestro legado.\n\nRenete conmigo en Ventormenta. Debo presentar la invitacin de los Aspectos a la Alianza.', '', '', '', '', '', '', 47187),
(65435, 'esES', 'Las Islas Dragn te esperan', 'Renete con Ebyssian en Orgrimmar.', 'Hroes de la Horda, traigo noticias. Las Islas Dragn estn despertando!\n\nPermanecieron dormidas tras el Hendimiento, pero ahora, por fin, nos llaman a mis hermanos y a m de vuelta a casa.\n\nAunque el archipilago alberga muchas maravillas, tambin es un lugar muy peligroso. Necesitaremos la ayuda de nuestros aliados mortales para recuperar nuestro legado.\n\nEstoy a punto de presentar la invitacin de los Aspectos al consejo de la Horda en Orgrimmar. Reunos conmigo all y veremos lo que tienen que decir.', '', '', '', '', '', '', 47187),
(65422, 'esES', 'No es fcil cazar tesoros', 'Coge el equipamiento de escalarrocas, busca un asidero y escala hasta la cima sin soltarte!', 'Puedo verlo en tus ojos: te mueres de ganas de escalar hasta la cima de la montaa y descubrir qu hay en la cima!\n\nLos escaladores siempre nos reconocemos. No permitiremos que ninguna montaa nos haga sentir diminutos, verdad?\n\nBueno, por suerte para ti he trado suficiente equipamiento de escalada. Coge una mochila y busca un camino hasta la cima!', '', '', '', '', '', 'Habla con Pa Trabaluz en lo alto de la montaa.', 47187),
(65421, 'esES', 'Ni una montaa sin escalar', 'Coge el equipamiento de escalada, busca un asidero y escala el acantilado para rescatar a la abrecaminos Yips.', 'Espero que seas autodidacta, $c. Porque no hay tiempo para lecciones!\n\nCoge una mochila y busca un camino hasta la cima.\n\nUna vez arriba, entrgale este paracadas a nuestra colega Yips. La pobre muchacha se qued atrapada en unas vides cuando esos elementales de aire derribaron nuestro avin!\n\nDate prisa para que podamos salir de aqu!', '', '', '', '', '', '', 47187),
(65417, 'esES', 'Conectando todo', '', '', '', '', '', '', '', '', 47187),
(65374, 'esES', 'La hora del desplume', 'Arranca $1oa plumas de cra.', 'Harleen me ha contado que est confeccionando un disfraz para ti! Qu emocionante! Sin embargo, necesita plumas de las cras de roc para completar el atuendo.\n\nPor suerte, acabo de arreglar el Desplumeitor 3300!\n\nLas alachirrido estn capturando cras de roc en la parte inferior de los acantilados para criarlas por su cuenta. Usa el Desplumeitor para salvarlas. Adems, les arrancar un par de plumas!\n\nDos pjaros de un plumazo? Claro que s!', '', '', '', '', '', '', 47187),
(65373, 'esES', 'Arrancando las piezas', 'Recupera 4 piezas del Desplumeitor 3300.', 'Oh, no... He cometido un grave error.\n\nHarleen me confi el famoso Desplumeitor 3300, un invento suyo realmente increble.\n\nTena pensado recoger plumas de roc en la cueva que hay al sur de aqu para que las investigase, pero las arpas me tendieron una emboscada y se rompi en pedazos mientras escapaba.\n\nRecupera las piezas! Probablemente estn repartidas por la cueva como escamas de muda.\n\nPuedo arreglarlo. Seguro. Bueno, con toda probabilidad.', '', '', '', '', '', '', 47187),
(65371, 'esES', 'Nuestro propio nido', 'Recoge $1oa garfas de alachirrido, $2oa bastones de alachirrido y $3oa ncleos de corriente.', 'El pergamino que encontraste es una orden que proclama que todos los huevos de plumazul deben llevarse ante la chef Ventofrita de las arpas. Al parecer, la matriarca alachirrido no comer nada que no haya sido debidamente cocinado y aderezado.\n\nLe vamos a llevar un huevo especial. Uno que tenga un sabor EXPLOSIVO y que... explote cuando se lo coma. Faltara ms.\n\nQue cmo vas a entregarlo? Con un disfraz!\n\nMata a las criaturas que hay en la parte baja de los acantilados, rene esta lista de piezas y te confeccionar un atuendo emplumado.', '', '', '', '', '', '', 47187),
(65313, 'esES', 'Hambre de roc', 'Mata a Hawthia Zamparrocs.', 'Tharzera parece de fiar y se le dan bien los artilugios, pero sucumbe al pnico con facilidad.\n\nPor ejemplo, cuando la envi a las cuevas del sur, se larg pitando de all a causa de una arpa extraamente grande. Parece que estaba dando rdenes a las dems.\n\nY si es la matriarca de este linaje? O una comandante? Ve y avergualo, $n.\n\nY no te preocupes si arrancas un par de plumas, ya me entiendes.', '', 'Una arpa alachirrido especialmente grande con un apetito voraz por los huesos de plumazul.', 'Hawthia Zamparrocs', '', '', '', 47187),
(65307, 'esES', 'La piedad es lo primero', 'Sana a los dracthyr y dracnidos heridos.', 'La toxicidad del nido casi se nos lleva a todos por delante. Aunque se est preparando el antdoto, necesito que encuentres heridos para sanarlos.\n\nS, tambin los dracnidos azules. Las Alas Sanadoras no permanecen de brazos cruzados mientras hay quienes sufren.', '', '', '', '', '', '', 47187),
(65306, 'esES', 'Ranchero de podredumbre', 'Recoge $1oa de moco oloroso de la descomposicin.', 'Descomposicin ser mala, apesta y duele. Pero tener idea con moco. COGER MOCO!', '', '', '', '', '', '', 47187),
(65302, 'esES', 'Las llaves del reino', 'Consigue la llave y sala para abrir el alijo de armas.', 'Necesitar armas para el plan. Yo tener buenas armas, pero bajo llave. Gnolls dejar llave en campamento y proteger alijo.\n\nConseguir palos puntiagudos, con sangre.', '', '', '', '', '', '', 47187),
(65287, 'esES', 'Separar la yema', 'Recoge $1oa huevos de plumazul.', 'He descifrado el pergamino y, cmo no, malas noticias!\n\nLas alachirrido no solo se estn comiendo a los plumazules para alimentarse. Resulta que han encontrado un par de hechizos que transfieren la fuerza innata de los rocs al devorarlos. Sobre todo sus huevos!\n\nBaja de los acantilados por aqu y salva tantos huevos de roc como puedas. Distraer a las arpas el tiempo suficiente como para poner en marcha mi plan.\n\nTen cuidado con los elementales que vagan por ah. El efecto del hechizo de las maldisposas los ha agitado!', '', '', '', '', '', '', 47187),
(65286, 'esES', 'Contactos dracnicos', 'Consigue acceder a Ventormenta.', 'Normalmente un vuelo as llevara mucho ms tiempo, pero, cuando cuentas con la ayuda del mismsimo Aspecto Bronce, el trayecto se puede completar en... \n\nEjem. \"Tiempo\" rcord.\n\nAh, y en cuanto a esos soldados con armas puntiagudas... No te preocupes. Una mera formalidad.\n\nMe encargar de organizar una audiencia con el lord comandante mientras Azurathel y t os ubicis.\n\nPor suerte, disfruto de bastante influencia en esta ciudad.', '', '', '', '', '', 'Habla con Azurathel.', 47187),
(65279, 'esES', 'Por decreto real', 'Mata a $1oa guerreros Frondacuero y a $2oa chamanes Frondacuero en el Cubil Arroyodientes.', 'Gnolls idiotas no entender corona. Solo violencia. Pgales o te como.', '', '', '', '', '', '', 47187),
(65274, 'esES', 'Navigation Playtest: Level Up', '', 'This is a single quest. It will guide you though the high points of the level up story for Thaldraszus', '', '', '', '', '', '', 47187),
(65267, 'esES', 'Que no queden ni las plumas', 'Mata a $1oa alachirrido marchitadoras y $2oa alachirrido garramaleficios.', 'Tena curiosidad por estas extraas criaturas aladas e intent presentarme. Me habran devorado de no ser por la profesora Chirridos y su enorme ave mecnica!\n\nPodras ayudarnos a lidiar con esas \"alachirrido\"? Los rocs plumazul autctonos estn teniendo problemas para defender sus nidos de ellas.\n\nAdems, no me gustara que ocurriesen ms presentaciones como la ma...', '', '', '', '', '', '', 47187),
(65220, 'esES', 'Navigation Playtest: Level Up (PART 2)', '', 'El final de las Tierras Azures.', '', '', '', '', '', '', 47187),
(65218, 'esES', 'Navigation Playtest: Level Up (PART 1)', '', 'El comienzo de las Tierras Azures.', '', '', '', '', '', '', 47187),
(65133, 'esES', 'Cmo usar el impulso con tu dragn', 'Planea a travs de los anillos y aterriza en la zona indicada.', 'Ahora bien, qu pasa si hay un obstculo en tu camino?\n\nMientras vueles de forma correcta, podrs conservar el impulso y ganar algo de altura despus de un picado.\n\nEsta vez, cuando hagas un picado, vers que tu ruta de vuelo te hace bajar con respecto a la zona de aterrizaje. Si usas el impulso, podrs recuperar la altura perdida al final del recorrido para aterrizar en la zona objetivo.\n\nSi te atascas, haz clic en el reloj de bronce y Celormu lo reiniciar para ti.', '', '', '', '', '', '', 47187),
(65120, 'esES', 'Cmo caer en picado con tu dragn', 'Cae en picado y luego planea a travs de los anillos hasta aterrizar en la zona objetivo.', 'Planear te llevar a donde quieras ir. Pero y si quieres llegar ms rpido?\n\nHacer un picado tras saltar desde algn lugar alto te dar un acelern de velocidad.\n\nVuela a travs de los anillos hasta la zona objetivo.\n\nSi te atascas, usa el reloj de bronce y Celormu te har empezar de nuevo.', '', '', '', '', '', '', 47187),
(65118, 'esES', 'Cmo planear con tu dragn', 'Planea a travs de los anillos y aterriza en la zona indicada.', 'Empecemos por lo bsico.\n\nSi vuelas en lnea recta, te cansars rpidamente. Usa la gravedad como ayuda y apunta ligeramente hacia abajo para volar a gran distancia. Los anillos te darn el ngulo general que deberas usar para planear de la forma ms bsica.\n\nPrimero, llama a tu draco.\n\nLuego vuela a travs de los anillos y aterriza en la zona indicada.\n\nSi te atascas, usa el reloj de bronce y Celormu te har empezar de nuevo.', '', '', '', '', '', '', 47187),
(65101, 'esES', 'Referente de la moda dracnica', 'Adopta tu rostro mortal.', 'Has revolucionado toda Ventormenta con tu llegada, $p. No cabe duda de que algunos ciudadanos han sido ms... amables con tu presencia que otros.\n\nPara poder comunicarnos mejor con otras razas, los dragones adoptamos un rostro mortal, como el que ves ante ti. No solo hace que los aliados se sientan ms cmodos, sino tambin sirve para que pasar por puertas no sea toda una odisea.\n\nEst claro que la esencia de los dragones fluye por los dracthyr. Sospecho que comparts nuestra capacidad de asumir un rostro.\n\nVen conmigo.', '', '', '', '', '', 'Muestra tu rostro a Wrathion.', 47187),
(65100, 'esES', 'rdenes finales', 'Organiza la evacuacin del Confn Olvidado.', 'La tormenta liberada por Raszageth es demasiado poderosa. Debemos evacuar el nico hogar que hemos conocido.\n\nYa no hay un Guardin de la Tierra que nos dirija. Por primera vez, somos libres de tomar nuestras propias decisiones. De encontrar nuestro destino.\n\nAll donde vayas en esta nueva era, espero que encuentres aliados dignos. Cuntales nuestra historia.\n\nYo me quedar y buscar supervivientes. Puede que encuentre respuestas sobre nuestro pasado por el camino.\n\nQue la fortuna nos favorezca a todos, $p.', '', '', '', '', '', 'Presntate ante tu escamandante.', 47187),
(65098, 'esES', 'Consecuencias del valor', 'Busca a Ebyssian.', 'Gracias por sanarme, $n. Espero que as se alimente una confianza mutua.\n\n<Wrathion se estremece>.\n\nLa Devoradora de Tormentas. Nunca me he enfrentado a un dragn con tanto poder elemental. Si hay otros como ella...\n\nEspera... Dnde est Ebyssian? Ha sobrevivido? Tienes que encontrarlo!', '', '', '', '', '', 'Habla con Pavethal.', 47187),
(65097, 'esES', 'Corre!', 'Retirada!', 'Las tormentas estn a punto de abrumarnos! Debemos evacuar la zona!\n\nSalva a todos los que puedas. Y encuentra a esos dragones negros!', '', '', '', '', '', 'Habla con Wrathion.', 47187),
(65087, 'esES', 'La recompensa interior', 'Defiende la cmara.', 'Entonces, los Primalistas quieren lo que hay dentro de esta cmara?\n\n<Sarkareth entorna la mirada>.\n\nQue vengan.\n\nLes ensearemos para qu nacieron los dracthyr!', '', '', '', '', '', '', 47187),
(65084, 'esES', 'La Cmara Petraescarcha', 'Acude a la Cmara Petraescarcha.', 'Mira all, ms all del confn! Las fuerzas primalistas estn confluyendo en la Cmara Petraescarcha.\n\nLa tormenta que pretenden desatar debe de estar encerrada ah dentro.\n\n<Pavethal hace una mueca cuando se le vienen a la cabeza unos recuerdos fragmentados>.\n\nYa nos enfrentamos antes a este enemigo y ganamos. Neltharion orden que se asegurara la cmara, pero no logro recordar la razn...\n\nNo es momento de contemplaciones. Renete con Sarkareth y las Escamas de bano en la cmara. Que no entre el enemigo!', '', '', '', '', '', 'Presntate ante el escamandante Sarkareth en la Cmara Petraescarcha.', 47187),
(65075, 'esES', 'Las Alas Sanadoras', 'Habla con Pavethal.', '$gEvocador:Evocadora;, estoy en deuda contigo por ayudar a mi alascuadrn en nuestro momento ms crtico.\n\nCuando recuperemos las fuerzas, las Alas Sanadoras se reunirn con el resto de nuestras huestes.\n\nCeni dice que Pavethal ha perdido a todo su alascuadrn. Me temo que no tengo magia que pueda curar semejante herida.\n\nPuede que parezca estoica, pero se trata de una prdida muy dolorosa para ella, $n. Dile que voy de camino.', '', '', '', '', '', 'Habla con Pavethal.', 47187),
(65074, 'esES', 'Presa fcil', 'Mata a $1oa guadidos.', 'En las tierras que rodean a este nido habitan los guadidos. Son unos insectoides voraces, a menudo territoriales y agresivos. \n\nTodos estos heridos seran presa fcil para esas bestias. No quiero que ataquen a nuestros ensalmadores mientras se recuperan.\n\nReduce su nmero mientras busco a Viridia.\n\nEs... muy valiente.', '', '', '', '', '', '', 47187),
(65073, 'esES', 'Un problema txico', 'Recoge $1oa glndulas de toxinas.', 'Te recuperas rpidamente, $n. Bien.\n\nQuienes escaparon de mi nido estn mejorando, pero an hay ms atrapados dentro. Si entras para rescatarlos, tendr que volver a sacarte de ah.\n\nHay unos nidos de alfazaques alrededor de la caldera. Sus glndulas de toxinas podran ayudarnos a contrarrestar el efecto de su veneno.\n\nNo estoy en condiciones de recogerlas yo misma, as que debo confiar en tus habilidades, $gevocador:evocadora;.', '', '', '', '', '', '', 47187),
(65071, 'esES', 'Ayuda!', 'Rescata a la pequea Ko.', 'Necesito ayuda!\n\nSoy To\'no y estaba explorando porque es lo que se me da bien, pero no me di cuenta de que mi hermana Ko me segua y necesito que me ayudes a encontrarla porque seguro que se ha metido en un lo. Por favor...\n\nSe meti en esta cueva, pero no sabe esconderse tan bien como yo, y nuestros padres estn demasiado lejos para ayudarnos.\n\nPuedes encontrarla antes de que lo hagan los monstruos?', '', '', '', '', '', 'Devuelve los nios a sus padres.', 47187),
(65063, 'esES', 'Hacia la colmena', 'Sigue a Trillaceniza para encontrar a Viridia.', 'Sea cual sea la toxina que ha infestado este nido, es lo suficientemente potente como para acabar con nuestros mejores sanadores.\n\nY eso no presagia nada bueno para ninguno de nosotros, $n.\n\nPero no importa. Si hay dracthyr atrapados ah dentro, entraremos sin importar el riesgo.\n\nRespira hondo y sgueme!', '', '', '', '', '', 'Habla con Viridia.', 47187),
(65060, 'esES', 'La Caldera de los Ensalmadores', 'Renete con Trillaceniza en la Caldera de los Ensalmadores.', 'Tu visin de la baliza Arcana mostr que an quedan otros dracthyr atrapados en sus nidos. No podemos permitirnos el lujo de perder ms.\n\n<Pavethal hace una breve pausa con el ceo fruncido>.\n\nNo hay mejores mdicos que las Alas Sanadoras en nuestras filas. Su nido est en la Caldera de los Ensalmadores. Trillaceniza conoce el camino.\n\nNo dejes a nadie atrs, $gevocador:evocadora;.', '', '', '', '', '', 'Habla con Trillaceniza en la Caldera de los Ensalmadores.', 47187),
(65057, 'esES', 'Unirse a Pavethal', 'Informa a Pavethal.', 'Ahora que la pelea ha terminado, me pides que informe a Pavethal. Azurathel espera que siga sus rdenes?\n\nDe eso nada.\n\nLas Escamas de bano solo responden ante el Guardin de la Tierra. Y, hasta ahora, no he recibido rdenes de Neltharion.\n\n<Sarkareth frunce el ceo>.\n\nAun as, no soy ajeno a la amenaza que representan esos Primalistas. Estoy seguro de que ya me haba enfrentado antes a su especie antes y sin embargo...\n\nNos reuniremos en el terreno cuando los mos se hayan recuperado. Puedes retirarte, $gevocador:evocadora;.', '', '', '', '', '', '', 47187),
(65052, 'esES', 'Las Escamas de bano', 'Ve con el escamandante Sarkareth.', 'Hemos superado la incursin primalista. Ahora debemos llegar hasta el nido.\n\nEl escamandante Sarkareth es duro como l solo, y su alascuadrn est resistiendo, pero un dragn ha acorralado a las Escamas de bano. \n\nEs hora de unirnos a la batalla!\n\nVe delante y da la seal cuando estemos al alcance del dragn. Entonces atacaremos con todas nuestras fuerzas.\n\nCuidado con las emboscadas. Tengo un mal presentimiento.', '', 'Una bestia antigua que mantiene a las Escamas de bano atrapadas.', 'Ekrazathal', '', '', 'Habla con el escamandante Sarkareth.', 47187),
(65050, 'esES', 'Ejrcito conjurado', 'Mata $1oa elementales conjurados.', 'Los Primalistas estn invocando un ejrcito de elementales. Tenemos que asumir que quieren liberarlos contra nuestras fuerzas.\n\nPues no lo permitiremos.\n\nCbrelos de llamas, $gevocador:evocadora;! Quema a los elementales del confn y elimina a sus conjuradores antes de que invoquen ms.', '', '', '', '', '', 'Renete con Azurathel en el Crter Hiendetormenta.', 47187),
(65049, 'esES', 'Lo con los tarasek', 'Mata a $1oa tarasek.', 'Los tarasek son salvajes e impredecibles. Parecen dracnidos primordiales, por as decirlo.\n\nPara Neltharion nunca fueron ms que carne de can, muecos de entrenamiento. Pero son cazadores astutos y extremadamente peligrosos cuando van en manadas.\n\nSi obtienen el poder elemental de los Primalistas, se volvern an ms peligrosos.\n\nNo podemos permitirlo, $n. Reduce su nmero.', '', '', '', '', '', 'Renete con Azurathel en el Crter Hiendetormenta.', 47187),
(65046, 'esES', 'Los Primalistas', 'Busca pistas sobre el origen y las intenciones de los Primalistas.', 'Mis recuerdos siguen nublados por la estasis, pero tengo la certeza de que ya nos habamos encontrado antes con esos Primalistas.\n\n<Derviche aprieta los colmillos>.\n\nNo sirve de nada. Cualquier intento de recordar es como perseguir fragmentos de un sueo.\n\nTal vez a ti te vaya mejor. Busca pistas sobre lo que motiva a esos invasores.', '', '', '', '', '', 'Renete con Derviche en el Crter Hiendetormenta.', 47187),
(65045, 'esES', 'El Crter Hiendetormenta', 'Renete con Azurathel en el Crter Hiendetormenta.', 'El informe de Derviche es preocupante. Unas fuerzas enemigas que se hacen llamar \"los Primalistas\" han invadido el Crter Hiendetormenta y tienen acorraladas a las Escamas de bano en el Nido de Asedio.\n\nEstn invocando violentos elementales y reclutando a los despiadados tarasek para su causa.\n\nAzurathel necesitar tu ayuda en el crter. Con alas o garfas, rescata a los nuestros.\n\nAsegrate de que las Escamas de bano estn a salvo y dile a su comandante que se rena conmigo. Pero cuidado. Sarkareth puede ser bastante... quisquilloso.', '', '', '', '', '', 'Habla con Azurathel en el Crter Hiendetormenta.', 47187),
(65036, 'esES', 'Entrenar como luchamos', 'Practica el remontamiento.', 'Atravesar los aros es til para orientarte, pero entrenamos igual que luchamos: sin descanso.\n\nVe y remonta el vuelo por la zona hasta que creas que has dominado la tcnica. Como no poda ser de otra forma, debes tener cuidado con la fauna local y estar alerta por si detectas posibles amenazas. Al fin y al cabo, practicamos para eso.\n\nInforma a Pavethal cuando quieras. Buena suerte!', '', '', '', '', '', 'Habla con la escamandante Pavethal para continuar.', 47187),
(64877, 'esES', 'Navigation Playtest: Level Up (PART 2)', '', 'Disfruta del final de las Tierras Bajas!', '', '', '', '', '', '', 47187),
(64873, 'esES', 'Estira las alas', 'Practica el lanzamiento de Remontar.', 'Me alegra ver que escaparon tantos del Nido Blico. Mi propio alascuadrn... no tuvo tanta suerte.\n\n<Pavethal permanece en silencio un instante>.\n\nHay otros nidos por todo el confn llenos de dracthyr en peligro. Harn falta alas fuertes para llegar hasta ellos.\n\nConcntrate. Recuerda tu entrenamiento. Vuelve a sentir el viento. Debes recuperar fuerzas y volar hasta los dems nidos.\n\nSe acab el descanso.', '', '', '', '', '', '', 47187),
(64872, 'esES', 'El fuego interior', 'Aprende Aliento de Fuego y practica los ataques potenciados.', 'Perteneces a los evocadores, $n. Los mejores entre los mejores, unos soldados que han dominado las habilidades de cada uno de nuestros alascuadrones.\n\nEspero mucho de ti.\n\nPuede que tus recuerdos no estn del todo claros, pero el poder de los dragones corre por tus venas. Aprovchalo.\n\nUna de las armas ms poderosas que tienes es tu ataque de aliento. El fuego interior se vuelve ms poderoso cuanto ms tiempo inhalas.\n\nEsos insectos que pululan por nuestro campo de entrenamiento sern objetivos adecuados para que practiques.', '', '', '', '', '', '', 47187),
(64871, 'esES', 'Dragn a las puertas', 'Derrota a Lapisagos y escapa del Nido Blico.', 'Ese dragn azul derrumbar el nido y nos atrapar dentro!\n\nDice servir a Malygos. Ese nombre me resulta familiar, pero... por qu querra encerrarnos un dragn?\n\nEscchame bien, $p. Nos entrenaron para luchar junto a los dragones, no contra ellos. Pero no nos dejan eleccin.\n\nEs hora de hacer lo que debe hacerse, $gevocador:evocadora;.', '', 'Bloquea tu salida.', 'Lapisagos', '', '', '', 47187),
(64866, 'esES', 'A la caldera', 'Preprate para abandonar el nido.', 'Necesitamos tus habilidades, $gevocador:evocadora;.\n\nEl nido se desmorona y tenemos pocos suministros. Debemos llegar hasta el pasadizo de salida, pero primero hemos de atravesar esta barrera Arcana.\n\nEn la cmara ms all hay dracthyr que necesitan nuestra ayuda. Sana sus heridas y destruye a cualquier enemigo que se interponga en tu camino.\n\nEsta puede ser la ltima vez que caminemos juntos por estas salas, $n. Haz que merezca la pena.', '', '', '', '', '', '', 47187),
(64865, 'esES', 'Equiparse', 'Consigue armas, armaduras y suministros.', 'Nos han invadido, los nuestros han sido confinados en un estasis mgico y nuestro nido est al borde del colapso.\n\nPara esto entrenamos, $n. En caso de duda, recurre a lo que sabes.\n\nLo primero es lo primero. Necesitamos armas, armaduras y suministros. Rene todo lo que encuentres y equpate, yo reunir a nuestras fuerzas.\n\nLuego encontraremos al Guardin de la Tierra. Seguro que Neltharion nos puede dar las respuestas que buscamos.', '', '', '', '', '', '', 47187),
(64864, 'esES', 'Despertad, dracthyr', 'Despierta a los dems dracthyr.', '<Cuando despiertas, solo te quedan vagos recuerdos de lo que parece un sueo interminable.\n\nLos dracthyr que ves no reaccionan; una magia desconocida los mantiene congelados. Notas un poder en tu interior capaz de liberar a tus aliados.\n\nPuede que haya ms en estasis en el nido.\n\nEs tu deber despertarlos>.', '', '', '', '', '', 'Habla con el escamandante Azurathel.', 47187),
(64863, 'esES', 'Guardianes Arcanos', 'Derrota a $1oa guardianes o ensamblajes.', 'Esos ensamblajes que patrullan por el nido no han sido animados por la magia del Guardin de la Tierra.\n\n<Derviche frunce el ceo>.\n\nNo podemos permitir que haya enemigos entre nosotros.\n\nDestryelos para despejar nuestro camino.', '', '', '', '', '', '', 47187),
(64856, 'esES', '[DNT] A Little Pruning', 'Mata a %1oa azotadores carnvoros.', 'Saludos, mortal. Necesito tu ayuda.\n\nLos jardines se han deteriorado durante la larga ausencia de los Vuelos. Muchas de sus plantas se han vuelto... indisciplinadas.\n\nDebo ocuparme de los esquejes, lo cual me preocupa. Por favor, deshazte de la vegetacin ms hostil, te recompensar.', '', '', '', '', '', '', 47187),
(64163, 'esES', 'Venganza contra los renegados', 'Encuentra y derrota a los guerreros centauro rebeldes en los campamentos improvisados al otro lado del ro.', 'Los clanes rebeldes han reclamado algunos de nuestros campamentos al otro lado del ro.\n\nDebemos encargarnos de esa gentuza.\n\nConfo en que sers capaz de darles una leccin a esos rebeldes.\n\nLos campamentos tambin estn hechos un desastre, as que ignora el caos por ahora. Podemos resolver ese asunto ms adelante, una vez que hayamos restaurado el orden.', '', '', '', '', '', '', 47187),
(64162, 'esES', 'El ritual rival', 'Encuentra y derrota al kahn rebelde en los campamentos improvisados al otro lado del ro.', 'Se ha alzado otro kahn entre las tribus rebeldes.\n\nMe encargara yo mismo, pero estoy ocupado supervisando las cosas aqu. \n\nConfo en que puedas ensearles el error de sus caminos.', '', '', '', '', '', '', 47187),
(64159, 'esES', 'Devolver suministros poco comunes', 'Recupera suministros de los campamentos improvisados al otro lado del ro.', 'Los rebeldes han robado suministros de los campamentos cercanos.\n\nHas demostrado ser capaz de arreglar situaciones como esta. Confo en que puedas ayudarnos a resolver esta.', '', '', '', '', '', '', 47187),
(37484, 'esES', 'Silbato del capitn', 'Trele a Anne Dunworthy 100 fragmentos de artefacto para conseguir un silbato del capitn.', '', '', '', '', '', '', '', 47187),
(5248, 'esES', 'Atormentados por el pasado', 'Lleva el Cristal de Zin-Malor a Lago Kel\'Theril en Cuna del Invierno y encuentra un espritu Altonato que hable contigo.', '$n, lamento terriblemente lo que ocurri en el pasado. Como este cristal, la raza de los elfos se rompi en mil pedazos. No s si las piezas volvern a unirse en una sola, pero el poder ayudarte con esta pequea tarea ha mitigado mi dolor.$B$BNo debemos olvidar el pasado, $n...$B$BPor favor, devuelve el Cristal de Zin-Malor al Lago Kel\'Theril. Debes encontrar un espritu Altonato que comprenda el error de lo que se hizo hace tanto tiempo. Muestra al espritu que hemos vuelto a corregir las cosas.', '', '', '', '', '', '', 47187),
(3632, 'esES', 'Ingeniera gnmica', 'Si quieres saber ms sobre ingeniera gnmica, lleva el Manual de disciplinas de ingeniera al maestro manitas Sobrechispa en Forjaz.', 'En ingeniera avanzada te encuentras con dos escuelas: la de los gnomos y la de los goblins. La ingeniera de los gnomos es mejor con diferencia! Se concentra en la creacin de aparatos e instrumentos que hacen la vida ms fcil.$B$BLete este manual, $n. Si quieres saber ms sobre el tema, llvaselo aI maestro manitas Sobrechispa, aqu en Forjaz. Recuerda que si te inscribes, no podrs pasarte luego a la otra escuela, as que pinsatelo bien!', '', '', '', '', '', '', 47187);
